','','Acompañamiento en el punto de navegación de la inspección ',2,'','','','',7,255,0,'0000-00-00 00:00:00','2015-05-22 15:30:29'),(279,'2014-06-26','','Se realizó un acompañamiento en el Punto de navegación por parte de la practicante de la zona en el Centro Cultural Los Colores',2,'','','','',7,248,0,'0000-00-00 00:00:00','2015-05-22 15:30:29'),(280,'2014-06-17','','Se realizó acompañamiento en el punto de navegación de la Inspección de Aranjuez',2,'','','','',7,255,0,'0000-00-00 00:00:00','2015-05-22 15:30:29'),(281,'2014-02-20','','Se realizó un acompañamiento en el punto de navegación de la BPP.',14,'','','','',7,240,0,'0000-00-00 00:00:00','2015-05-22 15:30:29'),(282,'2014-04-04','','Recolección de indicadores y seguimiento de sitio.',2,'','','','',10,306,0,'0000-00-00 00:00:00','2015-05-22 15:30:29'),(283,'2014-04-08','','Visita técnica en conjunto con el área de Comunicación Pública para la preparación del evento de socialización del kit de inclusión y la difusión del programa en la comunidad educativa con el fin de articular estudiantes beneficiarios de PP a nuestros procesos.',3,'','','','',10,406,0,'0000-00-00 00:00:00','2015-05-22 15:30:29'),(284,'2014-07-04','','Cierre del proceso y finalizacion del curso, se resuelven algunas inquietudes con los asistentes referentes al tema de blog y redes sociales.',4,'','','','',6,173,0,'0000-00-00 00:00:00','2015-05-22 15:30:29'),(285,'2014-07-18','','Acompañamiento a la clausura del taller de narrativas dictado por la practicante Isis Guisao, este se realizó con los jóvenes del programa Jóvenes por la Vida en el Centro Cultural de Moravia.Los jóvenes manifestaron haber adquirido conocimientos técnicos que les permite tomar fotografías de una mejor forma, ser un poco más sensibles a la hora de ver una película o algún contenido audiovisual.Como sugerencia dijeron que les gustaría que el taller fuera más extenso y manifestaron que Isis fue muy clara en sus explicaciones.Esta clausura fue acompañada por la profesional de monitoreo, la comunicadora, el promotor y coordinadora territorial y general del programa, quienes expresaron comentarios positivos del taller en general.Queda pendiente retomar la articulación el próximo semestre.',25,'UPJ_Jovenes_por_la_Vida_Clausura_Taller_de_Na','UPJ_Jovenes_por_la_Vida_Clausura_Taller_Narra','UPJ_Jovenes_por_la_Vida_Clausura_Taller_Narra','uploads/accompaniment/accompaniment_adjunct',11,288,0,'0000-00-00 00:00:00','2015-05-22 15:30:29'),(288,'2014-11-18','Seguimiento al punto de conexion WIFI','Se verificó el estado de la red WIFI del parque, se contacto un joven llamado Sebastian quien se encontraba utilizando la red para ingresar a redes sociales, es residente en Rionegro y se enteró de la red WIFI del parque porque le apareció la red en su dispositivo móvil.',1,'Parque_del_Poblado.JPG','','','uploads/accompaniment/accompaniment_adjunct',10,354,38,'0000-00-00 00:00:00','2015-05-22 15:30:29'),(289,'2014-11-19','Acompañamiento kit de inclusión','Se realizó acompañamiento a Vidalia, dinamizadora del Telecentro, en el uso del kit de inclusión con personas en situación de discapacidad, las personas se encontraban muy entusiasmadas con las actividades propuestas. ',1,'Telecentro_Zafra_Acompanamiento_Kit_de_inclusion.jpg','','','uploads/accompaniment/accompaniment_adjunct',3,454,15,'0000-00-00 00:00:00','2015-05-22 15:30:29'),(290,'2014-11-26','Acompañamiento a Gestor TIC','se acompañó a Mateo Meneses, estudiante de Pascual Bravo en el inicio del curso de alfabetización digital con adultos mayores del club de vida Alegrías de la comuna 13',12,'IMG_1209.JPG','','','uploads/accompaniment/accompaniment_adjunct',4,206,38,'0000-00-00 00:00:00','2015-05-22 15:30:29'),(291,'2014-11-25','Entrega de puesto al gestor TIC ','Se asiste con Diego Saldarriaga estudiante de diseño gráfico quién nos acompañará en en el punto de navegación de buenos aires 3 días de la mañana y en La inspección 9b otros 2 días en horario de 12m a 5 pm. Serie le presenta al contacto del sitio para que le firme las horas y para que sepa del acompañamiento. Se le envía correo con la información necesaria y los formatos para llenar en el punto se firma pacto de acompañamiento\"',1,'IMG_20141125_144356.jpg','IMG_20141125_153139.jpg','','uploads/accompaniment/accompaniment_adjunct',4,314,16,'0000-00-00 00:00:00','2015-05-22 15:30:29'),(292,'2014-11-26','Charla de NSN para adultos','Se realiza la charla de manera exitosa con participación de algunos de los asistentes (20 aproximadamente)\r\nSe sugiere realizar mas de estas intervenciones en el CAV. Se toma asistencia con la gestora TIC Isabel del punto de navegación.\"',1,'IMG_20141126_WA0008.jpg','IMG_20141126_WA0011.jpg','IMG_20141126_WA0000.jpg','uploads/accompaniment/accompaniment_adjunct',3,298,16,'0000-00-00 00:00:00','2015-05-22 15:30:29'),(293,'2014-11-27','Charla NSN Para Padres','Se realiza una charla muy exitosa y la cual deja a la funcionaria muy entusiasmada y sugiere que en el mes de diciembre se hagan mas charlas de estas. Las personas que estaban a la espera de su turno de atención recibieron la información, aproximadamente estuvieron 40 personas el 80% de la charla.\r\nSe reporta al área de conectividad que hay unas fallas en los equipos del punto de navegación.\r\nSe determina que los acompañantes de Jóvenes por la vida esta de lmv por la tarde y los Mj por la mañana\r\nSe deja fotos evidencia de la actividad.\"',1,'IMG_20141127_115026.JPG','IMG_20141127_WA0007.jpg','IMG_20141127_WA0025.jpg','uploads/accompaniment/accompaniment_adjunct',3,436,16,'0000-00-00 00:00:00','2015-05-22 15:30:29'),(295,'2014-11-28','Entrega de puesto a Gestor Tic','Se asiste con el gestor Diego Saldarriaga a la inspección 9b para que conozca a los encargados y mire el espacio en que va a trabajar, se le indica todo respecto a el registro de las planillas y las dinámicas del sitio.\r\nSe reporta las fallas en los equipos al equipo de conectividad y se deja registro fotográfico de la visita.',1,'','','','',4,307,16,'0000-00-00 00:00:00','2015-05-22 15:30:29'),(296,'2014-11-28','Charla NSN Adultos','Se asiste para realizar la charla que se había pactodo en el centro de capacitación Maria Auxiliadora con la Hmna Angela, que está arriba del Cav. Asisten 6 adultos muy juiciosos. Se sugiere iniciar un proceso de alfabetización digital con esta población.\r\nContactar el próximo año para reiniciar procesos.',1,'IMG_20141128_110525.jpg','IMG_20141128_092346.jpg','IMG_20141128_092257.jpg','uploads/accompaniment/accompaniment_adjunct',3,298,16,'0000-00-00 00:00:00','2015-05-22 15:30:29'),(298,'2014-11-19','Acompañamiento Primera Sesión Gobierno en línea','Se acompañó a la estudiante de pp en la primera sesión del taller de gobierno en línea con la comunidad.',10,'Parque_Biblioteca_SADEP_Taller_de_GEL_Comunidad_20141119.jpg','Parque_Biblioteca_SADEP_Taller_GEL_20141119.jpg','','uploads/accompaniment/accompaniment_adjunct',11,194,15,'0000-00-00 00:00:00','2015-05-22 15:30:29'),(299,'2014-11-18','Capacitación Estudiantes de pp','Se realizó la capacitación de Gobierno en línea con dos estudiantes de pp que realizaran su labor social en el taller de gobierno en línea que se dictará en el Parque Biblioteca San Antonio de Prado.',2,'Telecentro_Pradito_Capacitacion_Estudiantes_de_pp.jpg','Telecentro_Pradito_Estudiante_de_pp_20141118.jpg','','uploads/accompaniment/accompaniment_adjunct',4,211,15,'0000-00-00 00:00:00','2015-05-22 15:30:29'),(300,'2014-11-21','Acompañamiento tercera sesión Gobierno en línea','Se realizó acompañamiento a los gestores TIC Paula y Juan Pablo en la segunda sesión del taller de GEL para comunidad.',11,'Parque_Biblioteca_SADEP_Segunda_sesion_GEL_20141121.jpg','Parque_Biblioteca_SADEP_Segunda_sesion_GEL_20141121.jpg','','uploads/accompaniment/accompaniment_adjunct',4,194,15,'0000-00-00 00:00:00','2015-05-22 15:30:29'),(301,'2014-11-28','Acompañamiento última sesión Gobierno en línea','Se acompañó a los gestores TIC en la última sesión del taller de gobierno en línea, se hizo la clausura del taller y se programo una sesión de dispositivos móviles.',13,'Parque_Biblioteca_SADEP_Ultima_sesion_de_Taller_GEL_20141128.jpg','Parque_Biblioteca_SADEP_Certificacion_GEL_20141128.jpg','','uploads/accompaniment/accompaniment_adjunct',11,194,15,'0000-00-00 00:00:00','2015-05-22 15:30:29'),(302,'2014-11-28','Recolección de indicadores','Se realizó una visita a la corregiduria para identificar el funcionamiento del punto de navegación, el señor vigilante fue la persona que nos contó como estaba funcionando el sitio, además nos entrego los indicadores de uso.',1,'Corregiduria_El_Limonar_Seguimiento_al_sitio_1.jpg','Corregiduria_El_Limonar_Seguimiento_al_sitio_2.jpg','','uploads/accompaniment/accompaniment_adjunct',10,336,15,'0000-00-00 00:00:00','2015-05-22 15:30:29'),(303,'2014-12-02','Seguimiento al punto de navegación','\r\nSe verifica el flujo de usuarios al punto el cual es nulo por las limitaciones a la entrada del sitio, se le pregunta a varios funcionarios sobre la afluencia y manifiestan que nadie usa estos PC.\r\nPor medio escrito se le manifiesta a el área de conectividad la problematica y la propuesta de cambiar estos equipos al C AV de caunces y dejar de intervenir este sitio por que se esta perdiendo este servicio. Se intentó contactar con la coordinadora del servicio pero se necesita reservar cita previa.',0,'IMG_20141202_100453.jpg','IMG_20141202_WA0015.jpeg','','uploads/accompaniment/accompaniment_adjunct',7,427,16,'0000-00-00 00:00:00','2015-05-22 15:30:29'),(304,'2014-12-02','Visita a gestor TIC.','\r\nReunión con ISabel Florez quién esta muy juiciosa prestando su labor social en el lugar. Se recibe buenas referencias de los gestores por parte del contacto en el sitio y se solicitan las cedulas de los contactos para llenar la base de datos.\"',1,'IMG_20141202_111831.jpg','','','uploads/accompaniment/accompaniment_adjunct',4,314,16,'0000-00-00 00:00:00','2015-05-22 15:30:29'),(305,'2014-12-02','Visita a gestor TIC.','\r\nReunión con Diego Saldarriaga quién no estaba en el lugar por que se fue temprano a almorzar. Se recibe buenas referencias de los gestores por parte del contacto en el sitio y se solicitan las cédulas de los contactos para llenar la base de datos. Se propone realizar charlas de navegar sin naufragar en el sitio por la problematica expresada por los funcionarios.\"',1,'','','','',4,307,16,'0000-00-00 00:00:00','2015-05-22 15:30:29'),(306,'2014-12-04','Charla NSN','Se realiza la charla de NSN programada para este día con una asistencia de 7 personas entre adultos y niños. La realizó el practicante Diego Saldarriaga con mucho éxitoy con mucha participación de las personas sobre todo durante los videos de Grooming y de Amada Todd.\r\nPendiente de la realización de la otra charla el miércoles 10.',0,'IMG_20141204_WA0015.jpg','IMG_20141204_WA0016.jpg','IMG_20141204_WA0020.jpg','uploads/accompaniment/accompaniment_adjunct',3,307,16,'2014-12-05 10:28:15','2015-05-22 15:30:29'),(307,'2014-12-04','Sensibilización Kit de Inclusión','Registro audiovisual de una sesión de sensibilización con el kit de inclusión digital orientada a madres de familia con el fin de sistematizar las evidencias del buen uso y apropiación de estas herramientas en el sitio.',6,'Buen_Comienzo_La_Huerta_Seguimiento_y_registro_del_KIT_2.jpg','Buen_Comienzo_La_Huerta_Seguimiento_y_registro_del_KIT_3.jpg','Buen_Comienzo_La_Huerta_Seguimiento_y_registro_del_KIT.jpg','uploads/accompaniment/accompaniment_adjunct',12,413,17,'2014-12-05 11:13:02','2015-05-22 15:30:29'),(308,'2014-12-01','Entrega de Certificados curso Gobierno en Linea','Se realizó la entrega de certificados del curso de Gobierno en Linea acompañado por el Gestor TIC Steven Ocampo.',0,'20141129_113331.jpg','','','uploads/accompaniment/accompaniment_adjunct',6,450,38,'2014-12-05 11:45:52','2015-05-22 15:30:29'),(309,'2014-12-05','Acompañamiento a gestores TIC','Se realizó acompañamiento al curso de alfabetización digital orientado por 2 gestores TIC. en esta sesión se dio una asesoría básica sobre fotografía a los integrantes del grupo.',2,'2014_12_05_15_40_26.jpg','2014_12_05_15_46_01.jpg','','uploads/accompaniment/accompaniment_adjunct',4,362,14,'2014-12-09 11:28:15','2015-05-22 15:30:29'),(311,'2014-12-09','\"Charla de NSN para niños.','Se realiza la primera charla programada con niñ@s del parque que asisten al punto de navegación y a los servicios del parque. la charla fue con 16 personas entre ellos adultos acompañantes. Los funcionarios tenían todos los elementos necesarios para realizar la charla que salió muy bien.\r\nSe pide que me envíen la copia de la aistencia. Se deja copias y fotos como evidencia de la actividad\"',0,'IMG_20141209_151636.jpg','IMG_20141209_151655.jpg','IMG_20141209_153551.jpg','uploads/accompaniment/accompaniment_adjunct',3,318,16,'2014-12-10 12:01:29','2015-05-22 15:30:29'),(312,'2014-12-10','Charla NSN','Se realiza la charla de NSN programada para este día con una asistencia de 10 personas entre adultos y niños. Se desarrolló mucho éxito y con mucha participación de las personas sobre todo durante los vídeos.\r\nSe le informa a la inspectora que se le enviará un mail con fotos adjuntas y que continuamos contando con su colaboración para realizar charlas como estas.Se deja evidencia con fotos de la actividad.\"',0,'IMG_20141210_145159.jpg','IMG_20141210_145140.jpg','IMG_20141210_145142.jpg','uploads/accompaniment/accompaniment_adjunct',3,307,16,'2014-12-11 09:50:13','2015-05-22 15:30:29'),(313,'2014-12-11','Charla de NSN jóvenes.','Se realiza la primera charla programada con jóvenes del parque que asisten al punto de navegación y a los servicios del Inder. La charla fue con 18 personas entre ellos adultos acompañantes. Los funcionarios tenían todos los elementos necesarios para realizar la charla que salió muy bien.\r\nSe pide que me envíen la copia de la asistencia. Se adjunta fotos como evidencia de la actividad.',0,'IMG_20141211_155522.jpg','IMG_20141211_154158.jpg','IMG_20141211_150823.jpg','uploads/accompaniment/accompaniment_adjunct',3,318,16,'2014-12-12 09:11:17','2015-05-22 15:30:29'),(314,'2014-12-03','Empalme Gestor Tic','Titulo: Visita con Gestor Tic. Participantes: Maria del Socorro. Aspectos generales: Se presentó al gestor Tic que acompañará el Cav, se observaron algunas dinámicas del lugar y se  sugirió realizar una observación intencionada de las necesidades de las personas que frecuentan el lugar para poder pensar en procesos formativos pertinentes. Además de esto se indagó por los servicios que se ofrecen en el lugar resaltando toda la parte de la registraduría, asi pues el Gestor tic quedó con el compromiso de continuar ese diagnóstico además de potenciar el uso de las planillas dado que allí no se llenan.',1,'Cav_america_Seguimiento_al_sitio.jpg','','','uploads/accompaniment/accompaniment_adjunct',4,246,23,'2014-12-16 08:33:21','2015-05-22 15:30:29'),(315,'2014-12-10','Gobierno en linea','Titulo: Gobierno en línea con Víctimas. Participantes: Victimas comuna 3. Aspectos generales: Se acompañó la jornada con asesorías individuales respecto de las necesidades de información de cada persona. Se dio a conocer el chat del DPS a algunos funcionarios y una de las víctimas se dio cuenta a través de este que había sido beneficiada para vivienda',30,'Jose_Antonio_Galan_Intervencion_con_Victimas_1.jpg','','','uploads/accompaniment/accompaniment_adjunct',7,256,23,'2014-12-16 09:09:10','2015-05-22 15:30:29'),(319,'2014-12-05','Sensibilización sitio público.','La señal Wi-Fi es débil porque, al parecer, el techo-huerta bloquea la señal. Ya hubo una reunión con el área de Conectividad. En el sitio se motivan más de 70 personas, entre turistas, guías y comunidad a darle un buen uso a la red Wi-Fi, y a apropiarse de plataformas como Mi Medellín. Además, durante las actividades el equipo de comunicaciones publicó en Twitter imágenes que mencionan al @ParqueArvi.',77,'2014_12_05_11_03_21.jpg','2014_12_05_11_04_46.jpg','','uploads/accompaniment/accompaniment_adjunct1',11,317,37,'2014-12-16 09:43:30','2015-05-22 15:30:29'),(320,'2014-12-12','Cierre de curso','Titulo: Cierre de curso. Participantes: Grupo A.D cedezo. Aspectos generales: Aunque fue un grupo muy pequeño e limpacto del curso con las persoans fue muy grande. Satisfechos con el proceso, con el Gestor Tic y muy interesados en nuevos procesos para el 2015',6,'Cedezo_Manrique_Cierre_de_curso_1.jpg','Cedezo_Manrique_Cierre_de_curso_6.jpg','','uploads/accompaniment/accompaniment_adjunct',6,165,23,'2014-12-16 09:48:07','2015-05-22 15:30:29'),(323,'2014-12-05','Sensibilización sitio público','Aquí hay varias señales Wi-Fi: en el parque, al frente de la iglesia, prima la señal de \"MDE Inteligente\", aunque parece algo débil. Y al frente de la casa de Gobierno, hay buena señal de \"Medellín Digital\" (del punto de Navegación). Se motiva a más de 20 personas a darle un buen uso a la red Wi-Fi, y a apropiarse de plataformas como Mi Medellín. ',22,'','','','',4,319,37,'2014-12-16 09:50:48','2015-05-22 15:30:29'),(324,'2014-12-15','Cierre de curso','Titulo: Cierre de curso. participantes: Grupo A.D y Gobierno en línea-. Aspectos generales: Las personas quedaron muy interesadas en continuar con procesos en el 2015 y agradecieron la labor del gestor Tic.',22,'Telecentro_V_S_Cierre_de_curso_A_D_Y_GEL_18.jpg','Telecentro_V_S_Cierre_de_curso_A_D_Y_GEL_1.jpg','','uploads/accompaniment/accompaniment_adjunct',6,198,23,'2014-12-16 09:52:27','2015-05-22 15:30:29'),(325,'2014-12-10','Taller de realización Audiovisual con Rara Colecti','Dos estudiantes de grado 11 de la intitución educativa asisten a la primera sesión de taller. Queda pendiente la autorización de los padres de una de ellas y convocar a una más, para que sean 3 estudiantes.',2,'','','','',3,326,37,'2014-12-16 10:00:28','2015-05-22 15:30:29'),(326,'2014-12-11','Taller de realización Audiovisual con Rara Colecti','Dos estudiantes de grado 11 de la intitución educativa asisten a la segunda sesión de taller. Ya se tienen las dos autorizaciones de padres de familia.',2,'','','','',3,326,37,'2014-12-16 10:01:02','2015-05-22 15:30:29'),(327,'2014-12-12','Taller de realización Audiovisual con Rara Colecti','Dos estudiantes de grado 11 de la intitución educativa asisten a la tercera sesión de taller. ',2,'','IMG_20141212_WA0024.jpg','','uploads/accompaniment/accompaniment_adjunct1',3,326,37,'2014-12-16 10:02:02','2015-05-22 15:30:29'),(328,'2014-12-05','Seguimiento al punto de navegación','Aquí hay problemas de configuración del internet: cada vez que se reinician los equipos, hay que configurar de nuevo el internet, y esto ha hecho que varios usuarios desistan del servicio. Se genera caso en Aranda con ticket #382276 para el Punto de Navegación.',1,'','','','',7,296,37,'2014-12-16 10:05:16','2015-05-22 15:30:29'),(329,'2014-12-11','Seguimiento al sitio de Gobierno y recolección de ','Se conversa con la encargada Gloria del Río, quien solicita más acompañamiento de un practicante o estudiante. Hay que hacer la gestión con PP y el Fondo EPM. Hay varios usuarios interesados en procesos de formación más largos. La encargada pregunta por la clave del Wi-Fi. Pendiente consultar con el área de conectividad y responderle. Retomar contacto después del 18 de enero.',1,'','','','',7,294,37,'2014-12-16 10:05:52','2015-05-22 15:30:29'),(330,'2014-12-11','Seguimiento al sitio de Gobierno y recolección de ','Se conversa con los encargados Luz Edilia Ospina y Samir Murillo, quienes solicitan más acompañamiento de un practicante o estudiante, ojalá de población LGTB. Hay que hacer la gestión con PP y el Fondo EPM. También preguntan si hay modo de bloquear ciertos sitios web indeseables (pornográficos) Se identifica la necesidad de formación en internet seguro (hay usuarias con perfiles para el trabajo sexual..) y también en narrativas. Pendiente consultar con el área de conectividad la restricción de sitios web y responderles. No tienen receso de fin de año.',2,'','','','',7,300,37,'2014-12-16 10:06:33','2015-05-22 15:30:29'),(331,'2014-12-11','Seguimiento al sitio de Gobierno e indicadores','Se conversa con la encargada Olga Guzmán, el vigilante Carlos Monsalve, y la líder Arnobis Santillana. En este sitio hay buen flujo de usuarios, se identifica la potencialidad de reunir grupos de alfabetización digital y llevarlos a la Escuela del Maestro. Retomar contacto después del 18 de enero. Hay un usuario con alto volumen y no atiende la recomendación de bajarle: se desactivan todos los altavoces como medida provisional. El vigilante pregunta por la clave del Wi-Fi. Pendiente consultar con el área de conectividad y responderle. ',3,'','','','',7,321,37,'2014-12-16 10:07:22','2015-05-22 15:30:29'),(332,'2014-12-16','Visita Inauguración Aula Ambiental Sol de Oriente','Se realiza una visita de reconocimiento al Aula Ambiental de Sol de Oriente, con el fin de conocer personas, organizaciones y espacios para articular con la dinámica de Apropiaciónd e las TIC en la I.E. Sol de Oriente. Hay pues, nuevos espacios del Aula Ambiental, la Mesa Ambiental de la Comuna 8, y más de 30 Juntas de Acción Comunal para la gestión.\"',0,'','','','',10,326,37,'2014-12-17 09:54:53','2015-05-22 15:30:29'),(333,'2014-12-18','Acompañamiento taller Eafit_Labs Comunitarios','Explorando lo que sería un Laboratorio Comunitario de experimentación hipermedia en Santa Elena, 5 profesionales liderados por Mauricio Vásquez (docente de Eafit), acompañan a un grupo de más de 10 personas en dos talleres: en el primero se emplea el Lego Serious Play, y en el segundo se hace un taller de realización audiovisual. Se defina un laboratorio comunitario como un concepto, más que como un espacio (itinerancia): comprende saberes y personas reunidas por el trabajo colaborativo,. El orden del día es el siguiente: Saludo y recuento; entrega de dispositivo tecnológico: lápiz; Justificación del empleo del lenguaje audiovisual para este acercamiento; Corto de Geroge Meliés; Cada participantee a devolver el amterial en enero. muestra una foto especial y la asocia con una palabra clave y breve historia (ejercicio de memoria); construcción de una línea argumental con las fotos; Refrigerio; Qué es un story board y una scaleta; división por equipos para elaboración de scaleta; entrega de cámara y salida a grabar, esegurándose de hacer edición por cámara (grabar lo que va a quedar en el orden adecuado); Recepciónd e las cámaras. El equipode Eafit se compromete a devolver el material en enero.',16,'20141218_090357.jpg','20141218_092808.jpg','20141218_093132.jpg','uploads/accompaniment/accompaniment_adjunct',11,319,37,'2014-12-22 09:27:36','2015-05-22 15:30:29'),(334,'2014-12-03','Acompañamiento y formación a Gestor TIC Comuna 7','Se realiza la primera reunión con María Camila Puerta Martinez, gestora TIC para la comuna 7, se firma el acta de compromiso y entregan contenidos del Taller de Herramientas Web 2.0 y Alfabetización Digital para el trabajo a realizar en el CEDEZO La Quintana y el Parque Biblioteca.  ',1,'Parque_Biblioteca_La_Quintana_Acompanamiento_Gestores_TIC.jpg','','','uploads/accompaniment/accompaniment_adjunct',4,184,24,'2014-12-22 11:42:35','2015-05-22 15:30:29'),(335,'2014-12-15','Sensibilización a funcionarios kit de inclusión','Se realiza la sensibilización Sobre el Kit de Inclusión Digital-Tecnología para todos a los funcionarios del Parque Biblioteca Doce de Octubre. Está se realiza en dos grupos, en el primero asisten diez de los funcionarios, en el segundo se completa el cupo con ocho más, está estrategia se realiza con el fin de no cerrar la biblioteca y prestar el servicio de forma cómoda. ',18,'Parque_Biblioteca_Doce_de_Octubre_Taller_Funcionarios_Kit_de_Inclusion_Digital_1.jpg','Parque_Biblioteca_Doce_de_Octubre_Taller_Funcionarios_Kit_de_Inclusion_Digital_2.jpg','Parque_Biblioteca_Doce_de_Octubre_Taller_Funcionarios_Kit_de_Inclusion_Digital_4.jpg','uploads/accompaniment/accompaniment_adjunct',12,453,24,'2014-12-22 12:03:05','2015-05-22 15:30:29'),(336,'2014-12-19','Acompañamiento a gestores TIC','presentación del programa, del pilar de apropiación y explicación de las funciones de los gestores TIC a estudiantes beneficiarios de Presupuesto Participativo que tienen el compromiso de realizar su labor social con nosotros. Se llega al acuerdo de que se iniciaran actividades lo más pronto posible ya que estos estudiantes deben muchas horas.',5,'Mascerca_Poblado_induccion_gestores_TIC_1.JPG','','','uploads/accompaniment/accompaniment_adjunct',4,349,15,'2014-12-23 16:04:47','2015-05-22 15:30:29'),(337,'2015-02-02','Seguimiento al punto de navegación','Se visita el sitio para recoger indicadores que los tenía el estudiante de presupuesto participativo Andres Felipe, quién manifiesta que seguirá yendo al sitio a pagar horas, se hace revisión del uso de los equipos y se atienden usuarios del punto de navegación.',1,'IMG_20150202_144513.jpg','IMG_20150202_144508.jpg','','uploads/accompaniment/accompaniment_adjunct',4,436,16,'2015-02-03 13:35:17','2015-05-22 15:30:29'),(338,'2015-01-09','Seguimiento al punto de navegación','\"Inducción al gestor TIC Andrés Felipe López para que acompañe el punto de navegación del sitio de gobierno. Se habia programado una reunión con Eliana Zuluaga persona encargada del punto pero no se presentó por que tenía otro compromiso, sin embargo se el reconocimiento de las instalaciones del lugar y explicación de las actividades a realizar en este:\r\n - Velar por el registro de los usuarios\r\n - Invitar a la comunidad que se acerca al sitio a que use el punto\r\n - Realizar asesorías individuales en el punto\r\n - Realizar asesorías sobre dispositivos móviles a los usuarios\r\n - Queda pendiente socializar el banco de actividades\r\n Andrés Felipe estará visitando intercalando el tiempo de acompañamiento entre la taquilla única y tesorería según las dinámicas y demandas de cada sitio\"',1,'','','','',4,436,16,'2015-02-03 13:38:07','2015-05-22 15:30:29'),(339,'2015-01-21','Seguimiento al punto de navegación','\"Visita de seguimiento al sitio de gobierno para observar el acompañamiento que está realizando Andrés López, gestor TIC encargado. \r\n El gestor se observa puntual y responsable, tiene las planillas en orden.\r\n Se aprovecha esta visita para compartir los contenidos digitales del curso de Alfabetización Digital y Gobierno en Línea y explicarle la dinámica de estos ya que lo ideal es iniciar procesos de formación en febrero en los sitios que se tienen ubicados en la comuna 3.\"',1,'','','','',4,436,16,'2015-02-03 13:39:05','2015-05-22 15:30:29'),(340,'2015-01-09','Seguimiento al punto de navegación','\"Inducción al gestor TIC Andrés Felipe López para que acompañe el punto de navegación del sitio de gobierno. La persona encargada del punto se encuentra de vacaciones por lo tanto se realizó la presentación e inducción con Isabel Cristina Diez, ella es la encargada de firmar las horas y estar pendiente de los facilitadores que acompañan el punto, se hizo el reconocimiento de las instalaciones del lugar y explicación de las actividades a realizar en este:\r\n - Velar por el registro de los usuarios\r\n - Invitar a la comunidad que se acerca al sitio a que use el punto\r\n - Realizar asesorías individuales en el punto\r\n - Realizar asesorías sobre dispositivos móviles a los usuarios\r\n - Queda pendiente socializar el banco de actividades\r\n Andrés Felipe estará visitando intercalando el tiempo de acompañamiento entre la taquilla única y tesorería según las dinámicas y demandas de cada sitio\"',1,'','','','',4,437,16,'2015-02-03 13:40:35','2015-05-22 15:30:29'),(341,'2015-01-21','Seguimiento al punto de navegación','\"Visita de seguimiento al sitio de gobierno para observar el acompañamiento que está realizando Andrés López, gestor TIC encargado. \r\n El gestor se observa puntual y responsable, tiene las planillas en orden, pero se evidencia que el punto no es usado casi por los usuarios, se le sugiere al gestor TIC que motive a las personas que van al sitio de gobierno para que lo usen y que use el tablero adjunto a los equipos para plasmar mensajes que inviten al uso.\"',1,'','','','',7,437,16,'2015-02-03 13:41:27','2015-05-22 15:30:29'),(342,'2015-02-03','Seguimiento Punto de Navegación ','Se realizó seguimiento al punto de navegación en donde se pudo recoger los indicadores del sitio y conocer a la nueva líder de servicio del Mascerca.',2,'Mascerca_Poblado_Seguimiento_al_sitio_2015_02_03_1.jpg','Mascerca_Poblado_Seguimiento_al_sitio_2015_02_03_2.jpg','Mascerca_Poblado_Seguimiento_al_sitio_2015_02_03_3.jpg','uploads/accompaniment/accompaniment_adjunct',7,349,15,'2015-02-05 09:02:52','2015-05-22 15:30:29'),(343,'2015-02-02','Seguimiento al Sitio','Se realiza visita al sitio para evidenciar el buen funcionamiento de los equipos y se recogen indicadores.',1,'Centro_de_Servicios_estadio_Segumiento_al_sitio.jpg','','','uploads/accompaniment/accompaniment_adjunct',10,249,23,'2015-02-09 08:46:39','2015-05-22 15:30:29'),(344,'2015-02-05','Seguimiento al Sitio','En el telecentro se realizó empalme de los procesos actuales y se enfatizó en la propuesta de realizar el taller de Narrativas con el grupo de personas que conforman la emisora Radio Comuna 2 liderada por Willmar Osorio. Además del taller, el telecentro hizo la invitación abierta para que el programa participe de la emisora en algunos pregrabados. Se planeó para la próxima semana charla de dispositivos móviles.',1,'Telecentro_Villa_del_Socorro_Empalme_y_acuerdos.jpg','','','uploads/accompaniment/accompaniment_adjunct',10,198,23,'2015-02-09 09:08:41','2015-05-22 15:30:29'),(345,'2015-03-04','Acompañamiento Curso Alfabetización Digital','Se abrió el primer proceso de formación en Aula abierta, acompañado por MDE en la Institución Educativa San Roberto Belarmino, proceso de alfabetización Digital dictado por el Gestor TIC  Ricardo Alzate',1,'aula_abierta.jpg','','','uploads/accompaniment/accompaniment_adjunct',2,356,38,'2015-03-05 08:54:56','2015-05-22 15:30:29'),(346,'2015-02-24','Seguimiento Punto de Navegación ','se realizó el empalme con la nueva encargada del sitio, además se realizo seguimiento al punto de navegación y se tomo el registro de usuario.',1,'','','','',7,439,15,'2015-03-06 14:16:16','2015-05-22 15:30:29'),(347,'2015-02-24','Seguimiento Punto de Navegación ','Se realizó el seguimiento al WIFI del parque de Belén, se habló con un usuario frecuente del sitio quien nos contó que en semana el internet funciona muy bien pero los fines de semana es lento y no carga algunas páginas.',1,'','','','',7,352,15,'2015-03-06 14:18:20','2015-05-22 15:30:29'),(348,'2015-02-24','Seguimiento proceso de formación','Se realizó el seguimiento al curso de alfabetización digital en el parque Biblioteca, se habló con los gestores TIC encargados y se firmaron los documentos requeridos para la realización de sus horas de labor social.',2,'','','','',4,193,15,'2015-03-06 14:29:16','2015-05-22 15:30:29'),(349,'2015-03-04','Inicio de curso','Seguimiento al Aula abierta de la instituciín educativa, donde se está trabajando en alfabetización digital con comunidad orientado por un Gestor TIC',0,'','','','',2,356,15,'2015-03-06 15:39:20','2015-05-22 15:30:29'),(351,'2015-03-04','Seguimiento Punto de Navegación ','Se habló con dos usuarios del punto de navegación acerca del funcionamiento de los equipos, estos mencionaron que estaban conformes con el funcionamiento de estos.',2,'Casa_de_gobierno_SADEP_Seguimiento_Punto_de_navegacion_20150304_103711.jpg','','','uploads/accompaniment/accompaniment_adjunct',11,333,15,'2015-03-06 16:14:46','2015-05-22 15:30:29'),(352,'2015-03-05','Sensibilización Alfabetización Digital y Mercadeo','Se realizó una sensibilización con emprendedores del CEDEZO para realizar las inscripciones al curso de Alfabetización Digital y al taller de Mercadeo digital, se logró establecer la fecha de inicio.',0,'CEDEZO_San_Javier_Sensibilizacion_procesos_de_formacion.jpg','CEDEZO_San_Javier_Sensibilizacion_cursos.jpg','','uploads/accompaniment/accompaniment_adjunct',11,174,15,'2015-03-06 16:22:20','2015-05-22 15:30:29'),(354,'2015-03-10','Acompañamiento proceso de formación','Se realizó el acompañamiento al gestor en el curso de alfabetización digital con adultos mayores.',0,'Parque_Biblioteca_de_Belen_Acompanamiento_Gestor_TIC_20150310_161317.jpg','Parque_Biblioteca_de_Belen_Acompanamiento_Gestor_TIC_2_20150310_172409.jpg','','uploads/accompaniment/accompaniment_adjunct',4,193,15,'2015-03-11 11:17:35','2015-05-22 15:30:29'),(355,'2015-03-11','Acompañamiento a gestor TIC Cedezo San Javier','Acompañamiento a Gestor TIC en el inicio del curso de alfabetización digital con emprendedores en el CEDEZO de San Javier',0,'CEDEZO_SAN_JAVIER.jpg','CEDEZO_SAN_JAVIER_2.jpg','','uploads/accompaniment/accompaniment_adjunct',4,174,38,'2015-03-12 10:12:39','2015-05-22 15:30:29'),(356,'0000-00-00','Empalme e información','Se presenta al gestor que acompañara el proceso y sus labores a los funcionarios',5,'Casa_Maren_Empalme.jpg','','','uploads/accompaniment/accompaniment_adjunct',4,465,10,'2015-03-18 15:25:55','2015-05-22 15:30:29'),(357,'2015-03-19','Primera sesión AD Emprendedores','Sensibilización y acompañamiento al gestor TIC en su primera clase de AD en el CEDEZO de Moravia con emprendedores.',9,'IMG_20150319_WA0010.jpg','','','uploads/accompaniment/accompaniment_adjunct',4,166,10,'2015-03-20 08:09:48','2015-05-22 15:30:29'),(358,'2015-03-18','Gestión de actividades en el punto de navegación','Se realizó una pequeña intervención en el sitio en donde se pudo identificar algunas necesidades que tienen los usuarios del punto de navegación en su mayoría niños y niñas, se intentará agendar una charla de NSN con ellos.',2,'Corregiduria_El_Limonar_Intervencion_en_el_sitio.jpg','Corregiduria_El_Limonar_Seguimiento_Punto_de_Navegacion.jpg','','uploads/accompaniment/accompaniment_adjunct',7,336,15,'2015-03-24 17:53:01','2015-05-22 15:30:29'),(359,'2015-03-20','Entrega de formatos','Se realizó una reunión con la Gestora TIC Alejandra para presentar los formatos de procesos de formación con los que iniciara su labor social.',0,'','','','',4,192,15,'2015-03-25 16:38:19','2015-05-22 15:30:29'),(360,'2015-03-24','Acompañamiento curso','Se realizo acompañamiento a los gestores TIC en el curso de Alfabetización Digital.',0,'','','','',4,439,15,'2015-03-25 16:39:11','2015-05-22 15:30:29'),(361,'2015-03-24','Acompañamiento curso','Se realizo acompañamiento a los gestores TIC en el curso de Alfabetización Digital.',0,'','','','',4,439,15,'2015-03-25 16:39:46','2015-05-22 15:30:29'),(362,'2015-03-25','Sensibilización Alfabetización Digital','Se realizó la sensibilización de Alfabetización digital en compañia de la nueva gestora de la comuna 80.',0,'','','','',4,178,15,'2015-03-25 16:40:41','2015-05-22 15:30:29'),(363,'2015-03-25','Sensibilización Alfabetización Digital','Se realizó la sensibilización de Alfabetización digital en compañía de la nueva gestora de la comuna 80.',0,'','','','',4,178,15,'2015-03-25 16:41:18','2015-05-22 15:30:29'),(364,'2015-03-20','Seguimiento al Punto Wifi','En el espacio se le contó a varias personas acerca de la red de Medellín Ciudad Inteligente, algunas personas no sabían de la existencia de esta.',4,'IMG_6042_2.JPG','','','uploads/accompaniment/accompaniment_adjunct',7,473,42,'2015-03-26 08:40:17','2015-05-22 15:30:29'),(365,'2015-03-20','Intervención ','Se recogieron las planillas del punto de navegación y se observó la afluencia de público en el lugar.',4,'IMG_6035_2.jpg','','','uploads/accompaniment/accompaniment_adjunct',7,282,42,'2015-03-26 08:42:02','2015-05-22 15:30:29'),(366,'2015-03-27','Sensibilización de nuevo sitio WIFI','Sensibilización en el uso de WIFI libre en el parque, se presenta el servicio a los vecionos del sector',60,'2015_04_07.jpg','Guadalupe.jpg','','uploads/accompaniment/accompaniment_adjunct',11,510,10,'2015-03-27 15:56:48','2015-05-22 15:30:29'),(367,'2015-03-26','Asesoría usuarios','Atención a tres usuarios en el punto de navegación.  Se les pregunta sobre lo que hacen en Intenet: redes sociales, jugar.',3,'Inspeccion_9B_El_Salvador_4.JPG','Inspeccion_9B_El_Salvador_3.JPG','','uploads/accompaniment/accompaniment_adjunct',7,307,20,'2015-03-30 12:01:16','2015-05-22 15:30:29'),(368,'2015-02-24','Gestora TIC de PP','Reunión con la gestora TIC para dinamizar la atención de usuarios en el punto de navegación',1,'Mascerca_Buenos_Aires_gestora_TIC_1.jpg','Mascerca_Buenos_Aires_gestora_TIC_2.jpg','','uploads/accompaniment/accompaniment_adjunct',4,314,20,'2015-03-30 13:54:20','2015-05-22 15:30:29'),(369,'2015-02-24','Asesoría usuarios','Asesoría a usuario del punto. Se verifica la existencia de los catálogos de trámites, se encuentra completos. No se encuentra la funcionaria encargada del lugar. Recolección de registro de uso',1,'Inspeccion_9B_seguimiento_1.jpg','','','uploads/accompaniment/accompaniment_adjunct',7,307,20,'2015-03-30 15:32:37','2015-05-22 15:30:29'),(370,'2015-02-17','Charla Gobierno en Línea ','charla sobre gobierno en línea con 72 jóvenes del grado once en el aula de informática. ',72,'Republica_de_Urugay_Charla_Gobierno_en_Linea_1.jpg','Republica_de_Urugay_Charla_Gobierno_en_Linea.jpg','','uploads/accompaniment/accompaniment_adjunct',3,472,42,'2015-03-30 16:24:10','2015-05-22 15:30:29'),(371,'2015-02-18','Acompañamiento gestores TIC:',' Inducción al gestor TIC John Harold Londoño estudiante beneficiario de PP del Pascual Bravo. En la reunión con el se tocaron los siguientes temas:\r\n-El programa MCI, el área de apropiación y su labor como gestor TIC.\r\n-Selección de horarios para acompañamiento: John Harold se compromete a acompañar el curso de alfabetización digital que se lleva a cabo en la IE República de Uruguay los días martes de 6:00 a 8:00 p.m. y el curso de la IE Pedro Claver Aguirre los miércoles de 5:00 a 7:00 p.m. \r\n',1,'Comuna_5_IE_Pedro_Claver_Aguirre_Acompanamiento_gestores_TIC.JPG','','','uploads/accompaniment/accompaniment_adjunct',4,232,42,'2015-03-30 16:27:58','2015-05-22 15:30:29'),(372,'2015-02-18','Sensibilización cursos','Reunión general sobre la reactivación de la emisora con el grupo de estudiantes seleccionados por los docentes a cargo (Nelcy Tavera y Juan Diego Uribe). Se les hizo una presentación sobre el programa MCI y una presentación para hablar de algunos conceptos claves sobre la metodología de trabajo.\r\nA esta actividad asistieron  los estudiantes seleccionados para participar en el proyecto, cada uno se presentó con su nombre, grado y la expectativa para participar en la emisora, se compartió la programación o cronograma de trabajo que fue aprobada por todos, pero que está sujeta a cambios según la dinámica de trabajo.\r\nLa próxima reunión queda programada para el 12 de marzo de 8:30 a 10:00 a.m. en la biblioteca. El resto de encuentros será semanal en este mismo horario y espacio.\r\n',23,'Comuna_7_IE_Mariscal_Robledo_Emisora_1.JPG','Comuna_7_IE_Mariscal_Robledo_Emisora_2.JPG','Comuna_7_IE_Mariscal_Robledo_Emisora_3.JPG','uploads/accompaniment/accompaniment_adjunct',12,281,42,'2015-03-30 16:29:47','2015-05-22 15:30:29'),(373,'2015-02-25','Seguimiento a Gestores TIC','Este seguimiento se realizó en conjunto con la persona encargada de coordinar la biblioteca  Diana María Giraldo, la coordinadora le realiza claridades frente al proceso que se iniciará con adultos en este sitio, y las invita a realizar la formación con la mayor seriedad del caso. ',2,'Fundacion_Raton_de_Biblioteca_La_Esperanza_Seguimiento_a_Gestores_TIC.jpg','','','uploads/accompaniment/accompaniment_adjunct',4,479,24,'2015-03-30 19:55:46','2015-05-22 15:30:29'),(374,'2015-02-26','Seguimiento a Curso de Alfabetización Digital','Se realiza un acompañamiento al Gestor TIC Ranue Posso encargado de velar por la formación de empresarios y emprendedores de la comuna 7 adscritos al Cedezo. ',9,'Cedezo_La_Quintana_Seguimiento_al_Curso_de_AD_1.jpg','Cedezo_La_Quintana_Seguimiento_al_Curso_de_AD_2.jpg','Cedezo_La_Quintana_Seguimiento_al_Curso_de_AD_3.jpg','uploads/accompaniment/accompaniment_adjunct',3,168,24,'2015-03-30 20:01:57','2015-05-22 15:30:29'),(375,'2015-03-05','Seguimiento a Gestores TIC','Reunión con los dos gestores TIC encargados de llevar el taller de herramientas web 2.0 en la Fundación Ratón de Biblioteca, se evalúa su proceso y se apunta a resolver dudas frente a este.',2,'Raton_de_Biblioteca_La_Esperanza_Seguimiento_a_Gestores_TIC.jpg','','','uploads/accompaniment/accompaniment_adjunct',4,479,24,'2015-03-30 20:28:14','2015-05-22 15:30:29'),(376,'2015-03-05','Seguimiento a Taller de Herramientas web 2.0','Se realiza seguimiento al taller de herramientas Web 2.0 dictado por los dos Gestores TIC encargados del sitio. ',6,'Raton_de_Biblioteca_La_Esperanza_Seguimiento_Curso_Herramientas_Web_2_3.jpg','Raton_de_Biblioteca_La_Esperanza_Seguimiento_Curso_Herramientas_Web_2_2.jpg','Raton_de_Biblioteca_La_Esperanza_Seguimiento_Curso_Herramientas_Web_2_1.jpg','uploads/accompaniment/accompaniment_adjunct',3,479,24,'2015-03-30 20:35:46','2015-05-22 15:30:29'),(377,'2015-03-12','Acompañamiento a la Escuela de Líderes','En está fecha los participantes presentan una vaga propuesta de los módulos de formación que se tendrán en la escuela de líderes, el profesional de inclusión digital y la gestora de cultura digital escuchan con atención y propones continuar con un taller de ideación, el cual se llevará a cabo en el mes de mayo, se propone seguir trabajando en pro de la invitación a los demás líderes juveniles. ',5,'IE_Sor_Juana_Ines_de_la_Cruz_Formacion_Escuela_de_Lideres_Juveniles_1.jpg','IE_Sor_Juana_Ines_de_la_Cruz_Formacion_Escuela_de_Lideres_Juveniles.jpg','','uploads/accompaniment/accompaniment_adjunct',10,226,24,'2015-03-30 21:09:07','2015-05-22 15:30:29'),(378,'2015-03-14','Acompañamiento Observatorio Comuna 5','En esta oportunidad se trabajó el primer módulo del taller de Planeación de la comunicación, en este se trabajó todo el concepto de la participación y para que nos debemos comunicar. ',10,'IE_Pedro_Claver_Formacion_Observatorio_Comuna_5_Taller_Planeacion_de_la_Comunicacion_3.jpg','IE_Pedro_Claver_Formacion_Observatorio_Comuna_5_Taller_Planeacion_de_la_Comunicacion_1.jpg','','uploads/accompaniment/accompaniment_adjunct',10,232,24,'2015-03-30 21:15:59','2015-05-22 15:30:29'),(379,'2015-03-14','Sensibilización Curso Alfabetización Digital','Inicio del curso Alfabetización Digital y Gobierno en Línea a cargo de los Gestores TIC Gustavo Gonzalez y Sandy Ramos. ',12,'IE_Villa_Flora_Seguimiento_Curso_AD_1.jpg','IE_Villa_Flora_Seguimiento_Curso_AD_2.jpg','IE_Villa_Flora_Seguimiento_Curso_AD_3.jpg','uploads/accompaniment/accompaniment_adjunct',12,289,24,'2015-03-30 21:22:02','2015-05-22 15:30:29'),(380,'2015-03-19','Divulgación y acompañamiento escuela de líderes','Está reunión se cita para dar paso a un proceso de divulgación que se viene gestando con todos los líderes de la zona 2 (Comunas 5, 6 y 7) con el fin de anudar esfuerzos en la construcción de la escuela de líderes populares. Los llamados a participar no acogen la convocatoria y por tanto solo se realiza con 3 personas el encuentro.',3,'PB_La_Quintana_Reunion_Lideres_Comuna_5.jpg','','','uploads/accompaniment/accompaniment_adjunct',10,184,24,'2015-03-30 22:35:06','2015-05-22 15:30:29'),(381,'2015-03-18','Certificación Curso Alfabetización Digital','En está fecha se realiza la certificación del Curso dictado por los estudiantes beneficiarios de PP. ',17,'IE_Villa_Flora_Certificacion_Curso_AD_1.JPG','IE_Villa_Flora_Certificacion_Curso_AD_2.JPG','IE_Villa_Flora_Certificacion_Curso_AD_3.JPG','uploads/accompaniment/accompaniment_adjunct',2,289,24,'2015-03-30 22:53:10','2015-05-29 15:28:48'),(382,'2015-03-24','Sensibilización Taller Herramientas web 2.0','Sensibilización del Taller Herramientas Web 2.0 en el Telecentro La Carmelita',7,'Telecentro_La_Carmelita_Sensibilizacion_Curso_Herramientas_web_2_2.jpg','Telecentro_La_Carmelita_Sensibilizacion_Curso_Herramientas_web_2_1.jpg','','uploads/accompaniment/accompaniment_adjunct',12,483,24,'2015-03-30 22:54:05','2015-05-22 15:30:29'),(383,'2015-03-26','Visita a Zona WIFI','Se realiza una conexión por parte de las dos gestoras a la red Wifi y se comenta a las personas de que este sitio ya cuenta con el servicio. ',4,'Canchas_El_Progreso_2_Seguimiento_a_sitio_publico.jpg','','','uploads/accompaniment/accompaniment_adjunct',7,485,24,'2015-03-30 23:02:04','2015-05-22 15:30:29'),(384,'2015-03-25','Seguimiento al Kit de Inclusión Digital','Nos acercamos al aula de sistemas para conocer los adelantos que se tienen en el Parque Biblioteca en la apropiación del Kit de Inclusión Digital, para esto nos encontramos que varias personas en situación de discapacidad vienen trabajando con este recurso acompañados por Norma Ibargüen la encargada del espacio. ',4,'PB_La_Quintana_Seguimiento_al_Kit_de_Inclusion_Digital_1.jpg','PB_La_Quintana_Seguimiento_al_Kit_de_Inclusion_Digital_2.jpg','PB_La_Quintana_Seguimiento_al_Kit_de_Inclusion_Digital_3.jpg','uploads/accompaniment/accompaniment_adjunct',10,184,24,'2015-03-30 23:15:10','2015-05-22 15:30:29'),(385,'2015-03-30','Seguimiento y acompañamiento ','Se realizó el seguimiento a los gestores TIC en el curso de alfabetización digital, se desarrollo la primera clase de gobierno en línea y se aclararon dudas del correo electrónico.',0,'Mascerca_de_Belen_Seguimiento_Gestores_TIC_1.jpg','Mascerca_de_Belen_Seguimiento_Gestores_TIC_2.jpg','','uploads/accompaniment/accompaniment_adjunct',4,438,15,'2015-03-31 16:47:22','2015-05-22 15:30:29'),(386,'2015-03-30','Seguimiento y acompañamiento ','Se realizó el seguimiento a los gestores TIC en el curso de alfabetización digital, se desarrollo la primera clase de gobierno en línea.',0,'Unidad_Integral_de_Belen_Seguimiento_gestores_TIC.jpg','Unidad_Integral_de_Belen_Seguimiento_gestores_TIC_2.jpg','','uploads/accompaniment/accompaniment_adjunct',4,362,15,'2015-03-31 16:49:00','2015-05-22 15:30:29'),(387,'2015-03-31','Intervención','Se visitó el parque de San Cristóbal y se verificó el buen uso y funcionamiento del internet, además de esto se conversó con algunos usuarios y se informó de los fondos de educación superior.',2,'Parque_S_Cristobal_Seguimiento.jpg','','','uploads/accompaniment/accompaniment_adjunct',11,283,23,'2015-03-31 22:01:41','2015-05-22 15:30:29'),(388,'2015-03-31','Formación Gestores TIC','El día de hoy nos encontramos en el aula de capacitaciones del Parque Biblioteca Tomás Carrasquilla- La Quintana con el fin de formar a Cristian y Jackeline, gestores TIC de la Zona 2 para formarlos en el contenido de Narrativas Digitales. ',2,'PB_La_Quintana_Formacion_Gestores_TIC_1.jpg','PB_La_Quintana_Formacion_Gestores_TIC_2.jpg','PB_La_Quintana_Formacion_Gestores_TIC.jpg','uploads/accompaniment/accompaniment_adjunct',3,184,24,'2015-03-31 22:23:42','2015-05-22 15:30:29'),(392,'2015-04-01','Reunión Gestores TIC','Reunión con 5 estudiantes beneficiarios de presupuesto participativo para vincularlos en la figura de Gestores TIC y acompañen los procesos de apropiación en el punto de navegación del Mascerca de Buenos Aires y en aulas abiertas que puedan gestionarse en las IE cercanas. ',5,'Mascerca_Buenos_Aires_Acompanamiento_Gestores_TIC_1.JPG','Mascerca_Buenos_Aires_Acompanamiento_Gestores_TIC_2.JPG','Mascerca_Buenos_Aires_Acompanamiento_Gestores_TIC_3.JPG','uploads/accompaniment/accompaniment_adjunct',4,314,17,'2015-04-07 11:39:14','2015-05-22 15:30:29'),(395,'2015-04-08','Seguimiento al sitio','Se realizó seguimiento al sitio, se habló con el funcionario encargado de la atención al usuario y con 2 de los usuarios del punto de navegación acerca del funcionamiento del mismo y ellos expresaron que los computadores funcionan bien, además se recogieron los indicadores de gobierno.',2,'Mascerca_del_Poblado_Seguimiento_al_sitio_2.jpg','Mascerca_del_Poblado_Seguimiento_al_sitio.jpg','','uploads/accompaniment/accompaniment_adjunct',10,349,43,'2015-04-09 08:42:25','2015-05-22 15:30:29'),(396,'2015-04-08','Acompañamiento a gestor TIC Cedezo San Javier','Acompañamiento al curso de Alfabetización Digital dinamizado por el Gestor TIC Mateo Meneses',0,'FullSizeRender_1.jpg','','','uploads/accompaniment/accompaniment_adjunct',4,174,38,'2015-04-09 09:25:01','2015-05-22 15:30:29'),(399,'2015-04-07','sesión de transferencia de contenidos ','Se realizó una jornada de acompañamiento a gestores y gestoras TIC con el fin de  presentarles los contenidos del programa. En la sesión estuvimos conversando sobre la estrategia del Programa respecto a internet seguro, vimos los contenidos del curso de Alfabetización Digital y el taller de Gobierno en Línea. Los chicos y chicas aclararos dudas sobre dichos contenidos y se mostraron entusiasmados por empezar a dictar clases. ',6,'tallerchicxsPP.jpg','','','uploads/accompaniment/accompaniment_adjunct',4,440,21,'2015-04-09 15:57:29','2015-05-22 15:30:29'),(400,'2015-04-08','Acompañamiento curso AD','Se realizó la tercera sesión de Alfabetización Digital, pues las estudiantes de pp no pudieron asistir por cuestiones de estudio.',0,'CEDEZO_SADEP_Acompanamiento_AD.jpg','','','uploads/accompaniment/accompaniment_adjunct',4,178,15,'2015-04-09 16:11:29','2015-05-22 15:30:29'),(401,'2015-04-09','Seguimiento al punto de navegación','Seguimiento al punto de navegación del CAV de Caunces. Se encontró que uno de los equipos está dañado y que sólo hay uno en funcionamiento. Se interactuó con dos usuarios que se encontraban en el sitio haciendo uso del internet para conocer sus intereses y actividades realizadas allí.',2,'CAV_Caunces_Seguimiento_Punto_de_navegacion_2.JPG','CAV_Caunces_Seguimiento_Punto_de_navegacion_2.JPG','','uploads/accompaniment/accompaniment_adjunct',10,298,17,'2015-04-09 16:27:28','2015-05-22 15:30:29'),(402,'2015-04-13','Capacitación Alfabetizadores','Capacitación a los alfabetizadores de la institución educativa para el curso de AD ',5,'Capacitacion_gestores_Bravo_Marquez.jpg','','','uploads/accompaniment/accompaniment_adjunct',4,159,10,'2015-04-13 16:50:08','2015-05-22 15:30:29'),(403,'2015-04-14','Capacitación Gestores TIC en Dispositivos moviles','Capacitación Gestores TIC en Dispositivos móviles y metodologías de enseñanza con el adulto mayor',3,'Capacitacion_gestores_UVA_Moscu.jpg','','','uploads/accompaniment/accompaniment_adjunct',4,442,10,'2015-04-14 16:13:18','2015-05-22 15:30:29'),(404,'2015-04-13','Acompañamiento curso','Se realizó acompañamiento a los Gestores TIC en la octava sesión de Alfabetización digital.',0,'Mascerca_Belen_Acompanamiento_Gestores_TIC_1.jpg','Mascerca_Belen_Acompanamiento_Gestores_TIC_2.jpg','','uploads/accompaniment/accompaniment_adjunct',4,438,15,'2015-04-15 17:40:23','2015-05-22 15:30:29'),(405,'2015-04-13','Acompañamiento curso','Se realizó acompañamiento a los Gestores TIC en la octava sesión de Alfabetización digital.',0,'Unidad_Integral_6_Belen_Acompanamiento_Gestores_TIC.jpg','Unidad_Integral_6_Belen_Acompanamiento_Gestores_TIC_2.jpg','','uploads/accompaniment/accompaniment_adjunct',4,362,15,'2015-04-15 17:43:40','2015-05-22 15:30:29'),(406,'2015-04-15','Acompañamiento curso','Se realizó un acompañamiento a las Gestoras TIC en la sesión cuarta de AD.',0,'CEDEZO_San_Antonio_de_Prado_Curso_AD.jpg','CEDEZO_San_Antonio_de_Prado_Acompanamiento_Gestoras_TIC.jpg','CEDEZO_San_Antonio_de_Prado_Acompanamiento_Gestoras_TIC_2.jpg','uploads/accompaniment/accompaniment_adjunct',4,178,15,'2015-04-15 17:53:33','2015-05-22 15:30:29'),(407,'2015-04-15','Seguimiento curso AD Y GEL','Se dictó la sesión 3 de Herramientas Web 2.0, los alumnos descargaron videos y música de YouTube',8,'Telecentro_La_Carmelita_AD_Y_GEL_1.JPG','Telecentro_La_Carmelita_AD_Y_GEL.JPG','','uploads/accompaniment/accompaniment_adjunct',3,483,42,'2015-04-20 15:18:09','2015-05-22 15:30:29'),(408,'2015-04-17','Capacitación a gestora TIC.','Se realizó una reunión con la gestora TIC Alejandra Moreno para planear el inicio del curso de Alfabetización Digital que ella orientará en el Parque Biblioteca Guayabal, además iniciamos la capacitación en los contenidos del curso.',1,'Parque_Biblioteca_Guayabal_Acompanamiento_a_gestor_TIC.jpg','','','uploads/accompaniment/accompaniment_adjunct',4,192,43,'2015-04-20 15:50:07','2015-05-22 15:30:29'),(409,'2015-04-01','Vinculación de gestores TIC','Reunión con 5 estudiantes beneficiarios de presupuesto participativo para vincularlos en la figura de Gestores TIC y acompañen los procesos de apropiación en el punto de navegación del Mascerca y en aulas abiertas. ',5,'Mascerca_Buenos_Aire_acompanamiento_gestoresTIC.jpg','','','uploads/accompaniment/accompaniment_adjunct',4,314,20,'2015-04-21 11:20:39','2015-05-22 15:30:29'),(410,'2015-04-16','Vinculación de gestor TIC','Reunión con un estudiante de PP para su vinculación como Gestor TIC del programa. Sus labores principales estarán orientadas al diseño de los tutoriales en la plantilla de Power Point, adaptando los contenidos a la imagen del programa. Compromisos: Enviarle las plantillas de PPT y los formatos de tutoriales que debe elaborar; trabajar 8 horas a la semana para terminar estos turoriales.',1,'Mascerca_Buenos_Aires_Acompanamiento_Jerson_Rodriguez_1.JPG','Mascerca_Buenos_Aires_Acompanamiento_Jerson_Rodriguez_2.JPG','','uploads/accompaniment/accompaniment_adjunct',11,314,20,'2015-04-21 11:31:00','2015-05-22 15:30:29'),(411,'2015-04-08','Asesoría usuarios','Atención a usuarios en el punto de navegación. Comprobación del buen funcionamiento de los equipos y de la red wifi externa. Recolección de indicadores. ',5,'Parque_de_la_vida_empalme_1.jpg','Parque_de_la_vida_empalme_2.jpg','','uploads/accompaniment/accompaniment_adjunct',7,318,20,'2015-04-21 12:02:13','2015-05-22 15:30:29'),(412,'2015-04-13','Planeación del proceso formativo','Encuentro con una estudiante quien realizará sus prácticas universitarias en la biblioteca, para vincularla como Gestora TIC y poder así facilitar diversos procesos de formación. Compromiso: Comenzar los viernes en la tarde un curso con adultos sobre alfabetización, narrativas digitales y lecto-escritura; y los lunes en la tarde un taller de herramientas Web con jóvenes.',2,'Biblioteca_Villatina_Reunion_Gestora_TIC_1.JPG','Biblioteca_Villatina_Reunion_Gestora_TIC_2.JPG','','uploads/accompaniment/accompaniment_adjunct',4,525,17,'2015-04-22 15:17:15','2015-05-22 15:30:29'),(413,'2015-04-14','Seguimiento y planeación de actividades','Visita de seguimiento y acompañamiento al Gestor TIC que está desarrollando las horas en el punto de navegación de la Casa de Gobierno. El sitio es poco frecuentado por la comunidad, pero hay muy buena disposición de los funcionarios para prestar el servicio.',1,'Casa_Gobierno_Santa_Elena_Seguimiento_Gestor_TIC_1.jpg','Casa_Gobierno_Santa_Elena_Seguimiento_Gestor_TIC_2.jpg','','uploads/accompaniment/accompaniment_adjunct',4,296,17,'2015-04-22 16:41:04','2015-05-22 15:30:29'),(415,'2015-04-24','Vinculación de gestora TIC','Se realizó una reunión con María Isabel Rúa, estudiante de PP con el fin de realizar su vinculación como gestora TIC del programa, específicamente en el Parque Biblioteca Guayabal para apoyar inicialmente, el curso de Alfabetización Digital y Gobierno en Línea que se dictará los sábados de 9:00 am a 12:00 m. \r\nAdemás se realizó la inducción general sobre el programa, su proceso como gestora TIC y los contenidos del curso de Alfabetización Digital y Gobierno en Línea. Finalmente se firmó el pacto de acompañamiento.',1,'Parque_Biblioteca_Guayabal_Acompanamiento_a_gestora_TIC.jpg','','','uploads/accompaniment/accompaniment_adjunct',4,192,43,'2015-04-27 08:10:24','2015-05-22 15:30:29'),(416,'2015-04-25','Vinculación de gestor TIC','Se realizó una reunión con Diego Gonzalez Muñoz, estudiante de PP con el fin de realizar su vinculación como gestor TIC del programa, él acompañará el curso de Alfabetización Digital y Gobierno en Línea que se dictará los sábados de 08:00 am a 12:00 m en la Institución Educativa José Acevedo y Gómez. Además se realizó la inducción general sobre el programa, su proceso como gestor TIC y los contenidos del curso de Alfabetización Digital y Gobierno en Línea. \r\nLuego de la reunión, se realizó en compañía de Diego la sensibilización del curso a la comunidad. Finalmente se firmó el pacto de acompañamiento.\r\n',1,'Institucion_Educativa_Jose_Acevedo_y_Gomez_Acompanamiento_Gestor_TIC.jpg','','','uploads/accompaniment/accompaniment_adjunct',4,344,43,'2015-04-27 08:35:41','2015-05-22 15:30:29'),(417,'2015-04-24','Acompañamiento','Acompañamiento a gestor tic en el curso Alfabetización Digital',8,'Cedezo_Manrique_A_D1_800x600.jpg','Cedezo_Manrique_A_D2_800x600.jpg','','uploads/accompaniment/accompaniment_adjunct',4,165,10,'2015-04-27 08:58:43','2015-05-22 15:30:29'),(418,'2015-04-25','Cine para todos','Acompañamiento a 7 integrantes de la fundación casa Maren en Cine para Todos, programa de cine de inclusión del ministerio TIC',8,'Casa_Maren_Cine_para_todos_600x800.jpg','Casa_Maren_Cine_para_todos1_600x800.jpg','Casa_Maren_Cine_para_todos2_800x600.jpg','uploads/accompaniment/accompaniment_adjunct',10,465,10,'2015-04-27 09:00:56','2015-05-22 15:30:29'),(419,'2015-04-22','Inducción a Gestores Tic','Se visitó el centro de Servicios de Lusitania donde se realizó el empalme de las nuevas gestoras Tic en relación a las actividades que generalmente se realizan en los sitios de Gobierno con zonas WIFI- Puntos de Navegación, se dieron tips variados de relación con las personas, formas de acercamiento, diligenciamiento de planillas, tipos de asesorías. Se les contó de qué se trata el programa, se diligenciaron formatos, se indagaron expectativas, intereses, se les entregó a cada una la carpeta con alguana documentación para leer y se firmó el pacto de acompañamiento, entre otras actividades. ',2,'IMG_20150422_103051011.jpg','','','uploads/accompaniment/accompaniment_adjunct',4,272,23,'2015-04-27 16:03:08','2015-05-22 15:30:29'),(420,'2015-04-22','Recorrido con Gestor Tic','Se realizó recorrido con Gestor Tic por algunos lugares del Corregimiento de San Cristóbal, entre ellos: Cedezo, Parque y centro de servicios con el propósito de presentarla, conocer los funcionarios y hacer empalme de algunas dinámicas de cada lugar para poder empezar la labor en cada uno de ellos',1,'recorrido.jpg','','','uploads/accompaniment/accompaniment_adjunct',4,567,23,'2015-04-27 16:15:02','2015-05-22 15:30:29'),(421,'2015-04-22','Gestor Tic','Se realizó  acompañamiento  a Cristian, Gestor Tic de la comuna 7 que dicta actualmente taller de herramientas web 2.0 en el telecentro la amistad Villa Sofia en la comuna 7. Se observa buena asistencia al taller aunque algunas personas al parecer deberían estar en A.D . Se conversó con la persona encargada del telecentro para ofertar próximamente taller de narrativas digitales con población jóven. Se diligenciaron planillas y datos con el Gestor Tic y se conversó con las personas del curso.',1,'telecentro_la_amistad_V_Sofia_Acompanamiento_a_Gestor_Tic.jpg','','','uploads/accompaniment/accompaniment_adjunct',4,203,23,'2015-04-27 16:22:54','2015-05-22 15:30:29'),(429,'2015-04-24','Intervención sitio de gobierno','Intervención sitio de gobierno, activación y asesorías individuales',48,'C_A_V_la_America_Activacion1.jpg','C_A_V_la_America_Activacion2.jpg','','uploads/accompaniment/accompaniment_adjunct',7,246,10,'2015-04-28 09:16:30','2015-05-22 15:30:29'),(430,'2015-04-24','Intervención sitio de gobierno','Intervención sitio de gobierno, activación y asesorías individuales.',4,'Aula_Ambiental_la_America_Activacion4.jpg','Aula_Ambiental_la_America_Activacion3.jpg','','uploads/accompaniment/accompaniment_adjunct',7,236,10,'2015-04-28 10:21:02','2015-05-22 15:30:29'),(431,'2015-04-27','Capacitación AlfabetizadoreS Y GESTORES TIC','Se capacita a la gestora Tic y a los alfabetizadores en A.D para curso con comunidad.',5,'Casa_lectura_Villa_guadalupe_Gestor1.jpg','','','uploads/accompaniment/accompaniment_adjunct',4,463,10,'2015-04-28 11:03:40','2015-05-22 15:30:29'),(432,'2015-04-27','Acompañamiento a Gestor TIC','se firmó pacto de acompañamiento y se le entregó al nuevo gestor la información sobre el proceso de formación que va a acompañar en la biblioteca el salado de la comuna 13',1,'Acompanamiento_a_gestor_TIC.JPG','Acompanamiento_a_Gestor_TIC_2.JPG','','uploads/accompaniment/accompaniment_adjunct',5,450,38,'2015-04-29 09:02:24','2015-05-22 15:30:29'),(434,'2015-04-20','Presentación de nuevos gestores','se hizo reunión con el encargado del punto de navegación en el sitio de gobierno Inspección Aranjuez con los gestorres tic que acompañaran y dinamizarán este punto de la ciudad en la comuna 4. Se hace inducción de funciones y actividades con el registro de usuario. ',3,'IMG_6706.JPG','','','uploads/accompaniment/accompaniment_adjunct',4,255,41,'2015-04-29 14:46:59','2015-05-22 15:30:29'),(435,'2015-04-29','Seguimiento a punto de navegación.','Se realizó seguimiento al punto de navegación de la casa de gobierno, se conversó con 3 usuarios y con el funcionario encargado, identificando que los computadores están funcionando bien y se realiza buen uso de estos. Además se recogieron los indicadores del mes de Abril.',3,'','Casa_de_Gobierno_Altavista_Seguimiento_al_punto_de_navegacion.jpg','','uploads/accompaniment/accompaniment_adjunct1',7,332,43,'2015-04-29 15:40:42','2015-05-22 15:30:29'),(436,'2015-04-14','Atención a usuarios','Visita de seguimiento al punto de navegación del centro de servicios de la Alpujarra. Se identificaron tres equipos sin conectividad en el momento. Se interactuó con tres personas que hicieron uso de los computadores durante la visita, confirmando su importancia y funcionalidad para la comunidad.',3,'CAM_seguimiento1_2.JPG','CAM_seguimiento1_1.JPG','CAM_seguimiento1_3.JPG','uploads/accompaniment/accompaniment_adjunct',7,535,20,'2015-04-29 17:19:44','2015-05-22 15:30:29'),(437,'2015-04-28','Atención a usuarios','Se atienden a tres usuarios en el punto de navegación, uno de ellos interesado en la entrega de la ayuda humanitaria. Se verifica el buen funcionamiento de los equipos; pero se encuentra que 5 de ellos sin conexión a internet, se logra habilitar 2; los restantes son reportados a conectividad.',3,'CAM_seguimiento1_4.jpg','CAM_seguimiento1_5.jpg','','uploads/accompaniment/accompaniment_adjunct',7,535,20,'2015-04-29 17:22:17','2015-05-22 15:30:29'),(438,'2015-04-27','Acompañamiento certificación curso','Se realizó el cierre de los dos cursos de alfabetización digital que se estaba realizando con la comunidad de la Unidad Integral 6 de Belén y el Mascerca de Belén, las personas quedaron muy contentas con el curso y quieren realizar otros más.',0,'Parque_Biblioteca_Belen_Cetificacion_Alfabetizacion_Digital_y_Gobierno_en_Linea.jpg','','','uploads/accompaniment/accompaniment_adjunct',4,193,15,'2015-04-30 07:54:44','2015-05-22 15:30:29'),(439,'2015-04-29','Seguimiento y acompañamiento ','Se realizó seguimiento al punto de navegación de la casa de gobierno, se identifico que los equipos están funcionando muy bien.',4,'Casa_de_Gobierno_SADEP_Seguimiento_Punto_de_navegacion_29_04_15.jpg','','','uploads/accompaniment/accompaniment_adjunct',7,333,15,'2015-04-30 08:46:11','2015-05-22 15:30:29'),(442,'2015-04-07','Seguimiento Aulab','Acompañamiento semanal al Laboratorio Aulab de la Institución Educativa Aures',14,'Institucion_Educativa_Aures_Seguimiento_Gestores_TIC.JPG','','','uploads/accompaniment/accompaniment_adjunct',9,568,42,'2015-05-02 19:21:41','2015-05-22 15:30:29'),(443,'2015-04-08','Acompañamiento Laboratorio Comunitario','Acompañamiento semanal al laboratorio que está comenzando en la institución con los tres componentes: emisora, video y periódico.',10,'','Institucion_Educativa_Jorge_Robledo_Laboratorio_1.JPG','','uploads/accompaniment/accompaniment_adjunct1',9,278,42,'2015-05-02 19:24:26','2015-05-22 15:30:29'),(444,'2015-04-10','Acompañamiento Curso ','Seguimiento al curso, ver los avances y como van las personas con las gestoras de este lugar',14,'','','','',3,479,42,'2015-05-02 19:41:51','2015-05-22 15:30:29'),(445,'2015-04-14','Acompañamiento Aulab','Acompañamiento semanal al laboratorio, mirar el proceso y preparar los nuevos productos que se harán este año',12,'Educativa_Aures_Seguimiento_a_gestores_TIC_2.JPG','','','uploads/accompaniment/accompaniment_adjunct',9,568,42,'2015-05-02 20:02:41','2015-05-22 15:30:29'),(446,'2015-04-14','Acompañamiento Curso Herramientas Web 2.0','Se dictó en el curso de Herramientas Web 2.0 el tema de como descargar música y videos de YouTube',9,'Telecentro_La_Carmelita_Curso_AD_y_GEL_1.jpg','Telecentro_La_Carmelita_Curso_AD_y_GEL.jpg','','uploads/accompaniment/accompaniment_adjunct',3,483,42,'2015-05-02 20:06:28','2015-05-22 15:30:29'),(447,'2015-04-22','Acompañamiento Laboratorio Comunitario ','Se habló de hacer varios videos que ayuden a impulsar la institución Educativa ',10,'I_E_Jorge_Robledo_Laboratorio_Audiovisual.jpg','I_E_Jorge_Robledo_Laboratorio_Audiovisual_1.jpg','','uploads/accompaniment/accompaniment_adjunct',9,278,42,'2015-05-02 20:38:22','2015-05-22 15:30:29'),(448,'2015-04-29','Acompañamiento Laboratorio Comunitario','Los chicos hicieron un taller de Stop motion rápido, no hubo mucha asistencia porque en la institución hay varios profesores en paro',7,'Institucion_Educativa_Jorge_Robledo_Laboratorio_Comunitario.jpg','Institucion_Educativa_Jorge_Robledo_Laboratorio_Comunitario_2.JPG','','uploads/accompaniment/accompaniment_adjunct',9,278,42,'2015-05-03 08:29:40','2015-05-22 15:30:29'),(449,'2015-05-07','Acompañamiento Taller Herramientas web 2.0','Se realizó un acompañamiento al taller de herramientas web 2.0 en está sesión se repasaron algunas sesiones trabajadas en Alfabetización Digital. ',12,'Telecentro_La_Carmelita_Taller_Herramientas_web_2_0.jpg','','','uploads/accompaniment/accompaniment_adjunct',3,483,24,'2015-05-03 13:28:40','2015-05-22 15:30:29'),(450,'2015-04-30','Inicio Labor social','Se realizó una reunión con un voluntario y una estudiante de pp que iniciaran la labor social con el programa, acompañando algunos de los procesos de formación que se iniciaran el belén.',0,'Mascerca_Belen_Gestores_TIC.jpg','','','uploads/accompaniment/accompaniment_adjunct',4,438,15,'2015-05-03 13:34:45','2015-05-22 15:30:29'),(451,'2015-04-10','Inducción Gestor TIC','El encuentro se realiza con Ayen Amaya, estudiante del Pascual el cual manifiesta las ganas de cumplir su labor social en las estrategias que propone el programa, en el proceso de inducción se le muestra cual es nuestro objetivo y las opciones que tiene para cumplir con su labor social.  ',0,'Ayen_Fernando_Amaya_Estudiante_Pascual.jpg','','','uploads/accompaniment/accompaniment_adjunct',5,184,24,'2015-05-03 13:41:21','2015-05-22 15:30:29'),(452,'2015-04-10','Inducción Gestor TIC','Se realiza un  proceso de inducción a un estudiante del Pascual Bravo interesado en acompañar los procesos de formación con miras a cumplir con su labor social. Él será el encargado los días sábado de acompañar un curso de Alfabetización Digital con funcionarios de secretaría de Desarrollo económico y además con el parque biblioteca Tomás Carrasquilla La Quintana de asesorar a los usuarios en charlas de dispositivos móviles. ',0,'Cedezo_La_Quintana_Induccion_Gestor_TIC.jpg','Cedezo_La_Quintana_Induccion_Gestor_TIC.jpg','','uploads/accompaniment/accompaniment_adjunct',11,168,24,'2015-05-03 13:45:18','2015-05-22 15:30:29'),(453,'2015-04-11','Acompañamiento Observatorio Comuna 5','En está fecha se revisaron los compromisos y plantearon actividades direccionadas a definir el objetivo y población a la cual se comunicará el proyecto. ',13,'IE_Pedro_Claver_Aguirre_Observatorio_Comuna_5_2.jpg','IE_Pedro_Claver_Aguirre_Observatorio_comuna_5.jpg','','uploads/accompaniment/accompaniment_adjunct',3,232,24,'2015-05-03 13:55:43','2015-05-22 15:30:29'),(454,'2015-04-25','Seguimiento al curso Alfabetización Digital','Hoy se realizó seguimiento al Aula Abierta y se enseñó todo lo concerniente a correo electrónico. ',9,'IE_Villa_Flora_Seguimiento_Curso_AD_y_GEL.jpg','','','uploads/accompaniment/accompaniment_adjunct',2,289,24,'2015-05-03 21:59:17','2015-05-22 15:30:29'),(455,'2015-04-25','Acompañamiento Curso Alfabetización Digital','En la segunda sesión de alfabetización digital y gobierno en línea con los funcionarios de comodatos, se trabaja todo el tema del teclado y el mouse, se realizan ejercicios en Edukanda, los Gestores TIC Ayen Amaya y Osbaldo Arboleda quedan a cargo del curso. ',9,'Cedezo_La_Quintana_Segunda_Sesion_Curso_AD_y_GEL_Funcionarios_3.jpg','','','uploads/accompaniment/accompaniment_adjunct',2,168,24,'2015-05-03 22:02:14','2015-05-22 15:30:29'),(456,'2015-05-14','Reunión gestor TIC','Reunión con estudiante de PP del Pascual interesado en realizar la labor social en el programa. Se le cuenta sobre la estrategia de acompañamiento y se encuentra interesado en la hacerla. \r\nCompromiso: hablar con el edil de la 9 si puede el estudiante hacer su labor social en otra comuna como taquilla única.',1,'Inspeccion_9B_Gestor_TIC_PB.jpg','','','uploads/accompaniment/accompaniment_adjunct',4,307,20,'2015-05-03 22:57:22','2015-05-22 15:30:29'),(457,'2015-04-01','Transferencia de contenidos a Gestorxs Tic','Se realizó una sesión de acompañamiento a los y las gestoras TIC de la comuna 3 y 4 donde se presentaron los contenidos de los talleres y cursos, se aclararon dudas y se realizaron recomendaciones. ',6,'Capacitacion_Gestores_TIC_2.JPG','','','uploads/accompaniment/accompaniment_adjunct',4,440,21,'2015-05-04 15:18:14','2015-05-22 15:30:29'),(458,'2015-05-05','Acompañamiento a Curso','Acompañamiento al curso de alfabetización digital y gobierno en Línea con adulto mayor, realizado por el gestor TIC voluntario, Jhon Andrés Mestra en el telecentro Fátima de la comuna 16.',1,'Telecentro_Fatima_Acompanamiento_a_gestor_TIC_Jhon_Andres_Mestra_en_curso_de_Alfabetizacion_digital_y_gobierno_en_linea.JPG','','','uploads/accompaniment/accompaniment_adjunct',11,207,38,'2015-05-11 14:19:33','2015-05-22 15:30:29'),(459,'2015-05-07','Acompañamiento a Curso','Acompañamiento al curso de alfabetización digital y gobierno en Línea con adulto mayor, realizado por la gestora TIC de Pascual Bravo, Carolina Moreno en el telecentro Fátima de la comuna 16.',1,'Telecentro_Fatima_Acompanamiento_a_gestora_TIC_Carolina_Moreno_en_curso_de_Alfabetizacion_digital_y_gobierno_en_linea.JPG','','','uploads/accompaniment/accompaniment_adjunct',4,207,38,'2015-05-11 14:23:23','2015-05-22 15:30:29'),(460,'2015-05-09','Acompañamiento gestora TIC ','Acompañamiento a la gestora TIC del Pascual Bravo en el punto de navegación. El próximo sábado termina su labor social y se le entregará el certificado de terminación de sus horas.',1,'Parque_de_la_Vida_Acompanamiento_gestoraPB_Irianda_Osorio_1.jpg','Parque_de_la_Vida_seguimiento.jpg','','uploads/accompaniment/accompaniment_adjunct',5,318,20,'2015-05-11 16:45:03','2015-05-22 15:30:29'),(461,'2015-05-07','Seguimiento kit de inclusión digital','Seguimiento al kit de inclusión digital y acompañamiento al curso de alfabetización digital para personas en situación de discapacidad. Se señala la necesidad de utilizar algunas herramientas del kit para algunos participantes del curso',3,'PB_Leon_de_Greiff_acompanamiento_kit_de_inclusion_5.jpg','PB_Leon_de_Greiff_acompanamiento_kit_de_inclusion_4.jpg','PB_Leon_de_Greiff_acompanamiento_kit_de_inclusion_3.jpg','uploads/accompaniment/accompaniment_adjunct',8,188,20,'2015-05-11 16:51:55','2015-05-22 15:30:29'),(462,'2015-05-12','Acompañamiento Aula Abierta','Revisión de contenidos y proceso de Aula Abierta con la comunidad',3,'20150512_102828_HDR.jpg','IMG_20150512_WA0006.jpeg','','uploads/accompaniment/accompaniment_adjunct',2,254,10,'2015-05-12 12:00:53','2015-05-22 15:30:29'),(463,'2015-05-12','Acompañamiento Gestor TIC','Socialización de contenidos NSN para todo publico con los psicólogos de la institución para todo publico',2,'20150512_100854_HDR.jpg','','','uploads/accompaniment/accompaniment_adjunct',4,254,10,'2015-05-12 12:02:59','2015-05-22 15:30:29'),(464,'2015-05-12','Acompañamiento Aulab','Se acompañó a los chicos y chicas del laboratorio a grabar un documental que se encontraban preparando para unas madres comunitarias del sector aledaño a la institución educativa',10,'Institucion_Educativa_Aures_Laboratorio_Comunitario.JPG','Institucion_Educativa_Aures_Laboratorio_Comunitario_1.JPG','Institucion_Educativa_Aures_Laboratorio_Comunitario_2.JPG','uploads/accompaniment/accompaniment_adjunct',9,568,42,'2015-05-12 13:42:01','2015-05-22 15:30:29'),(465,'2015-05-12','Acompañamiento curso','Se realiza sesión 3 de Alfabetización digital cubriendo a la gestora TIC que no pudo acompañar la sesión por quehaceres de la universidad.',12,'20150512_140121_HDR.jpg','','','uploads/accompaniment/accompaniment_adjunct',4,463,10,'2015-05-12 17:10:16','2015-07-01 19:02:26'),(466,'2015-05-12','Atención a usuarios','Acompañamiento al punto de navegación, verificación del adecuado funcionamiento de los equipos; recolección de indicadores.Se atiende a un usuario que se encuentra en el punto; se indaga por la asistencia de los estudiantes de PP',1,'Mascerca_acompanamiento_al_sitio.jpg','','','uploads/accompaniment/accompaniment_adjunct',7,314,20,'2015-05-13 11:06:50','2015-05-22 15:30:29'),(467,'2015-05-12','Sitio de gobierno','Acompañamiento al punto de navegación, verificación del adecuado funcionamiento de los equipos; recolección de indicadores. El vigilante comenta que procura por el buen uso de los equipos por parte de los usuarios. ',1,'Inspeccion_9B_El_Salvador_acompanamiento_al_sitio.jpg','','','uploads/accompaniment/accompaniment_adjunct',7,307,20,'2015-05-13 11:11:50','2015-05-22 15:30:29'),(468,'2015-05-09','Acompañamiento a gestora TIC en curso de AD y GEL ','Se realizó acompañamiento a la gestora TIC Maria Isabel Rúa Taborda en la segunda sesión de Alfabetización Digital y Gobierno en Línea dirigido a adultos, se resolvieron las principales dudas con respecto a los contenidos y se brindaron algunas estrategias pedagógicas.',1,'Parque_Biblioteca_Guayabal_Seguimiento_a_la_gestora_TIC_Maria_Isabel_Rua.jpg','','','uploads/accompaniment/accompaniment_adjunct',4,192,43,'2015-05-13 15:20:37','2015-05-22 15:30:29'),(469,'2015-05-09','Acompañamiento a gestora TIC en curso de AD y GEL ','Se realizó acompañamiento y apoyo a la gestora TIC Maria Alejandra Moreno en la segunda sesión de Alfabetización Digital y Gobierno en Línea dirigido a adultos, además se realizó una dinámica de integración con el grupo.',1,'Parque_Biblioteca_Guayabal_Seguimiento_a_gestora_TIC_Maria_Alejandra_Moreno.jpg','','','uploads/accompaniment/accompaniment_adjunct',4,192,43,'2015-05-13 15:26:50','2015-05-22 15:30:29'),(470,'2015-05-11','Seguimiento a Kit de Inclusión Digital','Se realizó seguimiento al Kit de inclusión digital, se evidencio que en el aula de sistemas el Kit está visible y utilizado por 11 estudiantes de la institución con discapacidad cognitiva, se planeó con la docente de apoyo una estrategia para incluir a personas de la comunidad, dicha estrategia consiste en realizar un curso de Alfabetización Digital con personas en situación de discapacidad de la comuna.',2,'Institucion_Educativa_Santos_Angeles_Custodios_Seguimiento_al_KIT_de_inclusion.jpg','','','uploads/accompaniment/accompaniment_adjunct',8,359,43,'2015-05-13 15:49:31','2015-05-22 15:30:29'),(471,'2015-05-13','Seguimiento kit de inclusión digital','Reunión con la encargada del kit de inclusión digital para verificar su uso de los dispositivos. Este institución se ha empederado positivamente del kit con las personas en situación de discapacidad. Además, se le extiende la invitación para 7 estudiantes el 30 de mayo  con la propuesta del Ministerio de \"Cine para todos\". Confirmación de los participantes y envio de la programación del 30 de mayo.',1,'ITM_Fraternidad_acompanamiento_kit_inclusion.jpg','','','uploads/accompaniment/accompaniment_adjunct',8,308,20,'2015-05-13 16:50:56','2015-05-22 15:30:29'),(472,'2015-05-13','Acompañamiento seguimiento Gestores TIC','Se hace acompañamiento a los gestores TIC del la I.E Bravo Márquez, se realiza un refuerzo en contenidos del curso, se revisan las listas de asistencia. ',6,'20150513_145852_HDR.jpg','','','uploads/accompaniment/accompaniment_adjunct',4,159,10,'2015-05-14 08:20:41','2015-05-22 15:30:29'),(473,'2015-05-13','Vinculación de gestor TIC ','Se realizó una reunión con Daniel Pelaez Betancur, administrador de empresas y Tecnólogo en Sistemas, con el fin de realizar su vinculación como gestor TIC del programa de manera voluntaria, él acompaña el taller de Web 2.0 que se dicta los sábados de 08:00 am a 11:00 am en la Institución Educativa José Acevedo y Gómez. \r\nAdemás se realizó la inducción general sobre el programa, su proceso como gestor TIC y los contenidos del taller. Finalmente se firmó el pacto de acompañamiento y se realizó acompañamiento en la primera sesión del taller.',1,'Institucion_Educativa_Jose_Acevedo_y_Gomez_Acompanamiento_a_Gestor_Tic_Daniel_Pelaez.jpg','','','uploads/accompaniment/accompaniment_adjunct',4,344,43,'2015-05-14 11:32:27','2015-05-29 14:08:02'),(474,'2015-05-14','Acompañamiento a Gestor TIC en curso de AD','Se resolvieron las dudas del gestor TIC sobre el tema de Gobierno en Linea. Hicimos retroalimentación de las clases pasadas con los participantes y empezamos la clase 9, el procesador de texto.',1,'IE_Mariscal_Robledo_Alfabetizacion_Digital.jpg','','','uploads/accompaniment/accompaniment_adjunct',4,281,44,'2015-05-15 09:11:07','2015-05-22 15:30:29'),(475,'2015-05-07','Acompañamiento a Gestor TIC en curso de AD','En la primera sesión de Gobierno en linea, dentro del curso de Alfabetización Digital, el gestor TIC no tenía ningún conocimiento sobre el tema. Lo abordamos de forma personal antes de dictar la clase y en público aclaramos dudas.',1,'IE_Mariscal_Robledo_Alfabetizacion_Digital_2.jpg','','','uploads/accompaniment/accompaniment_adjunct',4,281,44,'2015-05-15 09:23:28','2015-05-22 15:30:29'),(476,'2015-05-08','Acompañamiento Gestores TIC','Se realizó acompañamiento al curso de alfabetización digital y gobierno en línea que es dictado por dos gestores TIC.',0,'CEDEZO_Belen_Acompanamiento_Curso_AD_Y_GEL_Getores_TIC_1.jpg','CEDEZO_Belen_Acompanamiento_Curso_AD_Y_GEL_Getores_TIC_2.jpg','CEDEZO_Belen_Acompanamiento_Curso_AD_Y_GEL_Getores_TIC_3.jpg','uploads/accompaniment/accompaniment_adjunct',4,176,15,'2015-05-15 10:54:44','2015-05-22 15:30:29'),(477,'2015-05-14','Revisiòn Contenidos ','Revisión y seguimiento el proceso de aula abierta con la comunidad, además de los contenidos del curso A.D',4,'20150514_161728_HDR.jpg','','','uploads/accompaniment/accompaniment_adjunct',4,222,10,'2015-05-15 14:32:03','2015-05-22 15:30:29'),(478,'2015-05-14','Reunión de seguimiento al Kit de Inclusión','Se planeó una sesión con la profesora Cielo quien es la encargada del kit para hablar de las fortalezas y debilidades con respecto al manejo en la IE, la próxima semana se verá con los estudiantes el resultado de la reunión',1,'Institucion_Educativa_Diego_Echavarria_Misas_Seguimiento_Kit_de_Inclusion.JPG','','','uploads/accompaniment/accompaniment_adjunct',8,225,42,'2015-05-19 07:37:32','2015-05-22 15:30:29'),(479,'2015-05-13','Acompañamiento Laboratorio Comunitario','Los chicos y chicas del laboratorio tuvieron una actividad de reconocimiento de los personajes de la IE, con ellos, se les encargó realizar un escrito, serie fotográfica o video de lo que observaron de los personajes.',9,'Institicion_Educativa_Jorge_Robledo_Laboratorio_Comunitario_2_Mayo_13.JPG','Institicion_Educativa_Jorge_Robledo_Laboratorio_Comunitario_Mayo_13.JPG','','uploads/accompaniment/accompaniment_adjunct',9,278,42,'2015-05-19 07:43:25','2015-05-22 15:30:29'),(480,'2015-05-14','Pacto de acompañamiento con Gestor TIC','Se firmó el pacto de acompañamiento con la gestor TIC Juliana Quiroz, quien iniciará procesos de formación en narrativas digitales con los estudiantes de la IE.',1,'IE_Jose_Acevedo_y_Gomez_Acompanamiento_a_gestor_TIC.JPG','','','uploads/accompaniment/accompaniment_adjunct',4,344,38,'2015-05-19 14:48:54','2015-05-22 15:30:29'),(481,'2015-05-16','Acompañamiento a gestor TIC en curso  ','Se acompañó al Gestor Tic Diego Gonzalez en la segunda sesión del curso de Alfabetización Digital y Gobierno en Línea, se realizaron unas pequeñas observaciones y se brindaron algunas estrategias pedagógicas.  ',1,'Institucion_Educativa_Jose_Acevedo_y_Gomez_Seguimiento_a_Gestor_Tic_Diego_Gonzalez.jpg','','','uploads/accompaniment/accompaniment_adjunct',4,344,43,'2015-05-19 15:42:07','2015-05-22 15:30:29'),(482,'2015-05-19','Intervenciòn mencual CAV','Acompañamiento tipo intervención en el CAV La América con población vulnerable en asesorías, y registro de uso',56,'20150519_145749_HDR.jpg','20150519_142248_HDR.jpg','','uploads/accompaniment/accompaniment_adjunct',7,246,10,'2015-05-19 16:43:43','2015-05-22 15:30:29'),(483,'2015-05-19','Intervenciòn sitio y recolecciòn de indicadores','Acompañamiento tipo intervención para recolección de indicadores y seguimiento de sitio.',8,'20150519_141317_HDR.jpg','20150519_141332_HDR.jpg','','uploads/accompaniment/accompaniment_adjunct',7,236,10,'2015-05-19 16:45:35','2015-05-22 15:30:29'),(484,'2015-05-19','Acompañamiento Aulab','Se acompañó a los chicos en la edición del documental de las damas amarillas, también junto con la Quintana se habló de los nuevos videos que se harán para este mes',10,'Institucion_Educativa_Aures_Laboratorio_Comunitario_2_mayo_19.JPG','Institucion_Educativa_Aures_Laboratorio_Comunitario_3_mayo_19.JPG','Institucion_Educativa_Aures_Laboratorio_Comunitario_mayo_19.JPG','uploads/accompaniment/accompaniment_adjunct',9,568,42,'2015-05-21 10:06:59','2015-05-22 15:30:29'),(485,'2015-05-20','Acompañamiento a Curso','Acompañamiento a Gestor TIC en el curso de Alfabetización Digital y Gobierno en Línea en su última sesión, se firmó y entregó las horas y el aula al contacto enlace del sitio y se realizó la evaluación del curso',1,'Cedezo_San_Javier_Acompanamiento_a_Gestor_TIC.JPG','','','uploads/accompaniment/accompaniment_adjunct',4,174,38,'2015-05-21 10:24:19','2015-05-22 15:30:29'),(486,'2015-05-21','Seguimiento proceso Aula Abierta gestor TIC','Seguimiento al proceso de Aula Abierta en la institución con el gestor TIC y el rector.',2,'IMG_20150601_WA0000.jpg','','','uploads/accompaniment/accompaniment_adjunct',4,162,10,'2015-05-21 16:48:34','2015-06-01 17:55:54'),(487,'2015-05-22','Curso Alfabetización digital y Gobierno en línea','Se realizó seguimiento y acompañamiento a los gestores TIC en el curso de AD y GEL.',0,'CEDEZO_Belen_Acompanamiento_a_Curso_Alfabetizacion_digital_y_gobierno_en_linea_1.jpg','CEDEZO_Belen_Acompanamiento_a_Curso_Alfabetizacion_digital_y_gobierno_en_linea_2.jpg','','uploads/accompaniment/accompaniment_adjunct',4,176,15,'2015-05-22 14:51:44','2015-05-29 22:13:17'),(488,'2015-05-20','Gestor Tic','Se visitó el  lugar e inicialmente se llevó a cabo un encuentro con uno de los funcionarios del centro de servicios el cual realizó un empalme completo con las Gestoras Tic en relación al funcionamiento del lugar, los servicios y características de la atención. Se tuvo un espacio de conversación con las gestoras para escuchar sus percepciones respecto de los procesos hasta ahora realizados, se realizaron recomendaciones en relación al registro en formatos, maneras de abordar públicos, intenciones de realizar determinadas intervenciones; entre otras. Se realizó observación e identificación de fortalezas y necesidades de ambas con el propósito de compartir estrategias que les permitan cualificar continuamente su experiencia.',2,'Centro_de_servicios_S_Cristobal_Acompanamiento_a_Gestoras_Tic.jpg','','','uploads/accompaniment/accompaniment_adjunct',4,567,23,'2015-05-22 15:50:10','0000-00-00 00:00:00'),(489,'2015-05-22','Seguimiento Curso y Gestor','Acompañamiento al proceso de Alfabetización y el modulo de marketing Digital por parte de un gestor TIC ',5,'2015_05_22.jpg','','','uploads/accompaniment/accompaniment_adjunct',5,165,10,'2015-05-22 16:06:00','0000-00-00 00:00:00'),(490,'2015-05-21','Certificación Curso AD ','Se certificó a las personas que realizaron el curso en el telecentro ',11,'Telecentro_Plaza_Colon_Certificacion_Curso_Alfabetizacion_Digital_y_Gobierno_en_linea_2.JPG','Telecentro_Plaza_Colon_Certificacion_Curso_Alfabetizacion_Digital_y_Gobierno_en_linea_3.JPG','Telecentro_Plaza_Colon_Certificacion_Curso_Alfabetizacion_Digital_y_Gobierno_en_linea.JPG','uploads/accompaniment/accompaniment_adjunct',3,200,42,'2015-05-25 15:41:18','2015-05-29 15:29:15'),(491,'2015-05-13','Acompañamiento a Taller Narrativas Fotográficas','El acompañamiento en el taller se realiza para aclarar algunas dudas frente al proceso de investigación que realizará el grupo de trabajo de algunos lugares representativos de la comuna en la que habitan, se planea con ellos las salidas de campo y se revisan las dudas frente a las entrevistas a realizar. ',7,'Biblioteca_Familia_La_Esperanza_Seguimiento_Taller_Narrativas_Fotograficas_1.jpg','Biblioteca_Familia_La_Esperanza_Seguimiento_Taller_Narrativas_Fotograficas_2.jpg','','uploads/accompaniment/accompaniment_adjunct',3,479,24,'2015-05-26 21:17:55','0000-00-00 00:00:00'),(492,'2015-05-13','Seguimiento a Gestor TIC y Estudiante del Pascual ','Este acompañamiento tiene por objetivo precisar las actividades a realizar en las salidas de campo, la logística de estas y a definir cual será el rol de cada uno. Se les entrega además la carta de certificación de las horas.',2,'Biblioteca_Familia_La_Esperanza_Seguimiento_a_Gestores_TIC.jpg','','','uploads/accompaniment/accompaniment_adjunct',4,479,24,'2015-05-26 21:22:28','0000-00-00 00:00:00'),(493,'2015-05-25','Vinculación de gestora TIC','Se realizó una reunión con Leydi Manuela López Vélez estudiante de PP, con el fin de realizar su vinculación como gestora TIC del programa. Manuela está apoyando el curso de Alfabetización Digital en el Parque Biblioteca Guayabal dirigido a personas en situación de discapacidad, el curso se está dictando los lunes de 03:00 pm a 06:00 pm. \r\nAdemás se realizó la inducción general sobre el programa, su proceso como gestora TIC, generalidades sobre la población a acompañar, sugerencias metodológicas y los contenidos del curso de Alfabetización Digital. Posteriormente se firmó el pacto de acompañamiento y se dio inicio el curso.	 ',1,'Institucion_Educativa_Santos_Angeles_Custodios_en_alianza_con_Parque_Biblioteca_Guayabal_Acompanamiento_a_Gestora_TIC_en_curso_Alfabetizacion_Digital_con_personas_en_situacion_de_discapacidad.jpg','','','uploads/accompaniment/accompaniment_adjunct',4,192,43,'2015-05-28 09:28:30','2015-05-29 14:03:40'),(494,'2015-05-21','Acompañamiento Taller Herramientas web 2.0','En este acompañamiento se enseña a los participantes del curso a trabajar en redes sociales, con el fin de generar mejor comunicación entre ellos y las personas que utilizan está herramienta. ',8,'Cedezo_La_Quintana_Acompanamiento_Curso_Herramientas_web_2_1.jpg','Cedezo_La_Quintana_Acompanamiento_Curso_Herramientas_web_2_2.jpg','','uploads/accompaniment/accompaniment_adjunct',3,168,24,'2015-05-28 17:31:47','0000-00-00 00:00:00'),(495,'2015-05-14','Acompañamiento Taller Herramientas web 2.0','Se realiza un repaso de las herramientas que tiene el correo electrónico y se les enseña a comunicarse a través de hangouts con los demás compañeros.',5,'Cedezo_La_Quintana_Seguimiento_curso_Herramientas_Web_2_0.jpg','','','uploads/accompaniment/accompaniment_adjunct',3,168,24,'2015-05-28 18:32:28','0000-00-00 00:00:00'),(496,'2015-05-07','Sensibilización Curso Alfabetización Digital y GEL','Sensibilización del curso Alfabetización Digital y Gobierno en línea en el Cedezo La Quintana, el curso está a cargo del Gestor TIC Ranue Posso, el será el encargado de formar a las personas que asisten al curso. ',13,'Cedezo_La_Quintana_Sensibilizacion_AD_y_GEL_2.jpg','Cedezo_La_Quintana_Sensibilizacion_Curso_AD_y_GEL_1.jpg','Cedezo_La_Quintana_Sensibilizacion_AD_y_GEL_4.jpg','uploads/accompaniment/accompaniment_adjunct',12,168,24,'2015-05-28 19:57:17','0000-00-00 00:00:00'),(497,'2015-05-07','Acompañamiento Taller Herramientas web 2.0','Este día nos acompañó la Gestora TIC Andrea Casiani, en la sesión se trabajaron las herramientas colaborativas y el concepto de herramientas colaborativas.',6,'Cedezo_La_Quintana_Taller_herramientas_web_2_1.jpg','Cedezo_La_Quintana_Taller_herramientas_web_2_2.jpg','Cedezo_La_Quintana_Taller_herramientas_web_2_3.jpg','uploads/accompaniment/accompaniment_adjunct',3,168,24,'2015-05-28 20:01:04','0000-00-00 00:00:00'),(498,'2015-05-05','Inducción Gestores TIC IE Gerardo Valencia Cano','Este día nos reunimos los Gestores TIC (Alfabetizadores del grado noveno) de la IE Gerardo Valencia, se realizó la presentación del programa, los contenidos y la firma del pacto. ',3,'IE_Gerardo_Valencia_Cano_Induccion_Gestores_TIC.jpg','','','uploads/accompaniment/accompaniment_adjunct',4,410,24,'2015-05-28 20:27:26','0000-00-00 00:00:00'),(499,'2015-05-06','Acompañamiento Taller Herramientas web 2.0','El acompañamiento se realiza con el fin de mirar las falencias que tienen los participantes de Aula Abierta y repasar los aprendizajes obtenidos desde el año pasado.  ',6,'IE_Gerardo_Valencia_Cano_Seguimiento_Aula_Abierta_2.jpg','IE_Gerardo_Valencia_Cano_Seguimiento_Aula_Abierta_3.jpg','IE_Gerardo_Valencia_Cano_Seguimiento_Aula_Abierta_1.jpg','uploads/accompaniment/accompaniment_adjunct',2,410,24,'2015-05-28 20:31:13','0000-00-00 00:00:00'),(500,'2015-05-05','Seguimiento a Gestores TIC y Aula Abierta','En está primera sesión, realizamos un repaso de los aprendizajes obtenidos, los gestores TIC estuvieron muy animados y concentrados en su labor de enseñar a los adultos.',6,'IE_Gerardo_Valencia_Cano_Seguimiento_Gestores_TIC_2.jpg','IE_Gerardo_Valencia_Cano_Seguimiento_Gestores_TIC_3.jpg','IE_Gerardo_Valencia_Cano_Seguimiento_Gestores_TIC_4.jpg','uploads/accompaniment/accompaniment_adjunct',4,410,24,'2015-05-28 20:34:16','0000-00-00 00:00:00'),(501,'2015-05-13','Seguimiento al Kit de Inclusión Digital y Aula ','El acompañamiento se concentro en el Aula Abierta y en el Kit de Inclusión que se utiliza en este, los adultos que tienen baja visión hacen uso de los teclados de alto contraste, lo cual les facilita un mejor acceso a la tecnología y al aprendizaje. ',6,'IE_Gerardo_Valencia_Seguimiento_Aula_Abierta_y_Kit_de_Inclusion_Digital_1.jpg','IE_Gerardo_Valencia_Seguimiento_Aula_Abierta_y_Kit_de_Inclusion_Digital_2.jpg','','uploads/accompaniment/accompaniment_adjunct',8,410,24,'2015-05-28 20:38:59','0000-00-00 00:00:00'),(502,'2015-05-15','Certificación Curso Alfabetización Digital','Se realiza la evaluación del curso y entrega de las constancias de participación, las personas se encuentran muy contentas con este curso y esperan que haya un segundo nivel. Felicitan al Gestor TIC por su paciencia, dedicación y amor con los adultos. ',10,'IE_Villa_Flora_Certificacion_Curso_AD.jpg','','','uploads/accompaniment/accompaniment_adjunct',2,289,24,'2015-05-28 20:44:02','2015-05-29 15:30:42'),(503,'2015-05-15','Evaluación con el Gestor TIC del curso','El Gestor TIC manifiesta alegría por los logros de las personas y una plena satisfacción por su trabajo, aunque cuenta que se dieron algunas irregularidades en los acompañamientos que hacían los chicos que estuvieron con él y gestionado por la líder comunitaria Gloria Vidal. Puesto que muchos llegaban un solo día y no volvían y otros tantos episodios que fueron comentados a la Gestora de Cultura Digital. ',1,'IE_Villa_Flora_Seguimiento_a_Gestor_TIC_1.jpg','IE_Villa_Flora_Seguimiento_a_Gestor_TIC_2.jpg','','uploads/accompaniment/accompaniment_adjunct',4,289,24,'2015-05-28 20:49:01','2015-05-29 01:52:03'),(504,'2015-05-27','Seguimiento a Gestores TIC','Se realiza un acompañamiento y retroalimentación con las Gestoras TIC, el acompañamiento se desarrolla en la observación por parte de la Gestora de Cultura Digital y al final de la sesión nos reunimos para dar algunas apreciaciones de la forma como ellas imparten la clase, se les manifiesta el reconocimiento por parte del observador del nivel de compromiso y las ganas por enseñar a los asistentes. ',2,'Biblioteca_Familia_La_Esperanza_Seguimiento_Gestora_TIC_2.jpg','Biblioteca_Familia_La_Esperanza_Seguimiento_Gestora_TIC.jpg','','uploads/accompaniment/accompaniment_adjunct',4,479,24,'2015-05-28 20:59:29','0000-00-00 00:00:00'),(505,'2015-05-27','Certificación Curso Alfabetización Digital','Se realiza la evaluación de los contenidos del curso, las Gestoras TIC y el espacio en el que se generó el curso, se dieron muy buenos comentarios de los diferentes temas a evaluar, las alumnas salieron muy contentas con la constancia de participación y quedaron agradecidas con las Gestoras TIC por su paciencia y dedicación. ',12,'Biblioteca_Familia_La_Esperanza_Certificacion_AD_y_GEL.jpg','','','uploads/accompaniment/accompaniment_adjunct',3,479,24,'2015-05-28 21:08:40','2015-05-29 15:32:16'),(506,'2015-05-22','Certificación Taller Gobierno en Línea','En está fecha se realiza una asesoría en dispositivos móviles y se realiza la evaluación y entrega de constancias a los participantes del taller. Las evaluaciones fueron positivas. ',9,'Telecentro_Doce_de_octubre_Certificacion_Taller_GEL.jpg','','','uploads/accompaniment/accompaniment_adjunct',3,480,24,'2015-05-28 21:57:32','2015-05-29 15:32:39'),(507,'2015-05-08','Acompañamiento Taller Gobierno en línea','se realiza un acompañamiento al taller de Gobierno en Línea con asesorías puntuales sobre bolsas de empleo y revisión de las hojas de vida. ',8,'Telecentro_Doce_de_Octubre_Taller_GEL_Sesion_3_1.jpg','Telecentro_Doce_de_Octubre_Taller_GEL_Sesion_3_2.jpg','','uploads/accompaniment/accompaniment_adjunct',3,480,24,'2015-05-28 22:00:01','0000-00-00 00:00:00'),(508,'2015-05-26','Certificación Taller Gobierno en Línea','Se realiza la evaluación del taller, la formadora (Madelfi la dinamizadora del Telecentro) y del espacio en el que se generó el curso. Los comentarios son positivos y las personas se encuentran a la espera otro curso o taller. ',14,'Telecentro_La_Carmelita_Taller_Gobierno_en_Linea.jpg','','','uploads/accompaniment/accompaniment_adjunct',3,483,24,'2015-05-28 22:03:32','2015-05-29 15:33:40'),(509,'2015-05-26','Certificación Taller Herramientas Web 2.0','Se realizan las evaluaciones de los espacios, formadoras (Cristina Guisao, Maria del Carmen Mesa y Mónica Castañeda) además de las temáticas abordadas en el taller, ellas manifiestan que esté contenido es muy complicado por ser muy avanzado, ellas quieren saber de redes sociales, herramientas de comunicación y bajar música y videos de youtube.',5,'Telecentro_La_Carmelita_Certificacion_Herramientas_Web_2_1.jpg','Telecentro_La_Carmelita_Certificacion_Herramientas_Web_2_2.jpg','','uploads/accompaniment/accompaniment_adjunct',3,483,24,'2015-05-28 22:06:30','2015-05-29 15:33:07'),(510,'2015-05-20','Salida de Campo Taller Narrativas Fotográficas ','La salida de campo se lleva a cabo con el objetivo de realizar unas entrevistas a las personas que se encuentran allí y que han sido habitantes del espacio desde su transformación, para esto llevamos cámaras y grabadoras de periodista. Se entrevistan a varias personas para conocer la percepción del cambio de espacio. ',6,'UD_Jose_Rene_Higuita_Salida_de_Campo_Narrativas_1.jpg','UD_Jose_Rene_Higuita_Salida_de_Campo_Narrativas_2.jpg','UD_Jose_Rene_Higuita_Salida_de_Campo_Narrativas_3.jpg','uploads/accompaniment/accompaniment_adjunct',3,287,24,'2015-05-28 22:10:01','0000-00-00 00:00:00'),(513,'2015-05-28','Acompañamiento Laboratorio Comunitario','Se hizo una reunión con los chicos y chicas del laboratorio para planear la primera emisión de la emisora',12,'Institucion_Educativa_Mariscal_Robledo_Laboratorio_Comunitario_2.JPG','Institucion_Educativa_Mariscal_Robledo_Laboratorio_Comunitario_3.JPG','Institucion_Educativa_Mariscal_Robledo_Laboratorio_Comunitario.JPG','uploads/accompaniment/accompaniment_adjunct',9,281,42,'2015-05-29 11:13:59','0000-00-00 00:00:00'),(514,'2015-05-26','Seguimiento al curso','Se hizo seguimiento del Curso de Alfabetización Digital y Gobierno en línea de la IE República de Uruguay',5,'Institucion_Educativa_Republica_de_Uruguay_Seguimiento_Aula_Abierta_2.JPG','Institucion_Educativa_Republica_de_Uruguay_Seguimiento_Aula_Abierta_3.JPG','Institucion_Educativa_Republica_de_Uruguay_Seguimiento_Aula_Abierta.JPG','uploads/accompaniment/accompaniment_adjunct',2,472,42,'2015-05-29 11:17:05','0000-00-00 00:00:00'),(516,'2015-05-25','Acompañamiento Gestor TIC','Se acompañó el curso con el gestor Julián Arias, se habló con la gente para ver como iban en el curso y el desempeño del gestor',9,'Institucion_Educativa_Villa_Flora_Seguimiento_al_Gestor_TIC_Julian_Arias_2.JPG','Institucion_Educativa_Villa_Flora_Seguimiento_al_Gestor_TIC_Julian_Arias.JPG','','uploads/accompaniment/accompaniment_adjunct',4,289,42,'2015-05-29 11:24:18','0000-00-00 00:00:00'),(517,'2015-05-27','Formación ','Se llevó a cabo sesión de formación con Gestoras Tic en  San Cristóbal, dentro de los temas abordados se trabajaron:\r\n-Concepto de gestión, estrategias para gestionar con diferentes públicos.\r\n- Se propuso en conjunto acordar un formato sencillo para que las gestoras reporten sus actividades y las fotos, se habló de las formas de nombrar las fotos.\r\n- Se conversó de la experiencia hasta ahora tenida en los diferentes lugares, caracterÍsticas, necesidades de los públicos, dudas frente a las maneras de intervenirlos; entre otros.\r\n- Se revisaron contenidos de Gel con el propósito de intensionar un poco más las intervenciones en las zonas WIFI',2,'Cedezo_San_Cristobal_Formacion_con_Gestoras_Tic.jpg','','','uploads/accompaniment/accompaniment_adjunct',4,169,23,'2015-05-29 11:29:18','0000-00-00 00:00:00'),(518,'2015-05-23','Inducción Gestora TIC','Reunión con nueva gestora TIC, Manuela Pino para enseñarle el programa y asignarle un lugar para realizar sus horas',1,'Institicion_Educativa_Pedro_Claver_Aguirre_Gestora_TIC_Manuela_Pino_2.JPG','Institicion_Educativa_Pedro_Claver_Aguirre_Gestora_TIC_Manuela_Pino.JPG','','uploads/accompaniment/accompaniment_adjunct',4,232,42,'2015-05-29 11:41:20','0000-00-00 00:00:00'),(519,'2015-05-27','Cierre de curso','Se llevó a cabo Cierre de curso WEB 2.0 dictado por el gestor Tic. Los participantes hicieron devoluciones muy positivas de la labor del gestor, del impacto de los contenidos del curso para su vida y en la cotidianidad.',1,'Telecentro_la_amistad_Acompanamiento_Estudiante_pascual_Cierre_de_curso.jpg','','','uploads/accompaniment/accompaniment_adjunct',5,203,23,'2015-05-29 11:44:43','0000-00-00 00:00:00'),(520,'2015-05-28','Seguimiento al lugar','Se fue al sitio a hacer sensibilización y a recoger las planillas del punto de navegación; el internet del sitio no estaba funcionando así que no se pudo hacer sensibilización, se recogieron las planillas y se habló con el funcionario.',1,'Centro_de_Servicios_Robledo_Seguimiento_al_sitio_2.JPG','Centro_de_Servicios_Robledo_Seguimiento_al_sitio.JPG','','uploads/accompaniment/accompaniment_adjunct',10,273,42,'2015-05-29 11:51:12','0000-00-00 00:00:00'),(521,'2015-05-27','Planeación de procesos en sitio','Se realizó encuentro con luguethis, dinamizadora del telecentro donde se planearon procesos siguientes a iniciar, se realizó invitación para el próximo taller y se conversó de las posibles formas de intervención delo programa con los grupos del telecentro',1,'IMG_20150527_143505408.jpg','','','uploads/accompaniment/accompaniment_adjunct',4,203,23,'2015-05-29 11:57:17','0000-00-00 00:00:00'),(522,'2015-05-27','Certificación de procesos de formación','Se certificó el proceso de formación en alfabetización digital y gobierno en Línea con emprendedores del Cedezo',11,'Cedezo_San_Javier_Certificacion_Alfabetizacion_Digital_y_Gobierno_en_linea.JPG','','','uploads/accompaniment/accompaniment_adjunct',6,174,38,'2015-05-29 14:32:22','0000-00-00 00:00:00'),(523,'2015-05-27','Kit de Inclusión','Se realizó una capacitación para las docentes de primaria de la I.E Marco Fidel Suárez sección la Iguaná para el uso del kit de inclusión digital, contando con el compromiso de cada una de ellas y la disposición para trabajar con el kit. ',10,'Seccion_Escuela_la_Iguana_Capacitacion_docentes_kit_de_inclusion_digital_2.JPG','Seccion_Escuela_la_Iguana_Capacitacion_docentes_kit_de_inclusion_digital_1.JPG','','uploads/accompaniment/accompaniment_adjunct',8,219,41,'2015-05-29 16:49:07','0000-00-00 00:00:00'),(524,'2015-05-22','Asesorías en dispositivos móviles','Se acompañó la UVA Versalles siguiendo los compromisos previamente establecidos entre las partes como transferir el contenido de asesorías en dispositivos móviles para comunidad al gestor de la sala de sistemas de la UVA. ',1,'UVA_Los_Suenos_Asesorias_en_dispositivos_moviles_mayo_2015.JPG','','','uploads/accompaniment/accompaniment_adjunct',4,570,41,'2015-05-29 16:57:55','0000-00-00 00:00:00'),(525,'2015-05-22','Acompañamiento Gestor TIC','Se visitó la Inspección Aranjuez con el fin de darle seguimiento al Gestor Tic que acompaña actualmente el punto de navegación, con el fin de guiar alguna asesoría, inquietud y demás que se estuviese presentando. Así como dinamización del punto de navegación. ',1,'Inspeccion_Aranjuez_Seguimiento_a_Gestor_Tic.JPG','','','uploads/accompaniment/accompaniment_adjunct',4,255,41,'2015-05-29 17:00:48','0000-00-00 00:00:00'),(526,'2015-05-21','Seguimiento al apertura del Aula Abierta','Se visitó la I.E Ciro Mendía con el fin de dar acompañamiento en la re activación del aula abierta con el grupo de estudios sociales que lidera el profesor de ciencias sociales de la institución, establecer fechas de acompañamiento luego de las vacaciones escolares. ',1,'I_E_Ciro_Mendia_Seguimiento_Aula_Abierta_y_Emisora_Escolar_mayo_2015.JPG','','','uploads/accompaniment/accompaniment_adjunct',2,250,41,'2015-05-29 17:02:43','2015-05-29 22:04:24'),(527,'2015-05-23','Inicio de curso Alfabetización Digital','Inicio de curso de alfabetización digital y Gobierno en línea, el estudiante de pp será el encargado de realizar el curso.',0,'Parque_Biblioteca_San_Antonio_Prado_Acompanamiento_Gestor_TIC.jpg','','','uploads/accompaniment/accompaniment_adjunct',4,194,15,'2015-05-29 17:17:35','0000-00-00 00:00:00'),(528,'2015-05-16','Capacitación Gestor TIC','Se realizó la formación y capacitación del Gestor TIC, en donde se le explico como realizaría la labor social con el programa y cuáles serían las actividades que apoyaría.',0,'Parque_Biblioteca_San_Antonio_de_Prado_Capacitacion_y_bienvenida_al_Gestor_TIC.jpg','','','uploads/accompaniment/accompaniment_adjunct',4,194,15,'2015-05-29 17:20:56','0000-00-00 00:00:00'),(529,'2015-05-26','Acompañamiento certificación curso','Se realizó el seguimiento y acompañamiento en la certificación del curso de Alfabetización digital y gobierno en línea en el aula abierta con madres de familia, además se programo una asesoría de dispositivos móviles y mas adelante un taller de narrativas digitales.',4,'IE_Fe_y_Alegria_El_Limonar_Certificacion_Curso_alfabetizacion_digital_y_gobierno_en_linea_1.JPG','IE_Fe_y_Alegria_El_Limonar_Certificacion_Curso_alfabetizacion_digital_y_gobierno_en_linea_2.JPG','','uploads/accompaniment/accompaniment_adjunct',2,340,15,'2015-05-29 17:29:06','0000-00-00 00:00:00'),(530,'2015-05-25','Seguimiento Punto de navegación','Se realizo seguimiento y acompañamiento al punto de navegación, además se logro conversar con un alfabetizador del grado 11 quien esta realizando sus horas en el punto de navegación atendiendo y asesorando a las personas, se le tomaron los datos.',1,'Casa_de_Gobierno_San_Antonio_de_Prado_Seguimiento_Punto_de_navegacion_1.jpg','Casa_de_Gobierno_San_Antonio_de_Prado_Seguimiento_Punto_de_navegacion_2.jpg','Casa_de_Gobierno_San_Antonio_de_Prado_Seguimiento_Punto_de_navegacion_3.jpg','uploads/accompaniment/accompaniment_adjunct',7,333,15,'2015-05-29 17:47:25','0000-00-00 00:00:00'),(531,'2015-05-27','Kit de inclusión','Se le recuerda la invitación para 7 estudiantes el 30 de mayo con la propuesta del Ministerio de \"Cine para todos\".',6,'ITM_Fraternidad_kit_inclusion.jpg','','','uploads/accompaniment/accompaniment_adjunct',8,308,20,'2015-05-30 17:32:52','0000-00-00 00:00:00'),(532,'2015-05-30','Cine para Todos','Salida con estudiantes del ITM en situación de discapacidad para la proyección de la película \"Maléfica\" en el marco del proyecto Cine para Todos.',7,'ITM_Cine_para_todos_1.jpg','ITM_Cine_para_todos_2.jpg','ITM_Cine_para_todos_3.jpg','uploads/accompaniment/accompaniment_adjunct',8,308,17,'2015-06-01 12:12:37','0000-00-00 00:00:00'),(533,'2015-06-07','Asesorías con usuarios','La gestora Tic visitó el sitio para fomentar el uso de trámites en línea, creación de correo electrónico, registro en planillas y despejar dudas de los usuarios',8,'Centro_de_servicios_Lusitania_Intervencion_al_sitio.jpg','','','uploads/accompaniment/accompaniment_adjunct',7,272,23,'2015-06-01 12:22:25','0000-00-00 00:00:00'),(534,'2015-05-30','Certificación Aula Abierta','En este día las personas participantes de los tres cursos que se realizan en esta aula abierta se certificaron, estás personas, realizaron un reconocimiento al equipo de trabajo encargado de formarlos, este reconocimiento se extendió a la gestora de cultura digital que los ha venido acompañando en este proceso.  ',30,'IE_Alfredo_Cock_Arango_Acompanamiento_Aula_Abierta_1.jpg','IE_Alfredo_Cock_Arango_Acompanamiento_Aula_Abierta_3.jpg','IE_Alfredo_Cock_Arango_Acompanamiento_Aula_Abierta.jpg','uploads/accompaniment/accompaniment_adjunct',2,267,24,'2015-06-01 13:03:34','0000-00-00 00:00:00'),(535,'2015-05-25','Seguimiento a punto de navegación.','Se realizó seguimiento al punto de navegación, se habló con los niños usuarios, los cuales expresaron que los computadores funcionan bien. Finalmente se habló con el funcionario encargado de servicio al cliente, el cual expresó que el punto de navegación es bastante frecuentado y que sería relevante que lo apoyemos consultando en que va el proceso de solicitud de arreglo de uno de los computadores, la solicitud del funcionario fue enviada al equipo de conectividad. ',3,'Casa_de_Gobierno_Altavista_Seguimiento_al_Punto_de_Navegacion.jpg','','','uploads/accompaniment/accompaniment_adjunct',10,332,43,'2015-06-01 13:12:33','2015-06-26 15:09:28'),(536,'2015-05-30','Acompañamiento Curso','Se realizó acompañamiento a la segunda sesión del curso de Alfabetización digital y gobierno en línea.',0,'Parque_Biblioteca_San_Antonio_de_Prado_Acompanamiento_Gestor_TIC_Daniel_Munoz_1.jpg','Parque_Biblioteca_San_Antonio_de_Prado_Acompanamiento_Gestor_TIC_Daniel_Munoz_2.jpg','','uploads/accompaniment/accompaniment_adjunct',4,194,15,'2015-06-01 13:34:42','0000-00-00 00:00:00'),(537,'2015-05-23','Capacitación Gestor TIC','Se realizó una corta capacitación al Gestor TIC, en donde se le explico el programa y las actividades que él estaría apoyando.',0,'Biblioteca_Publica_El_Limonar_Gestor_TIC_Pascual_Bravo_Jose_Miguel_Betancur.jpg','','','uploads/accompaniment/accompaniment_adjunct',5,196,15,'2015-06-01 13:41:05','0000-00-00 00:00:00'),(538,'2015-06-14','Acompañamiento Gestor TIC','Se realizó una reunión de inducción a la Gestora Tic que acompañará el Cedezo de Santo Domingo con el fin de iniciar el curso de mercadeo digital. ',3,'Cedezo_Santo_Domingo_Induccion_a_Gestor_Tic_3.JPG','','','uploads/accompaniment/accompaniment_adjunct',4,164,41,'2015-06-02 11:29:57','0000-00-00 00:00:00'),(539,'2015-05-07','Narrativas digitales: Fotografía. Sesión 2','Se realizó la sesión 2 del taller de narrativas composición de la imagen y ejercicio de collage. Ejercicio práctico para la casa y preparación del siguiente taller. ',5,'Telecentro_Moscu_Sesion_2_composicion_9.JPG','Telecentro_Moscu_Sesion_2_composicion_1.JPG','','uploads/accompaniment/accompaniment_adjunct',3,464,41,'2015-06-02 11:44:45','0000-00-00 00:00:00'),(540,'2015-06-14','Narrativas digitales: Fotografía. Sesión 3','Se realizó la sesión 3 del taller de narrativas de la agenda básica con el fin de enseñarle al grupo los ángulos y planos de la imágen. Se realizó ejercicio práctico de toma de fotografías en el barrio garantizando el aprendizaje de los participantes. ',5,'Telecentro_Moscu_Taller_de_narrativas_sesion_3_angulos_y_planos_3.JPG','Telecentro_Moscu_Taller_de_narrativas_sesion_3_angulos_y_planos_2.JPG','','uploads/accompaniment/accompaniment_adjunct',3,464,41,'2015-06-02 11:47:39','0000-00-00 00:00:00'),(541,'2015-06-28','Narrativas digitales: Fotografía. Sesión 4','Se realizó la sesión 4 del taller de narrativas sobre el fotoreportaje y la construcción de historias a través de las imágenes con el fin de preparar el trabajo final del taller. ',5,'Telecentro_Moscu_Taller_de_narrativas_sesion_4_Fotoreportaje_y_preparacion_trabajo_final_4.JPG','','','uploads/accompaniment/accompaniment_adjunct',3,464,41,'2015-06-02 11:50:08','0000-00-00 00:00:00'),(542,'2015-05-05','Narrativas digitales: Radio. Sesión 3','En el taller de narrativas digitales con los niños y niñas de la Fundación positivos por la vida, se proyectó la película Rojo como el cielo, con el fin de introducir el tema de las historias sonoras y el lenguaje de la radio. ',8,'Fun_positivos_Sesion_3_Pelicula_rojo_como_el_cielo_como_contar_historias_sonoras_2.JPG','Fun_positivos_Sesion_3_Pelicula_rojo_como_el_cielo_como_contar_historias_sonoras_1.JPG','','uploads/accompaniment/accompaniment_adjunct',3,518,41,'2015-06-02 11:55:46','0000-00-00 00:00:00'),(543,'2015-06-12','Narrativas digitales: Radio. Sesión 4','En esta sesión del taller se trabajó Introducción al mundo sonoro, con la identificación de sonidos naturales y artificiales y un ejercicio práctico de escucha atenta y grabación en el barrio, teniendo como referente la película proyectada la clase anterior. ',8,'Fun_Positivos_Taller_de_narrativas_sesion_5_introduccion_al_mundo_sonoro_Mayo_2015_9.JPG','','','uploads/accompaniment/accompaniment_adjunct',3,518,41,'2015-06-02 11:57:31','0000-00-00 00:00:00'),(544,'2015-06-19','Narrativas digitales: Radio. Sesión 5','En esta sesión del taller se realizó una actividad para la identificación de posibles personajes para el montaje y producción del cuento como trabajo final. La actividad consistió en nombrar todas las personas que integran el hogar donde viven los niños y atribuirle características de su personalidad. Finalmente se hace un ejercicio práctico de grabación de sonidos y locución. ',8,'Fun_Positivos_Taller_de_narrativas_sesion_5_Mayo_2015_3.JPG','Fun_Positivos_Taller_de_narrativas_sesion_5_Mayo_2015_7.JPG','Fun_Positivos_Taller_de_narrativas_sesion_5_Mayo_2015_8.JPG','uploads/accompaniment/accompaniment_adjunct',3,518,41,'2015-06-02 11:59:59','0000-00-00 00:00:00'),(545,'2015-06-04','Seguimiento Curso y Gestor','Seguimiento al curso de Alfabetización Digital dictado por el Gestor Tic en la casa de Lectura,retro alimentación con los asistentes.',11,'20150604_160114_HDR.jpg','','','uploads/accompaniment/accompaniment_adjunct',4,463,10,'2015-06-05 14:41:20','0000-00-00 00:00:00'),(546,'2015-06-04','Capacitación Gestores UVA','Capacitación en metodologías de enseñanza según tema y población.',3,'20150604_151841_HDR.jpg','','','uploads/accompaniment/accompaniment_adjunct',4,442,10,'2015-06-05 14:54:32','0000-00-00 00:00:00'),(547,'2015-06-06','Certificación eguimiento Curso y Gestores','Ceremonia de entrega de constancias de asistencia al proyecto de escuela de padres.',98,'samuel.jpg','','','uploads/accompaniment/accompaniment_adjunct',2,230,10,'2015-06-09 09:17:16','0000-00-00 00:00:00'),(548,'2015-06-04','Certificación seguimiento Curso y Gestores','Sesión de entrega de constancias de asistencia a los padres de famila y vecinos que asistieron al curso el la I.E',14,'bravo.jpg','','','uploads/accompaniment/accompaniment_adjunct',2,159,10,'2015-06-09 09:22:44','0000-00-00 00:00:00'),(549,'2015-06-09','Acompañamiento Aulab','Reunión con los chicos del laboratorio antes que ellos se vayan para vacaciones, en vacaciones se comprometieron a realizar el guión del próximo video',6,'Institucion_Educativa_Aures_Laboratorio_Comunitario-0.JPG','Institucion_Educativa_Aures_Laboratorio_Comunitario_2.JPG','','uploads/accompaniment/accompaniment_adjunct',9,568,42,'2015-06-09 13:02:11','0000-00-00 00:00:00'),(550,'2015-06-03','Última sesión y Certificación curso AD y GEL','Se realizó acompañamiento a la última sesión de alfabetización digital y gobierno en línea, además se realizó la certificación del curso.',0,'CEDEZO_San_Antonio_de_Prado_Curso_Alfabetizacion_digital_y_Gobierno_en_linea.jpg','CEDEZO_San_Antonio_de_Prado_certificacion_curso_AD_y_GEL.jpg','','uploads/accompaniment/accompaniment_adjunct',4,178,15,'2015-06-09 15:50:20','0000-00-00 00:00:00'),(551,'2015-06-04','Seguimiento a Kit de Inclusión Digital','Se realizó seguimiento al Kit de inclusión digital, dónde se evidenció que éste lo están usando 12 niñas de la institución educativa con discapacidades cognitivas, sensoriales y motrices. La intensidad de uso es 3 veces por semana, gracias a un proyecto de investigación de maestría que está llevando a cabo la docente del aula de apoyo. Dicho proyecto consiste en evaluar los aportes de la tecnología en el aprendizaje de las niñas en situación de discapacidad.\r\nAdemás el Kit se está proyectando a la comunidad por medio del curso de Alfabetización Digital con personas en situación de discapacidad, que se está realizando los lunes con el apoyo del espacio del Parque Biblioteca Guayabal.',1,'Institucion_Educativa_Santos_Angeles_Custodios_Seguimiento_al_Kit_de_Inclusion_Digital.jpg','','','uploads/accompaniment/accompaniment_adjunct',8,359,43,'2015-06-10 08:09:46','0000-00-00 00:00:00'),(552,'2015-06-03','Activación Zona Wifi','Se acompañó  a las dos gestoras Tic de San Cristóbal en la realización de algunas activaciones tanto en el parque principal de San cristóbal como en el centro de Servicios para dar algunas orientaciones en relación a la importancia de orientar a las personas a páginas de formación virtual, asesorías respecto de la creación de hojas de vida, trámites en línea entre otros usos postivos de la internet.',7,'Parque_San_Cristobal_Activacion_Zona_Wifi_1.jpg','Parque_San_Cristobal_Activacion_Zona_Wifi_2.jpg','Parque_San_Cristobal_Activacion_Zona_Wifi_3.jpg','uploads/accompaniment/accompaniment_adjunct',4,283,23,'2015-06-10 14:19:49','0000-00-00 00:00:00'),(553,'2015-06-04','Cierre de curso','Se acompañó a Esteban, uno de los Gestores Tic de Villa Flora en el cierre del curso Herramientas Web 2.0 con un grupo mixto de adultos y niños. Incialmente se hizo la retroalimentación del proceso y las personas hicieron una devolución muy positiva del gestor, reconocieron su disciplina, exigencia y la dedicación en el proceso. La comunidad pidió un nivel 3; sin embargo se les cuestionó a cerca de qué era eso que debía contener dicho nivel',15,'I_E_Villa_Flora_Cierre_de_Curso.jpg','I_E_Villa_Flora_Cierre_de_curso_2.jpg','','uploads/accompaniment/accompaniment_adjunct',4,289,23,'2015-06-12 08:39:14','0000-00-00 00:00:00'),(554,'2015-06-10','Seguimiento Aula Abierta','>Seguimiento al proceso de aula abierta y entrega de certificados al docente encargado para firmas',13,'20150610_171918_HDR.jpg','','','uploads/accompaniment/accompaniment_adjunct',2,162,10,'2015-06-12 08:39:39','0000-00-00 00:00:00'),(558,'2015-06-09','Atención a usuarios','Atención en el punto de navegación a usuarios del sitio; asesoría en recuperación de clave de facebook.Verificación del buen funcionamiento del internet.',5,'CAM_acompanamiento.jpg','CAM_acompanamiento1.jpg','','uploads/accompaniment/accompaniment_adjunct',7,436,20,'2015-06-12 14:15:53','0000-00-00 00:00:00'),(559,'2015-06-10','Divulgación de procesos en el corregimiento','Se visitó el parque principal de San Cristóbal, en esta ocasión para realizar divulgación de nuestros procesos en el corregimiento, se habló con la gente, se invitó a participar de nuestros cursos y talleres tanto en PB Fernando Botero como en PVD San Cristóbal',10,'Parque_San_Cristobal_Divulgacion_Procesos_en_el_corregimiento.jpg','','','uploads/accompaniment/accompaniment_adjunct',7,283,23,'2015-06-17 15:48:14','0000-00-00 00:00:00'),(560,'2015-06-17','Seguimiento Al punto de navegación','Se hizo seguimiento al punto de navegación y la dinámica del sitio',3,'Mascerca_Castilla_Seguimiento_al_punto_de_navegacion.JPG','','','uploads/accompaniment/accompaniment_adjunct',7,282,42,'2015-06-18 10:05:51','0000-00-00 00:00:00'),(561,'2015-06-18','Acompañamiento  y seguimiento de procesos','Firma de Horas y seguimiento al proceso de formación que acompaña el Gestor TIC con alfabetización digital y Gobierno en Linea',1,'Biblioteca_Comfenalco_El_Salado_Acompanamiento_a_Gestor_TIC_Pascual_Bravo_Sebastian_Vanegas.jpg','','','uploads/accompaniment/accompaniment_adjunct',5,450,38,'2015-06-18 12:05:28','0000-00-00 00:00:00'),(563,'2015-06-17','Gestor Tic','Se realizó acompañamiento a Ana Maria, gestora Tic San C en la realización de asesoría en web 2.0 a una de las líderes Comunitarias del corregimiento. Posteriormente se dejaron tareas puntuales para su intervención en algunos lugares de Nuevo occidente como enfocar los acompañamientos en las zonas WIFI  y sitios de Gobierno al tema de GEL ,además de reunirse con el administrador de la UPSS nuevo occidente para solicitar espacio con funcionarios y así divulgar la presencia de la red',1,'Parque_San_Cristobal_Acompanamiento_Gestor_Tic.jpg','','','uploads/accompaniment/accompaniment_adjunct',4,283,23,'2015-06-19 11:27:06','0000-00-00 00:00:00'),(564,'2015-06-17','Seguimiento  al Kit de Inclusión Digital','Se visitó el parque Biblioteca Fernando Botero, esta vez con el propósito de hacer seguimiento a los compromisos pactados desde la sensibilización realizada a  los funcionarios tanto en el tema de inclusión Digital como de Accesibilidad. Se evidencia parte del kit de manera visible aunque falta mayor exploración aún del software. También hay evidencia fotográfica del trabajo con los dispositivos en las clases que se desarrollan los miércoles con el grupo de discapacidad a las cuales fuimos invitados.',1,'PB_Fernando_Botero_Seguimiento_al_kit_de_inclusion_D.JPG','PB_Fernando_Botero_Seguimiento_al_Kit_de_Inclusion_digital_2.jpg','PB_Fernando_Botero_Seguimiento_al_Kit_de_Inclusion_digital_1.jpg','uploads/accompaniment/accompaniment_adjunct1',8,186,23,'2015-06-19 11:49:33','2015-06-19 16:50:40'),(565,'2015-06-02','Seguimiento  al Kit de Inclusión Digital','Se realizó la sensibilización en inclusión Digital con algunos funcionarios de lugares donde tenemos el kit de inclusión. Se convocó a la quintana, Colegio Mayor, centro integrado y Buen Comienzo la huerta dado que aun no poseen un conocimiento amplio de las herramientas del kit, ni lo saben usar o bien está siendo subutilizado precisamente por falta de conocimiento, exploración y experiencia. Algunas entidades no asistieron y se pudo evidenciar el empoderamiento de la biblioteca y el proceso tan sólido que desarrollan con el kit, el uso es permanente, reflexivo y cuidadoso. Hay grupos consolidados según tipo de discapacidades en el trascurso de la semana que se benefician del mismo.',20,'Biblio_Fdo_gomez_Martinez_Seguimiento_al_Kit_de_Inclusion.jpg','','','uploads/accompaniment/accompaniment_adjunct',8,268,23,'2015-06-19 14:52:28','0000-00-00 00:00:00'),(566,'2015-06-02','Seguimiento  al Kit de Inclusión Digital','Se convocó a la educadora especial de Buen Comienzo la Huerta para que a través del conocimiento y sensibilización con la experiencia exitosa de la biblioteca Fernando Gómez Martínez, pueda reconocer, explorar y potenciar el kit de inclusión que se encuentra en el lugar dado que actualmente y a razón de que el personal es nuevo este año en la sede, al momento de visitar el centro infantil el kit se encontraba totalmente subutilizado y guardado; al punto de no conocerlo; por tanto era muy importante la presencia en dicho espacio formativo de la persona que se encargará de dinamizar  nuestro kit en su territorio y a raiz del diagnóstico que se está elaborando con las familias del sector.',1,'Buen_Comienzo_la_Huerta_Seguimiento_al_Kit_de_Inclusion.jpg','','','uploads/accompaniment/accompaniment_adjunct',8,413,23,'2015-06-19 15:04:11','0000-00-00 00:00:00'),(567,'2015-06-02','Seguimiento  al Kit de Inclusión Digital','En aras de fortalecer el conocimiento y apropiación de los funcionarios del centro integrado respecto al kit de inclusión digital,  se convocaron a la sensibilización en la biblioteca Fernando Gómez Martínez en donde se tuvo la oportunidad de observar a los chicos y chicas con discapacidad cognitiva en una clase de sistemas usando el kit. ',1,'Centro_integrado_San_C_Seguimiento_al_kit.jpg','','','uploads/accompaniment/accompaniment_adjunct',8,444,23,'2015-06-19 15:22:15','0000-00-00 00:00:00'),(568,'2015-06-02','Seguimiento  al Kit de Inclusión Digital','En aras de fortalecer el conocimiento y apropiación de los funcionarios del parque Biblioteca respecto al kit de inclusión digital,  se convocaron a la sensibilización en la biblioteca Fernando Gómez Martínez el 2 de junio en donde se tuvo la oportunidad de observar a los chicos y chicas con discapacidad cognitiva en una clase de sistemas usando el kit. ',1,'PB_Doce_de_Octubre_Seguimiento_al_kit_de_inclusion_D.jpg','','','uploads/accompaniment/accompaniment_adjunct',8,183,23,'2015-06-19 15:25:18','0000-00-00 00:00:00'),(569,'2015-06-02','Acompañamiento Aula Abierta','En está sesión de trabajo con el aula abierta se les acompaña con una sesión de excel básico en el que se les muestra el programa, se explica los conceptos de celda, columna y fila además de las opciones de sumar, multiplicar y dividir. \r\n\r\nSe explica como dar formato a este, se plantean un ejercicio práctico y cotidiano de un presupuesto básico de compra y precios a la hora de ir a comprar el mercado mensual. ',9,'IE_Gerardo_Valencia_Cano_Seguimiento_Aula_Abierta.jpg','','','uploads/accompaniment/accompaniment_adjunct',2,410,24,'2015-06-19 16:03:34','0000-00-00 00:00:00'),(570,'2015-06-10','Seguimiento al Sitio y Asesoría','Revisión del funcionamiento de los equipos del Punto de Navegación y se realiza asesoría al Niño Juan Felipe y a las personas que se encuentran en el punto, para que utilice la planilla de registro de usos de los equipos.',3,'Por_Mis_Derechos_Acompanamiento_al_Sitio.jpg','','','uploads/accompaniment/accompaniment_adjunct',7,321,40,'2015-06-22 14:29:26','2015-06-22 19:32:29'),(571,'2015-06-05','Acompañamiento Sitio de Gobierno','Se realizó una visita al punto de navegación para ver la dinámica del lugar',1,'Sitio_Gobierno_Los_Colores.JPG','','','uploads/accompaniment/accompaniment_adjunct',7,248,46,'2015-06-22 16:02:18','0000-00-00 00:00:00'),(572,'2015-06-02','Seguimiento Kit de Inclusión en Aula Abierta','En cada sesión del Aula Abierta se utilizan algunos elementos del Kit de inclusión para que la comunidad reciba las clases de computadores. En está sesión conocimos uno de los programas que hacen parte de microsoft office llamado excel y para esto utilizamos los teclados de colores con algunos de los adultos mayores que hacen parte del proceso. ',7,'IE_Gerardo_Valencia_Cano_Seguimiento_Kit_de_inclusion_digital.jpg','','','uploads/accompaniment/accompaniment_adjunct',8,410,24,'2015-06-23 08:38:35','0000-00-00 00:00:00'),(573,'2015-06-04','Seguimiento Punto de navegación','Se realizó seguimiento al punto de navegación, en donde se pudo identificar el funcionamiento de los equipos y de la red wifi, además se pudo conversar con un usuario quien utiliza frecuentemente el punto de navegación para ingresar al correo y redes sociales.',1,'Permanencia_3_de_Belen_seguimiento_punto_de_navegacion.jpg','','','uploads/accompaniment/accompaniment_adjunct',7,439,15,'2015-06-23 09:19:38','0000-00-00 00:00:00'),(574,'2015-06-03','Inicio de curso AD y GEL','Se realizó acompañamiento al Gestor TIC en el inicio del curso de Alfabetización digital y gobierno en línea con adultos mayores del club de vida.',0,'Unidad_integral_6_de_Belen_Acompanamiento_curso_AD_y_GEL_Estudiantes_Pascual_Bravo_Carolina-0.jpg','','','uploads/accompaniment/accompaniment_adjunct',5,362,15,'2015-06-23 09:31:54','0000-00-00 00:00:00'),(575,'2015-06-03','Inicio de curso AD y GEL','Se realizó acompañamiento al curso de alfabetización Digital y Gobierno en línea con adultos mayores del club de vida.',0,'Unidad_integral_6_de_Belen_Acompanamiento_curso_AD_y_GEL_Getsor_TIC_Edwin_Monsalve-0.jpg','','','uploads/accompaniment/accompaniment_adjunct',4,362,15,'2015-06-23 09:34:49','0000-00-00 00:00:00'),(576,'2015-06-06','Curso Alfabetización digital y Gobierno en línea','Se realizó acompañamiento al curso de alfabetización digital y gobierno en línea que se está dictando en el parque biblioteca de San Antonio de Prado.',0,'Parque_Biblioteca_Jose_Horacio_Betancur_Acompanamiento_Gestor_TIC.jpg','','','uploads/accompaniment/accompaniment_adjunct',4,194,15,'2015-06-23 11:18:10','0000-00-00 00:00:00'),(577,'2015-06-03','Seguimiento al curso dictado por Gestor TIC','En está fecha el Gestor de Cultura Digital acompaña el taller de Narrativas puesto que el Gestor TIC no pudo ir. Para está fecha se realizaron los ajustes pertinentes a los productos que se mostrarán en el cierre. ',7,'Biblioteca_Familia_La_Esperanza_Seguimiento_Gestor_TIC_Taller_Narrativas_1.jpg','Biblioteca_Familia_La_Esperanza_Seguimiento_Gestor_TIC_Taller_Narrativas_2.jpg','Biblioteca_Familia_La_Esperanza_Seguimiento_Gestor_TIC_Taller_Narrativas_3.jpg','uploads/accompaniment/accompaniment_adjunct',4,479,24,'2015-06-23 11:18:31','0000-00-00 00:00:00'),(578,'2015-06-09','Evaluación de procesos Gestor TIC ','Este día nos reunimos el Gestor TIC, la Presidenta de la JAL Nelly Gil y la coordinadora de la Fundación Familia La Esperanza-Ratón de Biblioteca a realizar un proceso de retroalimentación frente a los talleres y cursos dictados por el Gestor TIC Estiven Marín y las inconsistencias que se presentaron durante la prestación de su servicio social con la comunidad.  Una de las observaciones realizadas por Diana la Coordinadora de la Biblioteca se centra en el poco compromiso que estos tuvieron con el espacio y se les invita a adquirirlo. Se manifiesta además la poca comunicación que se generó con la coordinadora del sitio, puesto que este chico no llamaba a contarle a ella las actividades que se realizarían fuera del espacio. ',4,'Biblioteca_Familia_La_Esperanza_Seguimiento_a_Gestor_TIC_1.jpg','','','uploads/accompaniment/accompaniment_adjunct',4,479,24,'2015-06-23 11:27:51','0000-00-00 00:00:00'),(579,'2015-06-09','Retroalimentación con Estudiante del Pascual Bravo','Este día nos reunimos la Estudiante del Pascual Bravo, la Presidenta de la JAL Nelly Gil y la coordinadora de la Fundación Familia La Esperanza-Ratón de Biblioteca a realizar un proceso de retroalimentación frente a los talleres y cursos dictados por la Estudiante del Pascual Bravo Jaqueline Muñoz y las inconsistencias que se presentaron durante la prestación de su servicio social con la comunidad.  Una de las observaciones realizadas por Diana la Coordinadora de la Biblioteca se centra en el poco compromiso que estos tuvieron con el espacio y se les invita a adquirirlo. Se manifiesta además la poca comunicación que se generó con la coordinadora del sitio, puesto que este chico no llamaba a contarle a ella las actividades que se realizarían fuera del espacio. ',4,'Biblioteca_Familia_La_Esperanza_Seguimiento_a_Estudiante_del_Pascual_3.jpg','Biblioteca_Familia_La_Esperanza_Seguimiento_a_Estudiante_del_Pascual_2.jpg','','uploads/accompaniment/accompaniment_adjunct',5,479,24,'2015-06-23 11:52:37','0000-00-00 00:00:00'),(580,'2015-06-03','Certificación Taller Narrativas','Se realiza la certificación del Taller Narrativas Digitales, acompañado por el Estudiante del Pascual Bravo Cristián Torres Usme, en este espacio se muestran los productos realizados por los asistentes. Cada uno muestra el fotoreportaje realizado en el curso. ',9,'IE_Villa_Flora_Aula_Abierta_Cierre_de_procesos_2.jpg','','','uploads/accompaniment/accompaniment_adjunct',5,289,24,'2015-06-23 12:00:21','0000-00-00 00:00:00'),(581,'2015-06-03','Certificación Aula Abierta Taller Narrativas','Se realiza la certificación del taller de narrativas Digitales dictada en el aula de sistemas de la IE Villa Flora, allí los participantes muestran su producto, ellos realizaron un fotoreportaje de la fauna y flora de su barrio. \r\n\r\n',9,'IE_Villa_Flora_Aula_Abierta_Cierre_de_procesos_1.jpg','','','uploads/accompaniment/accompaniment_adjunct',2,289,24,'2015-06-23 12:02:41','0000-00-00 00:00:00'),(582,'2015-06-06','Certificación Aula Abierta Curso y Taller.','Se realizó la certificación del curso de Alfabetización Digital y Gobierno en Línea y del Taller de Herramientas Web 2.0 que se llevaron a cabo en el aula abierta de la Institución Educativa José Acevedo y Gómez. Los adultos quedaron muy contentos y agradecidos por el proceso. ',40,'Institucion_Educativa_Jose_Acevedo_y_Gomez_Entrega_de_certificados_Curso_Alfabetizacion_Digital_y_Gobierno_en_Linea.jpg','','Institucion_Educativa_Jose_Acevedo_y_Gomez_Entrega_de_certificados_Taller_Herramientas_Web_2_0.jpg','uploads/accompaniment/accompaniment_adjunct',2,344,43,'2015-06-23 13:26:50','2015-06-23 18:29:03'),(583,'2015-06-03','Atención a usuarios','Atención en el punto de navegación a usuarios del sitio.Verificación del buen funcionamiento del internet. Recolección de indicadores.',4,'Mascerca_Buenos_Aires_acompanamiento_2-0.jpg','','','uploads/accompaniment/accompaniment_adjunct',7,314,20,'2015-06-23 15:23:22','0000-00-00 00:00:00'),(584,'2015-06-03','Atención a usuarios','Atención en el punto de navegación a usuaria del sitio.Verificación del buen funcionamiento del internet. Recolección de indicadores.',1,'Espacio_Publico_acompanamiento_3-0.jpg','','','uploads/accompaniment/accompaniment_adjunct',7,427,20,'2015-06-23 15:27:39','0000-00-00 00:00:00'),(585,'2015-06-04','Acompañamiento gestora TIC ','Reunión con gestora TIC para empezar labores en el CAM y en Tesorería Municipal, firma del pacto de acompañamiento; la gestora ha realizado su labor social con el programa durante varios semestres. Se le hace entrega del chaleco y el carné del programa.',1,'CAM_acompanamiento_gestora_TIC1.jpg','','','uploads/accompaniment/accompaniment_adjunct',4,436,20,'2015-06-23 15:42:16','0000-00-00 00:00:00'),(586,'2015-06-09','Acompañamiento gestora TIC ','Acompañamiento y presentación de la gestora TIC con la líder de servicio CAM ',2,'CAM_acompanamiento_gestora_TIC_2-0.jpg','CAM_acompanamiento_gestora_TIC-0.jpg','','uploads/accompaniment/accompaniment_adjunct',4,436,20,'2015-06-23 15:46:20','0000-00-00 00:00:00'),(587,'2015-06-11','Entrega certificado','Reunión del gestor Alejandro Marín con el gestor TIC Yerson Yair, para la entrega del certificado de las horas y la retroalimentación del proceso de acompañamiento en el diseño de 5 tutoriales de herramientas Web.',1,'Mascerca_Buenos_Aires_est_Pascual_Bravo_Yerson_Yair_Rodriguez.JPG','','','uploads/accompaniment/accompaniment_adjunct',5,314,20,'2015-06-23 15:55:21','0000-00-00 00:00:00'),(588,'2015-06-11','Atención a usuarios','Atención a un usuario del punto de navegación. Se le mostraron algunas páginas y herramientas web para la elaboración de cómic y animaciones.',1,'Mascerca_Buenos_Aires_acompanamiento2_2.JPG','','','uploads/accompaniment/accompaniment_adjunct',7,314,20,'2015-06-23 15:56:49','0000-00-00 00:00:00'),(589,'2015-06-20','Acompañamiento Curso AD y GEL','Se hizo acompañamiento al gestor TIC en el curso de alfabetización digital y gobierno en línea.',0,'Parque_Biblioteca_Jose_Horacio_Betancur_Acompanamiento_Gestor_TIC_2.jpg','','','uploads/accompaniment/accompaniment_adjunct',4,194,15,'2015-06-23 16:02:28','0000-00-00 00:00:00'),(590,'2015-06-23','Atención a usuarios','Atención a 4 usuarios del punto de navegación. Se verifica el buen funcionamiento de los equipos del punto de navegación. Además, se propone hacer asesorías a los funcionarios de la inspección.',4,'Inspeccion_9B_El_Salvador_acompanamiento.jpg','Inspeccion_9B_El_Salvador_acompanamiento2.jpg','','uploads/accompaniment/accompaniment_adjunct',7,307,20,'2015-06-23 16:05:14','0000-00-00 00:00:00'),(591,'2015-06-23','Expropiación del Kit de inclusión Digital','Se visitó el colegio Mayor con previo aviso para revisar y expropiar uno de los Kit de Inclusión Digital presentes en el lugar dada la subutilización del mismo desde hace ya algún tiempo. Se dieron nuevamente recomendaciones para el kit existente en  la I.ES ',1,'Colegio_Mayor_Expropiacion_Kit_de_inclusion_Digital.jpg','','','uploads/accompaniment/accompaniment_adjunct',8,406,23,'2015-06-23 16:11:08','0000-00-00 00:00:00'),(592,'2015-06-03','Certificación Aula Abierta','Certificación de los participantes del proceso Aula Abierta en la Institución Educativa, se certificaron 9 personas participantes en el taller de Herramientas Web 2.0',9,'IE_Gerardo_Valencia_Aula_Abierta_Cierre_de_procesos.jpg','','','uploads/accompaniment/accompaniment_adjunct',4,410,24,'2015-06-24 09:18:39','0000-00-00 00:00:00'),(593,'2015-06-24','Seguimiento  al Kit de Inclusión Digital','Se realizó visita de seguimiento al kit de inclusión  digital con la profesional especializada en gestión Bibliotecaria en donde se conversó a cerca de los siguientes aspectos: \r\n- La universidad cuenta con dos kit de inclusión digital; sin embargo se considera que con uno basta para la atención  a las personas en situación de discapacidad del lugar dado que solo tres lo usan.\r\n- Actualmente sólo hay un pc con algunos dispositivos visibles pero la mayoría están guardados.\r\n- No se usa el software por falta de conocimiento y apropiación del mismo, incluso se presume que el equipo donde estaba instalado ya no está en la biblioteca.\r\nAl respecto de estos hallazgos se establecen compromisos y se sugiere.\r\n- Asistir a la segunda capacitación que se realizará en Julio con apoyo de la biblioteca Fernando Gómez respecto al uso del kit.\r\n- Verificar la instalación del software o en su defecto solicitarla con tecnoayudas.\r\n- Sacar el resto del kit del maletín pues se explicó a la funcionaria cómo elementos como teclados de alto contraste con perfectamente utilizables por personas con baja visión, adultos o personas sin ningún tipo de discapacidad.\r\n- Mde inteligente mirará la pertinencia de continuar con dos kit de inclusión en el lugar.\r\n- ',1,'Pascual_Bravo_Seguimiento_Kit_de_inclusion_Digital.jpg','','','uploads/accompaniment/accompaniment_adjunct',8,411,23,'2015-06-24 10:57:57','0000-00-00 00:00:00'),(594,'2015-06-23','Acompañamiento Gestor TIC','Acompañamiento a la gestora TIC En el proceso de AD en el centro de lectura de Villa Guadalupe',7,'20150623_141307_HDR.jpg','','','uploads/accompaniment/accompaniment_adjunct',4,463,10,'2015-06-24 13:08:42','0000-00-00 00:00:00'),(595,'2015-06-23','Acompañamiento a curso AD','Acompañamiento al curso de AD en el centro de lectura Villa del Socorro',12,'20150623_141201_HDR.jpg','','','uploads/accompaniment/accompaniment_adjunct',3,463,10,'2015-06-24 13:10:19','0000-00-00 00:00:00'),(596,'2015-06-25','Certificación seguimiento Curso y Gestores','Seguimiento evaluación y certificación de los dos grupos de AD del sitio',20,'20150625_143044_HDR.jpg','20150625_144036_HDR.jpg','20150625_144706_HDR.jpg','uploads/accompaniment/accompaniment_adjunct',6,466,10,'2015-06-25 16:52:55','0000-00-00 00:00:00'),(597,'2015-06-16','Acompañamiento al curso Alfabetización Digital','El acompañamiento se gesta en la medida que se da la interacción con el grupo, para esto la Gestora de Cultura Digital presenta el programa  a las personas del curso y el gestor TIC dicta la clase. ',7,'Casa_de_la_Cultura_Pedregal_Seguimiento_Gestor_TIC_1.jpg','Casa_de_la_Cultura_Pedregal_Seguimiento_Gestor_TIC_2.jpg','','uploads/accompaniment/accompaniment_adjunct',4,487,24,'2015-06-25 17:23:50','0000-00-00 00:00:00'),(598,'2015-06-10','Certificación Curso','Se certificó el taller de narrativas digitales en la Biblioteca La Esperanza',8,'IMG_7851.JPG','IMG_7849.JPG','IMG_7850.JPG','uploads/accompaniment/accompaniment_adjunct',4,479,42,'2015-06-26 10:33:21','0000-00-00 00:00:00'),(599,'2015-06-24','Acompañamiento Gestores TIC','Se acompañó al gestor TIC en el punto de navegación para brindar asesorías en caso de que lo necesitará, además se le hizo un pequeño seguimiento.',0,'Casa_de_Gobierno_San_Antonio_de_Prado_Acompanamiento_Gestor_TIC.jpg','','','uploads/accompaniment/accompaniment_adjunct',4,333,15,'2015-06-26 15:05:09','0000-00-00 00:00:00'),(600,'2015-06-24','Acompañamiento Curso','Se hizo acompañamiento al gestor TIC en el curso de alfabetización digital y gobierno en línea.',0,'Unidad_Integral_6_de_Belen_Acompanamiento_Gestor_TIC.jpg','','','uploads/accompaniment/accompaniment_adjunct',4,362,15,'2015-06-26 15:11:48','0000-00-00 00:00:00'),(601,'2015-06-24','Acompañamiento Curso','Se acompañó a la gestora en el curso de alfabetización digital y gobierno en línea.',0,'Unidad_Integral_6_de_Belen_Acompanamiento_Gestor_Pascual_Bravo_Carolina.jpg','','','uploads/accompaniment/accompaniment_adjunct',5,362,15,'2015-06-26 15:12:58','0000-00-00 00:00:00'),(602,'2015-06-26','Acompañamiento Curso','Se acompañó al estudiante del Pascual Bravo en la novena sesión del curso de alfabetización digital y gobierno en línea con emprendedores.',0,'Cedezo_Belen_Acompanamiento_curso_AD_y_GEL_Estudiante_Pascual_Bravo_Alejandro.jpg','','','uploads/accompaniment/accompaniment_adjunct',5,176,15,'2015-06-26 15:18:16','0000-00-00 00:00:00'),(603,'2015-06-26','Acompañamiento Curso','Se acompañó al Gestor TIC en la novena sesión del curso de alfabetización digital y gobierno en línea con emprendedores.',0,'Cedezo_Belen_Acompanamiento_curso_AD_y_GEL_Gestor_TIC.jpg','','','uploads/accompaniment/accompaniment_adjunct',4,176,15,'2015-06-26 15:19:24','0000-00-00 00:00:00'),(604,'2015-07-02','Certificación seguimiento Curso y Gestores','Certificación del curso, retroalimetacion y acompañamiento a la gestora tic',14,'Centro_de_lectura_guadalupe_A_D_2.jpg','Centro_de_lectura_guadalupe_A_D.jpg','','uploads/accompaniment/accompaniment_adjunct',4,463,10,'2015-07-02 16:47:25','0000-00-00 00:00:00'),(605,'2015-07-09','Seguimiento a Kit de Inclusión Digital','Se realizó una reunión con el rector de la Institución para proponerle la promoción del Kit de inclusión digital, a través de un proceso de formación con esta población. El rector aprobó la propuesta y quedó como compromiso convocar el grupo en la comuna.',2,'Institucion_Educativa_Jose_Maria_Bernal_Seguimiento_al_Kit_de_inclusion.jpg','','','uploads/accompaniment/accompaniment_adjunct',8,124,43,'2015-07-09 15:21:28','0000-00-00 00:00:00');
