INSERT INTO `divulgations` VALUES (17,'2014-03-25','Lanzamiento nuevos sitios conectados','Se realizó una invitación para participar en el lanzamiento de los sitios nuevos.Y se tomaron los datos de tres personas como candidatos para hacer parte de un vídeo. ',3,'Parque Biblioteca de Belén','','','','',7,0,352,0,'0000-00-00 00:00:00','2015-05-22 15:29:46'),(19,'2014-05-17','Activación nuevo punto de conectividad','Asiste Comunicación Pública, Contenidos y Apropiación a la activación del nuevo punto de conectividad. Consistió en 3 espacios: Mi Medellín, uso libre de internet y trámites y servicios en línea. Los visitantes del mercado Arví se mostraron interesados en conocer el programa MDE Ciudad Inteligente y en consultar la mesa de votación para las elecciones presidenciales. Igualmente se brindó información para algunos turistas de otras regiones del país.',10,'Parque Arví','','','','',3,0,317,0,'0000-00-00 00:00:00','2015-05-22 15:29:46'),(20,'2014-06-19','Intervención CAV de Belencito','Se realizó intervención en el CAV, anuncio a través del micrófono sobre el programa, el uso del punto de navegación, los  trámites y servicios  en línea que se pueden hacer. Atención en el punto de navegación donde se les dio asesoría a las personas que se acercaron interesados en conocer las paginas para buscar empleo, cursos en el SENA y averiguar sobre indemnizaciones y ayudas para las victimas.Cambio de la información de la cartelera.',56,'CAV de Belencito ','2014_06_19_08_44_16.jpg','2014_06_19_09_59_18.jpg','CAV_de_Belencito_Intervencion_2.jpg','uploads/divulgation/divulgation_adjunct',7,0,335,0,'0000-00-00 00:00:00','2015-05-22 15:29:46'),(21,'2014-04-08','Video para inauguración 17 sitios con conexi','Intervención en el parque de Belén con la filmación del vídeo promocional para la inauguración de los 17 sitios públicos del programa.',2,'Parque Belén','','','','',7,0,352,0,'0000-00-00 00:00:00','2015-05-22 15:29:46'),(22,'2014-07-13','Activación nuevo punto de conectividad','Stand de Medellín Ciudad Inteligente con uso libre de internet, trámites en línea y bicilicuadora. Se acercan varias personas del corregimiento y de la ciudad a participar de las actividades. También se hace una jornada complementaria repartiendo volantes y afiches por las diferentes veredas.',149,'Parque de Santa Elena','','','','',3,0,319,0,'0000-00-00 00:00:00','2015-05-22 15:29:46'),(23,'2014-04-24','Inauguración 17 sitios con internet libre','Intervención en el parque de Belén - inauguración de los 17 sitios públicos nuevos de Medellín. alli se contó con la participación de las personas en los stand donde se les brindo información sobre la plataforma MiMedellin e información general del evento. ',80,'Parque Belén','','','','',4,0,193,0,'0000-00-00 00:00:00','2015-05-22 15:29:46'),(24,'2014-06-20','Activación parque del Poblado','Se realizó entrega de afiches y volantes a las personas que visitan el parque del poblado. se hablo con ellos sobre la conexión libre a la wifi del programa y en muchas ocasiones se les indico la forma correcta de conectarse. ',100,'Parque del Poblado ','Parque_de_El_Poblado.jpg','Parque_del_Poblado_Activacion_1.jpg','','uploads/divulgation/divulgation_adjunct',3,0,354,0,'0000-00-00 00:00:00','2015-05-22 15:29:46'),(25,'2014-06-20','Previo a la activación ','Entrega de Afiches y volantes en el punto de navegación y sitio de gobierno.  ',100,'Casa de Gobierno Altavista','Parque_Altavista_antesala_activacion.jpg','','','uploads/divulgation/divulgation_adjunct',6,0,353,0,'0000-00-00 00:00:00','2015-05-22 15:29:46'),(26,'2014-06-22','Activación pedagógica en el parque de Altavista','Asiste Comunicación Pública, Contenidos y Apropiación a la activación del nuevo punto de conectividad. Consistió en 3 espacios: Mi Medellín, uso libre de Internet y trámites y servicios en línea.  participo variada población de altavista.  ',100,'Parque de Altavista','Parque_Altavista_Activacion_2.jpg','prueba1.jpg','Parque_de_Altavista_Activacion1.jpg','uploads/divulgation/divulgation_adjunct2',3,0,353,0,'0000-00-00 00:00:00','2015-05-22 15:29:46'),(27,'2014-07-02','Previo a la activación ','Entrega de afiches y volantes previo a la activación del parque principal de San Antonio de Prado',100,'Parque San Antonio de Prado','','','','',3,0,452,0,'0000-00-00 00:00:00','2015-05-22 15:29:46'),(28,'2014-06-18','Trámites en línea','Se llevó a cabo la jornada de trámites con víctimas. La atención fue muy exitosa en tanto hubo afluencia de público y las dudas de los asistentes pudieron ser subsanadas a través de los trámites en línea. De los más solicitados fueron el sisbén, página de Sofia Plus, citas por chat, empleo, fosyga.Es necesario que este tipo de jornadas se realicen a lo sumo cada mes ya que las personas que asisten al cav valoran y necesitan todo tipo de ayuda e información',60,'Telecentro Palermo','','','','',6,0,247,0,'0000-00-00 00:00:00','2015-05-22 15:29:46'),(29,'2014-06-12','Actividad Festival','En esta actividad se activó el sitio realizando la promoción, entrega de afiches e instalación de publicidad.Esta actividad fue planeada por comunicación pública y participamos acompañándolos en las actividades ya mencionadas y  en el punto de navegación con trámites y correos electrónicos',100,'Parque de la vida, plazoleta y alrededores','','','','',3,0,318,0,'0000-00-00 00:00:00','2015-05-22 15:29:46'),(30,'2014-06-20','Activación Parque de Aranjuez-Inspección de ','Se realizó una jornada de información sobre servicios y tramites en línea. Se invitó a la comunidad cercana al parque a que conocieran El Programa Medellín Ciudad Inteligente, y los puntos de navegación en la ciudad, entre ellos el de la Inspección de Aranjuez. ',52,'Parque de Aranjuez','','','','',3,0,255,0,'0000-00-00 00:00:00','2015-05-22 15:29:46'),(31,'2014-07-12','Festival Viva el Internet Parque de la Floresta','Se realizó una jornada de información sobre servicios y tramites en línea. Se invitó a la comunidad cercana al parque a que conocieran El Programa Medellín Ciudad Inteligente. Se invitó a la gente a conectarse desde dispositivos móviles a la red de el programa en el Parque de la Floresta. ',100,'Parque de la Floresta','Festival_viva_el_Internet_Parque_La_Floresta.','','','uploads/divulgation/divulgation_adjunct',3,0,263,0,'0000-00-00 00:00:00','2015-05-22 15:29:46'),(33,'2014-11-20','Intervención CAV Belencito','Intervervención con diferentes actividades, asesorías en el punto de navegación en trámites y servicios, asesorías en dispositivos móviles e inscripción de usuarios para procesos de formación en alfabetización digital y herramientas web 2.0',250,'CAv Belencito','IMG_1156.JPG','IMG_1158.JPG','IMG_1160.JPG','uploads/divulgation/divulgation_adjunct',6,0,335,38,'0000-00-00 00:00:00','2015-05-22 15:29:46'),(34,'2014-12-03','Días de playa','\"Sensibilización MiMedellin\r\nEn el evento \"\"Días de playa\"\" propuesto por el Teatro Pablo Tobón y  la alcaldía de Medellín. Se busca que los ciudadanos participen de la plataforma de MiMedellin con sus opiniones.\r\nObservación: conexión a internet muy lenta.\r\nAgentes: Clara y Maria Paulina, apoyo estudiante de PP Paula.\"\r\n',43,'Avenida La Playa','Escuela_del_maestro_evento_dic3_3.jpg','','','uploads/divulgation/divulgation_adjunct',4,0,302,20,'2014-12-17 11:39:17','2015-05-22 15:29:46'),(35,'2014-12-05','Días de playa','\"Sensibilización MiMedellin\r\nEn el evento \"\"Días de playa\"\" propuesto por el Teatro Pablo Tobón y  la alcaldía de Medellín. Se busca que los ciudadanos participen de la plataforma de MiMedellin con sus opiniones.\r\nObservación: conexión a internet muy lenta.\r\nAgentes: Cristian y Mónica\"\r\n',70,'Avenida La Playa','Escuela_del_maestro_evento_dic5_2.jpg','Escuela_del_maestro_evento_dic5_4.jpg','','uploads/divulgation/divulgation_adjunct',4,0,302,20,'2014-12-17 11:45:25','2015-05-22 15:29:46'),(36,'2014-12-09','Días de playa','\"Sensibilización MiMedellin\r\nEn el evento \"\"Días de playa\"\" propuesto por el Teatro Pablo Tobón y  la alcaldía de Medellín. Se busca que los ciudadanos participen de la plataforma de MiMedellin con sus opiniones.\r\nObservación: Ese día estuvo muy lluvioso, se atendieron muy pocas personas. Conexión a internet muy lenta.\r\nAgentes: Cindy y Rosa, apoyo estudiante de PP Alejandra\"\r\n',10,'Avenida La Playa','Escuela_del_maestro_evento_dic9.jpg','','','uploads/divulgation/divulgation_adjunct',4,0,302,20,'2014-12-17 11:55:18','2015-05-22 15:29:46'),(37,'2014-12-11','Días de playa','\"Sensibilización MiMedellin\r\nEn el evento \"\"Días de playa\"\" propuesto por el Teatro Pablo Tobón y  la alcaldía de Medellín. Se busca que los ciudadanos participen de la plataforma de MiMedellin con sus opiniones.\r\nObservación: conexión a internet muy lenta.\r\nAgentes: Alejandro y Carolina\"\r\n',16,'Avenida La Playa','Escuela_del_maestro_evento_dic11_1.jpg','Escuela_del_maestro_evento_dic11_2.jpg','','uploads/divulgation/divulgation_adjunct',4,0,302,20,'2014-12-17 11:58:07','2015-05-22 15:29:46'),(38,'2014-12-16','Días de playa','\"Sensibilización MiMedellin\r\nEn el evento \"\"Días de playa\"\" propuesto por el Teatro Pablo Tobón y  la alcaldía de Medellín. Se busca que los ciudadanos participen de la plataforma de MiMedellin con sus opiniones.\r\nObservación: Conexión a internet muy lenta.\r\nAgentes: Cindy y Rosa\"\r\n',20,'Avenida La Playa','Escuela_del_maestro_evento_dic16_2.jpg','Escuela_del_maestro_evento_dic16.jpg','','uploads/divulgation/divulgation_adjunct',4,0,302,20,'2014-12-17 14:38:26','2015-05-22 15:29:46'),(39,'2015-05-22','SENSNN2015-21','Charla de Navegar sin naufragar con grados 4o',40,'Auditorio Biblioteca','IE_Santa_Catalina_de_Sena_Charla_de_Navegar_sin_Naufragar_con_estudiantes_de_grado_4o.JPG','','','uploads/divulgation/divulgation_adjunct',2,1,357,38,'2015-05-25 16:34:36','0000-00-00 00:00:00'),(40,'2015-06-02','SEILG2015-22','Divulgación de la Red Wifi a los visitantes del Parque. Verificación del funcionamiento de la red.',5,'Parque Bicentenario