 08:28:45','0000-00-00 00:00:00'),(97,'2015-06-24','SEILG2015-79','Acompañamiento al sitio de gobierno.',6,'Aula Ambiental de la America','20150624_141725_HDR.jpg','20150624_141420_HDR.jpg','20150624_141416_HDR.jpg','uploads/divulgation/divulgation_adjunct',6,1,236,10,'2015-06-25 08:33:43','0000-00-00 00:00:00'),(98,'2015-06-11','SENSNN2015-80','Charla NSN',21,'UVA La Esperanza','20150611_141717_HDR.jpg','','','uploads/divulgation/divulgation_adjunct',2,1,442,10,'2015-06-25 08:41:38','0000-00-00 00:00:00'),(99,'2015-06-24','SEIGEL2015-81','Se realizó sensibilización de trámites y servicios en línea con los padres de familia de los niños que entrenan en la Unidad Deportiva María Luisa Calle, los participantes quedaron muy contentos de poder conocer la estrategia de Gobierno Abierto y nos siguieron en redes sociales para aprender más sobre esta. ',17,'Zona Wifi de la unidad deportiva.','Unidad_Deportiva_Maria_Luisa_Calle_Sensibilizacion_Gobierno_en_Linea.jpg','','','uploads/divulgation/divulgation_adjunct',8,2,557,43,'2015-06-25 08:47:30','2015-06-25 13:52:03'),(100,'2015-06-19','SEILG2015-82','Se realiza un recorrido por el espacio contándole a las personas que hay servicio de wifi libre y a los que ya sabían de está se les preguntó cómo les había ido con la conectividad y las fallas que está había presentado, las personas se encuentran felices conectándose en el espacio. ',11,'Graderías de la Centralidad Deportiva','Centralidad_Deportiva_El_Progreso_2_1.jpg','Centralidad_Deportiva_El_Progreso_2_2.jpg','','uploads/divulgation/divulgation_adjunct',5,2,485,24,'2015-06-25 14:38:57','0000-00-00 00:00:00'),(101,'2015-06-23','SEILG2015-83','Esta sensibilización fue realizada en la zona deportiva, canchas y parques del sector. Se realizó un recorrido con varios de los asistentes, invitándolos a hacer uso de este espacio, como un lugar de conexión  libre y gratuita.',30,'Unidad Deportiva Granizal','Unidad_Deportiva_de_Granizal.jpg','Unidad_Deportiva_de_Granizal_2.jpg','Unidad_Deportiva_de_Granizal_3.jpg','uploads/divulgation/divulgation_adjunct',5,4,521,46,'2015-06-25 15:55:04','0000-00-00 00:00:00'),(102,'2015-06-24','SEDM2015-84','Se realiza una charla de dispositivos móviles con las personas convocadas al espacio. ',5,'Biblioteca ','Biblioteca_Familia_La_Esperanza_Charla_Dispositivos_Moviles_1.jpg','Biblioteca_Familia_La_Esperanza_Charla_Dispositivos_Moviles_2.jpg','Biblioteca_Familia_La_Esperanza_Charla_Dispositivos_Moviles_3.jpg','uploads/divulgation/divulgation_adjunct',2,3,479,24,'2015-06-26 08:50:16','0000-00-00 00:00:00'),(103,'2015-06-24','SENDF2015-85','Se realizó una charla de Stop Motion con los niños de la Fundación Gente de Corazón en el Telecentro Los Tanques. Los niños están en situación de vulnerabilidad, por lo cual estos espacios de experimentación audiovisual y creativa permiten fortalecer habilidades comunicativas en las niños, para aportar al mejoramiento de sus relaciones, proyecto de vida, expresión y participación.',15,'Auditorio del Telecentro.','Telecentro_Los_Tanques_Charla_Narrativas_Digitales.jpg','','','uploads/divulgation/divulgation_adjunct',2,1,457,43,'2015-06-26 09:14:31','0000-00-00 00:00:00'),(104,'2015-06-11','SENDF2015-86','Se realizó la sensibilización del taller de Narrativas Digitales por medio de la actividad de sensibilización llamada \"el árbol de expectativas\", con el fin de indagar necesidades, expectativas e intereses del grupo por medio de una técnica vivencial que permite dar respuesta al ¿Qué saben los jóvenes?, ¿Qué quieren aprender? y ¿Para qué lo quieren aprender?  y así lograr obtener un diagnóstico del grupo, para elegir una ruta metodológica pertinente al proceso.\r\n',10,'Auditorio de la Casa de Gobierno Altavista.','Casa_de_Gobierno_Altavista_Sensibilizacion_Taller_de_Narrativas.jpg','','','uploads/divulgation/divulgation_adjunct',3,4,332,43,'2015-06-26 09:39:30','2015-06-26 14:42:17'),(105,'2015-06-25','SEIGEL2015-87','Se conversó con uno de los habitantes del corregimiento que estaba usando la red WIFI para comunicarse con sus familiares en Sidney. Evalúo de una manera muy positiva el servicio, hablamos de las dinámicas y características propias del sector y sobre las oportunidades de estudio, becas y demás opciones para los jóvenes hoy ',1,'Parque palmitas','Parque_Palmitas_Activacion_Zona_WIFI.jpg','','','uploads/divulgation/divulgation_adjunct',5,2,419,23,'2015-06-26 10:02:04','0000-00-00 00:00:00'),(106,'2015-06-25','SENSNN2015-88','Se visitó la casa de Gobierno palmitas y se habló con los niños y niñas acerca de las actividades que cotidianamente realizan en la web, identificando la presencia constante en las redes sociales y el desconocimiento de algunos riesgos presentes al tener facebook que era la que estaban usando en el momento. Se dieron algunas recomendaciones. Además de esto se habló con el funcionario acerca de la importancia del cuidado de los equipos en el lugar, con el vigilante se tocó el tema de las planillas y la importancia de continuar fortaleciendo este tema en la casa de Gobierno y finalmente se trató de establecer contacto con la presidente de la JAL pero no se encontraba; sin embargo, se obtuvo el contacto para gestionar próximamente la vinculación de chicos y chicas de pp a nuestro programa.',3,'Casa de Gobierno palmitas ','Casa_de_Gobierno_Palmitas_Activacion_Zona_WIFI_1.jpg','Casa_de_Gobierno_Palmitas_Activacion_Zona_WIFI_2.jpg','','uploads/divulgation/divulgation_adjunct',5,1,270,23,'2015-06-26 10:15:18','0000-00-00 00:00:00'),(107,'2015-06-25','SEIMC2015-89','Sensibilización de un grupo de 15 empresarios del CEDEZO Buenos Aires que serán formados en el CEDEZO La Ladera porque allí se cuenta con los recursos. 5 de ellos manifiestan necesitar alfabetización digital, manejo de dispositivos móviles; y en su gran mayoría quieren aprender marketing digital, redes sociales y administración de la página web empresarial. Ambos CEDEZO tienen el mismo coordinador.',15,'Auditorio Mascerca de Buenos Aires','CEDEZO_La_Ladera_sensibilizacion_3.jpg','CEDEZO_La_Ladera_sensibilizacion_2.jpg','','uploads/divulgation/divulgation_adjunct',3,5,170,20,'2015-06-26 11:04:24','0000-00-00 00:00:00'),(108,'2015-06-11','SEIMC2015-90','Sensibilización con el grupo de alfabetización digital con personas en situación de discapacidad. En esta oportunidad fueron convocados los dos grupos de AD, fue un poco complicada la práctica con el mouse porque solo se contaba en la sala de sistemas con 16 equipos y asisteron 30 personas; se optó porque se hicieran de dos por equipo. En la próxima sesión solo asistirán el grupo convocado para los jueves',30,'Auditorio del CEDEZO La Ladera','PB_Leon_de_Greiff_sensibilizacion_alfabetizacion_digital_discapacidad_3.jpg','PB_Leon_de_Greiff_sensibilizacion_alfabetizacion_digital_discapacidad_4.jpg','','uploads/divulgation/divulgation_adjunct',3,7,189,20,'2015-06-26 11:15:53','0000-00-00 00:00:00'),(109,'2015-06-26','SEILG2015-91','La gestora Tic Ana maría espitia acompañó el sitio y además de resolver dudas de algunos usuarios se reunió con Adriana Castrillón para conversar acerca de algunas dificultades que han presentado al rededor del centro de servicios con las dinámicas que los jóvenes desarrollan en las noches por lo cual se solicita apagar la red WIFI en este lapso de tiempo; se traslada la solicitud a la líder de conectividad y se establece contacto con la funcionaria para resolver inquietudes. De otro lado se continúa promoviendo el uso de las planillas en el lugar.',6,'Centro de servicios Lusitania','Centro_de_servicios_Lusitania_Activacion_Zona_WIFI.jpg','','','uploads/divulgation/divulgation_adjunct',5,2,272,23,'2015-06-26 11:17:33','0000-00-00 00:00:00'),(110,'2015-06-24','SEDM2015-92','la gestora Tic Ana María Espitia se reunió con 3 personas para realizar charla de dispositivos móviles en el parque principal de San Cristóbal  ',3,'Parque principal San Cristóbal','Parque_San_Cristobal_Charla_Dispositivos_Moviles.jpg','','','uploads/divulgation/divulgation_adjunct',2,2,283,23,'2015-06-26 11:24:19','0000-00-00 00:00:00'),(111,'2015-06-24','SEILG2015-93','La gestora Tic Ana María Espitia Visitó la Upss nuevo Occidente con el propósito de reunirse con Rubiel Durango y solicitar un espacio en la reunión mensual de funcionarios para que el programa realice la divulgación con todo el personal en la Unidad de salud, además de esto acompañó a algunos jóvenes en la divulgación de al red WIFI y la asesoría respecto a dudas puntuales.',6,'Sala de Espera','Upss_Nuevo_Occidente_Activacion_Zona_WIFI.jpg','','','uploads/divulgation/divulgation_adjunct',5,4,496,23,'2015-06-26 11:30:29','0000-00-00 00:00:00'),(112,'2015-03-28','SENDF2015-94','se realizó charla número 1 de narrativas digitales en el centro de derivación y diagnóstico, proceso que se adjunta a la casa de justicia Robledo',14,'Centro de derivación y diagnóstico','Centro_de_derivacion_y_Dx_Charla_1_Narrativas_D.jpg','','','uploads/divulgation/divulgation_adjunct',2,14,271,23,'2015-06-26 11:42:13','0000-00-00 00:00:00'),(113,'2015-05-12','SENDF2015-95','charlas orientadas a fortalecer habilidades comunicativas en las niñas a través del uso y experimentación de cámaras digitales, legos, grabadoras de sonido y escritura creativa, para aportar al mejoramiento de sus relaciones, expresión de emociones, percepciones de mundo, proyecto de vida, identidad personal, memoria, interacción con su entorno y participación.\r\n',14,'Centro de derivación y diagnóstico','Centro_de_derivacion_y_Dx_Charla_2_Narrativa_D.jpg','','','uploads/divulgation/divulgation_adjunct',2,14,271,23,'2015-06-26 11:45:34','0000-00-00 00:00:00'),(114,'2015-06-02','SENDF2015-96',' Charlas orientadas a fortalecer habilidades comunicativas en las niñas a través del uso y experimentación de cámaras digitales, legos, grabadoras de sonido y escritura creativa, para aportar al mejoramiento de sus relaciones, expresión de emociones, percepciones de mundo, proyecto de vida, identidad personal, memoria, interacción