INSERT INTO `meetings` VALUES (38,'2014-07-08','Socialización Inclusión MDE a Red de bilbiotéca','La reunión es solicitada por Alejandra Ospina [aospina@reddebibliotecas.org.co 3007058192,5116789]La red quiere nuestra asesoría para realizar un proyecto con las bibliotecas dirigido a la población en situación de discapacidad. La idea es aportar contenidos al portal de la red que tengan que ver con el uso del kit y de mas servicios que ofrecen.Se presenta los vídeos promocionales del kit y de conectividad, se socializa sobre el concurso de diseño inclusivo y de los contenidos y accesibilidad que tendrá el metaportal, finalmente, se muestra la presentación del Kit','Apoyarlos, si lo solicitan, en el proceso del proyecto que van a desarrollar.Enviar por mail las presentaciones del KIT',NULL,NULL,NULL,'',3,163,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(39,'2014-01-29','Seguimiento Kit de inclusión','Reunión para hablar acerca del kit de inclusión, hacer gestión del préstamo del aula, conocer las ofertas de procesos de formación para la comunidad que tiene este año la biblioteca.','Ninguno',NULL,NULL,NULL,'',4,193,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(45,'2014-02-03','Empalme','Se hace contacto de nuevo con Yamileth Gallo encargada de la Sala Mi Barrio. Está interesada en continuar curso de alfabetización digital con la población que acude a la biblioteca, en el grupo de integración a las TIC en situación de discapacidad y en conectar a los niños pequeños con el Kit de Inclusión. Nos cuenta sobre la nueva directora Patricia Giraldo dirección.ladera@bibliotecasmedellin.gov.co. ','Agendar próxima reunión',NULL,NULL,NULL,'',2,189,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(46,'2014-01-29','Empalme de procesos','Se realizó una reunión con la coordinadora y el gestor para darles a conocer la oferta de parte del programa e identificar algunas necesidades que ellos tenían, lo cual permitiría iniciar procesos de formación con los emprendedores.','Ninguno',NULL,NULL,NULL,'',2,176,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(47,'2014-02-03','Empalme','Descripción de actividades a realizar este año y presentación del nuevo integrante de la zona.','Realizar seguimiento a la convocatoria del Telecentro para desarrollar actividades en estos espacios.',NULL,NULL,NULL,'',2,204,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(48,'2014-02-03','Empalme','El Coordinador Nelson Ospina plantea la posibilidad de replantear el curso de Marketing Digital, como lo sugirió el año pasado en la evaluación de los cursos, propone que sean 20% teoría y 80% práctico. Manifiesta que le gustaría que los cursos de alfabetización digital y gobierno en línea sean ofrecidos por el Parque Biblioteca dadas las óptimas condiciones del espacio. Se puede incluir el curso de Web 2.0, cursos cortos de Excel y Power Point, Imagen de tu negocio. Contacto JAL Educación Comuna 8 Oscar Torres 3137388569. Tiene el proyecto de crear mesa de emprendimiento social. Propone iniciar Excel avanzado en Marzo posiblemente. ','Ninguno',NULL,NULL,NULL,'',2,170,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(49,'2014-02-04','Empalme','Se hace contacto con la Promotora de Lectura Diana Carolina Valencia lectura.santaelena@bibliotecasmedellin.gov.co nos habla sobre las actividades de inclusión utilizando el Kit de manera sistemática los lunes. La directora no se encontraba en el momento de la visita, se indaga sobre la disponibilidad de la sala de Informática para realizar charlas en este espacio. Tel 538 0222 Ext 106. ','Ninguno',NULL,NULL,NULL,'',2,190,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(57,'2014-03-11','Seguimiento','Reunión con Rosa López Directora de la Biblioteca para establecer alianzas de trabajo. Se informa sobre la dinámica de este año, en la que haremos actividades puntuales como charlas o talleres con la comunidad, pero no un proceso de curso completo como se realizó el año pasado. Se planea iniciar con una charla de Gobierno en Línea para los asistentes de la sala de computadores y programar cada 15 días talleres. ','Ninguno',NULL,NULL,NULL,'',4,190,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(58,'2014-01-30','Seguimiento sala de sistemas','Se realizó una reunión con la gestora para verificar el estado de la sala de sistemas, se encontró que la sala continuaba en malas condiciones, por lo que no era posible iniciar procesos de formación con los emprendedores, a menos de que se gestionara en el Parque Biblioteca un espacio para iniciar.','Gestionar en el Parque biblioteca de San Antonio de Prado un aula de sistemas para iniciar procesos de formación con los emprendedores.',NULL,NULL,NULL,'',4,178,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(59,'2014-01-30','Empalme de procesos','Se realizó una reunión con el gestor para hablar de las posibles ofertas que se manejarían con los emprendedores, por otro lado el gestor nos hace saber que se abrirá un punto de atención en el Poblado el cual será atendido por el.','Ninguno',NULL,NULL,NULL,'',2,175,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(60,'2014-01-30','Seguimiento Kit de inclusión','Se realizó una reunión para hacerle seguimiento al kit de inclusión, la coordinadora nos cuenta que hay un grupo de personas en situación de discapacidad que están asistiendo a clases con ella, en estas clases utilizan el kit de inclusión, también se identifico que el kit esta conectado a un computador en donde las personas que las personas en situación de discapacidad pueden utilizar cuando lo requieran.','Ninguno',NULL,NULL,NULL,'',4,196,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(64,'2014-03-12','Seguimiento','Propuesta de curso de Marketing Digital replanteando la pertinencia de las clases teóricas. Inicio Abril 23 Miércoles, Inicio Curso Marketing Digital. Se quedó en enviar los contenidos del curso. El coordinador solicita tener los contenidos del curso para ser revisados previamente. ','Ninguno',NULL,NULL,NULL,'',4,170,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(65,'2014-03-12','Seguimiento con Directora','Contacto con la Directora de la Biblioteca Patricia Giraldo, nos proporciona sus datos de correo electrónico dirección.ladera@bibliotecasmedellin.gov.co y nos presentamos con ella para futuras actividades que se programen durante el año.','NA',NULL,NULL,NULL,'',4,189,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(67,'2014-01-28','Reunión de enlace','Reunión de enlace con Jana Olaya, gestora del CEDEZO de San Cristóbal. Se trataron los siguientes temas:-Estado técnico de los equipos: Internet intermitente y a un equipo le falta un cargador, razón por la que no se puede usar.-Balance de los cursos y talleres del 2013: Dice que no tuvo mucha acogida pero que aún así fueron exitosos. Se requiere profundizar en temáticas más avanzadas como Power point, Excel, Blogs, entre otros. Es necesario hacer un filtro en el que se separen los grupos de alfabetización digital básica y los de talleres más avanzados.-Vinculación de Estudiantes de PP: Se pretende vincular algunos de los estudiantes más juiciosos y responsables que están interesados en prestar sus horas de labor social. Se propuso contactar a 3 estudiantes.-Intereses de empresarios: Se puntualizó que los grupos de emprendedores necesitan formación en mercadeo digital práctico, redes sociales, creación de blogs, fotografía, etc.-Grupos de empresarios: Se tomaron los datos de 13 grupos de emprendedores que podrían beneficiarse de los procesos de formación en el CEDEZO. -Disponibilidad de la sala: Se establecieron posibles horarios para llevar a cabo las formaciones. Es de carácter urgente confirmar los días y las horas de éstas, pero hasta que no se contacten los grupos y los estudiantes facilitadores, no se puede confirmar nada aún.','Llamadas a los emprendedores y a estudiantes beneficiarios de PP para planear actividades.','.JPG',NULL,NULL,'uploads/meeting/meeting_adjunct',2,169,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(68,'2014-01-31','Seguimiento Punto de navegación','Se realizó una reunión para identificar las condiciones del punto de navegación, los registros de usuarios, además se entrego el cargador de un equipo se tenía pendiente.','Ninguno',NULL,NULL,NULL,'',4,335,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(69,'2014-01-31','Empalme de procesos','Reunión con Ana Maria para hablar del tema de atención de usuarios en el punto de navegación, ella nos cuenta que en el momento hay unos jóvenes por la convivencia que están realizando esta labor en las tardes, lo que facilita la toma del registro.','Se quedo con el compromiso de realizar una capacitación con los jóvenes.',NULL,NULL,NULL,'',2,334,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(70,'2014-01-29',' Seguimiento Punto de navegación','Reunión con la señora Ana lucia para verificar el estado del punto de navegación e identificar si estaban tomando el registro de usuarios, allá se pudo gestionar el servicio social de una alfabetizadora.','Ninguno',NULL,NULL,NULL,'',4,362,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(71,'2014-01-30','Seguimiento Punto de navegación','Reunión con la secretaria para verificar la toma de registros de usuarios, se recogieron los indicadores.','Ninguno',NULL,NULL,NULL,'',4,336,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(72,'2014-01-30','Seguimiento Punto de navegación','Se realizó una reunión para verificar el funcionamiento del punto de navegación y la toma de registro de usuario.','Ninguno',NULL,NULL,NULL,'',4,348,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(73,'2014-01-30','Seguimiento Punto de navegación','verificar el funcionamiento del punto de navegación y la toma de registro de usuario, la funcionaria comento que el punto de navegación no contaba con internet.','Ninguno',NULL,NULL,NULL,'',4,333,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(74,'2014-01-29','Seguimiento Punto de navegación ','Reunión para identificar las condiciones del punto de navegación y los registros de usuarios. ','Ninguno',NULL,NULL,NULL,'',4,439,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(75,'2014-01-29','Seguimiento Punto de navegación','Reunión para identificar las condiciones del punto de navegación y los registros de usuarios.','Ninguno',NULL,NULL,NULL,'',4,438,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(76,'2014-02-27','Gestión de estudiantes de pp','Se realizó una reunión con el edil de la comuna 16 para buscar el apoyo de estudiantes de pp en los procesos manejados por el programa en dicha comuna.','Se programa reunión para el 4 de marzo para la entrega de la base de datos de los estudiantes por PP',NULL,NULL,NULL,'',3,438,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(77,'2014-03-11','Seguimiento','Reunión con la Coordinadora Beatriz y la docente Lillia Torres para establecer la forma de trabajo este año en temas como Inclusión con la Comunidad, Navegar sin Naufragar y trabajo con la Comunidad del Placer. Plantea reactivar el comité interveredal orientado hacia el emprendimiento. Se propone también trabajar el tema de Navegar sin Naufragar con los chicos de Media Luna. ','NA','photo5.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',4,432,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(78,'2014-02-04','Empalme','Se habla con el encargado de la casa de gobierno, Guillermo Giraldo quien reemplazará temporalmente a Daniel guillermo.giraldo@medellin.gov.co, se observan los equipos nuevos de este espacio, están en excelentes condiciones de conectividad y los usuarios están conociendo de nuevo el servicio que cuenta con 4 computadores.','Ninguno',NULL,NULL,NULL,'',2,296,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(79,'2014-03-11','Empalme','Reunión con Oscar Mauricio y Nicolás Londoño. Nos cuentan sobre el proceso de instalación del WIFI en el parque, dicen que ya instalaron las antenas y switches, pero está pendiente la conexión de Une. Hablamos sobre los medios para hacer difusión del nuevo servicio de conectividad a través de redes sociales, periódicos locales y bases de datos. Se deja pendiente averiguar el apoyo en la comunicación de redes de MDE. Nos invitan a la Mesa de Turismo comunitario que lidera el Parque, con 206 empresas de la zona, el próximo 20 de Marzo a las 9 am. Igualmente asistirá Juan Camilo Parra el 21 de Marzo al Comité de Sostenibilidad para contarle a varios actores de la zona sobre el servicio de WIFI en el Parque Central y en Arví. Se acuerda una reunión pendiente por definir la fecha con la Directora Ejecutiva y con todo el personal de Arví.','Ninguno',NULL,NULL,NULL,'',2,317,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(80,'2014-03-11','Sequimiento','Se reconoce el uso del kit de inclusión digital dentro de las actividades de seguimiento. Encontramos un uso adecuado con los niños y niñas del centro desde preescolar. Tienen planeado abrir un espacio en las instalaciones del centro educativo para el uso del segundo kit con la comunidad que así lo ha solicitado. ','Ninguno',NULL,NULL,NULL,'',4,425,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(81,'2014-03-12','Seguimiento','Propuesta de curso de Marketing Digital replanteando la pertinencia de las clases teóricas. Inicio Abril 23 Miércoles, Inicio Curso Marketing Digital. Se quedó en enviar los contenidos del curso. El coordinador solicita tener los contenidos del curso para ser revisados previamente. ','NA',NULL,NULL,NULL,'',4,170,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(82,'2014-02-20','Seguimiento','Visita de nuevo a Espacio Público para hablar con la funcionaria Líder de Proyecto sobre la metodología de trabajo. A pesar de que habíamos acordado una cita con Isabel Pulgarín Líder, no se encontraba en el momento. Hablamos con su asistente.','Ninguno',NULL,NULL,NULL,'',4,427,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(83,'2014-03-12','Empalme','Contacto con la Directora de la Biblioteca Patricia Giraldo, nos proporciona sus datos de correo electrónico dirección.ladera@bibliotecasmedellin.gov.co y nos presentamos con ella para futuras actividades que se programen durante el año.','NA',NULL,NULL,NULL,'',2,189,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(84,'2014-03-13','Gestion con Aliados','Mesa de trabajo de La Sierra. Presentación del proyecto Crecer con Dignidad y MDE Inteligente. Planeación de la fiesta del niño en la Comuna 8, MDE propone apoyar la actividad con el tema de Reciclaje Electrónico con la presencia de 2.500 niños y niñas de la Comuna el 25 de Abril a las 9 am.','NA',NULL,NULL,NULL,'',3,327,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(85,'2014-02-20','Gestión de alfabetizadores','Se realizó una reunión con el funcionario para conversar de la posibilidad de un alfabetización que este en el punto de navegación, pero le enviaron estudiantes de 9° y tuvieron dificultades con los usuarios. ','Gestionar el mueble para niños.',NULL,NULL,NULL,'',3,335,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(86,'2014-03-19','Seguimiento kit de inclusión digital','Seguimiento al uso del kit de inclusión digital; registro fotográfico del primer usuario del kit en el Parque Biblioteca de Belén. ','Asistencia al laboratorio con personas sordas','20140313_145404.jpg','20140313_145527.jpg',NULL,'uploads/meeting/meeting_adjunct',4,193,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(87,'2014-03-25','Gestion con aliados','Por sugerencia de Arvi, se realiza reunión con la Mesa de Turismo liderada por el Parque. En esta reunión se expone a los comerciantes de la zona el programa MCI y se responden inquietudes relacionadas con la parte técnica y de conectividad. En este espacio se aprovecha para dar a conocer el nuevo punto de conectividad del parque de Santa Elena','NA',NULL,NULL,NULL,'',3,317,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(88,'2014-02-03','Gestión Estudiantes PP','Reunión con Ruth Estela Ospina, encargada de la JAL de San Cristóbal, para gestionar estudiantes beneficiarios de PP para atender el punto de navegación y los posibles cursos que se abran en los sitios aliados.','Enviarme por correo la base d datos de los estudiantes de PP y del Fondo EPM',NULL,NULL,NULL,'',3,269,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(89,'2014-06-04','Seguimiento y Recolección de Indicadores','Se realizó una reunión de seguimiento con Ana María la funcionaria para verificar el estado y funcionamiento de los equipos del punto de navegación y la recolección de las planillas de registro. ','Ninguno ',NULL,NULL,NULL,'',4,334,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(90,'2014-06-04','Reunión con el Edil Comuna 16','Reunión con el edil de la comuna 16 donde se le contó la función que cumplen los estudiantes de PP en el punto de navegación, Se hizo entrega de 2 chalecos mas y se logro obtener el apoyo de 2 estudiantes de PP para los procesos de formación que se están desarrollando en el Parque Biblioteca de Belén. ','Realizar una charla general con todos los estudiantes de PP que están interesados en prestar su servicio social con el programa. la fecha esta pendiente por confirmar.',NULL,NULL,NULL,'',3,438,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(91,'2014-02-06','Firmas de documentos y solicitud ','Se realizo una reunión con la corregidora para que ella firmara unos  documentos de cartera, en esta reunión la corregidora aprovecho para hacer la solicitud de nuevos equipos para el punto de navegación.','Ninguno',NULL,NULL,NULL,'',2,336,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(92,'2014-02-06','Gestión para investigación','Reunión con Paula Andrea Zorrilla, coordinadora del programa Amigos y Vecinos de Nuevo occidente, para comenzar la investigación sobre arquetipos en la zona y generar alianzas para los procesos de formación.','Ninguno',NULL,NULL,NULL,'',3,272,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(93,'2014-02-07','Entrevista','Encuentro y entrevista con José Fernando Correa, gestor administrativo de Nuevo occidente, quien maneja un grupo juvenil y es un líder clave para la investigación sobre “arquetipos”.','Ninguno',NULL,NULL,NULL,'',3,272,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(94,'2014-02-06','Firma de documentos y solicitud de equipos','Se realizó una reunión con la corregidora para firmar unos documentos de cartera, en esta reunión la corregidora aprovecho para hacer la solicitud de nuevos equipos para el punto de navegación.','Ninguno',NULL,NULL,NULL,'',2,336,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(95,'2014-06-03','Acompañamiento Procesos de Formación','Se realizó acompañamiento al curso de herramientas web 2.0 que esta siendo orientado por Luisa la practicante del programa, debido a varios inconvenientes presentados con la sala de informática la sesión fue cancelada por la gestora de CEDEZO y no nos informo de dicho cambio. Se logro organizar con ella y el coordinador del CEDEZO  un horario fijo para continuar con las clases ya que la sala la habían formateado y organizado con anterioridad. Se llamo a todos los emprendedores y se confirmo continuar con la clase de manera normal la próxima semana. ','Realizar las llamadas a los emprendedores y separar el espacio de capacitación para la comunidad',NULL,NULL,NULL,'',4,174,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(96,'2014-02-04','Gestión de estudiantes de pp','Se realizó una reunión con 4 personas de la JAL para vincular a estudiantes de presupuesto participativo en las actividades del área de apropiación.','Ninguno',NULL,NULL,NULL,'',3,348,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(97,'2014-07-03','Acompañamiento','Visita de seguimiento y acompañamiento a las actividades que la biblioteca esta desarrollando con la comunidad y mirar estrategias de apropiación que se puedan implementar desde el acompañamiento que el programa le esta realizando al Parque Biblioteca. cuentan con 2 grupos de adultos mayores en procesos de formación en alfabetización digital y a los cuales se les va a dar una charla de gobierno en linea. ','Realizar taller de Gobierno en linea con 2 grupos de adultos mayores que se encuentran en formación. ',NULL,NULL,NULL,'',4,192,0,'0000-0