 punto de navegación para reconocer las dinámicas de uso y apropiación de la comunidad y las posibles dificultades en la prestación de servicios.','Enviar formatos de registro de usuario.Hacer el reporte a S@mi de un computador que está fallando.',NULL,NULL,NULL,'',4,270,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(204,'2014-02-27','Empalme','Empalme presentación y reconocimiento del sitio','Seguimiento continuo','aula_rio.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',2,236,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(205,'2014-05-23','Estudiantes por PP','Se realizó reunión con el edil de lsa comuna 16 para conseguir acompañamiento de chicos de PP en los procesos de formación que se estan llevando a cabo en el parque biblioteca de Bélen y unas IE cercanas.','Quedó pendiente la confirmación y listado de los chicos que nos van apoyas a mas tardar el martes 27 de mayo',NULL,NULL,NULL,'',4,438,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(206,'2014-04-07','Gestión procesos de formación con personas e','Se realizo una reunión con una persona encargada de inclusión social y un líder comunitario, para identificar posibles ofertas de cursos con adultos mayores y personas en situación de discapacidad. ','Ninguno',NULL,NULL,NULL,'',3,333,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(207,'2014-05-21','Seguimiento talleres a la comunidad','Reunión de seguimiento a los cursos que se están realizando en el CEDEZO con los emprendedores de la zona. se hablo sobre la mala conexión a internet y se realizó el requerimiento para la revisión de los equipos con la mesa de ayuda. ','Adicional se quedo pendiente hacer la convocatoria para el taller de gobierno en linea con la comunidad y la convocatoria para iniciar con un curso de alfabetización digital con emprendedores para el segundo semestre.',NULL,NULL,NULL,'',4,174,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(208,'2014-04-09','Gestión de procesos de formación','Se realizo una visita a la biblioteca para organizar el taller de gobierno en línea.','Iniciar convocatoria por parte de la biblioteca.',NULL,NULL,NULL,'',2,195,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(209,'2014-03-14','Empalme Palmitas rural','Reunión con la coordinadora rural para comenzar a pensar las actividades y las estrategias de articulación entre el programa y los centros educativos.','Gestionar estudiantes beneficiarios de PP con los líderes de la JAL',NULL,NULL,NULL,'',2,397,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(210,'2014-05-23','Propuesta de charla NSN','Reunión con la rectora profe encargada de la institución para presentarle la propuesta de acompañamiento. Charlas de internet seguro para estudiantes de 3° y 4°: Recomiendan hacer contacto con el vicerrector académico del INEM para que autorice dichas charlas','Contactar al vicerrector académico para programar las charlas',NULL,NULL,NULL,'',4,342,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(211,'2014-04-07','Kit de inclusión','Se realizo una reunión con el coordinador de la IE, para verificar el traslado del kit de inclusión.','Ninguno',NULL,NULL,NULL,'',2,140,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(212,'2014-05-23','seguimiento aula abierta','Reunión con la profesora enlace para darle a conocer la propuesta de intervención; pero se encontraban en una capacitación, por tanto se concreta una próxima reunión.','Se concreta una reunión para la semana siguiente',NULL,NULL,NULL,'',4,330,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(213,'2014-04-09','Procesos de formación','Se realizo una visita a la biblioteca para organizar el taller de gobierno en línea.','Ninguno',NULL,NULL,NULL,'',2,210,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(214,'2014-03-14','Empalme Palmitas rural','Reunión de empalme y articulación con la escuela para analizar la posibilidad de realizar algún proceso de formación en el sitio.','Hacer el reporte a mesa de ayuda de los equipos que están presentando fallas de hardware y de conexión.',NULL,NULL,NULL,'',2,398,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(215,'2014-04-23','Labores de los funcionarios con MDE ciudad intelig','Se realizó una reunión con 8 funcionarios para identificar las funciones que tienen las diferentes secretarías con respecto a los equipos de MDE Ciudad Inteligente; a esta reunión asistieron los siguientes funcionarios: Melida Barrientos(Servicio a la ciudadanía), Patricia(coordinadora casa de justicia), Ana  (profesional de apoyo coordinación casa de justicia), Diana Mesa, Milena Palacio (encargadas jóvenes por la vida), Sandra Milena Vasquez, Olga (coordinadoras Casas de juasticia), Biviana Arango, Cindy Jaramillo (Mde Ciudad Inteligente).','Ninguno',NULL,NULL,NULL,'',2,334,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(216,'2014-04-07','Kit de inclusión','Se realizó una socialización del seguimiento del uso del kit de inclusión digital 2014.Propuesta de capacitación a 20 funcionarios de la UIA para el 7 de mayo de 2:00 a 6:00 pm.Conformación de un equipo interdisciplinario en las 19 instituciones educativas, tres encuentros uno en mayo, otro en agosto y el último en octubre.','Envío del consolidado del seguimiento al kit de inclusión digital.',NULL,NULL,NULL,'',2,451,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(217,'2014-03-14','Empalme ','Reunión de empalme y articulación con el colegio para analizar la posibilidad de realizar algún proceso de formación en el sitio. Al parecer no hay espacio disponible en la sala de sistemas ya que la institución está sobre ofertada.','Encontrar un espacio disponible para convocar a la comunidad.',NULL,NULL,NULL,'',2,276,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(218,'2014-04-23','Reunión','Se realizó una reunión con el señor Francisco (de la comunidad), pues nos ayudaría con un vídeo que se utilizaría en el lanzamiento de los nuevos sitios.','Ninguno',NULL,NULL,NULL,'',2,193,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(219,'2014-03-14','Articulación de procesos','Reunión de articulación y empalme con la gestora de servicios. Hay una muy buena recepción y disposición de la biblioteca para trabajar con el programa.  Se definen algunas temáticas específicas como: Gobierno en Línea con su grupo de informática de nivel III, charlas de navegar sin naufragar para niños y taller de narrativas con jóvenes.','Elaborar un plan de acción posible de ejecutar en la medida de las posibilidades.',NULL,NULL,NULL,'',3,185,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(220,'2014-05-21','seguimiento aula abierta','Se realizó una reunión con las docentes encargadas del aula abierta, para hacer el seguimiento correspondiente al aula abierta, ellas me contaron que hay un grupo de adultos que están validando el bachillerato y están utilizando la sala de sistemas para la clase de tecnología, se planeo con ellas los posibles cursos que están dispuestas a dar y se agendo una charla de Navegar sin naufragar con los estudiantes de quinto grado para el próximo martes.','Charla de NSN',NULL,NULL,NULL,'',4,351,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(221,'2014-04-23','Gestión de vídeo beam','Reunión para solicitar el préstamo del vídeo beam para los cursos de alfabetización en el Parque Biblioteca; solamente pueden prestarlo el viernes, los otros días tienen otras capacitaciones para los emprendedores.','Préstamo del vídeo beam los viernes en la mañana',NULL,NULL,NULL,'',2,176,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(222,'2014-05-21','Propuesta de charla NSN','Se realizó una reunión con la rectora y la coordinadora de la IE, para agendar charlas de Navegar sin Naufragar con los grados sextos y séptimos, ambas se mostraron muy interesadas y dispuestas.','Agendar charlas NSN',NULL,NULL,NULL,'',4,123,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(223,'2014-02-11','Empalme','Visita para empalme, reunión para conocer el patronato, caracterizar de las necesidades de la población que allí se impacta, análisis de la propuesta de intervención ','Se planea una próxima reunión, se propone realizar una convocatoria para realizar cursos de alfabetización digital','Patronato.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',2,214,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(224,'2014-04-22','Gestión de espacio para cursos','Reunión con el rector de la IE Cristobal Colon y el docente de informática para solicitar el espacio de aula abierta y poder dar inicio al curso de alfabetización digital con las personas del club de vida del CAV de Belencito. ','Quedo pendiente hablar con el docente para mirar la disponibilidad de la sala y poder llamar a confirmar a las personas.',NULL,NULL,NULL,'',3,335,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(225,'2014-07-02','Manejo de outlook','Por solicitud de la funcionaria se llevó a cabo un espacio donde se asesoró sobre el manejo de algunas herramientas que ofrece outlook, en vista de la necesidad que representa para ellos tener un buen manejo de las mismas.','Se recuerda el compromiso pactado bajo acta por disponer espacios de capacitación sobre Gobierno en Línea con los funcionarios, dado que la mayoría no conocen el portal de ciudad ni el de Gobierno y por tanto los beneficios que ofrecen.Se habla nuevamente de la necesidad de dinamizar las intervenciones de los chicos y chicas de jóvenes por la vida en los puntos de navegación, a través de algunas herramientas como páginas llamativas para los niños y niñas, con propósitos educativos y de la asesoría en algunos trámites en línea de utilidad para los adultos.',NULL,NULL,NULL,'',4,242,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(226,'2014-04-23','Gestión de procesos de formación','Reunión con las directora del Club de Vida Alegría para contarle cómo va el proceso de consecución de aula de informática para el curso y el taller para los adultos mayores. Se propone realizar el taller en el Telecentro y hacer contacto con el dinamizador para contar con su colaboración. ','Ninguno',NULL,NULL,NULL,'',2,335,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(227,'2014-04-24','Gestión de espacio para cursos','Reunión para gestionar préstamo de aula de informática talleres de GL del Club de Vida de la CAV de Belencito. Se recibe una respuesta positiva y la oferta de horarios disponibles.','Informar sobre los horarios definitivos.',NULL,NULL,NULL,'',3,206,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(228,'2014-05-29','Propuesta de charla NSN','Se realizó una reunión con la profesora Lyda Morales para evaluar el tema de aula abierta, así mismo se agendo una charla de internet seguro para los grados cuartos con las profesoras.','Confirmar charla NSN','Reunion_IE_Monsenor.jpg','Seguimiento_Aula_abierta.jpg',NULL,'uploads/meeting/meeting_adjunct1',4,132,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(229,'2014-05-15','Seguimiento','Reunión con la docente para programar charlas de internet seguro con los estudiantes, ya que el año pasado se desarrolló proceso con la comunidad y la docente considera difícil convocar de nuevo a los padres de familia. ','N',NULL,NULL,NULL,'',4,426,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(230,'2014-02-25','Reunión','Reunión para presentar la practicante de pp que continuara acompañando el sitio para cumplir con sus horas de servicio socia a la comunidad.','Se planea una nueva reunión para hablar de las horas y firmar el convenio','photo4_6-0.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',4,321,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(231,'2014-05-26','Reunión exploratoria de actividades','Esta reunión muy corta se realizó con el animo de programar actividades en la institución. Por cuestión de las dinámicas institucionales y por cierre de periodo escolar no tuvimos mayor receptividad por parte de los encargados y del psicólogo.','Regresar  la institución con propuestas concretas','IMG_20140526_WA0004.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',4,295,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(232,'2014-03-26','Reunión exploratoria de actividades','Se realiza la reunión para conocer al nuevo personal encargado y las actividades que están realizando.Se propone trabajar charlas especificas con las estudiantes ya que el año pasado la intervención contempló alfabetización digital avanzada y las mismas chicas que están este año ya pasaron por este curso.','Regresar con las propuestas concretas de las charlas',NULL,NULL,NULL,'',4,212,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(233,'2014-05-23','Reunión Ruta de intervención','Esta reunión se realizó con el animo de programar las intervenciones que tendrá la practicante que acompañará el punto de navegación. Se deja claro que por cuestiones de contratación este año no podemos tener un acompañamiento constante en el punto como se hizo el año pasado. Es necesario esto por la insistencia del coordinador.El coordinador expone que es ideal que podamos acompañar procesos en la Casa vivero ubicada en Sol de Oriente (nos desplazamos para conocerla) y en Esfuerzos de Paz 1 en dónde realizan procesos de memoria con jóvenes en situación vulnerable.','Se programa reunión para conocer proceso en Esfuerzo de Paz #1','20140523_101651.jpg','20140523_101655.jpg',NULL,'uploads/meeting/meeting_adjunct',4,298,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(234,'2014-05-15','Seguimiento','Reunión con el docente Felipe para realizar intervención con los niños de primaria. El año anterior se realizaron charlas de internet seguro, en esta ocasión se espera trabajar sobre temas de web 2.0. El docente manifiesta que la sala de colegio en la nube ha tenido una conexión muy inestable y con algunas descargas de energía. Se trata de evaluar esta situación con la sede principal y se hace seguimiento telefónico.','N',NULL,NULL,NULL,'',4,434,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(235,'2014-05-27','Reunión Líder Juvenil','En esta reunión se conoce el proceso cultural y social que ha acompañado el funcionario del CAV y que esta liderando la comunidad para sacar a los jóvenes de situaciones de vulnerabilidad social.Ellos tienen una casa como espacio de encuentro para realizar actividades culturales, reuniones de la JAL, tienen poca intervención del Estado y poseen una alta participación de la comunidad.En esta reunión se plantea intervenir la comunidad joven con un taller de narrativas para apoyar el proceso de memoria que de alguna forma lleva el CAV ','Programar los talleres de Narrativas, planearlo para adaptarlo a el objetivo con la comunidad y realizar una caracterización social y técnica del sitio para conectividad.','IMG_20140527_WA0000.jpg','IMG_20140527_WA0003.jpg','IMG_20140527_WA0006.jpg','uploads/meeting/meeting_adjunct',3,298,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(236,'2014-05-15','Seguimiento','Reunión con el coordinador del centro educativo para planear charla de internet seguro. El coordinador se ha mostrado resistente a abrir el aula a la comunidad, se trata de hacer reencuadre sobre este asunto.','N',NULL,NULL,NULL,'',4,431,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(237,'2014-04-22','Programación de actividades','La reunión se realiza con el animo de programar charlas de NSN con grupos conformados por líderes de los grupos que se detecten tengan problemáticas de usos de las redes sociales.La coordinadora Aliria aprovecha la visita para solicitar intervención en su sede (Escuela)Se programa para mayo 6, 2 charlas en la sede principaly para may 7 y 13, dos charlas en la sede escuela.En total asistieron 69 personas.','Regresar en segundo semestre','20140506_114822.jpg','IMG_20140507_WA0019.jpg','IMG_20140507_WA0021.jpg','uploads/meeting/meeting_adjunct',4,424,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(238,'2014-04-30','Procesos de formación','Reunión con la gestora del CEDEZO y coordinador del PIL para dar inicio al curso de herramientas web 2.0 con emprendedores del CEDEZO. en total son 18 personas que están terminando el curso de alfabetización digital con el SENA y quieren continuar con segundo nivel. fecha de inicio 6 de mayo. ','Definir fecha de inicio del curso ',NULL,NULL,NULL,'',2,191,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(239,'2014-04-29','Definición de horarios procesos de formación','Definición de horario para el curso de alfabetización digital; la fundación se encarga de hacer la convocatoria. Pendiente curso en Arasaac en tablets para otros padres.','Ninguno',NULL,NULL,NULL,'',2,215,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(240,'2014-04-23','Programación de actividades','La reunión se realiza con el animo de programar charlas de NSN y Gobierno en línea para intervenir en la institución.Tambien se indaga sobre la posibilidad de abrir un aula abierta en la IE. El rector manifiesta que es temeroso por que ya se han robado implementos de la sala de computo.Se programa y se envía por correo del rector. GEL con grupos de 8° y 9° NSN Con 5°, 6° y 7°  todas para el 3 de Julio','Regresar en segundo semestre.','IMG_2057.JPG','IMG_2070.JPG','IMG_2071.JPG','uploads/meeting/meeting_adjunct',4,301,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(241,'2014-01-22','Planteamiento de actividades','Primer acercamiento del año con los funcionarios para proponer intervención.En esta conversación se manifiesta por parte de Carlos Mario que cualquier proceso de formación con docentes debe hacerse en el vivero del Software imposibilitando la intervención con procesos formativos nuestros.La intervención en este sitio se limitará a la activación y seguimiento del punto de navegación.','Hacer seguimiento al punto de navegación.',NULL,NULL,NULL,'',4,302,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(242,'2014-04-29','Exploración de actividades','Se realiza  una visita a la IE para programar actividades. La docente por cuestiones de la dinámica institucional y por cierre de mitad de año no podía atendernos libremente. Se le pidió que se comunicara con nosotros, se le dejó la tarjeta, pero nunca se contactó.Se realizaron otras visitas mas y la docente no se encontraba en las instalaciones.','Intervenir en el segundo semestre',NULL,NULL,NULL,'',4,303,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(243,'2014-07-03','Cierre de procesos','Se llevó a cabo una reunión con el coordinador del telecentro para evaluar el proceso desarrollado con el curso de Alfabetización digital y Gobierno en línea, además de esto se compartieron todos los contenidos del programa, con el propósito de que él los revisara para generar nuevas propuestas en el siguiente semestre. Willmar se mostró muy interesado en la dotación del kit de inclusión digital y realizó un recuento de las reuniones que se han desarrollado entre el telecentro y tecnoayudas ,también relata la convocatoria hecha de un grupo de personas en situación de discapacidad de la comuna muy interesadas en tener procesos formativos en el telecentro villa del socorro.','Mirar la posibilidad de que uno de los kit de inclusión sea para el telecentro.',NULL,NULL,NULL,'',4,198,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(244,'2014-04-30','Programación de actividades','Reunión de programación de actividades y seguimiento al aula abierta que realizan los sábados por medio de monitores estudiantiles.Se propone al Coordinador Álvaro Villa y profe Nancy conformar un grupo de lideres y monitores de 10 y 11° que reproduzcan la información con un taller de NSN .Se programa para el 22 de Mayo','Intervenir en segundo semestre','IMG_0560.JPG','IMG_0682.JPG','IMG_0684.JPG','uploads/meeting/meeting_adjunct',4,304,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(245,'2014-03-20','Empalme y planeación','Reunión de empalme y planeación con el equipo gestor sobre las actividades que se llevarán a cabo en la institución por parte del programa. Se planeó un posible curso y se gestionaron alfabetizadores como acompañantes del proceso de formación.','Establecer un espacio (día y hora) para el curso.Realizar la inducción a los alfabetizadores.Planear charlas de Navergar sin Naufragar.',NULL,NULL,NULL,'',2,417,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(246,'2014-06-05','Panorama de intervención','Se llevó a acabo al reunión con el rector de la I.E Fe y alegría granizal y con las docentes orientadoras de once y de tecnolgía e informática para generar acuerdos de intervención. El aula Abierta no funciona actualmente por ausencia de personas a cargo de los recursos y espacios de la I.E','Se pactó realizar intervención con los chicos y chicas del grado once, específicamente la charla de Gobierno en línea para estudiantes y con algunos niños y niñas representantes de grados como seto y octavo la charla de Navegar sin naufragar. Esto se llevará a cabo una vez se retomen procesos en el mes de Agosto.',NULL,NULL,NULL,'',3,253,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(247,'2014-06-11','Funcionamiento punto de navegación','La reunión tuvo como objetivo concretar algunos acuerdos en relación al punto de navegación, al papel de los chicos del programa jóvenes por la vida y en relación a la formación de funcionarios. Los acuerdos pudieron concretarse y se explicitaron algunas dinámicas respecto al funcionamiento del punto de navegación. Se evidenció la necesidad de que los funcionarios conozcan el portal de ciudad y el de gobierno, información que arrojó la encuesta aplicada por MDE ','- Capacitación en Outlook para Adriana Ruiz y Auxiliar el 02 de Julio- Capacitación en Gobierno en Línea para funcionarios el o3 de Julio 3 p.m- Escaneo de las planillas o registros de uso  en el punto de navegación dado que no pueden volver a',NULL,NULL,NULL,'',4,242,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(248,'2014-06-11','Identificación de dificultades','Se llevó a cabo una reunión con Willmar osorio para identificar las razones por las cuales  han desertado algunas personas del curso de A.D  y conversar a cerca del proceso. Dentro de las razones expuestas se mencionó la situación de violencia de Aranjuez, dado que dos de las participantes iban desde allí y no pudieron volver; otra de las razones es la comunicación que tienen entre las personas del curso con al practicante y las personas que ven el curso con Willmar y las comparaciones en relación a la celeridad de nuestro curso, en comparación el ofrecido por el telecentro.','Se generaron compromisos para la continuidad de los procesos.   1. Compartir con willmar la oferta educativa del programa con el propósito de generar propuestas de intervención en el telecentro.                      2. Llevar  al equipo la propuesta de disminuir la celeridad del curso dado que se trata de un nivel básico y hay contenidos que quedan flojos lo que produce inseguridad e inconformidad entre los usuarios. ',NULL,NULL,NULL,'',4,198,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(249,'2014-03-31','Reunión exploratoria de actividades','Reunión de primer contacto para proponer actividades puntuales en la IE. El coordinador se muestra receptivo frente a las charlas propuestas. Dice que es mejor que vayamos al comité académico un lunes para que expongamos la propuesta.También se contactó a la psicóloga Sor para hacer seguimiento de Aula abierta y ver cómo podemos apoyarlos.','Confirmar Agenda para asistir al comité',NULL,NULL,NULL,'',4,305,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(250,'2014-05-12','Reunión con comité','Asiste el agente Juan Camilo Parra a esta reunión con 6 Docentes y directivos para realizarle propuesta de intervención y Aula abierta.Los docentes consideran que se debe realizar intervención en la sede escuela Juan Cancio Restrepo es Cl. 45 Nº 31-63 Tel.  2391959 con 4°aSe programa charla de NSN para el 5 de jun 2014','Intervenir en Segundo semestre','20140605_100138.jpg','20140605_100202.jpg','20140605_104648.jpg','uploads/meeting/meeting_adjunct',4,305,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(251,'2014-03-26','Planeación','Reunión de planeación para iniciar el curso de alfabetización digital para la comunidad y las charlas de Navegar sin Naufragar con los grados 6° y 7°.','Realizar la convocatoria para la inscripción al curso.',NULL,NULL,NULL,'',3,417,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(252,'2014-01-21','Seguimiento del punto de información','Se realiza primera visita del año para realizarle seguimiento al punto de navegación. La inspectora manifiesta su inconformidad por que el punto no tiene alguien todo el tiempo que lo esté monitoriando, se queja por que los usuarios son en su mayoría niños y no hay quién los controle, manifiesta que no le gusta ese servicio.','Compromiso de enviar un practicante tan pronto estén disponibles para este servicio.',NULL,NULL,NULL,'',4,307,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(253,'2014-03-18','Seguimiento kit de inclusión','Primer seguimiento al kit de inclusión digital con el fin de establecer estrategias de divulgación y apropiación en la comunidad educativa y aledaña al sitio. Se planteó retomar el grupo del 2012 para realizar un proceso de formación más avanzado.','Convocatoria del grupo para realizar el curso de alfabetización digital y gobierno en línea.  ',NULL,NULL,NULL,'',4,410,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(254,'2014-07-01','Procesos de formación ','Propuesta de charla de internet seguro para los niños usuarios del Telecentro, pendiente fecha y hora. Colaboración para la caracterización de CORAPAS y del Complejo deportivo','Pendiente fecha y hora de la charla',NULL,NULL,NULL,'',4,206,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(255,'2014-03-18','Gestión Estudiantes PP','Encuentro con dos estudiantes beneficiarias de presupesto participativo que tienen interés en hacer parte del programa como facilitadoras de procesos de formación y acompañantes de punto de navegación de la comuna 6','Acta de compromiso con la correspondiente firma de la JAL.',NULL,NULL,NULL,'',3,277,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(256,'2014-07-08','Acompañamiento 2014','Reunión con el técnico en cultura digital Juan Guillermo Ramírez y el coordinador para mirar el acompañamiento a realizar este año.Queda pendiente apenas reiniciemos actividades, programar una charla de Navegar sin Naufragar con el grupo que asiste a la capacitación sobre internet, una charla sobre Gobierno en Línea con el grupo de alfabetizadores que acompaña la biblioteca y realizar un taller de narrativas con el grupo de generación de contenidos de la biblioteca que es conformado por estudiantes de la Institución Educativa Jesús Rey.','Programar las fechas de las actividades pendientes',NULL,NULL,NULL,'',2,268,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(257,'2014-07-03','Seguimiento y procesos de formación ','Reunión de seguimiento y acompañamiento a los procesos que realiza la IE ademas se programo con el con el coordinador  dos charlas de Internet seguro para estudiantes de 4° y 5°. ','Quedo pendiente programar la fecha y la hora de dichas charlas para el segundo semestre. ',NULL,NULL,NULL,'',4,361,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(258,'2014-07-08','Seguimiento kit de inclusión','Acompañamiento al grupo Otras formas de leer y escribir con personas en situación de discapacidad en la sala de informática, en esta sesión el grupo estaba trabajando con algunos dispositivos del kit de inclusión.Beatriz Atehortúa es la persona encargada y el técnico en cultura digital Juan Guillermo Ramírez la apoya en el acompañamiento personalizado a los participantes. Beatriz cuenta que el trabajo se viene desarrollando armónicamente y que recientemente han adquirido dos equipos muy buenos, una maquina para imprimir en braille y un escaner que lee textos en voz alta.','Ninguno',NULL,NULL,NULL,'',4,268,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(259,'2014-07-03','Seguimiento Kit de inclusión','Caracterización kit de inclusión digital, se hace un recorrido por la las dos sedes para conocer las condiciones de accesibilidad y las características de las aulas de informática.La docente está muy interesada en tener el kit de inclusión digital para continuar desarrollando su investigación sobre los beneficios probables a las herramientas de software y hardware','ninguno',NULL,NULL,NULL,'',4,359,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(260,'2014-07-04','Seguimiento a los procesos de formación','Reunión para solicitar el logo de la biblioteca para las constancias de los participantes del taller de gobierno en línea y programar otros talleres mas para el segundo semestre. ','ninguno',NULL,NULL,NULL,'',4,192,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(261,'2014-05-07','Primer contacto con la institución','Previamente se había solicitado esta reunión con los coordinadores del tema de discapacidad.Esta institución entra por KIT por la división que tuvieron de las herramientas desde la sede central y corresponde a Zona 3  la sede fraternidad.Esta institución posee un trabajo juicioso y sistemático respecto a el trabajo con la comunidad educativa en situación de discapacidad. El Kit en el momento de la visita estaba instalado en una sala especializada y destinada únicamente para este propósito, ya tenian un protocolo designado para el uso de estos disositivos.Se sugiere realizar una capacitación con los funcionarios para obtener mejor información del software.','Pendiente cuadrar agendas con los funcionarios del ITM','IMG_20140507_WA0003.jpg','IMG_20140507_WA0008.jpg','IMG_20140507_WA0000.jpg','uploads/meeting/meeting_adjunct',4,308,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(262,'2014-07-03','Seguimiento a los procesos de formación','Reunión para acordar taller de gobierno en línea para jóvenes de la IE en el segundo semestre del año. ','programar las fechas y la hora de dichos talleres ',NULL,NULL,NULL,'',4,358,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(263,'2014-04-01','Reunión exploratoria de actividades','Se realiza reunión para concretar actividades.Primero se habla con la rectora quién esta muy ocupada y me pide que me dirija con el coordinador de la jornada que también está muy ocupado. Se realiza una conversación para que entienda el objetivo de la intervención que ademas viene desde el año pasado por Divertic y se desea continuar el proceso.El coordinador anota todo en su computadora y acordamos una fecha máxima para que nos responda con el cronograma de las actividades.Se esperó el plazo acordado y no tuvimos respuesta. Vía telefónica intente  recuperar el proceso pero fue un intento fallido ya que en la IE tenían una emergencia y no podían atenderme','Intervenir en segundo semestre, si no muestran mayor interés descartala de las IE',NULL,NULL,NULL,'',4,311,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(264,'2014-07-08','Acompañamiento 2014','Reunión con la rectora y la coordinadora académica para programar dos charlas sobre Gobierno en Línea con estudiantes de once grado.','Ninguno',NULL,NULL,NULL,'',2,414,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(265,'2014-04-28','Reunión exploratoria de actividades','Esta reunión se realizó para programar actividades en al IE y indagar sobre la posibilidad de realizar un aula abierta este año de la misma forma que el año pasado.La coordinadora accede a abrirnos un espacio en su agenda la cuál confirmamos vía correo electrónico y que cancela diciendo que ese día hay des-escolarización. No se puede realizar la intervención en la IEEn cuanto a el aula abierta dice que está interesada pero se debe hacer una convocatoria amplia en la IE y que debemos hacerla nosotros.','Intervenir segundo semestre',NULL,NULL,NULL,'',4,448,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(266,'2014-07-08','Programación','Reunión con la coordinadora para programar dos charlas sobre Navegar sin Naufragar y una charla sobre Gobierno en Línea con estudiantes de once en la biblioteca de la Institución.','Realizar procesos de formación sobre alfabetización digital.',NULL,NULL,NULL,'',2,226,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(267,'2014-07-08','Evaluación acompañamiento primer semestre','Reunión con la gestora empresarial Diana Londoño para evaluar el acompañamiento realizado durante este primer semestre.La gestora expone que los temas abordados son pertinentes y que los emprendedores han manifestado satisfacción sobre estos, sobre la facilitadora, manifiesta que fue puntual, comprometida y atenta al proceso individual de los participantes ya que constantemente realizaba asesorías personalizadas.Sugiere que los cursos y talleres se realicen dos veces por semana para que terminen más rápido y se puedan realizar varios en el semestre.','Realizar preinscripción a las personas interesadas.',NULL,NULL,NULL,'',4,167,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(268,'2014-06-17','Apertura de cursos con Víctimas',' Debido a  una solicitud del cav se proyectaba intervenir un grupo de victimas con Alfabetización Digital; sin embargo,  de las personas convocadas sólo llegaron 4 por tanto se pensará en este tipo de intervención para el mes de Agosto. Se planeó la jornada de trámites y se expresó la viabilidad del punto de navegación.  ','Una vez se reinicien los procesos, el cav se compromete a convocar  personas de la comuna que estén interesadas en desarrollar procesos de Alfabetización digital u otro tipo de propuestas acordes a la oferta del programa.',NULL,NULL,NULL,'',3,247,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(269,'2014-07-08','Seguimiento','Visita de seguimiento con la funcionaria del sitio. se recogieron las planillas del mes de julio y se pego la información sobre el mantenimiento de los equipos. quedo pendiente iniciar inscripciones para cursos de alfabetización digital  en el segundo semestre.  ','ninguno',NULL,NULL,NULL,'',4,362,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(270,'2014-07-10','Seguimiento Kit de inclusión','Se realizó visita se seguimiento a las actividades que realiza el parque Biblioteca y el uso que se le esta dando al KIT de inclusión. ademas se hablo sobre los cursos de alfabetización digital que están finalizando con personas de la unidad integral y el préstamo del espacio para el segundo semestre. ','ninguno',NULL,NULL,NULL,'',4,193,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(271,'2014-07-11','Seguimiento a los procesos de formación','Reunión con el Rector  se habla de los procesos de formación que está implementando el programa, además sobre kit de inclusión digital ','ninguno',NULL,NULL,NULL,'',4,340,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(272,'2014-07-11','Seguimiento Kit de inclusión','Reunión para conversar sobre el uso del kit de inclusión y las actividades que vienen desarrollando con las personas en situación de discapacidad.Se robaron una bola de un mouse del kit de inclusión digital ','averiguar si es posible reponer la bola del mouse',NULL,NULL,NULL,'',4,196,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(273,'2014-05-20','Gestion','Reunion con Hammer para hacer seguimiento al proceso de aula abierta y a la sala de MD. Manifiesta que tiene dos grupos con los que ha trabajado desde febrero del presente año en temas de Informatica básica y avanzada.','N',NULL,NULL,NULL,'',3,313,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(274,'2014-07-08','Procesos de formación ','Reunión con la coordinadora del la IE para conversar acerca de Aula abierta, los procesos de formación que estan dictando desde la IE y los posibles procesos que se realizaran el próximo semestre.','ninguno',NULL,NULL,NULL,'',4,290,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(275,'2014-05-21','Seguimiento','Reunion con el docente para hacer seguimiento al programa y para programar actividades con las estudiantes.','N',NULL,NULL,NULL,'',4,299,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(276,'2014-05-21','Seguimiento','Reunion de seguimiento del proceso de aula abierta en la IE. Se define la forma de trabajo con los estudiantes.','N',NULL,NULL,NULL,'',4,310,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(277,'2014-05-29','Programar charlas de NSN','Se realizo una reunión con la profesora Lyda Morales para evaluar el tema de aula abierta, así mismo se agendo una charla de internet seguro para los grados cuartos con las profesora','Confirmación de charlas de NSN',NULL,NULL,NULL,'',4,132,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(278,'2014-07-15','Seguimiento','Entrega de constancias de participación en el taller de Gobierno en Linea. Se reciben los dispositivos del kit de inclusión prestados por el programa (se encuentran en buen estado)','Prestarles nuevamente los dispositivos. Envio de fotos de la entrega de constancias',NULL,NULL,NULL,'',4,192,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(279,'2014-03-19','Seguimiento kit de inclusión','Reunión para el seguimiento del uso y apropiación del kit por parte de la comunidad universitaria. Se evidenció que los estudiantes, trabajadores, docentes y personal administrativo tienen conocimiento de la existencia de estos dispositivos ya que se encuentra instalado a la entrada de la biblioteca, aún así, sólo un docente en situación de discapacidad física es el único que lo ha utilizado. ','Gestionar estudiantes beneficiarios de PP para dinamizar el uso del kit','20140319_142117.jpg','20140319_145936.jpg',NULL,'uploads/meeting/meeting_adjunct',4,411,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(280,'2014-07-08','Seguimiento y capacitación kit de inclusión','Sensibilización sobre el kit de inclusión digital a la docente Patricia Zapata, que es la nueva persona encargada de este. Se reconocieron cada uno de los dispositivos, conectándolos y probando cada uno para conocer mejor su funcionamiento.La docente manifestaba a lo largo de la sensibilización que este kit se podría aprovechar mejor con estudiantes de primaria, por lo tanto queda pendiente presentarle esta sugerencia al rector para hacer el traslado a la otra sede.El kit no tenía en su interior el software de Tecnoayudas, solamente se encontraba hablando con July. Por esta razón queda pendiente indagar con la docente anterior sobre su ubicación.La docente manifiesta interés en trabajar y aprovechar el kit de inclusión y luego del traslado se comprometió a solicitar a Mesa de Ayuda la instalación del software en los portátiles disponibles ya que la sala de informática tiene colegio en la nube.','Trasladar kit de inclusión a la sede de primaria.Solicitud a Mesa de ayuda de instalación del software de tecnoayudas.','Seguimiento_y_capacitacion_kit_de_inclusion_4','Seguimiento_y_capacitacion_kit_de_inclusion_7','Seguimiento_y_capacitacion_kit_de_inclusion_9','uploads/meeting/meeting_adjunct',4,281,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(281,'2014-03-19','Seguimiento kit de inclusión','Seguimiento al uso y apropiación del kit por parte de la comunidad universitaria. Hasta el momento es usado para el servicio de consulta libre para estudiantes con discapacidad. La mayoría de los dispositivos estan en la sede de Boston.','Sistematización del uso del kit.Planeación de actividades concretas para personas en situación de discapacidad.','20140319_155814.jpg','20140319_160238.jpg',NULL,'uploads/meeting/meeting_adjunct',4,412,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(282,'2014-07-09','Cierre procesos primer semestre','Reunión con la coordinadora para exponerle que se pueden continuar procesos a partir de agosto, ella expresa que la comunidad está muy pendiente de poder seguir en estos procesos.','Iniciar nuevos talleres con la comunidad',NULL,NULL,NULL,'',4,402,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(283,'2014-03-20','Seguimiento kit de inclusión','Reunión de seguimiento al uso y apropiación del kit de inclusión por parte de la comunidad educativa y aledaña al sitio. Se encontró que en ocasiones usan el software con primaria y sexto para actividades lúdicas en diferentes materias. Solicitan una jornada de capacitación con Tecnoayudas para los docentes. Requieren instalación de software Jaws, Mekanta y Songr, porque son los programas que requieren las personas de Corpani.','Ninguna.',NULL,NULL,NULL,'',4,275,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(284,'2014-03-20','Seguimiento kit de inclusión','Reunión de seguimiento al uso y apropiación del kit de inclusión. Esta biblioteca se ha destacado por sus propuestas de inclusión y tiene muy buena experiencia en el manejo del kit, principalmente con el programa otras formas de leer y escribir\"\", el cual lo enfocan en el manejo de las TIC, en este espacio las personas con discapacidad aprenden a manejar hardware y software a partir de herramientas básicas, informática básica y juegos accesibles. Aún así, los invidentes requieren la instalación del Jaws, porque no se sienten cómodos con el programa del kit.\"','Sistematizar su experiencia con el uso del kit.',NULL,NULL,NULL,'',4,268,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(285,'2014-03-20','Seguimiento kit de inclusión','Reunión con el docente encargado del kit para conocer los usos y apropiación de éste por parte de la comunidad educativa y aledaña. El docente se encuentra elaborando un programa de experiencias integradoras con niños y padres de familia usando algunas programas del software.','Una vez lista la propuesta, articular acciones con el programa para llevarla a cabo.',NULL,NULL,NULL,'',4,413,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(286,'2014-07-10','Seguimiento kit de inclusión','Acompañamiento a la clase con la docente del aula de apoyo y un grupo de cinco estudiantes de primaria. La herramienta que más usan del kit es el software, para ello tienen dos portátiles en los que trabajan estudiantes de prescolar, primero y segundo grado, los programas que más usan son los juegos y los cuentos. La única dificultad que han tenido es que los portátiles tienen poco volumen y las estudiantes casi no escuchan, este problema se está solucionando con unos parlantes que los directivos asignaron con este fin.El trabajo con el kit se viene realizando durante una hora, tres días a la semana y las estudiantes que lo usan en su mayoría tienen discapacidades  cognitivas: síndrome down, mutismo selectivo, problemas de lenguaje y TDAH (trastorno por deficit de atención con hiperactividad), discapacidad auditiva (implante coclear).En general se ve un buen uso del kit, las estudiantes se ven apropiadas de los juegos, saben como manejarlos correctamente y se nota que los difrutan la docente hace un buen acompañamiento al guiar la selección de los juegos, resolver dudas, aprovechar los componentes de los juegos y cuentos para preguntarles conceptos y hacer relaciones.','Queda pendiente que la docente aproveche más el uso de los dispositivos, sobre todo los teclados y los mouse.','seguimiento_kit_1.JPG','seguimiento_kit_2.JPG','seguimiento_kit_3.JPG','uploads/meeting/meeting_adjunct',4,225,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(287,'2014-07-10','Cierre de procesos primer semestre','Reunión con el rector para tener continuidad con los procesos de formación con la comunidad en general y la facilitadora de PP Vanessa Taborda a partir de agosto.','Ninguno',NULL,NULL,NULL,'',4,225,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(288,'2014-03-21','Seguimiento kit de inclusión','Reunión con la coordinadora del sitio para conocer el uso del kit por parte de la comunidad educativa. Se evidenció un muy buen manejo y proceso de apropiación de estas herramientas por parte de los docentes y estudiantes, siendo un sitio modelo\"\" a la hora de utilizarlas. Están en una fase de caracterización de saberes previos de los estudiantes utilizando los implementos del kit. El grupo de la docente del taller de hábitos de trabajo es el que mas uso tiene del kit. Utilizan mucho los pulsadores, el soporte, los mouse trackball, software de imágenes y pictogramas, los programas de NEE,  juegos de aprendizaje y el software de reconocimiento facial.\"','Sistematizar sus experiencias para dar a conocer el uso óptimo del kit a diferentes instituciones.','20140321_101136.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',4,444,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(289,'2014-07-10','Actividades de 2014','Reunión con el rector y con la bibliotecaria para mirar el acompañamiento a realizar durante el presente año.','En la primera parte del semestre se realizaran dos charlas sobre gobierno en línea con estudiantes de once grado y durante el segundo semestre se realizará un taller sobre narrativas con un docente y un grupo de la institución educativa que trabaja sobre temas audiovisuales.',NULL,NULL,NULL,'',2,229,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(290,'2014-05-21','Seguimiento','Reunion para definir algunas actividades con las estudiantes durante el segundo semestre.','N',NULL,NULL,NULL,'',4,309,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(291,'2014-05-21','Seguimiento','Seguimiento al aula abierta de la IE, asiste Juan Camilo Perez para hablar con la docente sobre las posibles actividades a realizar en el segundo semestre del año.','N',NULL,NULL,NULL,'',4,325,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(292,'2014-05-28','Seguimiento','La sala ha venido presentando varios inconvenientes este año, se hace seguimiento telefónico a través de Sami, dicen que hay una interrupción del servicio por las constantes tormentas de la zona. Se le explica esta version al docente confirmando que lo van a solucionar lo mas rápido posible.','N',NULL,NULL,NULL,'',4,434,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(293,'2014-03-21','Seguimiento kit de inclusión','Reunión de seguimiento al kit de inclusión de la biblioteca para conocer su nivel de uso y apropiación por parte de la comunidad. Se evidención que el kit se presta bajo supervisión. Los teclados y mouse son los mas usados. Personas de baja visión utilizan la lupa y el software narrador. A veces utilizan los equipos para entretenimiento y asuntos de trabajo. El teclado multicolor fue utilizado con niños para lecto-escritura. Requieren otra capacitación sobre el software y el trato con las personas en situación de discapacidad con Tecnoayudas. ','Gestionar una nueva capacitación con Tecnoayudas.',NULL,NULL,NULL,'',4,453,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(294,'2014-07-15','Presentación de la agente dinamizadora y gesti','En esta reunión se presenta la agente dinamizadora, se recolectan los datos del nuevo rector que asume el cargo en esta institución educativa, se gestiona el espacio para dictar una charla planeada con la antigua rectora. ','Para el segundo semestre se realizarán charlas con los grados décimo y once de la institución educativa. ','IE_Luis_Lopez_de_Mesa_Empalme_Comuna_7_Julio.',NULL,NULL,'uploads/meeting/meeting_adjunct',2,418,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(295,'2014-05-28','Seguimiento','Reunion con Rosa Lopez para hacer seguimiento al kit de inclusion.','N',NULL,NULL,NULL,'',4,290,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(296,'2014-03-27','Empalme ','Reunión para comenzar a planificar los procesos de articulación entre la institución y el programa, teniendo en cuenta que Nuevo Occidente es un sector para priorizar. Hay buena disposición de trabajo, pero muy pocos espacios disponibles en la sala de sistemas, lo que dificultaría el desarrollo de procesos de formación.','Hacer una convocatoria pública para un curso de alfabetización digital.',NULL,NULL,NULL,'',2,405,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(297,'2014-05-28','Programar charlas de NSN','Se visito el centro educativo y se reprogramó la charla de navegar sin naufragar para la semana siguiente.','Programar taller de manejo del tablero digital',NULL,NULL,NULL,'',4,139,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(298,'2014-06-03','Seguimiento','Reunión con la docente para acordar taller Conéctate con ellos, la docente se muestra receptiva e informa que en el centro educativo están haciendo aula abierta con el Pascual Bravo los sábados, se analiza la posibilidad de que apoyemos esta actividad durante estos dos meses.','Ninguno',NULL,NULL,NULL,'',4,432,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(299,'2014-05-27','Programar taller de GEL jóvenes','Reunión con la rectora y la profe enlace de la institución para presentarle la propuesta de acompañamiento. Se acuerda el taller de gobierno en línea para jóvenes, estudiantes de 10° y 11°','Envío de oferta de intervención y propuesta de fechas de los talleres de gobierno en línea para estudiantes',NULL,NULL,NULL,'',4,330,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(301,'2014-05-28','Seguimiento aula abierta','Reunión para presentar la propuesta de acompañamiento por parte del programa. Se ofrece el taller de GL para jóvenes de 10° y 11°. Solicitan una charla de tablero digital y manejo de tablet para docentes; se acuerda que solo para 5 docentes.Continúan con el aula abierta, el viernes 30 de mayo se gradúan 10 padres de familia','Se le envían opalinas para la impresión de los certificados.',NULL,NULL,NULL,'',4,340,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(302,'2014-05-28','Seguimiento kit de inclusión','Seguimiento al kit de inclusión digital. Tienen un equipo con los dispotivos conectados, no lo ponen en la aula de informática, por el tipo de población que acude allí (porque son inquietos).Actividad con personas en situación de discapacidad dos veces a la semana miércoles de 10: 00 a 12:00 y jueves de 2:00 a 4:00 pm (alfabetización digital)','Continuar con el acompañamiento',NULL,NULL,NULL,'',4,196,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(303,'2014-05-27','Seguimiento aula abierta','Se realizo una reunión con el coordinador para hablar del aula abierta, quien se noto muy interesado en volver a desarrollar aula abierta, sin embargo dice que se debe buscar un estudiante de pp que colabore con este proceso, por otro lado se pretende agendar charlas Navegar sin Naufragar para los grados cuartos y quintos.','Se tiene agendada otra reunión para hacer el cronograma de actividades.',NULL,NULL,NULL,'',4,357,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(304,'2014-05-22','Solución de situación puntual','Con el apoyo de la Practicante Lesly pudimos solucionar una problemática con unas chicas que no obedece a los funcionarios del sitio y bebían líquidos sobre los PC, de hecho una de las chicas de la rabia tiró un café que afortunadamente no cayó sobre el PC.La practicante queda con la directriz de realizar un trabajo educativo con la cantidad de niños que asisten insistiendo en la apropiación de la información que apoye a punto y que los niños en dado momento pueden ayudar a otros usuarios.','Hacer seguimiento a las chicas del inconveniente',NULL,NULL,NULL,'',4,438,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(305,'2014-05-29','Seguimiento aula abierta','se realizo una reunión con el docente encargado para hablar acerca de aula abierta.','Continuar con el acompañamiento','Seguimiento.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',4,134,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(306,'2014-05-29','Programar charlas de NSN','Reunión para agendar charlas para los niños.','Confirmación de fechas',NULL,NULL,NULL,'',4,195,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(307,'2014-05-29','Seguimiento kit de inclusión','Se realizó seguimiento al kit de inclusión.','Programar sensibilización kit de inclusión digital',NULL,NULL,NULL,'',4,140,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(308,'2014-05-29','Presentación de la agente dinamizadora y gesti','El Agente Dinamizador Alejandro Marín presenta a la nueva Agente Mónica Castañeda, se realizan preguntas sobre los procesos de formación que se han llevado a cabo durante el año, ella comenta que el Aula Abierta ha estado suspendida y que no se han realizado más capacitaciones en la sala de Medellín Digital, Socorro Vergara la rectora informa que entregará el cargo puesto que se va a jubilar y deja encargada a la coordinadora de llevar a cabo los procesos.','Se planean talleres de gobierno en línea con los grados décimo y once de la institución educativa para el mes de julio.Se recomienda llamar a la coordinadora para concertar los espacios y separar las horas de trabajo puesto que para estas fechas asumirá su cargo el nuevo Rector.',NULL,NULL,NULL,'',2,418,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(309,'2014-05-29','Programar charlas de NSN','Reunión para agendar charlas para los niños.','Confirmación de la charla',NULL,NULL,NULL,'',4,210,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(310,'2014-06-03','Seguimiento Kit','Reunión con la docente para acordar charla de internet seguro con los chicos. También se hace seguimiento al kit de inclusión digital. El segundo kit está casi listo y adecuado para la comunidad y será abierto al uso en las mañanas.','N',NULL,NULL,NULL,'',4,425,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(311,'2014-04-22','Reunión exploratoria de actividades','Esta IE ha sido muy poco receptiva frente a nuestro trabajo este año se realizará el último esfuerzo para trabajar allí.Se realiza la visita para programar actividades y el coordinador no se ocupa de nosotros la rectora no se encontraba, decidimos buscar a la docente Ángela Londoño quién ha demostrado tener mayor disponibilidad de trabajo. Nos informan que ella ahora trabaja en una de las sedes. Nos dirigimos allí para conversar con ella, está incapacitada, intentamos por mail y celular y nunca fue posible la comunicación con ella.','Intervenir en el segundo semestre',NULL,NULL,NULL,'',4,315,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(312,'2014-06-03','Seguimiento','El coordinador informa que la convocatoria para iniciar el curso, aún no es suficiente que se debe extender una semana más. Se realiza la gestión del espacio en la biblioteca. ','N',NULL,NULL,NULL,'',4,173,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(313,'2014-05-27','Reunión exploratoria de actividades','En esta reunión se socializa con el profesor recién encargado del proyecto de informática los objetivos que persigue el programa y cómo podemos apoyarlos en la IE.Temas:Aula abierta. El docente está dispuesto a realizar un espacio con los padres de familia de la comunidad educativa, consultando previamente con la rectora quien recalca que el docente debe saber que es a mérito propio y no es remunerable.Programamos una charla con jóvenes lideres y que reproducirán la información en la IE sobre Gobierno en línea para el 9 de Julio de 10.30 a 12 m','Concretar el Aula Abierta.',NULL,NULL,NULL,'',4,316,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(314,'2014-02-20','Contacto inicial para actividades','Este sitio ingresa este año cómo uno de los sitios nuevos conectados en la ciudad. En este parque se instalará punto de navegación con 4 equipos y cómo sitio público en la plazoleta beneficiando a la instituciones cercanas y a la comunidad de esta zona de la ciudad.Se realiza la primera reunión en diciembre del año pasado y se continúa este año para realizar actividades que promuevan y divulguen los beneficios de este servicio que tendrá el parque.Se abordó el tema de realizar un trabajo de promoción previo a la instalación del servicio entre ellos socializar la propuesta con los líderes zonales.','Se programa reunión con líderes para el 24 de febrero','IMG_201411220_WA0000.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',2,318,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(315,'2014-02-24','Reunión con lideres','La reunión se realiza con los líderes de la comunidad impactada por el proyecto a quienes se socializa la propuesta del punto de navegación y del wifi libre con que contarán próximamente.Esta reunión es acompañada por Biviana Arango quién de forma detallada les explica a los asistentes el rango de operación técnica del servicio y las ventajas que tienen con esta conexión.Se les comenta las posibles rutas de intervención que podemos tener tales cómo cursos de alfabetización digital, charlas de manejo de celulares entre otros.Se les pide el especial favor del registro de uso de los equipos, de ayudarnos con el cuidado de los equipos y que la comunidad le de el mayor beneficio.','Mantenerlos al tanto a través de la comunicadora de la llegada de los equipos. ',NULL,NULL,NULL,'',3,318,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(316,'2014-03-21','Gestion con aliadas','Reunión con el comité de sostenibilidad de la cámara de comercio de Arvi con empresarios de santa Elena, para presentar el programa a los comerciantes de la zona.','Nueva reunión con los practicantes.',NULL,NULL,NULL,'',3,317,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(317,'2014-02-26','Informe PC con internet','Se informa a los funcionarios y a la comunidad que el servicio de punto de navegación y wifi libre esta habilitado para el disfrute ciudadano.Se hace acompañamiento en la prueba de la velocidad y de la usabilidad técnica de la herramienta.','Continuar con las pruebas para verificar que funcione bien',NULL,NULL,NULL,'',4,318,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(318,'2014-04-08','Presentación y empalme ','Presentación de la nueva agente dinamizadora y empalme de los procesos que se vienen realizando en la institución educativa, se desarrolla la presentación del programa a los asistentes del curso por parte de la agente dinamizadora Rosa Pérez, además de la preinscripción de los asistentes a este. ','Acompañar el aula abierta una mes al mes.Enviar la totalidad de los contenidos del curso.Enviar las fotos tomadas ese día.','IE_Fe_y_Alegria_Villa_de_la_Candelaria_Alfabe',NULL,NULL,'uploads/meeting/meeting_adjunct',2,409,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(319,'2014-04-29','Reunión de seguimiento y planificación de ac','Se visita la sede para verificar el uso de los equipos y verificar un AP que está por fuera de unas láminas y corre el peligro de ser hurtado, se solicita por medio escrito y presencial hacer la gestión para poner el AP encima de las láminas.Por otro lado, este mes se ha acompañado el sitio con la presencia de la practicante Lesly Amparo ayudando a los usuarios con creación de correos electrónicos y trámites en línea.','Seguimiento a la gestión de la ubicación del AP',NULL,NULL,NULL,'',4,318,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(320,'2014-07-10','Planeación Charla GEL en la institución','Se programó una charla con los grados 11° sobre Gobierno en Línea, donde se tocarían temas como ofertas de estudio y empleo, páginas de universidades y demás opciones para cuando los y las estudiantes terminen el colegio se orienten de mejor manera.','La charla se realizará el lunes 14 de julio a las 7 am.',NULL,NULL,NULL,'',4,265,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(321,'2014-07-04','Planteamiento de actividades','En esta reunión se tocó varios temas:1. Percepción del servicio y comentarios de los usuarios. La funcionaria manifiesta que le han notificado que aveces el servicio deja de funcionar, se le aconseja que identifique las horas y en que equipos se conecta el usuario que no le sirve la señal.2. Palneación de aula abierta. Como tal no tienen lugar para realizarla, se le pide que gestione una en la facultad de medicina o en una entidad aliada para trabajar con la población adulto mayor que atienden.3 identificar unos chicos para darles una charla de NSN.4. Capacitación de los estudiantes de Jóvenes por la vida para que trabajen trámites en línea en el punto.','Estar pendientes de esta gestión',NULL,NULL,NULL,'',4,318,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(322,'2014-07-11','Cierre de procesos primer semestre','Reunión con el equipo de coordinación de la Unidad Permanente de Justicia para mirar cuando se podría terminar el taller de herramientas web 2.0 que se estaba realizando, las dos sesiones que faltan se darán en agosto.En esta también se mencionó que los equipos y muebles fueron retirados para ser repotenciados y para actualizar la imagen corporativa del programa.Otro asunto a tratar fue la capacitación a otros funcionarios de la UPJ, se llegó al acuerdo que esta sería apartir del mes de agosto que es cuando reiniciamos procesos.','Terminar el taller de herramientas web 2.0 con el equipo de coordinación.Continuar con el acompañamiento al punto de navegación.Realizar procesos de formación en TIC con otros funcionarios de la UPJ.',NULL,NULL,NULL,'',4,288,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(323,'2014-01-28','Reunión de planeación de actividades','Se realizó una reunión con la coordinadora de la Casa de la Cultura para mirar de qué manera el programa y la Casa de la Cultura iban a continuar este año. ','Quedó la tarea de programar una nueva reunión cuando se sepan las propuestas de formación del programa.',NULL,NULL,NULL,'',3,244,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(324,'2014-01-30','Seguimiento Kit de Inclusión','Se realizó una reunión para planear las actividades que se realizaran en la IE involucrando el Kit de inclusión. Se llegó a la conclusión de que la prioridad es que los docentes se familiaricen con el Kit.','Se diseñarán por parte de la Institución unos carteles que contengan información sobre el Kit. Estos carteles serán expuestos para que las personas conozcan del Kit.',NULL,NULL,NULL,'',4,160,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(325,'2014-01-23','Reunión de planeación de actividades','Se realizó una reunión para planear las actividades que se realizarían en conjunto desde la biblioteca y El Programa.','Se queda pendiente realizar una convocatoria para realizar un taller de GEL',NULL,NULL,NULL,'',4,179,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(326,'2014-01-30','Gestión con aliados','A esta reunión llegaron los tres agentes de la zona con el fin de gestionar la base de datos de los estudiantes de Presupuesto Participativo y Fondo EPM, los cuales harán su labor social en los sitios que acompaña el programa. Se presenta al líder comunitario el programa y los procesos que se vienen gestando en la zona 2','El líder comunitario deberá contactar los estudiantes beneficiarios de la base de datos que este tiene y entregar esta información.Deberá enviar al correo electronico los datos de los interesados y las actas de compromiso que estos deben asumir para con los sitios en los que cumplirán la labor social.',NULL,NULL,NULL,'',3,279,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(327,'2014-02-03','Presentación del Programa y de los funcionarios','Se realizó una reunión de presentación donde se dio a conocer el programa a el inspector y a el secretario de la Inspección.','Se quedó con el compromiso de realizar una reunión con todos y todas las funcionarias de la Inspección para que conozcan el programa Medellín Ciudad Inteligente y puedan entenderse de mejor manera con el uso del punto de navegación.',NULL,NULL,NULL,'',2,255,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(328,'2014-01-21','Reunión de planeación de actividades','Se realizó una reunión con la coordinadora de servicios al público, para mirar que actividades podemos realizar en la biblioteca con el Programa.','Se decidió realizar una convocatoria para realizar un taller de GEL, apenas estén listos los contenidos del taller.',NULL,NULL,NULL,'',4,240,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(329,'2014-07-02','Gestion','Cierre del proceso realizado el presente año en la IE con el rector. Se evalúan logros y dificultades para continuar la intervención en futuros contratos.','N',NULL,NULL,NULL,'',3,290,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(330,'2014-07-30','Planeación','El objetivo de la reunión fue el de mirar los objetivos y compromisos desde los dos actores inmersos en el proceso, puesto que desde el Parque Biblioteca se planteó realizar cursos de alfabetización digital, la discusión gira entorno a la participación del programa en los procesos de formación para el sitio. Una de las conclusiones a las que se llega es, el Parque Biblioteca asumirá el proceso de Alfabetización en su parte inicial y el programa dictará el segundo nivel. ','Entregar contenidos de los procesos de formación, en especial Alfabetización Digital.Generar los espacios de capacitación a la comunidad. ',NULL,NULL,NULL,'',4,183,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(331,'2014-02-27','Reunión de planeación de actividades','Se realizó una reunión de planeación de actividades en conjunto con la Biblioteca, entre esas actividades está la realización de un taller de Fotografía.','Se quedó con el compromiso de pasarle la propuesta de taller a la Biblioteca para de allí decidir cómo realizar la convocatoria.',NULL,NULL,NULL,'',4,180,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(332,'2014-02-12','Reunión de planeación de actividades','Se realizó una reunión de seguimiento del Kit y  con base a la reunión del mes anterior se realizó una actividad de divulgación del Kit dentro de la Institución.','Las docentes encargadas del Kit dentro de la IE se comprometen a brindar mayor acompañamiento a los demás docentes que están intentando a el uso del Kit.',NULL,NULL,NULL,'',4,160,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(333,'2014-01-30','Planeación','Planeación de las actividades que se llevaran a cabo durante el año, los participantes de la reunión por parte de la Biblioteca desean realizar talleres de Navegar sin Naufragar para padres de familia y algunos procesos de formación.','Entregar por parte del programa los contenidos adaptados del taller navegar sin naufragar para padres en los próximos días. Los funcionarios de la Biblioteca realizarán la convocatoria y ejecutaran el taller con los contenidos entregados por el programa. ',NULL,NULL,NULL,'',4,184,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(334,'2014-02-12','Reunión de Empalme','Se realizó una reunión de empalme con la agente que acompañará el CEDEZO, también de pretende realizar una convocatoria con los empresarios vinculados al CEDEZO para que asistan a los cursos del Programa.','La agente que acompaña el CEDEZO se compromete a enviar los contenidos y las fechas para realizar las convocatorias para los cursos.',NULL,NULL,NULL,'',2,166,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(335,'2014-07-02','Seguimiento','Se acuerda con la docente hacer cierre del proceso con los padres y madres de los niños. ','N',NULL,NULL,NULL,'',4,447,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(336,'2014-01-31','Empalme','Se retoman las actividades y se evalúan las actividades realizadas el año anterior, también se plantean algunas acciones que tendrán lugar en el primer semestre del año, se propone a partir de esto abrir un aula abierta para la comunidad, por esto se inician la programación para esto.','Iniciar el proceso de convocatoria para el aula abierta.La docente deberá gestionar el espacio de tiempo y físico para llevar a cabo el proceso de formación. ',NULL,NULL,NULL,'',2,409,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(337,'2014-02-05','Reunión de planeación de actividades','Se realizó una reunión con el docente Libardo Múnera y el Rector John Garavito con el motivo de mirar de que forma se iba a continuar el trabajo este año. El rector presentó una serie de negativas frente al trabajo con el programa. Al finalizar la reunión se quedó con el compromiso de que la IE iba a realizar una búsqueda de un estudiante que acompañara al docente Libardo en los cursos hacia la comunidad.','Realizar una búsqueda de un estudiante practicante que acompañe los procesos hacia la comunidad.',NULL,NULL,NULL,'',4,256,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(338,'2014-07-11','Cierre de procesos primer semestre','Reunión con la persona de contacto en la Unidad Municipal de Atención y Reparación a Víctimas, para mirar las sensibilizaciones realizadas mensualmente en los CAV y la preinscripción de las personas interesadas en los procesos de formación e TIC.Alcira comenta que los coordinadores de los CAV han manifestado que estas se han desarrollado con normalidad y éxito y que las personas están pendientes de los cursos y talleres.','Realizar una reunión de empalme para comenzar procesos de formación con las personas preinscritas.',NULL,NULL,NULL,'',4,288,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(339,'2014-03-28','Gestión de procesos','Reunión para gestionar el espacio de formación para la comunidad en la institución. Se acordó realizar un curso de alfabetización digital enfatizando principalmente en Internet, correo y trámites en línea para adultos mayores. Se tendrá el acompañamiento de algunas estudiantes alfabetizadoras durante el proceso.','Realizar la convocatoria a la comunidad.Realizar la capacitación a las estudiantes alfabetizadoras que acompañarán el curso.',NULL,NULL,NULL,'',3,410,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(340,'2014-02-04','Reunión de planeación de actividades','Se realizó una reunión con la docente Marcela Zapata para planear las actividades que se realizarían este año. La docente era quien coordinaba el proceso de Aula Abierta en la IE, pero hace unos meses dejó de hacerlo debido a que adquirió otras responsabilidades y la IE le descargó todas las responsabilidades de  ese proceso en ella, por lo que la docente decidió no continuar con el proceso.','Se menciona la posibilidad de que varios egresados de la IE retomen el Aula Abierta, la docente queda con la labor de gestionar las posibilidades.',NULL,NULL,NULL,'',4,239,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(341,'2014-07-11','Cierre de procesos primer semestre','Reunión con Erika Meléndez y otra compañera del programa de responsabilidad social educativa de   la secretaría de gobierno para mirar el acompañamiento realizado en el primer semestre.Algunos de los chicos y chicas del Fondo EPM y PP acompañaron puntos de navegación, se espera que el otro semestre se inicien los procesos de formación ya que esta actividad los motiva mucho más.','Retomar contacto con los chicos y chicas del programa para iniciar procesos de formación.',NULL,NULL,NULL,'',4,288,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(342,'2014-03-12','Reunión de planeación de actividades','Se realizó una reunión con la docente Marcela Zapata, la docente solicita apoyo del programa debido a que se está organizando un colectivo de medios en la IE, y ella necesita apoyo para la construcción de la página web de la IE.','Se planea realizar una reunión con los estudiantes interesados en el colectivo de medios.',NULL,NULL,NULL,'',4,239,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(343,'2014-03-13','Aula abierta','Se realizó una reunión con al rectora de la IE, para mirar las estrategias que se llevarán en conjunto con el programa, especialmente el tema de Aula Abierta.','Se realizará una convocatoria con padres y madres de familia para iniciar el proceso de Aula abierta de este año. ',NULL,NULL,NULL,'',4,149,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(344,'2014-03-11','Presentación del programa y planeación','Se realizó la presentación del programa y se identificaron posibles alianzas con el Telecentro, inicialmente se pretende realizar un acercamiento con formación hacia las mujeres que hacen parte del Telecentro, sin embargo es necesario mirar los horarios de disponibilidad de estas personas ya que poseen varias ocupaciones. ','Se realizará una encuesta diagnostico sobre la cual se pretenden proponer actividades para el Telecentro.',NULL,NULL,NULL,'',2,199,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(345,'2014-01-31','Empalme','Se evalúan las actividades realizadas el año pasado y plantean los procesos que se gestarán este año. El docente continuará con el Aula Abierta acompañada por el programa, además se plantea generar un espacio con estudiantes con el fin de construir el periódico digital de la institución educativa','Realizar la convocatoria y la inscripción de las personas para iniciar el curso.Realizar una nueva reunión para concretar el periódico digital.',NULL,NULL,NULL,'',2,410,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(346,'2014-03-06','Reunión de planeación de actividades','Se realizó una reunión con la persona contacto de la IE Adriana Castrillon con el fin de planear las actividades que se realizaran este año.Se planea seguir realizando actividades periódicas que apoyen el uso del Kit en la IE.','Se realizará una charla de Internet Seguro con algunos docentes de la IE y Estudiantes.',NULL,NULL,NULL,'',4,157,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(347,'2014-03-21','Seguimiento Kit de Inclusión','Se realizó visita de seguimiento al Kit de inclusión digital. El Kit es usado por la IE, sin embargo aún algunos docentes y estudiantes no saben de él.','Hacer más divulgación del Kit.',NULL,NULL,NULL,'',4,160,0,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(352,'2014-11-18','Gestión de procesos de formación','Se realizó una reunión con las docentes para programar los procesos de formación para el próximo año.','Programar una nueva reunión el próximo año.','INEM_Guillermo_Echavarria_Reunion.JPG',NULL,NULL,'uploads/meeting/meeting_adjunct',4,342,15,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(353,'2014-11-18','Gestión Aula Abierta','Se realizó una reunión con el coordinador de la IE para identificar la posibilidad de iniciar nuevamente con el aula abierta en la IE, se obtuvo una buena respuesta, la idea es apoyarnos de estudiantes de pp y/o alfabetizadores que dicten los procesos de formación a la comunidad.','Agendar reunión próximo año para hacer el cronograma de los procesos de formación.','IE_Monsenor_Victor_Wiedemann_Reunion.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',4,132,15,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(354,'2014-11-19','Planeacion de actividades 2015','Se planeó con la coordinación académica de la institución educativa procesos de formación con padres de familia y estudiantes de grados cuarto, quinto, décimo, undécimo.','26 de febrero: Charla de Navegar sin Naufragar con Padres de familia 6:00 pm\r\n2 de marzo:  Charla de Gobierno en línea con grados 10 y 11 11:00 am\r\n2 de marzo:   Charla de Navegar sin Naufragar  con grados 4 y 5   1:00 pm\r\n','20141119_094947.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',4,347,38,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(355,'2014-11-18','Reunión de seguimiento y plantación ','Se realizó reunión de seguimiento a las actividades que se planearon con los emprendedores que finalizaron el taller de mercadeo digital','entrega y firma de certificados \r\nprogramar taller de pagina web con emprendedores','2014_11_18_16_27_16.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',4,176,14,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(356,'2014-11-19','Reunión de planeación ','Reunión de seguimiento con Daniel Rozo Coordinador se trataron temas sobre la reserva y préstamo de la sala. adicional sobre los procesos de formación que realiza el parque biblioteca.','Se quedo pendiente la reunión para el próximo lunes 24 de noviembre para mirar las estrategias de acompañamiento del próximo año. ','2014_11_19_16_18_50.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',4,193,14,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(358,'2014-11-18','Seguimiento Punto de navegación','Se realizo una corta visita a la casa de gobierno para identificar el estado de los equipos, se encontró que los equipos estaban apagados porque no estaban ingresando a internet, se llamo a la líder de servicio quien es la persona que tiene el ticket, ella quedo de enviarlo para que desde el programa se le haga seguimiento.','Hacer seguimiento al arreglo de los equipos.','Casa_de_Gobierno_SADEP_Seguimiento_Punto_de_navegacion.jpg','','','uploads/meeting/meeting_adjunct',4,333,15,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(359,'2014-11-21','Reunion INDETVO','Reunión con el grupo audiovisual de INDETVO para iniciar acompañamiento a procesos audiovisuales duarante el fin de año y 2015 y proramar ruta de trabajo y actividades concretas.','- Reunion con proyecto audiovisual para Teleantioquia\r\n- Inicio de Taller de Narrativas con actividades específicas para producción de audiovisuales para televisión\r\n- Entrega de Tareas Lunes 24 a los correos de los estudiantes','20141121_111520.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',4,346,38,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(360,'2014-11-18','Seguimiento al sitio','Reunión con el dinamizador del telecentro donde se programo las actividades de formación con el grupo de adultos mayores. se realizara una sesión de dispositivos movil y se dara inicio al taller de gobierno en linea con la comunidad. quedo pendiente programar una reunión con las personas en situación de discapacidad.','se realizara una sesión de dispositivos movil y se dara inicio al taller de gobierno en linea con la comunidad. quedo pendiente programar una reunión con las personas en situación de discapacidad.','Telecentro_altavista_reunion_de_seguimiento.jpg','Telecentro_altavista_reunion_de_seguimiento_2.jpg',NULL,'uploads/meeting/meeting_adjunct',4,209,12,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(361,'2014-11-18','Seguimiento al sitio ','Se realizó acompañamiento a la conexión del sitio y se hablo con una de las usuarias que frecuentan conectarse al internet del parque de altavista','.','Parque_de_altavista_seguimiento_al_sitio.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',4,353,12,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(362,'2014-11-18','Seguimiento al sitio ','Acompañamiento al punto de navegación. el servicio estaba suspendido','.','Casa_de_gobierno_altavista_seguimiento_al_punto_de_navegacion.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',4,332,12,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(364,'2014-11-27','Reunion de planeacion de actividades 2015','Reunión para programar actividades y procesos de formación en el 2015, en la institución educativa existe aula abierta y se aceptó la posibilidad de iniciar procesos de formación con padres de familia\r\n','- Reunión en enero para programar inicio de procesos\r\n- Asesoria en dispositivos móviles\r\n- procesos en alfabetización digital','20141127_103416.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',4,127,38,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(365,'2014-12-02','Reunión de Planeación 2015','Reunión de planificación de Trabajo conjunto con la funcionaria Olga Agudelo para programar actividades conjuntas durante el año 2015 en procesos de formación, sensibilizaciones y estrategias conjuntas.','- Sensibilización Kit de inclusión digital con funcionarios del vivero\r\n- Taller con docentes de tecnología en Navegar sin Naufragar y entrega de contenidos.\r\n- Charlas de Navegar sin Naufragar con estudiantes de grados 9\r\n- Charlas de Gobierno en Linea con estudiantes de grados 10 y 11 en los dos semestres del año\r\n- Caracterización conjunta de procesos TIC\r\n- Sensibilización con funcionarios de la UAI, docentes de apoyo y psicólogos de instituciones educativas en el tema de inclusión digital','IMG_1231.JPG',NULL,NULL,'uploads/meeting/meeting_adjunct',3,451,38,'0000-00-00 00:00:00','2015-05-22 15:29:00'),(366,'2014-12-03','Reunión de seguimiento y plantación ','Se realizó una reunión con la presidenta de la JAC y encargada del Telecentro para gestionar procesos de formación con adultos mayores. sobre manejo de dispositivos moviles y narrativas digitales para el proximo año','Programar actividades de formación para e próximo año ','CAM00028.jpg','CAM00030.jpg',NULL,'uploads/meeting/meeting_adjunct',4,456,14,'2014-12-03 14:03:38','2015-05-22 15:29:00'),(367,'2014-12-02','Gestión de procesos de formación','Se realizó una reunión con el dinamizador del Telecentro para gestionar procesos de formación con adultos mayores. se quedo con el compromiso de convocarlos para una charla de dispositivos móviles.','Realizar convocatoria de adultos mayores para charla de dispositivos móviles.','Telecentro_Los_tanques_Gestion_de_procesos_1.jpg','Telecentro_Los_tanques_Gestion_de_procesos_2.jpg',NULL,'uploads/meeting/meeting_adjunct',4,457,15,'2014-12-03 16:33:44','2015-05-22 15:29:00'),(368,'2014-12-03','Programación de actividades y informe del punto de','Me reuno con Ramón Perea para confirmar el correo de programación de actividades propuesto, él manifiesta que este año no es posible porque no han instalado la infraestrucutra necesaria  en el centro, los públicos a los que atienden ya salen a vacaciones y no planeó las actividades. Durante esta contratación se le realizó incontables llamadas y mail (ver seguidilla de mails) para concretar actividades, nunca devolvía las llamadas o correos, tanto que tuve que buscarlo personalmente. Se le solicita contestar el correo para validar que él recomienda no realizar las actividades este año. Por otra parte se le informó de la visita de conectividad realizada, que ademas no asistió a la cita, y que se debe esperar a que infraestructura les proporcione la conexión a la red eléctrica regulada.\r\n','Se le pidió responder el correo de las actividades propuestas.','IMG_20141203_144646.jpg','IMG_20141203_143936.jpg','IMG_20141203_143943.jpg','uploads/meeting/meeting_adjunct',4,297,16,'2014-12-03 16:56:00','2015-05-22 15:29:00'),(369,'2014-12-03','prueba','xxx','xxx',NULL,NULL,NULL,'',4,297,16,'2014-12-03 17:02:02','2015-05-22 15:29:00'),(370,'2014-12-04','Gestión de procesos de formación','Se realizó una reunión con la dinamizadora del telecentro Erika y su voluntario Cesar para agendar una charla de dispositivos móviles con adultos y adultos mayores, se programo para el próximo viernes 12 de diciembre. la idea es continuar con procesos de formación el próximo año.','Se agendo una charla de dispositivos móviles con adultos mayores.','Telecentro_Trinidad_Gestion_de_procesos_1.JPG','Telecentro_Trinidad_Gestion_de_procesos_2.JPG',NULL,'uploads/meeting/meeting_adjunct',4,459,15,'2014-12-05 14:08:47','2015-05-22 15:29:00'),(373,'2014-12-05','Reunión con Dinamizador de Telecentro','Reunión con el dinamizador del Telecentro para iniciar procesos de formación y planeaciónn de procesos y actividades conjuntas para el 2015.','Charla de Navegar sin Naufragar Jueves 11 de Diciembre de 10:00 a 11:00 am','20141205_092759-0.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',4,458,38,'2014-12-09 09:47:38','2015-05-22 15:29:00'),(374,'2014-12-04','Seguimiento y planeación taller de sonido ','Se realizó seguimiento al sitio y planeación de unos talleres de sonido con personas en situación de discapacidad. este taller estara liderado por el profesional de cultura digital Jorge Ocampo. quedo pendiente programar una reunión finalizando el mes de enero para poner las fechas de inicio de los talleres. ','Reunión en enero','2014_12_04_10_14_35.jpg','2014_12_04_11_19_32.jpg',NULL,'uploads/meeting/meeting_adjunct',4,193,14,'2014-12-09 11:25:53','2015-05-22 15:29:00'),(375,'2014-12-09','Reprogramación de actividades','Se canceló la charla de dispositivos móviles planeada con adultos mayores, por falta de asistencia, se reprogramó quedando pendiente confirmar la nueva fecha. \r\n','Quedo pendiente programar un taller con niños sobre las novenas de navidad','IMG_1262.JPG',NULL,NULL,'uploads/meeting/meeting_adjunct',4,457,38,'2014-12-09 16:48:14','2015-05-22 15:29:00'),(376,'2014-12-11','Convocatoria procesos de formación','Se realizó una reunión con el dinamizador del telecentro para gestionar la charla de dispositivos móviles.','Se hará una charla de dispositivos móviles el viernes 12 de diciembre.','Telecentro_San_Antonio_de_Prado_Gestion_de_procesos.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',4,210,15,'2014-12-12 08:26:17','2015-05-22 15:29:00'),(377,'2014-12-11','Convocatoria procesos de formación','Se realizó una reunión con el funcionario del sitio, Adrian, para verificar el estado de la convocatoria para la charla de dispositivos móviles.','Charla de dispositivos móviles el 12 de diciembre junto con el telecentro de San Antonio de Prado.','Biblioteca_filial_comfenalco_SADEP_Reunion.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',4,195,15,'2014-12-12 13:37:41','2015-05-22 15:29:00'),(378,'2014-12-11','Seguimiento Punto de navegación','Se realizó una reunión con el funcionario José Jaramillo, para conversar del estado de los equipos, los cuales se encuentran fuera de servicio, ya que no estan ingresando a internet.','Se quedó con el compromiso de realizar seguimiento al punto, y tratar de solucionar lo antes posible el tema de la conectividad.','Casa_de_gobierno_SADEP_Seguimiento_al_sitio.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',4,333,15,'2014-12-12 13:42:02','2015-05-22 15:29:00'),(379,'2014-12-10','Convocatoria procesos de formación','Se realizó una reunión con el dinamizador Diego para agendar procesos de formación, se logró programar para el 17 de diciembre una charla de dispositivos móviles con adultos y adultos mayores.','Se realizara una charla de dispositivos móviles el día 17 de diciembre.','Telecentro_Rosales_Programacion_de_procesos_1.jpg','Telecentro_Rosales_Seguimiento_al_sitio_2.jpg',NULL,'uploads/meeting/meeting_adjunct',4,208,15,'2014-12-12 13:47:24','2015-05-22 15:29:00'),(380,'2014-12-02','Reunión de empalme y presentación ','Se realizó la presentación del programa y de las actividades que realizamos en la Inspección. Se espera que para el próximo año se puedan realizar actividades de divulgación con la comunidad. ','Atención de una estudiante de PP al punto de navegación. ','Reunion_de_empalme_Inspeccion_de_Aranjuez.JPG','Reunion_de_empalme_Inspeccion_de_Aranjuez.JPG','Reunion_de_empalme_Inspeccion_de_Aranjuez.JPG','uploads/meeting/meeting_adjunct',2,255,21,'2014-12-12 16:26:04','2015-05-22 15:29:00'),(381,'2014-12-12','Seguimiento Punto de navegación','Se realizó seguimiento al punto de navegación, además se recogieron los registro de usuario.','Ninguno','Mascerca_Poblado_Seguimiento_punto_de_navegacion.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',4,349,15,'2014-12-12 16:59:47','2015-05-22 15:29:00'),(382,'2014-12-16','Reunión de planeación 2015','Se realizó reunión con la voluntarias de la Biblioteca para planeación de actividades en 2015, para iniciar con convocatoria de la comunidad a procesos de formación en alfabetización digital.','- Convocatoria a comunidad para curso de alfabetización digital\r\n- Gestión con el CE para el espacio de formación\r\n- Narrativas con niños\r\n- Dispositivos Móviles','Biblioteca_el_Manzanillo_Reunion_gestion_de_procesos.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',4,461,38,'2014-12-16 13:49:43','2015-05-22 15:29:00'),(383,'2014-12-15','Caracterización','Se realizó una reunión con las encargadas del lugar para realizar la caracterización de la terminal.','Programar visita técnica y procesos de formación.','Centro_Comercial_Terminal_del_sur_caracterizacion_1.jpg','Centro_Comercial_Terminal_del_sur_caracterizacion_2.jpg',NULL,'uploads/meeting/meeting_adjunct',4,460,15,'2014-12-18 08:36:43','2015-05-22 15:29:00'),(384,'2014-12-18','Entrega de certificados','Se realizó una corta reunión con el gestor del CEDEZO en donde se le entregaron los certificados que se tenian pendiente.','Iniciar otros procesos el próximo año.','Punto_de_atecnion_CEDEZO_Guayabal_Reunion_y_entrega_de_certificados.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',4,175,15,'2014-12-18 14:54:40','2015-05-22 15:29:00'),(385,'2014-12-05','Reunión planeación ','La reunión se lleva a cabo con Juliana Barrios, coordinadora del Parque Biblioteca con el fin de planear la sensibilización a los funcionarios del Kit de inclusión digital, este se planteó para el día lunes 13 de diciembre en dos tandas por la mañana. ','1. Citar a los funcionarios a la fecha estipulada.\r\n2. Tener a disposición los espacios, videobeam, computador, sonido y la maleta del Kit de Inclusión Digital','Parque_Biblioteca_Doce_de_Octubre_Seguimiento_al_sitio.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',4,453,24,'2014-12-22 11:51:48','2015-05-22 15:29:00'),(386,'2014-12-09','Presentación de la nueva funcionaria a cargo','La reunión se lleva a cabo con la nueva funcionaria encargada del sitio Adriana Ruiz, ella será la nueva coordinadora de este espacio, se plantea buscar estrategias con el fin de dar solución a la No recolección de los indicadores del punto de navegación en este espacio, para esto la agente dinamizadora se encargará de llevar el día jueves una tabla con los formatos, y estos se instalarán al lado de los computadores. ','1. La agente dinamizadora se encargará de llevar el día jueves una tabla con los formatos.\r\n2. Los funcionarios del sitio se encargarán de dinamizar la recolección de los indicadores. ','Casa_de_Justicia_Robledo_Empalme_1.jpg','Casa_de_Justicia_Robledo_Empalme_2.jpg','Casa_de_Justicia_Robledo_Empalme_3.jpg','uploads/meeting/meeting_adjunct',2,271,24,'2014-12-22 12:07:40','2015-05-22 15:29:00'),(387,'2014-12-09','Reunión nueva dinamizadora de Telecentro','Empalme con la nueva dinamizadora del Telecentro, se muestran los contenidos a trabajar durante el otro año, esta persona busca realizar varios cursos y talleres, puesto que considera que no hay casi movimiento en este espacio. ','1. Entrega de los contenidos por parte de la Agente Dinamizadora.\r\n2. Se entrega además los formatos de inscripción para las personas interesadas en los cursos y talleres. ','Telecentro_Picacho_Empalme_1.jpg','Telecentro_Picacho_Empalme_2.jpg',NULL,'uploads/meeting/meeting_adjunct',2,202,24,'2014-12-22 13:18:28','2015-05-22 15:29:00'),(388,'2015-02-02','Recolección de indicadores ','Recolección de indicadores del punto de navegación, en este día el encuentro se realiza con la coordinadora de la casa de Justicia de Robledo, en la conversación se retoman compromisos planteados anteriormente como los talleres de gobierno en línea para los funcionarios. ','Al iniciar el contrato del año 2015 se reanudarán las actividades de formación con los funcionarios y de apropiación por parte de la comunidad del punto de navegación. ','Casa_de_Justicia_Robledo_Seguimiento_al_sitio_1.jpg','Casa_de_Justicia_Robledo_Seguimiento_al_sitio_2.jpg',NULL,'uploads/meeting/meeting_adjunct',4,271,24,'2015-02-04 14:18:49','2015-05-22 15:29:00'),(389,'2015-02-02','Planeación 2015','Revisión de propuestas de cursos para los empresarios beneficiarios del espacio y planeación de agenda para el año 2015. Se abrirá un curso de Alfabetización Digital y Gobierno en Línea el día 17 de febrero de 2:00 p.m. a 4:00 p.m. ','La agente dinamizadora: Será la encargada de buscar a los gestores TIC encargados de dictar el curso.\r\nNelsón Ospina, encargado del CEDEZO  realizará la convocatoria de las personas y la búsqueda de los espacios.','Cedezo_La_Quintana_Seguimiento_al_sitio_1.jpg','Cedezo_La_Quintana_Seguimiento_al_sitio_2.jpg','Cedezo_La_Quintana_Seguimiento_al_sitio_3.jpg','uploads/meeting/meeting_adjunct',4,168,24,'2015-02-04 14:25:26','2015-05-22 15:29:00'),(390,'2015-02-02','Gestión con aliados','La reunión se lleva a cabo con los funcionarios del Parque Biblioteca y el Cedezo, con el fin de generar un curso en el que se vinculen empresarios y comunidad en general, utilizando las instalaciones del Parque Biblioteca, la certificación se realizará entre las tres entidades. ','El Parque Biblioteca acomodará los espacios para dictar los cursos y realizar la convocatoria de comunidad en general \r\nEl Cedezo será el encargado de generar la convocatoria de los empresarios ','PB_La_Quintana_Cedezo_La_Quintana_Empalme.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',3,184,24,'2015-02-04 14:39:23','2015-05-22 15:29:00'),(391,'2015-02-03','Empalme con funcionarios','Se realizó reunión con el señor Orlando Sánchez, don hernando y dos participantes más; uno en representación de la ACJ y una de la asociación de padres de familia. Se habló de las estrategias y propuestas tanto para la formación de los jóvenes que lideran el aula abierta como de la inscripción, reunión e inicio de las clases con los padres de familia. Se propuso incluir a la corporación sal y luz en al alianza del programa. Respecto a la formación de los chicos es claro que se realizará un taller de narrativas y fotografía con ellos y que se llevará a cabo una nueva reunión para revisar los contenidos que se utilizaran en las clases con los padres. Don hernando reitera la importancia de continuar fortaleciendo el componente de formación con propuestas de MDE inteligente, la ACJ y el colegio. Se hizo especial énfasis en el interés del colegio por visibilizar la experiencia tanto a nivel local con otros colegios que tal vez pudieran pilotearla en sus instalaciones como a nivel externo de la comuna, también se menciona el interés por contar con el apoyo e intercambio de experiencias con la IE Antonio Derka. ','Visitar Nuevamente la I.E para llevar a cabo reunión con los jovenes encargados del Aula abierta','Samuel_Barrientos_Empalme.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',2,230,23,'2015-02-09 08:54:10','2015-05-22 15:29:00'),(392,'2015-02-04','Empalme Coordinación ','Se conversó con la señora Pilar Marin quien es la Coordinadora académica y se mencionó el interés de la IE por retomar el proceso de aula abierta, de hecho dos de los docentes del área de informática lideran el proceso y ya hicieron un sondeo de padres inscritos. Se aclaró en qué consiste el acompañamiento y apoyo del programa y se programó una nueva reunión con los docentes encargados para definir fechas y propuestas.','Agendar nueva reunión con los docentes encargados de reactivar el aula abierta','I_E_CristobaL_Colon_Empalme.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',2,222,23,'2015-02-09 08:58:06','2015-05-22 15:29:00'),(393,'2015-02-05','Emplame nuevo funcionario','En la visita se verificó el estado de la conectividad, se recogieron indicadores, tambíen se conversó con un estudiante de la Uniminuto para mirar la posibilidad de tenerlo  como gestor Tic dado que pertenece a presupuesto participativo. Además de esto se realizó empalme con la nueva directora Claudia Castro la cual manifestó su interés por capacitar a los funcionarios en Gobierno en línea; sin embargo no se agendaron fechas aun.','agendar nueva reunión para programar capacitación con funcionarios','C_J_Villa_del_socorro_Empalme_y_seguimiento_2.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',2,242,23,'2015-02-09 09:06:15','2015-05-22 15:29:00'),(394,'2015-03-03','Reunion INDETVO','reunión con el grupo INDETVO para acompañamiento del proceso de producción de programa magazín para Teleanqitoquia, asesoría en estructura y construcción conceptual del piloto.','- revisar documentos requeridos por Teleantioquia como manual de estilo, y sugerencias hechas por el canal.\r\n- Acompañamiento al proceso de estructuración del programa y producción de contenidos','la_independencia.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',4,346,38,'2015-03-05 09:07:33','2015-05-22 15:29:00'),(395,'2015-02-24','Gestión estudiantes de pp','Se realizó la entrega del sitio de parte de Caolina Agudelo a la nueva encargada Cindy Jaramillo, se realizó una reunión con la JAL para conversar acerca de los nuevos procedimientos que se harán con los chicos de pp.','Se estableció como compromiso de parte de la JAL conseguir estudiantes de pp que puedan realizar la labor social con el programa y de parte de MDE Ciudad inteligente se quedo con el compromiso de indicar en cuales IE se necesitan los chicos y en que procesos de formación.','Mascerca_de_Belen_Reunion_JAL.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',3,438,15,'2015-03-06 12:04:41','2015-05-22 15:29:00'),(396,'2015-02-24','Entrega procesos','se realizó la entrega del sitio por parte de Carolina Agudelo a la nueva encargada Cindy Jaramillo, se converso de los procesos de formación que se iniciaran en este, para lo cual se debe hablar con la JAL y mirar que chicos se tienen disponibles.','Buscar un estudiante de pp que pueda apoyar los cursos que se iniciaran con el CEDEZO.','CEDEZO_Belen_Empalme.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',2,176,15,'2015-03-06 14:25:55','2015-05-22 15:29:00'),(397,'2015-03-03','Aula abierta','Se realizó una reunión con el coordinador de la jornada de la tarde, en donde se le hizo seguimiento al Aula abierta, además se establecieron las fechas para iniciar charlas de NSN con grados cuartos y quintos.','Se realizaran charlas de NSN con cuartos y quintos, además se realizará un seguimiento constante y regulado al aula abierta.','IE_San_Roberto_Belarmino_reunion_aula_abierta_20150303_141314.jpg','IE_San_Roberto_Belarmino_Acompanamiento_Gestor_TIC.jpg','IE_San_Roberto_Belarmino_seguimiento_aula_abierta_20150303_145442.jpg','uploads/meeting/meeting_adjunct',4,356,15,'2015-03-06 15:26:04','2015-05-22 15:29:00'),(398,'2015-03-04','Procesos de formación','Se realizó una reunión con la gestora del CEDEZO de SADEP en donde se estipularon algunas fechas para el inicio de cursos con emprendedores, que se harán con una estudiante de pp que ellos mismos contactarón.','Se quedo con el compromiso de iniciar un curso de alfabetización digital que será dictado por una estudiante de pp que apoya las labores del CEDEZO, la idea es iniciar la última semana de Marzo.','CEDEZO_SADEP_Reunion_procesos_de_formacion_20150304_092522.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',4,178,15,'2015-03-06 16:08:17','2015-05-22 15:29:00'),(399,'2015-03-04','Seguimiento Punto de navegación','Se realizó seguimiento al sitio, se habló con el funcionario encaragdo de la atención al usuario, acerca del funcionamiento del punto de navegación, además se recogieron los indicadores de gobierno y el chaleco.','Seguir realizando el seguimiento al sitio con más frecuencia, además se quedo de enviar al funcionario el formato de registro de usuario.','Casa_de_Gobierno_SADEP_seguimiento_al_sitio.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',4,333,15,'2015-03-06 16:18:01','2015-05-22 15:29:00'),(400,'2015-03-09','Reunión Coordinación de procesos 2015','Reunión para gestión de procesos con los públicos del parque biblioteca, entrega de contenidos de procesos de formación.','- revisión por parte del equipo de la biblioteca para su aprobación y revisión de pertinencia\r\n- convocatoria a público joven para procesos de formación en narrativas digitales y web 2.0\r\n- conseguir gestores TIC que acompañen procesos en alfabetización digital los días mrtes y viernes en las horas de la tarde\r\n- programación de capacitación 