ad.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',2,459,38,'2015-03-18 15:24:43','2015-05-22 15:29:00'),(405,'2015-03-18','Empalme y planeación de actividades para 2015.','Se realizó la presentación del programa y de los gestores de cultura digital que acompañarán el sitio este año, los funcionarios manifestaron interés en vincularse con nosotros para llevar a cabo varios procesos que van acorde con las acciones que ellos realizarán este año; inicialmente manifestaron interés en comenzar con taller de narrativas, charlas de navegar sin naufragar, talleres para emprendedores y charlas de dispositivos móviles, para esto comenzarán haciendo las convocatorias pertinentes.','Realizar convocatorias para los talleres para emprendedores, taller de narrativas, charla de navegar sin naufragar y charla de dispositivos móviles.','Parque_Biblioteca_Guayabal_Empalme.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',2,192,43,'2015-03-19 09:20:49','2015-05-22 15:29:00'),(406,'2015-03-18','Empalme ','Se realizó la presentación del programa y de los gestores de cultura digital que acompañarán el sitio este año, se identifica que la principal necesidad en este momento es realizar divulgación de la red WIFI y del programa en la comunidad educativa, por lo cual queda como compromiso programar la divulgación e informarle a los directivos de la Institución.','Programar divulgación e informarle a la Institución.','IES_Pascual_Bravo_Belen_Empalme.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',2,560,43,'2015-03-19 14:11:55','2015-05-22 15:29:00'),(407,'2015-03-19','Empalme nuevo gestor ','Reunión de empalme con el nuevo gestor de cultura digital y los funcionarios del CEDEZO Manrique, presentación  por parte del gestor de los proceso de formación del programa y los distintas alternativas de intervención posibles en el sitio.','Darle seguimiento a los cursos y un taller de Excel avanzado para el martes 23 de marzo','IMG_20150319_WA0010.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',2,165,10,'2015-03-20 08:02:39','2015-05-22 15:29:00'),(408,'2015-03-18','Planeación de actividades','Se converso sobre las distintas actividades que se quieren realizar para este año, entre ellas articular la estrategia de Navegar sin Naufragar a las actividades que realiza la psicologa de la IE.','Realizar una charla de NSN en la IE con los grados 6. Y articular las agendas con el contenido que ya vienen adelantando en la IE respecto a Bullyng.','DSC_0566_1.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',3,507,21,'2015-03-20 16:07:41','2015-05-22 15:29:00'),(409,'2015-03-19','Empalme y planeación de actividades para 2015.','Se realizó la presentación de la nueva gestora de cultura digital que acompañará la Fundación Integrar, que atiende niños diagnosticados con algún trastorno del espectro autista, posteriormente se identificaron las principales necesidades de la Institución, entre ellas capacitar a los padres de familia en dispositivos móviles, para que puedan hacer uso de aplicaciones que fomentan el aprendizaje de sus hijos. ','Quedó como compromiso programar la reunión de sensibilización con padres de familia para iniciar el taller de dispositivos móviles orientado a suplir la necesidad específica de la población, la cual consiste en que lo padres aprendan a utilizar aplicación que promueva el aprendizaje de los niños diagnosticados con algún trastorno del espectro autista.','Fundacion_Integrar_Empalme.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',2,215,43,'2015-03-24 08:50:17','2015-05-22 15:29:00'),(410,'2015-03-19','Empalme y planeación de actividades para 2015.','Se realizó la presentación de la nueva gestora de cultura digital que acompañará la Institución Educativa, se detectaron las principales necesidades, entre las cuales están, realizar un taller con los estudiantes en situación de discapacidad que usan en Kit de inclusión digital y realizar charlas de gobierno en línea con estudiantes del grado 11°. ','Quedó como compromiso programar el taller sobre 