 la comunidad (padres de familia) y realizar charlas de GEL para jóvenes, se programó charla de Gobierno en Línea con el grado 11° para el miércoles 8 de Abril.','Quedó como compromiso realizar la convocatoria a los padres de familia para iniciar proceso de formación con ellos y programar la fecha de inicio.','Institucion_Educativa_Benjamin_Herrera_Empalme.jpg','Institucion_Educativa_Benjamin_Herrera_Empalme.jpg',NULL,'uploads/meeting/meeting_adjunct',2,330,43,'2015-03-30 09:57:58','2015-05-22 15:29:00'),(434,'2015-03-27','Empalme y planeación de actividades para 2015.','Se realizó la presentación de la nueva gestora de cultura digital que acompañará la Institución Educativa, se detectaron las principales necesidades, entre las cuales está realizar charlas de gobierno en línea dirigida a los jóvenes de los grados 10° y 11°, se programó la charla para el Martes 14 de Abril.','Quedó como compromiso gestionar el espacio y los recursos para la charla de GEL.','Institucion_Educativa_Jose_Maria_Bernal_Empalme.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',2,124,43,'2015-03-30 10:12:34','2015-05-22 15:29:00'),(435,'2015-03-17','Empalme del Sitio','Reunión de empalme y seguimiento al punto de navegación. El uso es poco frecuente, pero siempre está a disposición de los usuarios. ','Buscar enlace con las corporaciones que intervienen en el sitio y gestionar Gestores TIC con estudiantes de PP.','Emplame_Centro_Diversidad_Sexual.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',2,300,40,'2015-03-30 10:17:06','2015-05-22 15:29:00'),(436,'2015-03-17','Seguimiento al Sitio','Reunión de empalme y seguimiento al punto de navegación. El uso es poco frecuente, pero siempre está a disposición de los usuarios. ','Agendar reunión con el coordinador del sitio para gestionar Gestor TIC',NULL,NULL,NULL,'',2,321,40,'2015-03-30 10:53:15','2015-05-22 15:29:00'),(437,'2015-03-18','Seguimiento kit de inclusión digital','Reunión de seguimiento al kit de inclusión digital, el cual se encuentra instalado en la sala de sistemas y en la oficina de inclusión para el uso de los estudiantes. Algunos alumnos recibirán una capacitación práctica sobre las herramientas para personas invidentes, de baja visión y con limitaciones motrices.','Ninguno','ITM_fraternidad_kitdeinclusion_2.jpg','ITM_fraternidad_kitdeinclusion_1.jpg',NULL,'uploads/meeting/meeting_adjunct',4,308,20,'2015-03-30 10:57:38','2015-05-22 15:29:00'),(438,'2015-03-17','Reunión de empalme y gestión','Reunión con el coordinador académico y el docente de informática para realizar el empalme y planear los procesos de intervención del programa en la institución.','Pactar una reunión con los coordinadores de práctica del colegio y el profesional de inclusión de MDE para articular las estudiantes con la estrategia de Gestores TIC.','CEFA_6.jpg','CEFA_10.jpg',NULL,'uploads/meeting/meeting_adjunct',2,299,17,'2015-03-30 11:29:27','2015-05-22 15:29:00'),(439,'2015-03-17','Reunión de empalme y gestión','Reunión con la dinamizadora cultural de la biblioteca para gestionar procesos de formación con el público infantil y adultos en temas de alfabetización digital, internet seguro, arte y promoción de lecto-escritura. ','Programar un próximo encuentro para comenzar a desarrollar un proceso complejo en alfabetización digital, narrativas digitales y escritura creativa.','Biblioteca_Villatina_12.jpg','Biblioteca_Villatina_4.JPG',NULL,'uploads/meeting/meeting_adjunct',2,525,17,'2015-03-30 11:36:56','2015-05-22 15:29:00'),(440,'2015-03-19','Reunión de empalme y gestión','Reunión con la directora del centro educativo para realizar el empalme y programar la actividad de día del niño en la institución. ','Queda pendiente enviar el correo oficial con toda la información detallada del evento.','CE_El_Placer.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',2,425,17,'2015-03-30 11:39:40','2015-05-22 15:29:00'),(441,'2015-03-25','Reunión de empalme y gestión','Reunión de empalme con el dinamizador del telecentro para continuar los procesos de formación en narrativas digitales y gobierno en línea con jóvenes y adultos de la comunidad.','Programar una próxima reunión con el estudiante de PP que podría ser Gestor TIC','Telecentro_San_Miguel_La_Mansion.JPG',NULL,NULL,'uploads/meeting/meeting_adjunct',2,205,17,'2015-03-30 11:46:08','2015-05-22 15:29:00'),(442,'0000-00-00','Reunión con Nelly Gil','Encuentro con Nelly Gil de la JAC de Castilla, quien nos ayuda en la comunidad a encontrar jóvenes Gestores TIC para dictar los cursos en la comuna, también se habló de un proyecto para que los jóvenes de la comuna se agrupen y formen una junta de jóvenes líderes en la comuna 5.','Los jóvenes quedaron en pensar los puntos en los que se quieren trabajar para la escuela de líderes',NULL,NULL,NULL,'',3,232,42,'2015-03-30 11:49:26','2015-05-22 15:29:00'),(443,'2015-03-26','Reunión de empalme','Reunión de empalme con la Inspectora de la 9B El Salvador, indagar sobre el funcionamiento de los equipos. Recolección de indicadores.','Ninguno',NULL,NULL,NULL,'',2,307,20,'2015-03-30 11:55:09','2015-05-22 15:29:00'),(444,'2015-03-17','Empalme del Sitio','Reunión con  el rector, la coordinadora y el docente de tecnología de la institución para agendar procesos de formación, gestores TIC Y presentar la propuesta del proyecto Edulabs e invitarlos a hacer parte de él. Se firmó el compromiso con el rector y se dejó las cartas de solicitud de permiso para los padres de familia de los niños seleccionados.','Continuar procesos de formación iniciados en el semestre anterior y la Institución se compromete a brindarles alimentación (refrigerio y almuerzo) a los estudiantes como requisito para participar el el proyecto Edulabs. ','Empalme_Sol_de_Oriente_1.jpg','Empalme_Sol_de_Oriente_2.jpg',NULL,'uploads/meeting/meeting_adjunct',2,326,40,'2015-03-30 12:08:49','2015-05-22 15:29:00'),(445,'2015-03-19','Reunión de articulación','Reunión con la coordinadora de Crecer con dignidad y el pedagogo de la Fundación Munay (sede Santa Elena), para articular procesos de formación en narrativas digitales y posteriormente en herramientas Web con los niños, niñas y jóvenes que son intervenidos por la fundación.','La Fundación queda con la tarea de enviar un correo con el consentimiento del coordinador. El programa MDE queda con el compromiso de gestionar la realización de dos talleres de narrativas digitales.\r\n','Fundacion_Munay.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',3,433,17,'2015-03-30 13:26:28','2015-05-22 15:29:00'),(446,'2015-03-17','Empalme Sitio','Reunión de empalme y seguimiento al sitio. Recolección de indicadores y planificación proceso formación','programar charla Gobierno en Línea para el Adulto Mayor','Emplame_AMAUTTA_2.jpg','Empalme_AMAUTTA_4.JPG','Empalme_AMAUTTA_3.JPG','uploads/meeting/meeting_adjunct',2,291,40,'2015-03-30 13:44:01','2015-05-22 15:29:00'),(447,'2015-03-26','Gestión Estudiantes de PP y Procesos de formación','Reunión con el administrador del Centro de Integración Barrial y Dinamizador del Telecentro para gestionar estudiantes de presupuesto participativo y alfabetizadores que apoyen los procesos de formación del programa y agendar actividades con los Microempresarios de la Fundación Golondrinas, presidentes de las organizaciones de la comuna 8 y los integrantes de Asocomunal 8.','Iniciar procesos de formación con charla de sensibilización y Gobierno en Línea en la semana del 6 al 10 de abril.','Reunion_CIB_Los_Mangos_1.jpg','Reunion_CIB_Los_Mangos_2.jpg','Reunion_CIB_Los_Mangos_3.jpg','uploads/meeting/meeting_adjunct',3,204,40,'2015-03-30 13:55:32','2015-05-22 15:29:00'),(448,'2015-02-24','JAL comuna 9','Reunión con el presidente de la JAL comuna 9','Contacto Medellín Ciudad Inteligente con estudiantes de PP',NULL,NULL,NULL,'',3,314,20,'2015-03-30 14:02:47','2015-05-22 15:29:00'),(449,'2015-03-17','Empalme y compromisos Edulab','Reunión de empalme con Coordinadora de la Institución Educativa Antonio Derka para el empalme del proceso anterior y los nuevos procesos de formación, además acordar los compromisos de la institución con el proceso Edulab con Eafit. ','Acompañamiento año 2015 con el aula abierta\r\nPosible gestión de estudiantes para cumplir horas de labor social con el programa en los sitios de Santo Domingo \r\nCompromiso acompañamiento Institución con los cuatro jóvenes pertenecientes al proceso con Edulab. ','Nuevo_doc_1.pdf',NULL,NULL,'uploads/meeting/meeting_adjunct',2,237,41,'2015-03-30 14:07:34','2015-05-22 15:29:00'),(450,'2015-03-26','Empalme y programación Procesos de Formación','Reunión con el director de la Institución para agendar charla de Gobierno en Línea para los estudiantes de 10° y 11°, programar charla de Navegar sin Naufragar con los estuiantes de 4° y 5°.','Iniciar procesos de formación la semana del 6 al 10 de abril.','Emplame_La_Milagrosa_1.JPG','Emplame_La_Milagrosa_2.JPG',NULL,'uploads/meeting/meeting_adjunct',2,312,40,'2015-03-30 15:54:53','2015-05-22 15:29:00'),(451,'2015-03-24','Empalme Positivos por la Vida','Empalme de sitio, compromisos previos del proceso anterior y nuevos procesos de formación. Articulación horarios, nueva agenda y objetivos esperados','Terminar Taller de narrativas digitales\r\nSesiones de trabajo semanal martes de 4 a 6pm\r\nPensar en contenido de internet seguro para trabajar con las educadoras de los niños\r\nDar continuidad al acompañamiento','acta_empalme_positivos.pdf',NULL,NULL,'uploads/meeting/meeting_adjunct',2,518,41,'2015-03-30 16:45:17','2015-05-22 15:29:00'),(452,'2015-02-27','Planeación Escuela de Líderes Juveniles','María Nelly Gil, es la presidenta de la Junta Administradora Local, ha propuesto al programa y a líderes de la comuna 5 integrar una escuela de formación direccionada a los más jóvenes de la comuna, para esto acudimos a la Corporación Una Vida Tranquila con el fin de generar algunas alianzas y conocer las ideas y proyecciones de estos jóvenes.','1. invitar a otros líderes y actores de la comuna o institucionales que quieran hacer parte de este proceso.\r\n2. La líder y los integrantes de la corporación se comprometen a traer una propuesta más estructurada con el fin de dar cumplimiento a un requerimiento desde el programa y es entender el rol que asumiremos al interior de este. ','IE_Sor_Juana_Ines_de_la_Cruz_Planeacion_Formacion_Escuela_de_Lideres_Juveniles_2.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',3,232,24,'2015-03-30 20:10:52','2015-05-22 15:29:00'),(453,'2015-02-28','Reunión líderes Observatorio comuna 5','Nos encontramos en la reunión del observatorio de la comuna 5, proyecto dirigido y gestionado por los líderes comunales con miras a generar un proyecto de Open Data comunitario. El programa será el encargado de trabajar toda la parte de formación y desarrollo con ellos del plan de comunicaciones del proyecto. ','1. Formular y realizar el Taller Planeación de la comunicación.\r\n2. Buscar las estrategías para desarrollar un buen proceso de formación con los líderes. ','IE_Pedro_Claver_Formacion_Observatorio_Lideres_Comuna_5_2.jpg','IE_Pedro_Claver_Formacion_Observatorio_Lideres_Comuna_5_3.jpg','IE_Pedro_Claver_Formacion_Observatorio_Lideres_Comuna_5_4.jpg','uploads/meeting/meeting_adjunct',3,226,24,'2015-03-30 20:21:55','2015-05-22 15:29:00'),(454,'2015-03-17','Reunión Promotor jóvenes por la vida','La reunión tuvo lugar con el promotor encargado de los jóvenes por la vida que se encuentran prestando su labor social en el punto de navegación, puesto que se vienen presentando algunas dificultades en la prestación de este, por la falta de chicos y la renovación de los convenios. Por esto se busca que las chicas que se encuentren en el punto puedan prestar su labor en las mañanas mientras ingresan la totalidad de los otros jóvenes.','1. Acompañamiento por parte de las jóvenes del punto de navegación.\r\n2. La Gestora de Cultura Digital se compromete a realizar la inducción de los nuevos integrantes del programa que llegaran la segunda semana de abril. ','UPJ_Empalme_Promotor_Jovenes_por_la_Vida.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',2,288,24,'2015-03-30 21:35:06','2015-05-22 15:29:00'),(455,'2015-03-17','Reunión Empalme','Se realiza el reconocimiento de las personas que integrarán el proceso y se firma el acta de inicio de la formación que se llevará a cabo en la Universidad de Eafit. ','1. La coordinadora y el rector se comprometen a cumplir con los compromisos adquiridos y consignados en la carta que se firmó en este encuentro. ','IE_Jesus_Amigo_Empalme.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',2,488,24,'2015-03-30 21:41:12','2015-05-22 15:29:00'),(456,'2015-03-17','Seguimiento y planeación ','Se realiza un proceso de planeación de todos los cursos y talleres de formación que se llevarán a cabo durante el año. ','1. Realizar las gestiones pertinentes del caso, para llevar a cabo los procesos de formación en el sitio.','Cedezo_La_Quintana_Planeacion.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',4,168,24,'2015-03-30 21:44:53','2015-05-22 15:29:00'),(457,'2015-03-18','Participación en la formación de EAFIT','Presentación de la propuesta EDULABS y firma del compromiso por parte del rector, para que cuatro estudiantes puedan participar del proceso de formación dictado por EAFIT. ','1. El rector y los docentes se comprometen a llevar a cabalidad los compromisos adquiridos a través de la firma de este. ','IE_Jorge_Eliecer_Gaitan_Empalme_y_planeacion_1.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',2,415,24,'2015-03-30 21:55:09','2015-05-22 15:29:00'),(458,'2015-03-26','Planeación 2015','En está reunión se retoman los contactos y los compromisos adquiridos desde el año pasado, para esto se planean algunas charlas de Gobierno en línea para los estudiantes de los grados décimo y once. \r\nSe espera realizar otros procesos en el transcurso del año.','Realizar las charlas en el mes de abril por parte del programa.','IE_El_Triunfo_Santa_Teresa_Planeacion.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',2,481,24,'2015-03-30 23:04:29','2015-05-22 15:29:00'),(459,'2015-03-26','Presentación del programa al nuevo dinamizador','Presentación del programa al nuevo dinamizador del Telecentro, se busca además realizar alianzas y procesos de formación para el 2015.','Convocar a la Ana Teresa Ocampo, la representante Legal del Telecentro con el fin de generar sinergias y alianzas para este año. ','Telecentro_Picacho_Empalme.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',2,202,24,'2015-03-30 23:08:41','2015-05-22 15:29:00'),(460,'2015-03-31','Empalme y planeación con Director','Se realizó reunión con el director del parque biblioteca, además de la gestora de Servicios Marcela Ocampo y la directora de fomento Lectura y escritura Carolina Gallón. En esta reunión se realizaron varias actividades: Recorrido por la biblioteca y empalme de los servicios ofertados a la comunidad, identificación de grupos focales de atención y planeación de propuestas de intervención desde el programa con dichos grupos,además de fijación de fechas para las mismas. ','15 de Abril: En la mañana se realizará visita al centro integrado de desarrollo en compañía de la biblioteca. En la tarde se desarrollará taller de Accesibilidad con funcionarios de la Biblioteca.\r\n17 Abril : Taller de Accesibilidad con segundo grupo de Funcionarios.\r\n2 de Mayo: Navegar sin Naufragar con los niños del Club de lectura infantil 9 a  11 a.m\r\n\r\n- Enviar el material que se produjo con el centro integrado de desarrollo para que al Biblio lo visibilice\r\n-Enviar correo con propuestas de Formación del programa\r\n- Ir desarrollando las propuestas planeadas de forma paulatina pero con compromiso para cada grupo focal identificado','Biblioteca_S_Cristobal_Empalme_y_planeacion_4.jpg','Biblioteca_S_Cristobal_Reunioon_de_planeacion_y_empalme_2.jpg','Biblioteca_S_Cristobal_Reunioon_de_planeacion_y_empalme_6.jpg','uploads/meeting/meeting_adjunct',2,186,23,'2015-03-31 21:53:26','2015-05-22 15:29:00'),(461,'2015-04-01','Reunión con coordinador de la biblioteca','Reunión para hablar de lo que se hará con la biblioteca este año, conocer a la nueva persona encargada de acompañar la biblioteca y quedar en una nueva reunión','Se hará una nueva reunión el día jueves 9 de abril para organizar todo bien con el coordinador y la gestora de cultura digital.','Bilioteca_Tren_de_papel_reunion.JPG',NULL,NULL,'uploads/meeting/meeting_adjunct',3,182,42,'2015-04-06 07:44:14','2015-05-22 15:29:00'),(462,'2015-03-31','Seguimiento','Seguimiento del sitio, presentación con los funcionarios, revisión de los recursos, socialización con usuarios y recolección de indicadores','Seguimiento continuo.','Visita_CAV_la_America.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',4,246,10,'2015-04-06 15:55:22','2015-05-22 15:29:00'),(463,'2015-03-31','Seguimiento','Seguimiento del sitio de gobierno, su funcionamiento, retroalimentación con el gestor y recolección de indicadores','Seguimiento continuo del sitio.','Visita_Aula_Ambiental_La_America.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',4,236,10,'2015-04-06 16:04:26','2015-05-22 15:29:00'),(464,'2015-04-07','Reunión de empalme y gestión','Reunión de empalme y gestión de procesos con el rector de la institución. Se acordaron dos cosas principales: Crear un laboratorio audiovisual con estudiantes de 8° y 9° para trabajar continuamente este año; y gestionar el Aula abierta para realizar cursos con la comunidad.','Por parte de la IE: Convocar a los estudiantes para conformar el laboratorio audiovisual escolar.\r\nPor parte nuestra: Gestionar la vinculación de estudiantes de PP para la realización de cursos en aula abierta.','IE_Alfonso_Lopez_Reunion_empalme.JPG',NULL,NULL,'uploads/meeting/meeting_adjunct',2,290,17,'2015-04-07 11:29:13','2015-05-22 15:29:00'),(465,'2015-04-07','Empalme con funcionarios','Se llevó a cabo reunión de empalme con funcionarios de la biblioteca, entre ellos el coordinador, las promotoras de lectura y el encargado de los procesos de formación. Inicialmente se comentó el interés de visibilizar la experiencia de la biblioteca con las personas en situación de discacapcidad, frente a otras entidades como arque biblioteca la Quintana y el colegio mayor. Se indagó por las dinámicas del lugar, población atendida y afluente y se socializaron los procesos de formación que se desarrollan desde el programa. ','Agendar una nueva reunión con Beatriz para planear la socialización de la experiencia. También con la nueva persona encargada de al sala de sistemas para agendar curso de Alfabetización digital y Gel con comunidad. Para los funcionarios se piensa desarrollar algo de Web 2.0 según sus necesidades.','Bilioteca_Fdo_Gomez_M_Empalme_y_planeacion_1.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',2,268,23,'2015-04-07 15:41:50','2015-05-22 15:29:00'),(466,'2015-04-07','Empalme con funcionarios','Se conversó acerca de lso procesos realizados anteriormente y de los compromisos pactados con la comunidad en relación a nuevos procesos. Iniciará el taller de herramientas web 2.0. Se indaga por los públicos afluentes al telecentro y en vista de que la población jóven no es muy frecuente se propone la convocatoria del taller de narrativas digitales','Hacer invitación para todos los procesos, programar dispositivos móviles con Adultos mayores de martes- jueves. \r\nIniciar el taller de herramientas web 2.o y llamar a las personas para recordar.','Telecentro_la_amistad_Empalme_y_planeacion_1.jpg','Telecentro_la_amistad_Empalme_y_planeacion_3.jpg',NULL,'uploads/meeting/meeting_adjunct',2,203,23,'2015-04-07 15:53:36','2015-05-22 15:29:00'),(467,'2015-04-07','Empalme con funcionarios','Se realizó reunión con el rector de la I.E en donde se habló de los procesos realizados anteriormente y de las propuestas para este año. Se habló de realizar el taller de Gel con la escuela de padres. Hay un interés de la I.E por recuperar los proceosos del aula abierta, por lo tanto tanto la I.E como la gestora de Cultura digital se compriometieron a revisar qué chicos de la Í.E y de pp pueden apoyar la restauración de dicho proceso','Visitar la I.E nuevamente para reunirnos con la coordiandora y poner fechas a las propuestas abordadas\r\n- Realizar GEL con estudiantes de once en mayo y una charla mensual de NSN con los grupos de quinto a noveno.','I_E_Fe_y_alegria_aures_Empalme_y_planeacion_1.jpg','I_E_Fe_y_alegria_aures_Empalme_y_planeacion_2.jpg','I_E_Fe_y_alegria_aures_Empalme_y_planeacion_3.jpg','uploads/meeting/meeting_adjunct',2,407,23,'2015-04-07 16:17:11','2015-05-22 15:29:00'),(468,'2015-04-07','Seguimiento al sitio y planeación de actividades.','Se realizó una reunión para detectar las principales necesidades del sitio y programar las actividades que se llevaran a cabo este año, inicialmente los funcionaron se comprometieron a realizar las convocatorias respectivas para charlas de NSN y taller de narrativas. ','Por parte del Parque Biblioteca quedó como compromiso realizar las convocatorias respectivas para las charlas de NSN y el taller de narrativas. ','Parque_Biblioteca_Guayabal_Seguimiento_al_sitio.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',4,192,43,'2015-04-09 08:01:35','2015-05-22 15:29:00'),(469,'2015-04-08','Empalme y gestión','Reunión para empalme de nuevo Gestor de cultura digital y seguimiento del uso del kit para personas en situación de discapacidad, el uso de este es aceptable pero podría mejorar.','Se empieza convocatoria para escuela de padres, Aula Abierta, con el plus del kit, se programan 3 charlas de NSN.','Olaya_Herrera.jpg','Olaya_Herrera1.jpg',NULL,'uploads/meeting/meeting_adjunct',2,154,10,'2015-04-09 08:05:21','2015-05-22 15:29:00'),(470,'2015-04-08','Empalme y gestión','Reunión para presentación del nuevo gestor de cultura digital y seguimiento de los procesos del sitio, se entregan los contenidos para aula abierta de escuela de padres y se programan 2 sesiones de nsn','Capacitación a profesores para aula abierta y dos charlas de nsn','Fe_y_Alegria_Granizal.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',2,253,10,'2015-04-09 08:08:04','2015-05-22 15:29:00'),(471,'2015-04-09','Reunión de programación de actividades para el año','En la reunión se conversó sobre las necesidades de formación que tiene la comunidad aledaña al Telecentro.','Se iniciará un taller de herramientas web.20 La idea es empezar el 29 de abril.','TelecentroSantaLucia_Reunion.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',4,520,21,'2015-04-09 11:36:57','2015-05-22 15:29:00'),(472,'2015-04-09','Seguimiento del sitio y recolección de indicadores','Seguimiento del sitio y recolección de indicadores','Gel la próxima semana con funcionarios','Casa_de_justicia_Villa_del_Socorro.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',4,242,10,'2015-04-09 11:55:50','2015-05-22 15:29:00'),(473,'2015-04-09','Gestión','Se presentan los contenidos para el seguimiento de dos grupos de AD, GEL y WEB 2.0','Seguimiento','Telecentro_Villa_del_Socorro.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',3,198,10,'2015-04-09 11:58:29','2015-05-22 15:29:00'),(474,'2015-04-07','Planeación de actividades','Se conversó sobre la importancia de realizar procesos que involucren a las personas con discapacidad de la ciudad. Por esa razón estuvimos conversando sobre realizar un taller de narrativas que además tuviera continuidad, por lo que se conversó sobre la idea de construir un laboratorio de medios para la IE.','Se realizará un taller de narrativas digitales cuyo fin será la construcción de un laboratorio de medios dentro de la IE.','reunionGuillermoVelez.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',4,157,21,'2015-04-09 12:13:28','2015-05-22 15:29:00'),(475,'2015-04-08','Reunión gestión y planeación','Reunión con el comité académico conformado por el rector y los coordinadores de las tres sedes, para gestionar procesos de formación en la instutución, tanto para estudiantes como para la comunidad. ','Comenzar las charlas de NSN desde primaria, y gestionar el Aula Abierta con el acompañamiento de estudiantes de PP','IE_Gonzalo_Restrepo_Reunion_planeacion.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',2,305,17,'2015-04-09 16:14:50','2015-05-22 15:29:00'),(476,'2015-04-09','Reunión gestión y planeación','Reunión con la dinamizadora cultural para programar los procesos de formación en la biblioteca. ','Charla de NSN para niños la próxima semana, convocar a adultos para curos de AD, capacitar a la estudiantes de PP como Gestora TIC, y convocar al grupo de víctimas para realizar un proceso de AD y ND bajo la nueva metodología.','Biblioteca_Villatina_Reunion_planeacion.JPG',NULL,NULL,'uploads/meeting/meeting_adjunct',2,525,17,'2015-04-09 16:17:52','2015-05-22 15:29:00'),(477,'2015-04-09','Reunión gestión y planeación','Reunión con la coordinadora del centro de capacitación del SENA para programar el proceso de formación en AD y ND según la nueva metodología, con un grupo de víctimas de desplazamiento forzado la comuna 9. ','Convocar a las personas para el próximo viernes 24 de abril','CAV_Caunces_Reunion_de_planeacion.JPG',NULL,NULL,'uploads/meeting/meeting_adjunct',3,298,17,'2015-04-09 16:32:56','2015-05-22 15:29:00'),(478,'2015-04-08','Empalme en I.E Sección Escuela la Iguaná','Reunión de empalme y nuevos procesos 2015.\r\nConocimiento de uso de kit de inclusión digital y posibles escenarios de articulación entre la Institución y el Programa. \r\nPropuestas de contenidos y posibles talleres y cursos: Proyecto de emisora escolar, capacitación para el uso del kit de inclusión digital y charlas de navegar sin naufragar. ','Inicio de capacitación docente: miércoles 22 de abril: Uso de Kit de Inclusión Digital y Charla de navegar sin naufragar. Socialización de la propuestas de emisora escolar. \r\nReunión con Coordinadora para revisar cronograma de inicio Emisora Escolar. \r\n\r\nMiércoles 29 de abril: Charla de navegar sin naufragar grados tercero, cuarto y quinto. Grupo A mañana y grupo B tarde. ','Reunion_de_Empalme_I_E_Marco_Fidel_Suarez_Seccion_la_Iguana.JPG',NULL,NULL,'uploads/meeting/meeting_adjunct',2,219,41,'2015-04-09 16:36:18','2015-05-22 15:29:00'),(479,'2015-04-08','Empalme y nuevos procesos 2015 Ciro Mendía','Empalme del proceso anterior, contextualización del estado y uso anterior del Aula Abierta. Actualmente es un proceso que se encuentra sin ser ofrecido a la comunidad pues según manifiesta el profesor no han tenido acompañamiento a los estudiantes. \r\nReconocimiento de las instalaciones físicas y los recursos audiovisuales con los que cuenta la institución educativa y la iniciativa de los estudiantes y el docente acompañante del proceso. \r\nPropuestas de contenido para acompañamiento 2015: Apertura del aula abierta y proyecto de alfabetización audiovisual para el colegio como estrategia de sostenibilidad de un proceso de narrativas. ','Próximo encuentro: Presentar proyecto de alfabetización digital para el rector de la Institución Educativa y propuesta de Cronograma para el acompañamiento. \r\n\r\nVincular a la personera escolar en el proyecto de alfabetización audiovisual para fortalecer los procesos de liderazgo y gobierno escolar al interior de la Institución. ','Profe_de_la_I_E_Ciro_Mendia_en_sala_audiovisual_con_sus_estudiantes_Visita_de_empalme.JPG',NULL,NULL,'uploads/meeting/meeting_adjunct',2,250,41,'2015-04-09 16:48:03','2015-05-22 15:29:00'),(480,'2015-04-01','Programación de actividades','Reunión de planeación de actividades con jóvenes de la corporación. Se solicita el apoyo en la emisrora para que los estudiantes sean los locutores y quienes generen algunos de los contenidos. Este trabajo se realizará con el acompañamiento del profesor Gustavo quien está cargo de la emisora. ','Reunión con el profe encargado de la emisora el martes 7 de abril a las 2:00 pm ','Corporacion_Hogar_reunionplaneacion.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',4,213,20,'2015-04-09 16:55:24','2015-05-22 15:29:00'),(481,'2015-04-08','Empalme y gestión de nuevos procesos 2015','En la reunión se retomó el acompañamiento iniciado por la anterior gestora en cultura digital que acompañaba el telecentro, donde se habían tenido unas conversaciones previas para iniciar procesos de MDE Inteligente. \r\n\r\nUna vez conocidos los talleres y cursos que de dictan a la comunidad en el Telecentro se le propone a la coordinadora el acompañamiento en narrativas: fotografía para un grupo con el que previamente se ha trabajado en alfabetización digital y requieren otro tipo de oferta en formación. \r\n','Agendado incio de taller de Narrativas digitales: fotografía con grupo de madres cabeza de hogar para el jueves 16 de abri en la mañana. ','Usuaria_del_Telecentro_Moscu_en_visita_de_empalme.JPG','Usuario_Telecentro_Moscu_en_Visita_de_Empalme.JPG','Visita_de_empalme_Telecentro_Moscu.JPG','uploads/meeting/meeting_adjunct',2,464,41,'2015-04-09 16:57:45','2015-05-22 15:29:00'),(482,'2015-04-09','Empalme y nuevos procesos 2015 ','Empalme del proceso anterior con al aula abierta a la comunidad, proceso con padres de familia, resultados y continuación. \r\nPropuesta de acompañamiento: Capacitación docente en alfabetización digital y web 2.0  y charlas de navegar sin naufragar. Aula abierta: Padres de familia. ','El coordinador se encargará de proponer las fechas de inicio de la reunión con los docentes. ','I_E_Escuela_del_Concejo_Clodomiro_3.JPG',NULL,NULL,'uploads/meeting/meeting_adjunct',2,252,41,'2015-04-09 17:11:03','2015-05-22 15:29:00'),(483,'2015-04-09','Empalme y planeación de actividades para 2015.','Se realizó la presentación de la nueva gestora de cultura digital que acompañará la Institución Educativa, se detectaron las principales necesidades de la institución, entre las cuales está acompañar aula abierta, dictar charlas de NSN y realizar un taller de narrativas con algunos de los estudiantes. Se programaron las charlas de NSN.','Quedó como compromiso programar el taller de narrativas y concretar otra reunión para apoyar el proceso de aula abierta. ','Institucion_Educativa_Jose_Acevedo_y_Gomez_Empalme.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',2,344,43,'2015-04-10 09:08:14','2015-05-22 15:29:00'),(484,'2015-04-07','Seguimiento','Reunión de seguimiento y capacitación de los gestores tic del telecentro de santa monica','Terminar la capacitación el viernes 10','Telecentro_Santa_Monica-0.jpg','Cristobal_Colon2.jpg',NULL,'uploads/meeting/meeting_adjunct',4,468,10,'2015-04-10 13:59:52','2015-05-22 15:29:00'),(485,'2015-04-10','Seguimiento','Continuación de la capacitación con los gestores tic del telecentro','Enviar las bases de datos para elaborar certificados','Telecentro_Santa_Monica2.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',2,468,10,'2015-04-10 14:02:03','2015-05-22 15:29:00'),(486,'2015-04-07','Reunión ','Reunión con directivas de la I.E para planear intervención en la institución ','Convocatoria con la comunidad y horarios para charlas','Cristobal_Colon2.jpg','Cristobal_Colon1.jpg',NULL,'uploads/meeting/meeting_adjunct',4,222,10,'2015-04-10 14:04:31','2015-05-22 15:29:00'),(487,'2015-04-10','Reunion para procesos de formación','Reunión con directivas para elaborar horarios de charlas NSN para cinco quintos y 3 grupos de escuela de padres en AD','Capacitación de los profesores encargados del Aula Abierta y charlas de NSN','Telecentro_Santa_Monica2-0.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',4,222,10,'2015-04-10 14:07:31','2015-05-22 15:29:00'),(488,'2015-04-08','Empalme con funcionarios','Se realizó reunión con la docente encargada para agendar acompañamiento 2015 y se programaron 2 charlas de Navegar sin Naufragar en la mañana, además de NSN para padres el día  10 de junio. Se habló de capacitar las dos docentes en Prezzi y/0 socializar herramientas educativas en la web que les permitan elaborar insumos como sopas de letras, crucigramas etc para el trabajo con los niños y niñas. Se programará además la charla de dispositivos móviles. Se verificó la conectividad en las afueras de la I.E.','Desarrollar las actividades programadas','vereda_la_suiza.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',2,492,23,'2015-04-13 08:11:50','2015-05-22 15:29:00'),(489,'2015-04-08','Empalme con funcionarios','Se llevó a cabo reunión con el rector de la I.E y manifestó el impacto positivo del taller de Narrativas que se realizó con los chicos el año pasado, por lo cual se propuso continuar ese proceso  a manera de laboratorio y que sean los mismos chicos los encargados de liderar el grupo con lso nuevos integrantes e iniciar el proceso formativo con el taller. Se propueso realizar Gel con grupos décimos y once para el segundo semestre y una charla de NSN cada mes para el resto de grupos ','Reunión el próximo miércoles 22 con el grupo de chicos y chicas que haran parte del laboratorio.','I_E_Hector_Rogelio_Empalme_y_planeacion.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',2,276,23,'2015-04-13 08:26:48','2015-05-22 15:29:00'),(490,'2015-04-08','Empalme con funcionarios','Se llevó a cabo reunión con funcionarios de la biblioteca y además de indagar las dinámicas, tipos de población y procesos anteriores se planeó una actividad para cada tipo de público. En julio se planean charlas de dispositivos móviles para  los grupos de A.D de la biblioteca. En septiembre s eplanea NSN con jóvenes','Miércoles 6 de mayo: Navegar sin naufragar de 2 a 3 de la tarde con niños.\r\nCésar será encargado de replicar GEL con sus grupos DE A.D y se le deben pasar los contenidos',NULL,NULL,NULL,'',2,185,23,'2015-04-13 08:47:53','2015-05-22 15:29:00'),(491,'2015-04-08','Seguimiento al Sitio','Se visitó la casa de Gobierno, se presentó a La Gestora de Cultura Digital encargada, se revisaron los equipos y se reportaron los dañados. Se recogieron planillas y se pegó el afiche Para cursos','No hay ','Casa_de_Gobierno_S_S_Palmitas_Seguimiento_al_sitio.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',4,270,23,'2015-04-13 09:04:07','2015-05-22 15:29:00'),(492,'2015-04-08','Empalme con funcionarios','Se llevó a cabo reunión con el rector de la I.E para evaluar la posibilida de reanudar el aula abierta y se convocan 4 estudiantes de la I.E para liderar el proceso y se programa charla de NSN con los otrs grupos','Reunión con alfabetizadores a la 9 a.m el jueves 16 de mayo y charla de NSN de 10 a 12 p.m el mismo día','I_E_Loma_hermosa_Empalme_y_planeacion.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',2,493,23,'2015-04-13 14:32:30','2015-05-22 15:29:00'),(493,'2015-04-08','Empalme con funcionarios','Se realizó reunión de empalme y planeación con funcionario en donde surge la necesidad de apoyar los procesos con el curso de Alfabetización Digital, para lo cual se prevee que el horario serán los sábados de 9 a 11.','- Llevar a cabo reunión con la comunidad para iniciar curso de A.D el dia jueves 23 de abril a las  2 p.m\r\n- Buscar chico de pp para desarrollar el proceso o un alfabetizador de la I.E La loma.\r\n- Enviar correo electrónico con el resúmen de los procesos formativos con que cuenta el programa para ir agendando paulatinamente según el tipo de población','Biblioteca_la_loma_Empalme_y_planeacion.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',2,187,23,'2015-04-13 14:45:16','2015-05-22 15:29:00'),(494,'2015-04-09','Empalme con funcionarios','Se llevó a acbo reunión con la señora Ana lópez, Coordinadora académica de la I.E y se inadagó por los procesos anteriores desarrollados por el programa y se concluyó la importancia de volver a convocar a la comunidad para curso de A.D y buscar chico de PP  para desarrollarlo en las noches. Se programaron algunas charlas y se pensará en GEL para estudiantes de once en el segundo semestre.','Jueves 7 de mayo: Navegar sin Naufragar de 8 A 12 con dos grupos.\r\nJueves 28 de mayo: Navegar sin Naufragar de 1:20 a 3:15 con dos grupos.\r\nEnviar correo electrónico para recordar fechas','I_E_Ciudadela_N_Occidente_Empalme_y_planeacion.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',2,405,23,'2015-04-13 14:55:34','2015-05-22 15:29:00'),(495,'2015-04-09','Emplame','Se conversó con la funcionaria y se pensó en asesorías para los funcionarios en Gel','Mirar la posibildad de un chico de Pp para acompañar el punto de navegación','Centro_de_servicios_N_Occidente_Empalme.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',2,272,23,'2015-04-13 15:07:13','2015-05-22 15:29:00'),(496,'2015-04-13','Reunion de planeacion de actividades 2015','Reunión con el Dinamizador del Telecentro para iniciar procesos de formación, ','-Se iniciará taller de fotografía con la corporación Alma y Vida, de personas en situación de discapacidad, a partir del 21 de abril.\r\n\r\n- Convocatoria de emprendedores para iniciar mercadeo digital.','Telecentro_Villa_Laura_Acompanamiento_al_Sitio.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',4,206,38,'2015-04-14 08:41:47','2015-05-22 15:29:00'),(497,'2015-04-14','Gestion con aliados','Reunión de gestión y seguimiento del proceso de padres de la institución educativa Samuel barrientos','Reunión con el rector y los estudiantes de la institución para gestión de procesos y revisión de contenidos','Reunion_con_aliados_Samuel_Barrientos.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',3,230,10,'2015-04-14 16:23:42','2015-05-22 15:29:00'),(498,'2015-04-14','Procesos de formación','Se realizó una reunión con un nuevo Gestor TIC que apoyará los procesos de formación que se iniciarán con emprendedores del CEDEZO de Belén, Además se aprovecho para presentarlo con la coordinadora del CEDEZO.','Inicio de curso de Alfabetización Digital Viernes 24 de Abril.','CEDEZO_Belen_Reunion_Procesos_de_Formacion.jpg','CEDEZO_Belen_Procesos_de_formacion_y_presentacion_Gestor_TIC.jpg',NULL,'uploads/meeting/meeting_adjunct',4,176,15,'2015-04-15 17:48:24','2015-05-22 15:29:00'),(499,'2015-04-15','Gestión Procesos de Formación','Se realizó una reunión con el técnico de cultura digital para conversar acerca de los procesos que se estan llevando en el Parque Biblioteca y mirar la manera como nos podemos articular con ellos.','Iniciar convocatorias para procesos de formación.','Parque_Biblioteca_SADEP_Gestion_de_procesos_de_formacion.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',4,194,15,'2015-04-15 17:58:52','2015-05-22 15:29:00'),(500,'2015-04-15','Gestión de estudiantes de pp','Reunión con la encargada de la parte educativa de la JAL para gestionar estudiantes de presupuesto participativo, además se le comentó el avance que se ha tenido con los que estan realizando la labor social con nosotros.','Enviar correo para confirmar estudiantes.','Casa_de_Gobierno_SADEP_Reunion_con_la_JAL.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',3,333,15,'2015-04-15 18:01:43','2015-05-22 15:29:00'),(501,'2015-04-17','Empalme y planeación','Empalme y planeación del acompañamiento del programa a la I.E este mes.','Charla NSN para 5tos',NULL,NULL,NULL,'',2,150,10,'2015-04-20 08:56:18','2015-05-22 15:29:00'),(502,'2015-04-14','Seguimiento al KIT de Inclusión digital.','Se realizó una reunión con la docente del aula de apoyo para identificar el número de estudiantes en situación de discapacidad que tiene la sede y cuales de estos estudiantes usan el KIT de inclusión digital, ella mencionó que en este momento se está realizando un estudio sobre el tema y que dicho estudio estará listo a finales de Abril, por lo cual la docente solicita que volvamos a finales de Abril o a principios de Mayo para socializarnos los resultados del estudio.','Quedó como compromiso por parte de la Institución Educativa informarnos sobre el número de estudiantes que usan el KIT de inclusión digital.\r\nAdemás la Institución se comprometió a agendar una posible fecha para realizar la sensibilización del uso del KIT de inclusión digital con docentes y así fomentar el uso de este. ','Institucion_Educativa_Santos_Angeles_Custodios_Seguimiento_KIT_de_Inclusion.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',4,359,43,'2015-04-20 14:59:00','2015-05-22 15:29:00'),(503,'2015-04-17','Reunión con Rubén Patiño','Se planeó la intervención al sitio durante todo el año, se llegó al acuerdo de dar charlas para los jóvenes del grado 11 quienes van a ingresar a la educación superior, también se habló de reforzar el uso del Kit de Inlusión en la institución','Charlas de navegar sin naufragar, reforzar el kit de inclusión','I_E_Diego_Echavarria_Misas_Reunion_de_Planeacion.JPG',NULL,NULL,'uploads/meeting/meeting_adjunct',3,225,42,'2015-04-20 15:11:30','2015-05-22 15:29:00'),(504,'2015-04-14','Planeación de actividades.','Se realizó una reunión de planeación de actividades basadas en suplir las necesidades del Parque Biblioteca. Se agendaron los siguientes procesos: curso de Alfabetización Digital y Gobierno en Línea para adultos, charlas de Navegar sin Naufragar para niños y padres de familia, talleres de Narrativas y fotografía para jóvenes. ','Por parte del Parque Biblioteca, quedó como compromiso gestionar un grupo para el taller de narrativas, otro para el curso de Alfabetización Digital y Gobierno en Línea y gestionar grupos para charlas de Navegar sin Naufragar.','Parque_Biblioteca_Guayabal_Reunion_de_planeacion.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',4,192,43,'2015-04-20 15:23:00','2015-05-22 15:29:00'),(505,'2015-04-16','Empalme y planeación de actividades para 2015.','Se realizó reunión con la rectora de la institución para iniciar el proceso de acompañamiento, se detectaron las principales necesidades del centro educativo, entre las cuales está acompañar aula abierta, dictar charlas de Navegar sin Naufragar con niños y con padres de familia y realizar taller de narrativas y fotografía con niños. ','Quedó como compromiso por parte de la institución educativa programar fechas para las charlas de Navegar sin Naufragar y el taller de narrativas.\r\nAdemás, la rectora se comprometió a evaluar la posibilidad de abrir el aula abierta a la comunidad e informarnos sobre la decisión.','Centro_Educativo_El_Manzanillo_Reunion_empalme_y_planeacion.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',2,127,43,'2015-04-20 15:39:20','2015-05-22 15:29:00'),(506,'2015-04-07','Funcionamiento de la emisora','Reunión conocimiento y reconocimiento del funcionamiento de la emisora de la Corporación; el docente encargado trabajó en una emisora, esta experiencia ha permitido una mayor apropiación del recurso por parte de los jóvenes de la corporación. Se contó con el acompañamiento de Chsritian (comunicador)','Se acuerda realizar los talleres los jueves de 2:00 a 3:30','Corporacion_Hogar_reunion_emisora_1.jpg','Corporacion_Hogar_reunion_emisora_2.jpg',NULL,'uploads/meeting/meeting_adjunct',4,213,20,'2015-04-21 11:11:12','2015-05-22 15:29:00'),(507,'2015-04-08','Seguimiento punto de navegación','Reunión con una de las funcionarias del lugar para conocer el desempeño de los estudiantes de PP en el punto de navegación.','Continuar con el acompañamiento del sitio','Mascerca_Buenos_Aires_seguimiento.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',4,314,20,'2015-04-21 11:27:06','2015-05-22 15:29:00'),(508,'2015-04-07','Reunión de empalme','Reunión de empalme con enlace, datos de las funcionarias, verificación del funcionamiento de los equipos del punto de navegación. y recolección de indicadores.','Continuar con el acompañamiento del punto de navegación','Espacio_publico_empalme.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',2,427,20,'2015-04-21 11:42:03','2015-05-22 15:29:00'),(509,'2015-04-07','Reunión de empalme','Reunión de empalme y planeación de actividades\r\nSe concreta GEL para los dos grupos del aula abierta, GEL par estudiantes de 11°y  charlas de NSN para el grado 5°.\r\nEn la institución se continúa con el aula abierta martes y miércoles con dos grupos de padres de familia.','El profesor enviará la programación de las actividades','IE_Asamblea_Departamental_empalme_planeacion.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',2,293,20,'2015-04-21 11:50:33','2015-05-22 15:29:00'),(510,'2015-04-14','Seguimiento kit de inclusión digital','Seguimiento al kit de inclusión digital, es utilizado por los técnicos de cultura digital en sus cursos. O cuando un usuario de las salas de informática lo requiere. \r\n','Compromiso: agendar una reunión con la coordinadora de los tecnicos de cultura digital para planificar actividades entre MCI y la biblioteca','PB_Leon_de_Greiff_kit_inclusion.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',4,189,20,'2015-04-22 12:00:33','2015-05-22 15:29:00'),(511,'2015-04-22','Reunión para gestión de Aula Abierta','Reunión con el rector para reactivar el aula abierta, se generó el compromiso de gestionar el grupo, que posiblemente sea de la tercera edad de la JAC de la loma de los parras, y asignar el Gestor formador y enviar la información al rector. con la docente de tecnología de primaria se articuló charla de NSN con estudiantes de 4 y 5 grado, queda fecha por definir.','-  Gestionar Información sobre proceso de aula abierta, público, gestor encargado y demás que el rector necesite\r\n- Coordinar con la docentes de tecnología las charlas de NSN y GEL para las primeras semanas de mayo','Acompanamiento_al_Sitio_IE_Santa_Catalina_de_Sena.JPG',NULL,NULL,'uploads/meeting/meeting_adjunct',4,357,38,'2015-04-22 13:38:57','2015-05-22 15:29:00'),(512,'2015-04-10','Reunión de planeación','Reunión con el dinamizador del telecentro para programar el taller de narrativas digitales con adultos. Se estableció el día lunes en la tarde para comodidad de la comunidad.','Convocar a la comunidad para los lunes en la tarde. Enviar una breve información del taller para hacer divulgación.','Telecentro_La_Mansion_Reunion_de_planeacion_1.JPG','Telecentro_La_Mansion_Reunion_de_planeacion_2.jpg',NULL,'uploads/meeting/meeting_adjunct',3,205,17,'2015-04-22 16:24:01','2015-05-22 15:29:00'),(513,'2015-04-14','Reunión de empalme y gestión','Encuentro con la directora del centro educativo para planear los procesos de formación con la comunidad y fortalecer el aula abierta. Nos acompañó además un Gestor TIC que sería el encargado de realizar y asesorar los cursos que comenzarán en la institución.  Se hizo además la entrega del álbum Medellín es un caramelo, como reconocimiento por su labor y disposición de trabajo siempre.','Reunirnos en 15 días con líderes comunitarios y funcionarios de entidades aliadas al centro educativo, para programar los horarios de los procesos de formación.','CE_El_Plan_Reunion_empalme.jpg','CE_El_Plan_Reunion_empalme_1.jpg','CE_El_Plan_Entrega_album.jpg','uploads/meeting/meeting_adjunct',2,426,17,'2015-04-22 16:35:13','2015-05-22 15:29:00'),(514,'2015-04-14','Reunión gestión y planeación','Reunión con la directora del centro educativo para la planeación de la actividad el día del niño en la institución. Realizamos un recorrido de reconocimiento por el centro educativo para organizar los detalles del evento y saber con qué espacios y recursos contamos. ','Enviar un correo con la información y requerimientos específicos para poder poner a disposición a los docentes de la institución para la actividad.','CE_El_Placer_Reunion_de_planeacion.jpg','CE_El_Placer_Visita_de_planeacion_de_evento_6.jpg','CE_El_Placer_Visita_de_planeacion_de_evento_4.jpg','uploads/meeting/meeting_adjunct',4,425,17,'2015-04-22 16:38:28','2015-05-22 15:29:00'),(515,'2015-04-14','Reunión de empalme y gestión','Encuentro con la técnica social y cultural de la biblioteca para realizar el empalme y planear los procesos de formación a la comunidad. Surgen dos propuestas de trabajo orientadas a la población de emprendedores del CEDEZO y para jóvenes del corregimiento. ','Gestionar con la dirección del CEDEZO el grupo de personas y luego contactar a los funcionarios de la biblioteca para programar los horarios de capacitación; igualmente, programar un horario para trabajar el taller de narrativas digitales con los jóvenes. Estos procesos serían facilitados por el Gestor TIC del corregimiento.','Biblioteca_Santa_Elena_Reunion_de_planeacion_2.JPG','Biblioteca_Santa_Elena_Reunion_de_planeacion_3.JPG','Biblioteca_Santa_Elena_Reunion_de_planeacion_8.jpg','uploads/meeting/meeting_adjunct',2,190,17,'2015-04-22 16:49:12','2015-05-22 15:29:00'),(516,'2015-04-22','Gestión de Aula Abierta','reunión para gestionar la apertura del aula abierta en la institución, el año pasado estuvo activa, pero hay que organizar nuevos procesos y hacer convocatoria','- Llamar al coordinador para gestionar reunión\r\n- Conseguir gestor y hacer convocatoria','Acompanamiento_al_sitio_IE_Republica_de_Venezuela.JPG',NULL,NULL,'uploads/meeting/meeting_adjunct',4,125,38,'2015-04-23 08:56:40','2015-05-22 15:29:00'),(517,'2015-04-22','Seguimiento al punto de navegación','Seguimiento al punto de navegación del sitio','- compromiso de fomentar la firma de la planillas de registro de usuario en el punto de navegación por parte de los funcionarios','Seguimiento_a_Sitio_Mascerca_Guayabal.JPG',NULL,NULL,'uploads/meeting/meeting_adjunct',4,348,38,'2015-04-23 10:46:21','2015-05-22 15:29:00'),(518,'2015-04-22','Gestión de Procesos 2015','Gestión de procesos de formación para el año 2015 en alfabetización digital, web.2.0 y mercadeo digital para segundo semestre','- Hacer convocatoria con adultos mayores para iniciar curso de alfabetización digital en la primera semana de Mayo, gestionar gestor TIC para acompañar el proceso','Reunion_de_gestion_de_procesos_Telecentro_Fatima.JPG',NULL,NULL,'uploads/meeting/meeting_adjunct',4,207,38,'2015-04-23 10:52:42','2015-05-22 15:29:00'),(519,'2015-04-13','Seguimiento del sitio y planeación de actividades','Se realizó reunión con el funcionario encargado de la Bolera Suramericana, se habló del funcionamiento de la red y él nos contó que la red ha funcionado bien y que los usuarios hacen un uso considerable de esta. Se pensó en la posibilidad de hacer una charla de dispositivos móviles, ya que es una necesidad de los usuarios del sitio, puesto que muchos de estos son adultos y quieren aprender a usar sus teléfonos inteligentes. ','Programar charla de dispositivos móviles.','Bolera_Suramericana_Planeacion_de_actividades.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',4,563,43,'2015-04-24 14:44:05','2015-05-22 15:29:00'),(520,'2015-04-13','Seguimiento del sitio y planeación de actividades','Se realizó una reunión con la funcionaria encargada del sitio, la cual manifestó que la red la usan mucho los padres de familia que vienen a acompañar a los niños en los entrenamientos, además manifestó que sería viable programar una visita para conversar con dichos padres y proponerles si quieren participar en alguno de nuestros procesos de formación, mientras sus hijos entrenan, como por ejemplo charla de dispositivos móviles o GEL. Agrega que ella conoce los padres de familia y sabe que estarían muy contentos con la propuesta. ','Programar nueva visita para conversar con los padres usuarios de la red WIFI. ','Pista_de_bicicross_Planeacion_de_actividades.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',4,565,43,'2015-04-24 15:01:58','2015-05-22 15:29:00'),(521,'2015-04-15','Empalme  y planeación','Se realizó reunión de empalme y planeación con coordinador del Cedezo San Cristóbal en donde se conversó de la necesidad de contar con la red WIFI para dar inicio a los procesos de formación. De este modo según la población  las ofertas posibles son Alfabetización digital, Herramientas web 2.0 y GEL Comunidad; además de charlas de dispositivos móviles que se consideran muy pertinentes para los usuarios del lugar','Asesoría de dispositivos móviles con micro empresarios para el 6 de mayo a las 9 de la mañana','IMG_20150415_085654769.jpg','IMG_20150415_091152102.jpg','IMG_20150415_091205467.jpg','uploads/meeting/meeting_adjunct',2,169,23,'2015-04-27 08:40:12','2015-05-22 15:29:00'),(522,'2015-04-15','Empalme  y planeación','Se realizó reunión de Empalme y planeación con Coordinador en donde se identificaron características de la población, además de algunas necesidades, rutinas y dinámicas propias del sitio; los acompañamientos cotidianos y de esta forma fue posible identificar la manera en que el programa se vinculara con una propuesta de formación, en este caso narrativas digitales, en donde se vincule un docente del lugar como líder y aquellos jóvenes que ya tuvieron la formación anterior para continuar el proceso',' Iniciar el taller de Narrativas digitales el 14 de mayo y confirmar la fecha. Es necesario posteriormente al taller de narrativas realizar el taller de Kit de inclusión con el grupo de formadores ya que tanto el coordinador como varios docentes son nuevos y no lo saben usar, además de esto compartir algunas herramientas web para el trabajo con los chicos y chicas.','Centro_integrado_S_C_Empalme_y_Planeacion.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',2,444,23,'2015-04-27 12:56:57','2015-05-22 15:29:00'),(523,'2015-04-22','Empalme y planeación de actividades para 2015.','Se realizó reunión con el coordinador del Punto de Atención CEDEZO Altavista, en la cual se detectaron las principales necesidades de los emprendedores del corregimiento, entre ellas está aprender alfabetización digital y mercadeo digital.','Por parte del coordinador del CEDEZO, quedó como compromiso llevar la propuesta de formación a los emprendedores y hacer la convocatoria pertinente. ','Punto_de_Atencion_CEDEZO_Altavista_Empalme_y_planeacion.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',2,177,43,'2015-04-27 13:41:11','2015-05-22 15:29:00'),(524,'2015-04-15','Empalme','Se visitó el centro de servicios para hacer contacto con el funcionario, verificar el estado de los equipos y planear acciones de divulgación del servicio con la comunidad. Se plantea con el funcionario la posibilidad de gestionar chicos de PP para acompañar el centro de servicios en algunos momentos y realizar asesorías con los usuarios, además acompañar el punto.','Ninguno','Centro_de_Servicios_S_C_Empalme_Funcionario.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',2,567,23,'2015-04-27 13:42:34','2015-05-22 15:29:00'),(525,'2015-04-22','Empalme y planeación de actividades para 2015.','Se realizó una reunión de empalme y planeación con el dinamizador del telecentro, con el fin de detectar las principales necesidades de los usuarios del lugar, el dinamizador expresa que partiendo de las necesidades de la población, sería pertinente realizar una charla de dispositivos móviles con un grupo de adultos mayores, trabajar narrativas y navegar sin naufragar con 2 grupos de niños de una corporación que se llama \"Gente de Corazón\". ','Quedó como compromiso programar las charlas y el taller.','Telecentro_Los_Tanques_Empalme_y_planeacion.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',2,457,43,'2015-04-27 13:49:36','2015-05-22 15:29:00'),(526,'2015-04-15','Gestión JAL','Se llevó a cabo reunión con Secretaria de la JAL de San Crsitóbal con el propósito de gestionar la presencia de chicos y chicas de PP para acompañar algunos de los sitios que acompaña el programa en el corregimiento, además de esto se realizó asesoría en el manejo de dispositivo móvil y se conversó la importancia de generar vínculos estratégicos con los jóvenes para este tipo acompañamientos en su territorio.','La foto de la reunión se publicará en redes sociales de la JAL para hacer difusión y de este modo captar la atención de aquellos jóvenes que aun faltan por pagar su labor social.','IMG_20150415_114250404.jpg','IMG_20150415_120407858.jpg',NULL,'uploads/meeting/meeting_adjunct',3,567,23,'2015-04-27 13:50:49','2015-05-22 15:29:00'),(527,'2015-04-16','Visita de Seguimiento','Se realizó visita de seguimiento dado que se había convocado reunión con el rector; sin embargo con motivo de una marcha docente se interrumpió dicha reunión; por tanto con la secretaria se acordaron algunos puntos necesarios para un próximo encuentro. El aula de informática esta lista para aperturar el proceso con padres','Esperar hasta luego del 22 de Abril que se llevará a cabo el paro Nacional docente para definir acuerdos para convocar reunión con estudiantes alfabetizadores que liderarán el aula abierta. Convocar para dicha reunión al docente de informática. Reagendar la charla de NSN. ','IMG_20150416_101512923.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',4,493,23,'2015-04-27 14:46:08','2015-05-22 15:29:00'),(528,'2015-04-21','Planeación de procesos','Se llevó a cabo reunión con Beatriz Atehortúa. Inicialmente ella comaparte un breve diagnóstico tanto de la población atendida como del recorrido, premios y  demás actividades realizadas en la biblioteca;  para planear un encuentro en donde se socialice la experiencia tan exitosa que ha realizado  en el tema de discapacidad con otras entidades como el Colegio Mayor, el ITM Y algunas I.E . Se plantea dicho encuentro para la tercera semana de mayo. Se plantea un taller práctico de más o menos 3 horas donde se convoquen chicos y chicas con diferentes tipos de discapacidades para que los funcionarios puedan observar de manera práctica los contenidos abordados.','Enviar información previa vía correo electrónico con antelación.','Biblioteca_Fdo_Gomez_Martinez_Planeacion_Sensibilizacion_Disc.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',3,268,23,'2015-04-27 15:19:01','2015-05-22 15:29:00'),(529,'2015-04-21','Planeación de procesos','Se planearon fechas para las charlas propuestas en la primera reunión y se descartó la posibilidad de reanudar el aula abierta en al I.E . El rector dice ya haber cumplido con esa labor años anteriores y no querer hacerlo de nuevo por que \"las condiciones no se prestan\" refiriéndose al sistema en la nube. Por tanto se acuerda  12 de mayo: NSN con grado Noveno y 16 de Julio GEL con grado once. Para estas charlas se contará con la presencia del orientador de grupo además del psicólogo en tanto serán los encargados de replicarlas con el resto de los grados.','Dictar las charlas asignadas y pasar los contenidos','Fe_y_alegria_aures_Planeacion_de_procesos.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',3,407,23,'2015-04-27 15:30:13','2015-05-22 15:29:00'),(530,'2015-04-22','Gestión Aliados','Se conversó con una de las personas que trabajan en  la ludoteca casa San Martín y realizó un recuento de la población perteneciente al sector, sus características, dinámicas, las actividades frecuentes y cómo se convocan al rededor del lugar. Los programas que funcionan allí y los datos de algunas personas encargadas. Se plantean posibles acompañamientos, se presentan las dos nuevas gestoras Tic que en algunas ocasiones estarán en el lugar y se hace recorrido por el sector','Ninguno.','Ludoteca_Casa_San_Martin_Empalme_y_conocimiento_S_P.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',3,494,23,'2015-04-27 15:43:45','2015-05-22 15:29:00'),(531,'2015-04-22','Empalme y caracterización ','Se visitó la UPSS Nuevo Occidente. El funcionario sabe de la instalación de la red y de los equipos, se instalarán en total 6. Se observó el lugar y el contexto, se recorrió con dos de las gestoras Tic que lo acompañarán y se estableció contacto con algunas personas del lugar.','Ninguno','UPSS_Nuevo_Occidente_Empalme_y_recorrido.jpg',NULL,'IMG_20150422_100603451.jpg','uploads/meeting/meeting_adjunct',2,496,23,'2015-04-27 15:49:03','2015-05-22 15:29:00'),(532,'2015-04-20','Gestión de procesos','Se realizó una reunión con el rector de la IE y la docente de informatica encargada del aula abierta para conversar sobre los procesos de formación que se están dando y la posible articulación del programa, indicando cual es la oferta que tenemos para ellos.','Realizar una nueva reunión para programar actividades en la Institución.','IE_Fe_y_Alegria_El_Limonar_Reunion_Programacion_de_charlas.jpg','IE_Fe_y_Alegria_El_Limonar_Seguimiento_Aula_Abierta.jpg',NULL,'uploads/meeting/meeting_adjunct',4,340,15,'2015-04-29 08:52:34','2015-05-22 15:29:00'),(533,'2015-04-22','Gestión de procesos','Se realizó una reunión con el coordinador de convivencia de la jornada de la mañana para conversar de los procesos de formación que se iniciaran en la IE.','Programar una nueva reunión después de que se defina el paro, para programar otras charlas en la IE.','IE_San_Antonio_de_Prado_Programacion_de_charlas.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',4,130,15,'2015-04-29 09:05:06','2015-05-22 15:29:00'),(534,'2015-04-22','Kit de inclusión y Procesos de formación','Se realizó una reunión con el coordinador de convivencia para programar actividades en la IE con padres de familia y estudiantes.','Se hará una charla de Navegar sin Naufragar con padres de familia.','IE_San_Antonio_de_Prado_Sede_Carlos_Betancur_Gestion_de_procesos.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',4,140,15,'2015-04-29 10:13:41','2015-05-22 15:29:00'),(535,'2015-04-22','Gestión de procesos','Se realizó una reunión con los dos encargados del telecentro, donde se programó una sesión de fotografía con un grupo de alfabetización digital que ellos tienen, la idea es hacer un piloto para luego realizar un taller completo.','Taller corto de Narrativas digitales para el 13 de mayo','Telecentro_San_Antonio_de_Prado_Programacion_de_sesion_de_narrativas_digitales.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',4,210,15,'2015-04-29 10:40:25','2015-05-22 15:29:00'),(536,'2015-04-22','Procesos de formación','Se realizó una reunión con el coordinador de la Biblioteca para conversar acerca de los procesos de formación que se han dictado en el sitio, además de programar nuevos procesos con ellos.','Realizar otra reunión para programar procesos.','Biblioteca_Filial_San_Antonio_de_Prado_Gestion_de_procesos.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',4,195,15,'2015-04-29 10:50:13','2015-05-22 15:29:00'),(537,'2015-04-23','Gestión de procesos','Reunión con la dinamizadora del telecentro para programar algunas charlas y procesos de formación con la comunidad.','Charla dispositivos móviles, agendar nueva reunión para programar otros procesos.','Telecentro_Belen_Zafra_Reunion_Gestion_de_procesos.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',4,454,15,'2015-04-29 11:01:00','2015-05-22 15:29:00'),(538,'2015-04-24','Procesos de formación','Se realizó una reunión con la secretaría de la Unidad Integral 6 de Belén, con la idea de iniciar convocatoria para procesos de Alfabetización digital.','Se iniciara convocatoria para procesos de formación.','Unidad_Integral_6_de_Belen_Reunion_Gestion_de_procesos.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',4,362,15,'2015-04-29 11:04:57','2015-05-22 15:29:00'),(539,'2015-04-15','Reunión de empalme y nuevos procesos 2015 ','Se hizo la primera reunión de empalme del proceso anterior con el fin de conocer los compromisos previamente establecidos con la Institución educativa, conocer el contacto enlace y planear los procesos nuevos para el año 2015. \r\nEl año anterior se trabajó en el aula abierta con adultos mayores, para el año lectivo se pretende iniciar el acompañamiento con la comunidad educativa de primaria y secundaria. \r\nPara el segundo semestre: Procesos con bachillerato y acompañamiento y capacitación al personero escolar para dar charlas de Gobierno en línea y navegar sin naufragar para jóvenes. \r\nEl profesor Diego, cuenta con un grupo de jóvenes del grado noveno con quienes viene trabajando en animación 3D y stopmotion que puede ser un referente para iniciar un laboratorio audiovisual en dicho colegio. ','Agendar charlas de navegar sin naufragar para los estudiantes de los grados primaria y capacitación a la planta docente. ',NULL,NULL,NULL,'',2,251,41,'2015-04-29 11:07:37','2015-05-22 15:29:00'),(540,'2015-04-15','Empalme procesos anteriores y planeación 2015','Empalme con dinamizador del telecentro para retomar el proceso anterior y darle seguimiento a los compromisos previamente establecidos con este sitio. Conocimiento y contacto de la nueva gestora en Cultura Digital. ','Retomar el taller de narrativas digitales con el grupo de niños con el que actualmente trabaja la dinamizadora. ','IMG_6513.JPG','IMG_6517.JPG',NULL,'uploads/meeting/meeting_adjunct',2,197,41,'2015-04-29 12:05:03','2015-05-22 15:29:00'),(541,'2015-04-16','Empalme y nuevos procesos 2015 ','En esta reunión se presentó la nueva persona de cultura digital que acompañará el proceso y a la par se hizo empalme con la anterior gestora Johana Higuita sobre los procesos anteriores y compromisos pendientes. \r\nSe planearon las actividades para este año y el acompañamiento de un Gestor Tic para los nuevos procesos de web 2.0','Inicio de curso de web 2.0 acompañamiento de gestora tic Daniela Puerta para el 5 de mayo en las horas de la tarde. ','IMG_6580.JPG','IMG_6573.JPG',NULL,'uploads/meeting/meeting_adjunct',2,179,41,'2015-04-29 14:36:14','2015-05-22 15:29:00'),(542,'2015-04-28','Planeación de actividades.','Se realizó una reunión para programar actividades con personas en situación de discapacidad y con niños en las \"vacaciones creativas\". Se va a realizar taller de narrativas dirigido a personas en situación de discapacidad y una jornada de creación audiovisual infantil en la semana de vacaciones de mitad de año.',' Quedó como compromiso construir las actividades para la jornada de creación infantil. ','Parque_Biblioteca_Guayabal_Reunion_de_seguimiento_y_planeacion.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',4,192,43,'2015-04-29 15:28:29','2015-05-22 15:29:00'),(543,'2015-04-14','Reunión de empalme','Reunión con uno de los funcionarios del CEDEZO, quien informa el cambio de coordinador y la realización de dos cursos de emprendedores en el parque biblioteca. Le parece pertinente planificar procesos de formación con el programa después de mitad de año. \r\n','Compromiso. Reunión con el nuevo coordinador para programar actividades.','CEDEZO_La_Ladera_empalme_1.jpg','CEDEZO_La_Ladera_empalme_2.jpg',NULL,'uploads/meeting/meeting_adjunct',2,170,20,'2015-04-29 16:07:48','2015-05-22 15:29:00'),(544,'2015-04-14','Empalme y planeación','Reunión de planeación con la profesora enlace y el coordinador académico para definir la intervención del programa MCI en la institución, se concreta la realización de GEL para todos los estudiantes del grado 11° . Están realizando aula abierta abren su institución para la formación de adultos y con el programa \"la U en el barrio\" del ITM con la tecnología en administración. \r\n','Compromiso: realizar una visita para caracterizar la institución como posible beneficiaria del kit de inclusión digital. Agendar reunión con la presencia de la profesional de la UAI','Federico_Ozanam_planificacion_1.jpg','Federico_Ozanam_planificacion_3.jpg','Federico_Ozanam_planificacion_2.jpg','uploads/meeting/meeting_adjunct',4,303,20,'2015-04-29 16:30:54','2015-05-22 15:29:00'),(545,'2015-04-14','Reunión de empalme y planeación','Reunión de empalme y planificación de actividades con el rector y la coordinadora de la institución. Se acuerda realizar dos talleres de GEL para estudiantes del grado 11° y  charla de NSN para padres de familia.','Confirmación de las actividades','IE_Villa_Turbay_planificacion_2.jpg','IE_Villa_Turbay_planificacion_1.jpg',NULL,'uploads/meeting/meeting_adjunct',2,327,20,'2015-04-29 16:53:34','2015-05-22 15:29:00'),(546,'2015-04-16','Reunión de empalme y planeación','Reunión de empalme y planificación de actividades con el dinamizador del telecentro. Se acuerda realizar taller de GEL para el grupo de avanzada, charla de NSN para adultos. \r\n','Compromiso: programar en junio narrativas digitales sonoras para niños. y narrativas digitales fotografía','Telecentro_La_Sierra_planificacion_2.jpg','Telecentro_La_Sierra_planificacion_1.jpg',NULL,'uploads/meeting/meeting_adjunct',2,470,20,'2015-04-29 17:09:10','2015-05-22 15:29:00'),(547,'2015-04-15','Reunión de empalme y planeación','Reunión de empalme con la funcionaria encargada del CAM. Indagada por la repotencialización del punto de navegación. ','La gestora se compromete averiguar sobre este asunto con el área de conectividad, además, de mirar la posibilidad de la presencia de un gestor TIC en el punto de navegación para la atención al público.','CAM_empalme.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',2,535,20,'2015-04-29 17:16:58','2015-05-22 15:29:00'),(548,'2015-04-24','Gestión de activación Zona WIFI','Se realizó una reunión con el gestor administrativo del desarrollo integral Belén Zafra en donde se pudo programar una activación en el sitio.','Activación Zona WIFI el próximo 9 de mayo.','Desarrollo_Integral_Beleb_Zafra_Reunion_programacion_de_activacion_WIFI.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',4,559,15,'2015-04-30 07:52:00','2015-05-22 15:29:00'),(549,'2015-04-29','Aula Abierta y procesos de formación','Se realizó una reunión con la docente Mary Luz Velez quién lidera los cursos de alfabetización digital con la comunidad en el aula abierta de la IE, se programaron diferentes actividades con los padres de familia y con los estudiantes, además se logro conversar con algunas de las madres que están en los cursos quiénes dicen que se sienten muy contentas en el curso.','Se programaron diferentes actividades con los padres de familia y con los estudiantes.','IE_Antonio_Ricaurte_Reunion_Aula_abierta.jpg','IE_Antonio_Ricaurte_Seguimiento_Aula_Abierta.jpg',NULL,'uploads/meeting/meeting_adjunct',4,328,15,'2015-04-30 08:43:38','2015-05-22 15:29:00'),(550,'2015-04-16','Planeación de activación ','Reunión entre la líder de apropiación y el tesorero municipal, este último se encuentra interesado en la activación del punto. Se plantea  la formación de los tres jóvenes por la convivencia y una actividad de activación del punto de navegación. ','Formación de jóvenes por la convivencia en el registro al portal de ciudad y algunos trámites en línea. Activación del punto de navegación','Tesoria_municipal_planificacion_1.jpg','Tesoria_municipal_planificacion_2.jpg',NULL,'uploads/meeting/meeting_adjunct',4,437,20,'2015-04-30 10:26:15','2015-05-22 15:29:00'),(551,'2015-04-20','Reunión de empalme y planeación','Reunión de empalme y planeación de actividades de acompañamiento del programa. Se planifican dos charlas de GEL para estudiantes del grado 11° y 4 charlas de NSN para estudiantes de 8° y 9°. Se plantea la posibilidad de realizar el taller de narrativas digitales con estudiantes del grado 5°.\r\n','Compromiso: Enviar el contenido de narrativas digitales  a la profesora',NULL,NULL,NULL,'',2,304,20,'2015-04-30 11:37:28','2015-05-22 15:29:00'),(552,'2015-04-23','Empalme y Seguimiento al Kit','Se visitó el Jardín Infantil para hacer seguimiento de kit de inclusión digital y se estableció contacto tanto con la coordinadora como con la educadora especial. En este momento el kit no se usa por varias razones. Se detectó algo de desconocimiento de su utilidad, además de esto el personal de este año es nuevo y en la población infantil no hay presencia de discapacidades; sin embargo se realizará un breve diagnóstico con la comunidad para identificar posibles necesidades. Además de esto se generó una alianza con la educadora especial para agendar una capacitación con los gestores de cultura Digital en relación a los tipos de discapacidad, estrategias y demás aspectos relevantes ',' Regresar para conversar sobre hallazgos del diagnóstico con la comunidad y verificar la pertinencia del kit.\r\nAgendar la capacitación para los gestores de cultura Digital','2015_04_30.jpg','2015_04_30_1.jpg',NULL,'uploads/meeting/meeting_adjunct',2,413,23,'2015-04-30 11:50:39','2015-05-22 15:29:00'),(553,'2015-04-28','Empalme y planeación','Reunión entre el director de comunicaciones Concejo de Medellín y uno de los comunidadores del programa para generar estragegias de divulgación de la red wifi libre del recinto del Concejo. \r\nToman nota sobre las estrategias para ser implementadas en el lugar.','Implementación de estrategias de divulgación por parte del área de contenidos y comunicación pública del programa','Recinto_Concejo_municipal_empalme.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',2,536,20,'2015-04-30 12:15:14','2015-05-22 15:29:00'),(554,'2015-04-22','Asesoría en GEL','Formación en GEL a dos jóvenes por la convivencia quienes nos acompñaran como gestoras TIC en el punto de navegación de la tesorería municipal. Quedaron muy motivadas frente a los nuevos trámites que conocieron los cuales les servirán para brindar un mejor servicio a los usurarios. ','Atención de usuarios en la intervención al día siguiente','Tesoreria_municipal_seguimiento_2.jpg','Tesoreria_municipal_seguimiento_1.jpg',NULL,'uploads/meeting/meeting_adjunct',4,437,20,'2015-04-30 13:09:41','2015-05-22 15:29:00'),(555,'2015-04-01','Empalme y gestión de procesos','Reunión de empalme y planeación de procesos de formación con la profesional de servicios de información y un auxiliar de la Biblioteca. Confirmación de los datos de los encargados del sitio.','Confirmar las fechas de inicio de proceso de formación para los auxiliares de la Biblioteca, a partir de la primera semana de mes de Mayo.','Biblioteca_EPM_Empalme.jpg','Biblioteca_EPM_Empalme_2.jpg',NULL,'uploads/meeting/meeting_adjunct',2,163,40,'2015-04-30 13:19:35','2015-05-22 15:29:00'),(556,'2015-04-08','Empalme y gestión de procesos','Reunión de empalme y planeación con la Rectora de la Institución y el Maestro de Informática para iniciar procesos de formación con los estudiantes. ','Se iniciará charla de Gobierno en Línea con los alumnos de los grados 10° y 11° el día 20 de abril y se programará charla de Navegar sin Naufragar con los alumnos de los grados 4° y 5°. ','I_E_Miraflores_Empalme_2.jpg','I_E_Miraflores_Empalme_1.jpg','I_E_Miraflores_Empalme_3.jpg','uploads/meeting/meeting_adjunct',2,316,40,'2015-04-30 13:37:54','2015-05-22 15:29:00'),(557,'2015-04-23','Empalme y planeación con Coordinador','Se llevó a cabo reunió con la coordinadora de la I.E. Se retomaron las intervenciones del año pasado con el propósito de analizar la pertinencia de las acciones a proponer para el presente año; por lo tanto se tocó el tema del aula abierta en donde se dejó claro la importancia de buscar un chico de pp para gestionar nuevamente el proceso. De parte de  Colegio analizar la posibilidad de contar con alfabetizadores a modo de generar un proceso más sostenible. Se habló además del proceso con la escuela de padres para generar intervenciones respecto al acompañamiento en temas como el acceso a internet de forma  segura de los chicos y chicas y para esto se brindaron los datos de la persona encargada de este espacio que es la docente Yanet Acevedo.\r\n\r\nPara el mes de Agosto se piensa en realizar GEL con décimos y once.','Se propone la creación por parte de la IE DE un comité de navegar sin naufragar liderado por el personero, una persona de apoyo pedagógico y los representantes de cada grupo, desde sexto a noveno de modo que este comité será capacitado en la charla y será encargado de replicarla en todos los grupos además de generar otras acciones que apoyen la promoción del uso seguro y responsable del internet a modo de campaña preventiva. LLamar la segunda semana de mayo para evaluar el estado de la I.E por motivos del Paro Docente.','1429798782617.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',2,417,23,'2015-04-30 14:31:49','2015-05-22 15:29:00'),(558,'2015-04-09','Empalme y gestión de procesos','Reunión con el profesor Hamer para gestionar procesos de formación y confirmar aula abierta. ','Se programa charla de Navegar Sin Naufragar para adultos el día martes 14 de abril a las 7:00 pm hasta las 9:00 pm.','I_E_Luis_Carlos_Galan_Sarmiento_Sede_Nino_Jesus_de_Praga_Empalme.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',2,313,40,'2015-04-30 16:13:57','2015-05-22 15:29:00'),(559,'2015-04-15','Empalme y gestión de procesos','Reunión con la Coordinadora Marta Cecilia García para gestionar procesos de formación para los funcionarios y recolección de indicadores del sitio.','Queda pendiente consultar las necesidades del los funcionarios en capacitación, para evaluar los procesos para la intervención.','Archivo_Historico_de_Medellin_Empalme.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',2,292,40,'2015-04-30 16:28:48','2015-05-22 15:29:00'),(560,'2015-04-15','Empalme y gestión de procesos','Reunión de empalme con la Inspectora Luz Mary Toro y la Contratista de descongestión para gestión de proceso de formación para los funcionarios del sitio. ','Queda pendiente confirmar el proceso y la fecha.','Inspeccion_10B_Empalme_2.jpg','Inspeccion_10B_Empalme.jpg',NULL,'uploads/meeting/meeting_adjunct',2,306,40,'2015-04-30 16:47:31','2015-05-22 15:29:00'),(561,'2015-04-23','Gestión con Aliados','Se llevó a cabo reunión con la señora Martha Aldana, trabajadora Social del programa Jóvenes por la convivencia con el propósito de gestionar procesos de formación para 60 chicos y chicas pertenecientes al programa. Inicialmente se hizo un recuento del programa, sus particularidades y tiempos. De este encuentro surge como necesidad primaria realizar la charla de GEL en un primer momento con todos y todas. Algunos se trasfieren a zona 4 por pertenecer a belén. Se sugiere adicionar información del ICFES dado  que algunos chicos y chicas no los han presentado y tienen dudas respecto de fechas, formas, páginas, entre otras cosas','Se programan dos charlas de GEL estudiantes para jueves 18 de junio y 23 de junio a las 2 p.m cada una.','1429821430347.jpg','IMG_20150423_145736867.jpg',NULL,'uploads/meeting/meeting_adjunct',3,187,23,'2015-04-30 21:53:11','2015-05-22 15:29:00'),(562,'2015-04-06','Reunión con Andrea Sierra','Reunión con técnica de Cultura Digital para hablar de los procesos que se llevarán a cabo durante este año.','Organizar el cronograma para dictar entre otras cursos de edición de video y stop motion para los asistentes al Parquebiblioteca','Parque_Biblioteca_12_de_Octubre_Reunion_de_planeacion.JPG',NULL,NULL,'uploads/meeting/meeting_adjunct',4,453,42,'2015-05-02 19:05:24','2015-05-22 15:29:00'),(563,'2015-04-08','Reunión de empalme con luis Arias','Reunión de planeación para lo que se hará en el telecentro este año.','Se realizarán cursos de AD y GEL y charlas de NSN para los asistentes al telecentro ','Telecentro_Plaza_Colon_Reunion.JPG',NULL,NULL,'uploads/meeting/meeting_adjunct',2,200,42,'2015-05-02 19:29:45','2015-05-22 15:29:00'),(564,'2015-04-13','Reunión con Mario Ceballos','Reunión de empalme con el coordinador de la biblioteca para planear que procesos se llevarán a cabo en el año','tendremos charlas de Gobierno en Línea y Navegar sin Naufragar, además de apoyar los cursos de Alfabetización Digital','Biblioteca_Tren_de_Papel_Reunion_de_Planeacion.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',2,182,42,'2015-05-02 19:59:58','2015-05-22 15:29:00'),(565,'2015-04-16','Reunión con Ibsen Cossio','Reunión para planear que se hará este año en la institución','se harán charlas de Gobierno en Línea para jóvenes de los grados superiores y de Navegar sin Naufragar para los chicos de primaria','Institucion_Educativa_Pedro_Claver_Aguirre_Reunion_de_Planeacion.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',2,232,42,'2015-05-02 20:10:11','2015-05-22 15:29:00'),(566,'2015-04-17','Reunión con Cristian Álvarez','Reunión con el coordinador de la institución para planear los procesos del año','Hacer charlas de Navegar Sin Naufragar y Gobierno en Línea para Jóvenes','I_E_Tricentenario_Reunion_de_Planeacion.JPG',NULL,NULL,'uploads/meeting/meeting_adjunct',2,228,42,'2015-05-02 20:16:17','2015-05-22 15:29:00'),(567,'2015-04-17','Reunión con Rubén Patiño','Reunión para hacer planeación de lo que se hará este año en la institución ','Haremos charlas y cursos en la institución','I_E_Diego_Echavarria_Misas_Reunion_de_Planeacion-0.JPG',NULL,NULL,'uploads/meeting/meeting_adjunct',2,225,42,'2015-05-02 20:18:27','2015-05-22 15:29:00'),(568,'2015-04-17','Reunión con Cielo Vélez','Reunión para hacer seguimiento del Kit de inlusión','Planear una reunión con gente que les enseñe bien el manejo, para apropiarse de dicho kit y poder manejarlo mejor en la institución','Institucion_Educativa_Diego_Echavarria_Misas_Seguimiento_Kit_de_Inclusion.jpg','Institucion_Educativa_Diego_Echavarria_Misas_Seguimiento_Kit_de_Inclusion_2.jpg',NULL,'uploads/meeting/meeting_adjunct',2,225,42,'2015-05-02 20:22:23','2015-05-22 15:29:00'),(569,'2015-04-17','Reunión con ediles de la comuna 7','Nos reunimos para hablar de la estrategia de Gestores TIC ','Una próxima reunión para hablar con los demás ediles','Institucion_Educativa_Villa_Flora_reunion_con_JAL_7.JPG',NULL,NULL,'uploads/meeting/meeting_adjunct',3,289,42,'2015-05-02 20:32:57','2015-05-22 15:29:00'),(570,'2015-04-22','Reunión con Daniel Gaviria','Reunión para hacer el cronograma de Aulab','vamos a trabajar en conjunto con las personas de la biblioteca entonces se quedó de dividir los temas para darlos por módulos','Parquebiblioteca_La_Quintana_Reunion_de_planeacion.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',2,184,42,'2015-05-02 20:44:39','2015-05-22 15:29:00'),(571,'2015-04-23','Reunión con Luis Lizón','Reunión para hablar del proceso del Kit de Inclusión en la institución.','Organizar una reunión con personas de varias instituciones para que vayan a ver el proceso que lleva el ITM con su kit.','Instituto_Tecnico_Metropolitano_Reunion_Planeacion.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',2,412,42,'2015-05-03 08:17:06','2015-05-22 15:29:00'),(572,'2015-04-23','Reunión con Bienestar','Reunión para planear la intervención del programa en las jornadas de bienestar de la institución, apoyando en el tema de Gobierno en Línea','El señor Ramón quedó de enviar un correo con las fechas donde podríamos realizar la intervención','Instituto_Tecnico_Metropolitano_Reunion_Planeacion_Bienestar.JPG',NULL,NULL,'uploads/meeting/meeting_adjunct',2,412,42,'2015-05-03 08:21:30','2015-05-22 15:29:00'),(573,'2015-04-06','Planeación 2015','El encuentro se realiza con Flor Yolanda dinamizadora del Telecento Doce de Octubre, se dialoga frente a los procesos que se han llevado a cabo en el espacio y se acuerda realizar un taller de GEL con la comunidad, con miras a potenciar el uso adecuado de los trámites en los asistentes al espacio. ','Iniciar el curso de Gobierno con la comunidad, los funcionarios del telecentro son los encargados de realizar la convocatoria de los participantes. ','Telecentro_Doce_de_Octubre_Empalme_y_planeacion.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',2,480,24,'2015-05-03 12:37:22','2015-05-22 15:29:00'),(574,'2015-04-06','Planeación 2015','Las dos entidades presentan el panorama de las actividades a realizar durante el año, se propone en este primer semestre trabajar con edición de video, además de dictar conjuntamente un curso de Alfabetización digital a madres comunitarias de los Buen Comienzo de la zona. ','El día jueves 9 de abril nos reuniremos con las propuestas que desde cada una de las entidades se tendrán para trabajar con está población. ','PB_Doce_de_Octubre_Empalme_y_planeacion.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',2,183,24,'2015-05-03 12:46:07','2015-05-22 15:29:00'),(575,'2015-04-28','Planeación de actividades','Se realizó una reunión con el Coordinador de la IE con el fin de agendar actividades de acuerdo a las necesidades propias de la IE, El coordinador manifestó estar interesado en que se desarrollara dentro de la institución un taller de narrativas con fotografía.  La idea es realizarlo a finales de mayo con población sorda de la IE. El coordinador realizará la gestión de un Modelo de lenguaje para mejorar la comunicación con las personas sordas que asistan a la taller. ','Se espera realizar la primera sesión apenas se retomen las clases (en el momento la IE se encuentra en paro de maestros) por esa razón la fecha es tentativa para finales de mayo. ','IE_Francisco_Luis_Hernandez_Reunion_planeacion.JPG',NULL,NULL,'uploads/meeting/meeting_adjunct',3,160,21,'2015-05-03 13:24:52','2015-05-22 15:29:00'),(576,'2015-04-30','Procesos de formación','Se realizó una reunión con los funcionarios de la biblioteca para conversar acerca de los posibles procesos de formación que se pueden dictar con la comunidad.','Se quedo con el compromiso de iniciar un taller de narrativas digitales con los jóvenes que asisten los sábados a la biblioteca.','Biblioteca_Publica_El_Limonar_Reunion.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',4,196,15,'2015-05-03 13:28:10','2015-05-22 15:29:00'),(577,'2015-04-09','Planeación Curso','En está ocasión cada uno de los programas plantea las sesiones que deberá llevar el curso de Alfabetización Digital con las madres comunitarias del Buen Comienzo, para esto cada uno de los participantes de la reunión propone ejercicios para llevar a cabo este proceso. ','El curso iniciará el día 28 de abril a las 6:00 p.m. en las instalaciones del PB, este se hace responsable de la convocatoria de las personas. ','PB_Doce_de_Octubre_Seguimiento_y_planeacion.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',4,183,24,'2015-05-03 13:33:23','2015-05-22 15:29:00'),(578,'2015-04-28','Empalme y planeación','Se realizó una reunión con el dinamizador del Telecentro con el fin de mirar las necesidades de la población que se acerca al Telecentro en el barrio Sta Cecilia, el dinamizador trabaja en su mayoría con adultos mayores, por esa razón se contempló la idea de realizar un taller de web 2.0 con estas personas cuando ya hallan avanzado en el curso que ven en la actualidad con el dinamizador. También se hizo evidente realizar un trabajo con los y las  jovenes del Telecentro ya ue son uno de los públicos más alejados de las dinámicas que se realizan en el Telecentro. La idea es buscar una alianza con la IE más cercana para invitar a este público a participar de varias actividades. ','Se quiere realizar un taller de Gobierno en línea con funcionarios y funcionarias de los Telecentro de la zona, la idea es realizarlo para finales de mayo. La fecha está por confirmar. ','Telecentro_Sta_Cecilia_2_Reunion_de_planeacion.JPG',NULL,NULL,'uploads/meeting/meeting_adjunct',2,519,21,'2015-05-03 13:38:10','2015-05-22 15:29:00'),(579,'2015-04-28','Reunión de gestión y empalme','En la reunión se conversó sobre la necesidad de que en la IE se realicen acompañamientos con los y las jóvenes, ya que son el público que más necesidades presenta dentro de la IE. Así mismo el rector manifestó un intereses en que el acompañamiento del programa esté ligado a reforzar las habilidades de los y las estudiantes de su institución, se mencionó la posibilidad de realizar un preicfes y un preuniversitario para brindar más posibilidad de acceder a la educación superior de estas personas.','Se realizará inicialmente un apoyo a la construcción del periódico barrial digital que será construído por los y las estudiantes de 10 y 11 grado de la IE. Se espera comenzar con este proceso el martes 5 de mayo. ','IE_Pequena_Maria_Reunion_de_Empalme_y_planeacion.JPG',NULL,NULL,'uploads/meeting/meeting_adjunct',3,264,21,'2015-05-03 13:59:30','2015-05-22 15:29:00'),(580,'2015-03-31','Planeación de actividades ','Se realizó una reunión con el coordinador del sitio, debido a que la mayor parte de personas que frecuentan la casa de la cultura son adultos y adultas mayores se manifesta la necesidad de realizar un trabajo que involucre a este público. Se decidió continuar con la estrategia implementada el año pasado de narrativas digitales fotografía y trabajar el documental con el fin de constribuir a hacer memoria de barrio. ','La fecha de inicio del taller se programó para el 17 de mayo a las 3 pm.',NULL,NULL,NULL,'',4,248,21,'2015-05-03 14:12:33','2015-05-22 15:29:00'),(581,'2015-04-21','Planeación de actividades','Se realizó una reunión con el dinamizador del telecentro para determinar el acompañamiento del Programa en el sitio. El dinamizador manifestó que sería muy enriquecedor para las personas del telecentro recibir formación en web 2.0 ya que son contenidos que generalmente desconocen. La idea es realizar un taller de web 2.0 con las personas que hayan terminado Alfabetización Digital en los cursos del Telecentro.','Se espera concretrar la fecha a finales de mayo para iniciar con el taller a principios de junio. ','Telecentro_San_Joaquin_Reunion_de_Planeacion.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',4,467,21,'2015-05-03 14:25:29','2015-05-22 15:29:00'),(582,'2015-04-13','Planeación Taller sensibilización Kit de inclusión','La reunión se llevó a cabo con la técnico de Biblioteca Norma Ibargüen encargada de dinamizar el kit de inclusión digital, la reunión se centró en planear el taller de sensibilización con la comunidad referente al Kit de inclusión digital que se encuentra en el espacio. ','La técnico de biblioteca se compromete a realizar la convocatoria de las personas que asistirán a la sensibilización, además de tener a punto la sala de computadores para la actividad.','PB_La_Quintana_Planeacion_procesos.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',4,184,24,'2015-05-03 14:30:54','2015-05-22 15:29:00'),(583,'2015-04-14','Empalme y planeación 2015','La coordinadora de la tarde realiza una presentación oficial del coordinador de la Jornada de la mañana, esté se encuentra muy interesado en que las charlas de GEL se dicten a los chicos de los grados décimo y once, además se trabajará con el CLEI con el fin de dar a conocer las ofertas universitarias. ','Ninguno','IE_Picachito_Empalme_y_planeacion.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',2,420,24,'2015-05-03 14:55:02','2015-05-22 15:29:00'),(584,'2015-04-08','Planeación de actividades','Se realizó una reunión en la IE sede Marco Fidél Suárez. Se quiere realizar varias charlas de Navegar sin Naufragar en vista de que los niños y niñas de la IE desconocen en buena parte los riegos que pueden ocurrir en Internet. Así mismo se realizará acompañamiento al Kit de inclusión Digital que posee la sede. ','Se dictarán varias charlas con los grados 4 y 5. Las charlas están programadas para mediados de mayo. ','IE_Pedro_Luis_Villa_Reunion.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',4,149,21,'2015-05-03 15:08:47','2015-05-22 15:29:00'),(585,'2015-04-16','Planeación de actividades','Se realizó una reunión con la coordinadora del CEDEZO con el fin de mirar cómo será el acompañamiento este año a el sitio. La funcionaria se mostró interesada por la repotenciación del sitio, ya que la sala no cuenta con Internet y ello dificulta que se puedan realizar procesos formativos en el espacio. Se quiere realizar un taller de web 2.0 con las personas del Cedezo. También se conversó sobre las experiencias anteriores con el Programa y se definió que se realizaría una convocatoria entre los tres Cedezos de la zona (Cedezo de Moravia, Manrique y Sto Domingo) para así asegurar que más emprendedores y emprendedoras reciban la formación con el Programa.','La funcionaria realizará una reunión zonal con los otros dos Cedezos para mirar los requisitos y convocatoria. ','Cedezo_Moravia_Reunion.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',4,166,21,'2015-05-03 15:18:51','2015-05-22 15:29:00'),(586,'2015-04-14','Reunión Planeación con Gestores TIC ','La reunión se llevó a cabo con los Gestores TIC que vienen acompañando los procesos en la Biblioteca, se fomentan acuerdos entre los Gestores y la Coordinadora de la Biblioteca. ','Iniciar el curso de Narrativas digitales con la comunidad. ','Biblioteca_Familia_La_Esperanza_Seguimiento_Gestores_TIC_2.jpg','Biblioteca_Familia_La_Esperanza_Seguimiento_Gestores_TIC_1.jpg',NULL,'uploads/meeting/meeting_adjunct',2,479,24,'2015-05-03 15:22:51','2015-05-22 15:29:00'),(587,'2015-04-15','Planeación 2015','Se realiza una reunión donde se plantean las acciones a realizar durante el año. Se espera continuar con el Aula Abierta en un taller de Herramientas Web 2.0 en el primer semestre, con algunos estudiantes se realizará un taller de Narrativas Digitales. ','Realizar una reunión con la comunidad para definir los días y horas del taller. Para esto el docente se compromete a realizar la convocatoria. ','IE_Gerardo_Valencia_Cano_Empalme_y_planeacion_2.jpg','IE_Gerardo_Valencia_Cano_Empalme_y_planeacion_1.jpg','IE_Gerardo_Valencia_Cano_Empalme_y_planeacion_3.jpg','uploads/meeting/meeting_adjunct',2,410,24,'2015-05-03 15:29:21','2015-05-22 15:29:00'),(588,'2015-04-16','Planeación 2015','En está reunión se plantean las acciones que se llevarán durante el año, se planea para el primer semestre charlas de GEL y NSN','No hay compromisos','IE_Camilo_Mora_Carrasquilla_empalme_y_planeacion.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',2,482,24,'2015-05-03 15:37:45','2015-05-22 15:29:00'),(589,'2015-04-20','Reunión de empalme con aliados','La IE Ciudad Don Bosco nos hizo una petición de trabajar con un grupo de chicos desvinculados del conflicto armado, para esto se recurre a una reunión con ellos en la cual se plantea realizar charlas de NSN y GEL para estudiantes para el primer semestre, además de charlas de dispositivos móviles con las personas de servicios generales. ','El Gestor trabajará en una propuesta de fechas para presentarla a la IE','IE_Aures_Ciudad_Don_Bosco_empalme_y_planeacion.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',3,409,24,'2015-05-03 16:22:04','2015-05-22 15:29:00'),(590,'2015-04-20','Planeación 2015','En está reunión se replantea el modelo de Aula Abierta, a partir de esto se busca que los estudiantes que deben alfabetizar sean los encargados de dar los cursos, para esto se es formará y acompañará en el proceso. ','El docente elegirá a los estudiantes que participaran en el proceso. ','IE_Doce_de_Octubre_empalme_y_planeacion_2.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',2,274,24,'2015-05-03 16:28:59','2015-05-22 15:29:00'),(591,'2015-04-20','Planeación 2015','En está reunión nos sentamos con la docente encargada de dinamizar el Kit de Inclusión digital y con el docente Fran Edilson, realizaremos en el primer semestre Charlas de NSN y GEL, además se realizarán trabajos con la fundación de la cual hace parte la docente Pilar. ','Ningún compromiso','IE_El_Pedregal_Empalme_y_planeacion.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',2,275,24,'2015-05-03 16:35:42','2015-05-22 15:29:00'),(592,'2015-04-17','Empalme y gestión de procesos','Reunión de empalme y planeación de procesos de formación para los estudiantes de la institución con el rector Alfonso Guarín Salazar, se gestiona aula abierta y procesos de formación para la comunidad y estudiantes de alfabetización de la institución como gestores TIC para el aula abierta.','Se programa charla Gobierno en Línea con 8 grupos del 11° y charla de Navegar Sin Naufragar para los grupos de 4° y 5° en la Sección de primaria Luis Alfonso Agudelo, con sus respectivas fechas. Queda pendiente programación charla Navegar Sin Naufragar en la Sección de primaria Antonia Santos en los grupos de 4° y 5°. Se gestiona aula abierta para los sábados, queda por confirmar.','I_E_Javiera_Londono_Empalme.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',2,309,40,'2015-05-03 18:26:19','2015-05-22 15:29:00'),(593,'2015-04-28','Reunión de empalme y gestión','Reunión de empalme y planeación con la directora del centro educativo para realizar procesos de formación en la institución. ','Contactar a la profesora encargada de tecnología para desarrollar talleres de stopmotion con un grupo de niños de grado 5','CE_Media_Luna_Reunion_de_empalme_y_planeacion_2.JPG',NULL,NULL,'uploads/meeting/meeting_adjunct',2,432,17,'2015-05-03 18:36:20','2015-05-22 15:29:00'),(594,'2015-04-17','Empalme y gestión de procesos','Reunión con la directora del centro para gestionar procesos de formación con el grupo de alfabetizadores que tiene el centro.','Queda pendiente dar una fecha para charla de Gobierno en Línea para el grupo de alfabetizadores y hacer convocatoria.','Centro_de_Diversidad_Sexual_Empalme.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',2,300,40,'2015-05-03 18:37:51','2015-05-22 15:29:00'),(595,'2015-04-28','Reunión de empalme y gestión','Reunión de empalme y planeación con el coordinador del CEDEZO para realizar procesos de formación con los emprendedores. Se llega a la conclusión de ofrecer un curso de alfabetización digital con adultos que no tienen conocimiento de computadores. ','Agendar en conjunto con la biblioteca, un espacio para la capacitación.','Cedezo_Santa_Elena_Reunion_de_empalme_y_gestion_1.JPG','Cedezo_Santa_Elena_Reunion_de_empalme_y_gestion_2.JPG',NULL,'uploads/meeting/meeting_adjunct',2,173,17,'2015-05-03 18:49:22','2015-05-22 15:29:00'),(596,'2015-04-22','Empalme y gestión de procesos','Reunión empalme con el Coordinador Carlos Augusto Carmona para gestionar procesos de formación y asesorías personales para algunos funcionarios del Cedezo. ','Queda pendiente hablar con la encargada de la Biblioteca EPM para solicitar préstamo de una sala de sistemas para realizar procesos de formación con la población del Cedezo.','CEDEZO_Pasaje_La_Bastilla_Empalme.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',2,171,40,'2015-05-03 18:51:09','2015-05-22 15:29:00'),(597,'2015-04-28','Reunión de empalme y gestión','Reunión de empalme y planeación con las docentes del centro educativo para realizar procesos de formación en la institución. Las docentes manifiestan que la comunidad es muy difícil de convocar y participa muy poco de las dinámicas de la institución, por ello se decide desarrollar talleres de stopmotion con un grupo de niños de grado 5','Se concretó comenzar el día martes 11 de mayo en la mañana.','CE_El_Cerro_Reunion_de_empalme_y_planeacion_1.JPG','CE_El_Cerro_Reunion_de_empalme_y_planeacion_2.JPG','CE_El_Cerro_Reunion_de_empalme_y_planeacion_3.JPG','uploads/meeting/meeting_adjunct',2,423,17,'2015-05-03 19:04:19','2015-05-22 15:29:00'),(598,'2015-04-22','Empalme y gestión de procesos','Reunión de empalme con la coordinadora de sitio, para conocer las actividades que realizan y conocer las necesidades de la comunidad que frecuenta el sitio.','Planeación de asesorías y procesos de formación para la formación de la comunidad.','Centro_de_Informacion_e_Investigacion_Ambiental_Empalme.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',2,294,40,'2015-05-03 19:26:51','2015-05-22 15:29:00'),(599,'2015-04-27','Empalme y gestión de procesos','Reunión con Liboria y Horasio, profesores de Informática de la Institución Educativa Madre Laura para gestionar procesos de formación. ','Se programa Charla de Gobierno en Línea para los estudiantes del grado 11 y aula abierta para padres de familia. ','I_E_Madre_Laura_Empalme_1.jpg','I_E_Madre_Laura_Empalme_2.jpg',NULL,'uploads/meeting/meeting_adjunct',2,324,40,'2015-05-03 19:45:41','2015-05-22 15:29:00'),(600,'2015-04-28','Empalme y gestión de procesos','Reunión de empalme con Juan Díaz Londoño, rector de la institución, para gestionar procesos de formaciín para los estudiantes y para la comunidad en aula abierta.','Se programan charlas de GEL para los estudiantes de 11° y charla de NSN para los estudiantes de 4° y 5°. Se plantea proceso de formación para la comunidad en aula abierta.','I_E_Arzobispo_Tulio_Botero_Salazar_Empalme.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',2,422,40,'2015-05-03 19:55:23','2015-05-22 15:29:00'),(601,'2015-04-29','Empalme y gestión de procesos','Reunión de empalme para conocer los procesos que tienen en el sitio y seguimiento al uso del punto de navegación.',' Se plantea la necesidad de que se realice el registro de uso.','Escuela_del_Maestro_Empalme_1.jpg','Escuela_del_Maestro_Empalme_2.jpg',NULL,'uploads/meeting/meeting_adjunct',2,302,40,'2015-05-03 20:05:40','2015-05-22 15:29:00'),(602,'2015-04-29','Reunión Banco de la República de Medellín','Reunión de planeación de procesos de formación para los funcionarios del Banco.','Agendar charla de Gobierno en Línea.','Parque_Berrio_Banco_de_la_Republica_Gestion_con_Aliados.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',3,538,40,'2015-05-03 20:27:39','2015-05-22 15:29:00'),(603,'2015-04-22','Empalme y planeación 2015','Reunión de empalme y planeación, en esta se tratan temas tales como la conexión que se viene ejecutando en el momento en el TAL, puesto que en este espacio habrá punto de navegación y la conexión del parque de Pedregal a Internet wifi, se busca generar estrategias de apropiación y buenas prácticas de conexión a estos. Para esto se proponen charlas de GEL para jóvenes y NSN para todos los públicos. ','No hay compromisos','TAL_y_Casa_de_Cultura_de_Pedregal_Empalme_y_Planeacion_1.jpg','TAL_y_Casa_de_Cultura_de_Pedregal_Empalme_y_Planeacion_3.jpg',NULL,'uploads/meeting/meeting_adjunct',2,486,24,'2015-05-03 21:12:34','2015-05-22 15:29:00'),(604,'2015-04-22','Empalme y planeación 2015','La reunión se centro en la necesidad por parte del programa de conocer las fechas de entrega por parte del municipio a la comunidad, pues a la fecha la casa de la cultura del barrio pedregal no se encuentra abierta al público, la funcionaria espera que está sea entregada a mediados de agosto. ','Avisar cuando se entregará el espacio y continuar con el contacto entre las partes.','TAL_y_Casa_de_Cultura_de_Pedregal_Empalme_y_Planeacion_2.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',2,487,24,'2015-05-03 21:46:19','2015-05-22 15:29:00'),(605,'2015-04-23','Empalme y planeación 2015','Se le cuenta a la coordinadora la decisión de conectar el espacio bajo el modelo de punto de navegación y se espera que pronto se lleve a cabo este proceso, se realizarán algunas reuniones con los funcionarios de este espacio para contarles las estrategias que se implementarán, cuales serán además las responsabilidades por parte de ellos y del programa. ','Consolidar un diagnostico por parte de la entidad de los trámites que más se necesitan en el espacio, además se realizarán charlas de NSN para las comunidades que allí habitan. ','Centro_de_Salud_San_Camilo_Planeacion_y_empalme.jpg','Centro_de_Salud_San_Camilo_Planeacion_y_empalme_2.jpg',NULL,'uploads/meeting/meeting_adjunct',2,491,24,'2015-05-03 21:56:08','2015-05-22 15:29:00'),(606,'2015-04-27','Empalme y planeación 2015','Se busca retomar la planeación instaurada desde el año pasado, donde se plantearon algunas asesorías grupales para funcionarios en GEL y dispositivos móviles. ','Se espera generar por parte de la entidad un diagnostico de las personas que necesitan este apoyo. ','Casa_de_Justicia_Robledo_empalme_y_planeacion.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',2,271,24,'2015-05-03 22:13:54','2015-05-22 15:29:00'),(607,'2015-04-27','Planeación Taller sensibilización Kit de inclusión','En está oportunidad nos sentamos a plantear y revisar las herramientas del kit para el taller con personas en situación de discapacidad cognitiva que tendrá lugar el martes 28 de abril.','Llegar temprano al aula donde se realizará el taller para dar inicio a las 9 am','PB_La_Quintana_Planeacion_actividad_sensibilizacion_Kit.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',4,184,24,'2015-05-03 22:17:02','2015-05-22 15:29:00'),(608,'2015-04-28','Empalme y planeación 2015','Se busca retomar los procesos del año pasado y llegar a acompañar el Aula Abierta que tiene el Equipo Gestor DIGIKON de la IE, para esto se formarán a los docentes que hacen parte de este equipo gestor en herramientas web 2.0 y a las personas que hacen parte del aula abierta en narrativas digitales. ','No hay compromisos','IE_Alfredo_Cock_Arango_empalme_y_planeacion_1.jpg','IE_Alfredo_Cock_Arango_empalme_y_planeacion_2.jpg',NULL,'uploads/meeting/meeting_adjunct',2,267,24,'2015-05-03 22:23:19','2015-05-22 15:29:00'),(609,'2015-04-30','Feria de servicios Zonales','Planeación feria de servicios Zona 2: Comunas 5, 6 y 7. Se busca que todas las secretarías presenten sus propuestas de impacto en el territorio en una gran feria zonal que tendrá lugar el día 30 de mayo del presente año en el hall del Parque Biblioteca Doce de Octubre. Para esto el programa será el encargado de llegar con asesoría en trámites en línea, charlas de dispositivos móviles y activación de su punto Wifi. ','Asistir a la próxima reunión. ','Telecentro_Doce_de_Octubre_Gestion_Con_Aliados_1.jpg','Telecentro_Doce_de_Octubre_Gestion_Con_Aliados_2.jpg','Telecentro_Doce_de_Octubre_Gestion_Con_Aliados_3.jpg','uploads/meeting/meeting_adjunct',3,480,24,'2015-05-03 22:34:07','2015-05-22 15:29:00'),(610,'2015-04-28','Seguimiento al KIT de inclusión y planeación','Se realizó una reunión con la profesional de biblioteca para identificar el número de estudiantes en situación de discapacidad que tiene la Institución y cuales de estos estudiantes usan el KIT de inclusión digital, la profesional manifestó que la Institución Universitaria cuenta con 3 estudiantes en situación de discapacidad, los cuales usan el KIT de inclusión digital constantemente. Se pensó en la posibilidad de incluir personas externas, que vivan en el sector y que estén en situación de discapacidad para que aprovechen el recurso. \r\nAdemás se habló con un profesional del área de bienestar institucional, con el cual se pensó en la posibilidad de acompañarlos en las jornadas univiersitarias para hacer sensibilización del KIT de inclusión digital y de todo el tema de Gobierno en Línea con los estudiantes.','Programar próxima reunión para planear el acompañamiento en las jornadas universitarias. ','Institucion_Universitaria_Pascual_Bravo_Seguimiento_al_KIT_de_inclusion_digital.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',4,411,43,'2015-05-04 07:31:30','2015-05-22 15:29:00'),(611,'2015-04-17','Empalme y acompañamiento 2015','Se visitó el sitio y se contactó el gestor administrativo para presentar el nuevo gestor en cultura digital de Medellin Ciudad Inteligente que acompañará el sitio este año. Así mismo se revisó la conexión wifi sin ningún contratiempo, horarios de visitas de público más frecuentes y conectividad de los usuarios. ','Enviar información sobre la actividad de activación de los sitios del Estadio ','IMG_6346.JPG','IMG_6342.JPG',NULL,'uploads/meeting/meeting_adjunct',2,500,41,'2015-05-04 11:05:46','2015-05-22 15:29:00'),(612,'2015-04-17','Empalme y acompañamiento 2015','Se visitó el sitio para contactar al encargado del mismo y presentar al gestor en cultura digital de Medellín Ciudad Inteligente, así mismo como la conectividad de los usuarios en las tribunas. \r\nHace falta visibilizar la red wifi porque no hay ninguna publicidad visual acerca de su existencia y uso libre. Sin embargo, los funcionarios del sitio le informan al público que los visita.  ','Enviar información de la actividad de activación de sitios del estadio. ','IMG_6331.JPG','IMG_6333.JPG',NULL,'uploads/meeting/meeting_adjunct',2,502,41,'2015-05-04 11:11:26','2015-05-22 15:29:00'),(613,'2015-04-17','Empalme y acompañamiento 2015','Se visitó el sitio para conocer el administrador encargado y el funcionamiento de la red wifi, así como apropiar a posibles usuarios que se conecten a la red y establecer en conjunto estrategias de apropiación para el público visitante. ','Enviar información sobre el evento de activación de sitios del estadio de Medellín Ciudad Inteligente','IMG_6334.JPG','IMG_6335.JPG',NULL,'uploads/meeting/meeting_adjunct',2,501,41,'2015-05-04 11:22:28','2015-05-22 15:29:00'),(614,'2015-04-30','Empalme y nuevos procesos 2015 ','Se visitó el sitio y se hizo empalme de los procesos anteriores y se presentó la nueva gestora en cultura digital que acompañará el año 2015. \r\nUso y apropiación del sitio de gobierno, planeación e ideas en conjunto sobre el tipo de acompañamiento para este año. Así como estrategias para la dinamización dle punto de navegación. \r\nCompromisos y varios. ','Acompañamiento para: \r\n1. Jóvenes hacia las narrativas digitales y la apropiación y conexión con los espacios de la casa de la cultura. \r\n2. Adultos mayores alfabetización digital y narrativas. \r\n3. Pensar en un curso de intercambio generacional entre jóvenes y adultos. \r\n4. Apoyo en la cartografía a través de mapas para el grupo de huerteros que acude a la casa de la cultura y tienen la necesidad de conocer y apropiar herramientas de comunicación que les permita visibilizar su trabajo. \r\n','empalme_Casa_de_la_Cultura_Los_Alcazares_6.JPG','empalme_Casa_de_la_Cultura_Los_Alcazares_3.JPG','empalme_Casa_de_la_Cultura_Los_Alcazares_2.JPG','uploads/meeting/meeting_adjunct',2,243,41,'2015-05-04 11:56:04','2015-05-22 15:29:00'),(615,'2015-04-30','Empalme y planeación 2015','Se realiza una revisión de los compromisos que se tienen frente al tema de conectividad en el sitio, se encuentran preocupados porque el espacio se encuentra sin internet hace tiempo y los equipos fueron retirados. Se espera por parte de estos funcionarios que este se haga efectivo en corto tiempo. Se espera realizar charlas de dispositivos móviles y asesorías grupales a los funcionarios en tramites en línea. ','No hay compromisos','Inspeccion_Doce_de_Octubre_empalme_y_planeacion.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',2,277,24,'2015-05-04 12:13:43','2015-05-22 15:29:00'),(616,'2015-04-30','Empalme y acompañamiento 2015','Se visitó el sitio de gobierno verificando la navegación y el acceso y uso del punto de navegación, se recogieron planillas y se contactó al funcionario para pasarle seguimiento al punto y apropiación de los usuarios del sector que lo visitan, quién además sugiere la importancia de tener un gestor tic que acompañe el punto de navegación. ','ninguno. ','IMG_7056.JPG','IMG_7055.JPG',NULL,'uploads/meeting/meeting_adjunct',2,260,41,'2015-05-04 13:31:54','2015-05-22 15:29:00'),(617,'2015-04-14','Sensibilización Beneficiarios Fondo EPM','Reunión con estudiantes beneficiarios Fondo EPM con el fin de contarles la estrategia de apropiación e invitarlos a cumplir con su labor social en los procesos de ciudad que se tienen con el programa Medellín Ciudad Inteligente. A la actividad llegaron 20 personas. ','Llamar a los estudiantes para invitarlos a los cursos y proponerles actividades en campo','Gestion_con_Aliados_Estudiantes_Beneficiarios_Fondo_EPM.PDF','UPJ_Gestion_con_aliados.jpg',NULL,'uploads/meeting/meeting_adjunct',3,288,24,'2015-05-04 16:09:09','2015-05-22 15:29:00'),(618,'2015-05-04','Reunión de planeación en la Secretaría de movilida','Reunión de empalme con los comunicadores de la Secretaría de Movilidad para llegar a acuerdos de las intervenciones a realizar este año, en especial con respecto al Punto de Navegación','Enviar correo con sugerencias para agrandar la oferta de gobierno en línea ','Secretaria_de_Movilidad_Reunion_de_Empalme.JPG',NULL,NULL,'uploads/meeting/meeting_adjunct',2,286,42,'2015-05-06 08:29:58','2015-05-22 15:29:00'),(619,'2015-05-04','Planeación evento Ruta N.','Se realizó una reunión con funcionarios del Parque Biblioteca y Comuna Innova para planear el apoyo por parte del programa en el tema de la apropiación de la plataforma de conectividad urbana. Se planeo una actividad tipo picnic en la cual se hará la apropiación de la plataforma por medio de una charla de dispositivos móviles, con el fin de que los adultos resuelvan las dudas del manejo de sus celulares y a su vez hagan uso de la plataforma. ','Quedó como compromiso convocar a los adultos participantes. ','Parque_Biblioteca_Guayabal_Reunion_de_planeacion-0.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',4,192,43,'2015-05-08 10:53:10','2015-05-22 15:29:00'),(620,'2015-05-06','Reunión con Coordinador de la biblioteca','Reunión para definir fechas de charlas y cursos','Se agendó para el mes de mayo dos charlas, una para el mes de junio y empezar un taller de narrativas en agosto.','Biblioteca_Tren_de_Papel_Reunion_de_planeacion.JPG',NULL,NULL,'uploads/meeting/meeting_adjunct',4,182,42,'2015-05-11 07:54:44','2015-05-22 15:29:00'),(621,'2015-05-08','Reunion encargados de sitios recolecciòn indicador','Reunión de seguimiento de sitio con la encargada y recolección de indicadores','Continuar con la capacitación de funcionarios en tramites en línea.','Casa_de_Justicia_Villa_del_Socorro_seguimiento_2.jpg','Casa_de_Justicia_Villa_del_Socorro_seguimiento.jpg',NULL,'uploads/meeting/meeting_adjunct',4,242,10,'2015-05-11 08:48:12','2015-05-22 15:29:00'),(622,'2015-05-05','Reunión de planeación','Reunión para planificar actividades de articulación entre MCI y el PB con personas en situación de discapacidad. Se acuerda participar de la planeación y de la formación de uno de los cursos, porque cuentan con más de 50 inscritos entre cuidadores y personas en situación de discapacidad, se piensa en dividirlo en tres grupos para un mejor acompañamiento. ','Participar de la planeación del curso de alfabetización con personas en situación de discapacidad. Utilización de algunos dispositivos del kit de inclusión','PB_Leon_de_Greiff_reunion_planeacion_1.jpg','PB_Leon_de_Greiff_reunion_planeacion_2.jpg','PB_Leon_de_Greiff_reunion_planeacion_3.jpg','uploads/meeting/meeting_adjunct',4,188,20,'2015-05-11 17:02:53','2015-05-22 15:29:00'),(623,'2015-05-08','Empalme con encargados del sitio','Reunión de empalme con encargados del nuevo sitio de navegación y zona wifi','Seguimiento continuo para contarle a la comunidad sobre los servicios del sitio.','Centro_de_Salud_Vila_del_Socorro_seguimiento_2.jpg','Centro_de_Salud_Vila_del_Socorro_seguimiento.jpg',NULL,'uploads/meeting/meeting_adjunct',2,499,10,'2015-05-12 08:42:57','2015-05-22 15:29:00'),(624,'2015-05-12','Reunión con la JAL ','Reunión con el coordinador de educación de la JAL de comuna 9; para solicitarle la participación de algunos de los estudiantes que están con el programa desplazarse a otras comunas para realizar actividades del programa','Enviar una relación de los estudiantes que están realizando la labor social con el programa MCI','Mascerca_Buenos_Aires_gestion_con_aliados.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',3,314,20,'2015-05-13 10:58:06','2015-05-22 15:29:00'),(625,'2015-05-13','Reunión de empalme y planeación','Reunión con el coordinador de la institución para agendar dos charlas de GEL para los estudiantes del grado 11. Se nota disposición para la propuesta del programa. ','Confirmar la charla días antes de su realización','IE_Juan_de_Dios_Carvajal_empalme.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',2,310,20,'2015-05-13 16:40:05','2015-05-22 15:29:00'),(626,'2015-05-13','Planeación procesos Junio y Julio','La reunión se lleva a cabo con la Coordinadora del espacio y las dos Gestoras de Cultura Digital encargadas de formar a la comunidad en Alfabetización Digital, en está se planean las actividades que se tendrán en la Biblioteca durante junio y julio del presente año. ','La biblioteca se compromete a realizar la convocatoria para el nuevo grupo de Alfabetización Digital, La Gestora de Cultura Digital será la encargada de formular el nuevo contenido para las personas que se están formando. ','Biblioteca_Familia_La_Esperanza_Reunion_Planeacion_1.jpg','Biblioteca_Familia_La_Esperanza_Reunion_Planeacion_2.jpg','Biblioteca_Familia_La_Esperanza_Seguimiento_al_sitio.jpg','uploads/meeting/meeting_adjunct2',4,479,24,'2015-05-13 21:18:57','2015-05-26 00:18:57'),(627,'2015-05-13','Planeación procesos mayo','El día de hoy se tenía programado iniciar el curso con las madres comunitarias del buen comienzo, la cual no se dio por mal manejo de la información por parte de los convocantes a la cita, el Parque Biblioteca era el encargado de realizarla y las personas no acataron el mensaje, por ende la sensibilización se cancelo, de igual forma se hablaron de los procesos que se llevarán a cabo este mes con el motivo de la celebración del día de la Internet. Para esto nos sumaremos con charlas de NSN para niños y padres de familia. ','Sara López sera la encargada de mirar los contenidos y decidir si la información es necesaria para las charlas relámpago. ','PB_Doce_de_Octubre_Planeacion_Mes_de_Mayo.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',4,183,24,'2015-05-13 21:27:12','2015-05-22 15:29:00'),(628,'2015-05-13','Reuniòn Coordinadores','Seguimiento del proceso de Aula Abierta, y programación de posibles charlas.','revisión de horarios y programación de charlas.','20150513_145842_HDR.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',4,159,10,'2015-05-14 08:25:04','2015-05-22 15:29:00'),(629,'2015-05-12','Planeación actividad \"narrativas Parques del Río\"','Reunión con la directora y la docente de 5° del centro educativo para programar una actividad de recorrido por la quebrada Santa Elena con estudiantes y comunidad nativa, con el fin de realizar un taller de fotografía para presentar un producto en la convocatoria de \"Narrativas del Parques del Río\" de la Alcaldía de Medellín. ','Crear un grupo de estudiantes y convocar a la comunidad para el día martes 26 de mayo.','CE_Media_Luna_Reunion_planeacion_7.JPG','CE_Media_Luna_Reunion_planeacion_2.JPG',NULL,'uploads/meeting/meeting_adjunct',3,432,17,'2015-05-14 11:14:50','2015-05-22 15:29:00'),(630,'2015-05-12','Reunión de empalme y planeación Aula Abierta','Reunión con la docente de tecnología para conocer las actividades de aula abierta que lideró el año pasado y planear conjuntamente la activación de estos procesos para este año. ','Realizar una carta del dirigida a la comunidad para invitarlos al aula abierta los lunes de 1 a 3 pm. ','CE_El_Plan_Reunion_empalme_y_planeacion_1.JPG','CE_El_Plan_Reunion_empalme_y_planeacion_3.JPG',NULL,'uploads/meeting/meeting_adjunct',2,426,17,'2015-05-14 11:16:38','2015-05-22 15:29:00'),(631,'2015-05-12','Reunión de empalme y planeación ','Reunión con la gestora del CEDEZO para programar el día y la hora para el curso de AD con emprendedores, teniendo en cuenta la disponibilidad de la sala de cómputo de la biblioteca, lugar en el que se realizará la formación. ','Convocar a empresarios y emprendedores que no tienen conocimiento en manejo de computadores para realizar el curso.','CEDEZO_Santa_Elena_Reunion_Planeacion_3.JPG','CEDEZO_Santa_Elena_Reunion_Planeacion_2.JPG',NULL,'uploads/meeting/meeting_adjunct',2,173,17,'2015-05-14 11:21:17','2015-05-22 15:29:00'),(632,'2015-05-06','Seguimiento Punto de navegación','se realizó una corta reunión con Lina funcionaria del Mascerca, para conversar acerca del funcionamiento de los equipos.\r\n','Se quedó con el compromiso de llevar en una tabla la planilla de registro para que las personas la llenen antes de utilizar el computador.','Mascerca_Belen_Reunion_seguimiento.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',4,438,15,'2015-05-15 10:48:50','2015-05-22 15:29:00'),(633,'2015-05-14','Revisiòn proximas charlas','Reunión para articular el comienzo de nuevos grupos y charlas de GEL','Horarios y Bases de datos para nuevos procesos','20150514_153758_HDR.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',4,468,10,'2015-05-15 14:35:53','2015-05-22 15:29:00'),(634,'2015-05-14','Reunión con Coordinadora de la Institución','Reunión con la coordinadora para planear las intervenciones del año en la institución y el proceso del Aula Abierta','Enviar un cronograma con las fechas de las actividades en la institución','Institucion_Educativa_Maestro_Pedro_Nel_Gomez_Reunion_de_seguimiento_2.JPG','Institucion_Educativa_Maestro_Pedro_Nel_Gomez_Reunion_de_seguimiento.JPG',NULL,'uploads/meeting/meeting_adjunct',4,280,42,'2015-05-19 07:32:48','2015-05-22 15:29:00'),(635,'2015-05-14','Reunión con Coordinador de la Institución','Se tuvo una reunión con Ibsen Cossio para hablar del Aula Abierta que finalizó y planear la próxima.','Ibsen enviará un correo con los horarios en que se podría tener los cursos de Alfabetización Digital y Gobierno en línea en la institución','Institucion_Educativa_Pedro_Claver_Aguirre_Reunion_de_seguimiento.JPG',NULL,NULL,'uploads/meeting/meeting_adjunct',4,232,42,'2015-05-19 07:35:15','2015-05-22 15:29:00'),(636,'2015-05-19','Seguimiento Escuela de Padres','Reunión de Seguimiento del proceso de Aula Abierta, Escuela de padres, se encuentra estancado por los procesos de paro y reintegro, se planifica una reunión para el próximo mes para ver los resultados de la convocatoria a la comunidad y programar charlas.','Reunión el próximo mes ',NULL,NULL,NULL,'',4,154,10,'2015-05-19 11:46:22','2015-05-22 15:29:00'),(637,'2015-05-14','Gestión de procesos paa personas con discapacidad','Reunión con el coordinador de tecnología de la biblioteca para iniciar la inplementación de procesos de formación para personas con discapacidad en los temas de alfabetización digital, fotografía, escritura y georeferenciación a través de google maps','- Realizar documento con la ruta metodológica para entregar a la biblioteca (Gestor de Cultura digital)\r\n- Iniciar la convocatoria y analizar metodología del proceso (Daniel Rozo)','Parque_Biblioteca_de_Belen_Reunion_Gestion_de_procesos.JPG',NULL,NULL,'uploads/meeting/meeting_adjunct',4,193,38,'2015-05-19 14:43:22','2015-05-22 15:29:00'),(638,'2015-05-19','Planeación de actividades.','Se realizó reunión con la coordinadora de la fundación para programar las actividades que se realizarán, entre ellas un taller de dispositivos móviles dirigido a padres de familia, el taller estará enfocado en aprender a utilizar las aplicaciones y páginas web que promueven el aprendizaje y la comunicación en los niños diagnosticados con trastornos del espectro autista. La sensibilización de dicha actividad queda programada para el 17 de Junio. Además se quiere hacer un taller de narrativas digitales con los niños, lo cual quedará sujeto a autorización de la directora de la Fundación.','Por parte de la fundación quedó como compromiso evaluar la propuesta del taller de narrativas digitales. ','Fundacion_Integrar_Planeacion_de_actividades.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',4,215,43,'2015-05-19 16:06:41','2015-05-22 15:29:00'),(639,'2015-05-20','Empalme Nueva encargada','Reunión de empalme y socialización de procesos en articulación con el programa.','Se agenda procesos en charlas NSN, capacitaciones en recursos pedagógicos con gestores.','Capacitacion_gestores_UVA_Moscu.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',2,442,10,'2015-05-21 08:53:34','2015-05-22 15:29:00'),(640,'2015-05-07','Programación de procesos','Reunión para programar charlas para los estudiantes de 4 y 5 grado, planeación de proceso de formación para padres en aula abierta.','Realizar charla de Navegar Sin Naufragar con los estudiantes de 4° y 5°, al regresar de vacaciones la institución, iniciamos charla de Gel para los estudiantes de 11°.','Reunion_de_Seguimiento_I_E_Luis_Carlos_Galan_Sarmiento_sede_Nino_Jesus_de_Praga.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',4,313,40,'2015-05-21 09:42:09','2015-05-22 15:29:00'),(641,'2015-05-19','Empalme nueva docente enlace','En la reunión se realizó el empalme con la docente Ilsa contandole el acompañamiento que El Programa realizó durante este tiempo. La docente manifestó su interés de que el Pograma acompañe la construcción de la emisora y en general el componente de medios que se quiere desarrollar en la IE. También surgió la inquietud sobre unos aparatos de robótica que permanencen en la IE y que la docente quiere saber qué se puede hacer con ellos. \r\n\r\nA la docente le interesa realizar algunas actividades que involucren el tema del sonido, especialmente con los niños y niñas que se interesan por el tema de la emisora.','De la reunión sale el compromiso de preguntar qué estrategia se puede seguir con respecto al componente de medios y en cuanto a la pregunta sobre los aparatos de robótica que tiene la IE. \r\n\r\n','IE_Barrio_Santa_Cruz_Reunion_de_Empalme.JPG',NULL,NULL,'uploads/meeting/meeting_adjunct',2,239,21,'2015-05-21 10:01:19','2015-05-22 15:29:00'),(642,'2015-05-12','Empalme y gestión de procesos','Reunión de empalme y programación de procesos de formación para la comunidad. ','Se programa charla de NSN para grupo de niños asistentes al Telecentro, se programa convocatoria para curso de Alfabetización para el adulto mayor.','Reunion_Empalme_Telecentro_El_Salvador_2.jpg','Reunion_Empalme_Telecentro_El_Salvador_4.jpg','Reunion_Empalme_Telecentro_El_Salvador_5.jpg','uploads/meeting/meeting_adjunct',2,569,40,'2015-05-21 10:14:36','2015-05-22 15:29:00'),(643,'2015-05-12','Empalme y gestión de procesos','Reunión de empalme y programación de procesos de formación, gestión de aula abierta para la comunidad.',' Se programa charla NSN en grupo 5°1 y queda pendiente programar para después de vacaciones charla de GEL con el grado 11.','Reunion_empalme_I_E_Manuel_Jose_Cayzedo_3.jpg','Reunion_empalme_I_E_Manuel_Jose_Cayzedo_7.jpg','Reunion_empalme_I_E_Manuel_Jose_Cayzedo_4.jpg','uploads/meeting/meeting_adjunct',2,448,40,'2015-05-21 10:29:45','2015-05-22 15:29:00'),(644,'2015-05-19','Procesos de formación','Reunión con la dinamizadora del Telecentro para programar charlas de gobierno en línea.','Realizar una reunión con la rectora de la IE que queda cerca para invitar a los estudiantes de 11 a la charla de Gobierno en línea.','Telecentro_Belen_Zafra_Reunion_programacion_procesos.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',4,454,15,'2015-05-22 14:35:48','2015-05-29 21:39:40'),(645,'2015-05-22','Revisiòn formato certificado','Se revisan los formatos para la certificación de los padres próximos a terminar el proceso de alfabetización digital en la I.E Samuel Barrientos','Enviar de nuevo formato para revisión ','20150522_100122_HDR.jpg','20150522_100535_HDR.jpg',NULL,'uploads/meeting/meeting_adjunct',3,230,10,'2015-05-22 14:57:01','0000-00-00 00:00:00'),(646,'2015-05-22','Planeaciòn agenda Escuela de Padres','Reunión para agendar el comienzo de la escuela de padres aula abierta para la comunidad, una asesoría con los profesores encargados del proceso y una charla de GEL para el otro once de la I.E','Charla I.E y capacitación con profesores','20150522_111519_HDR.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',5,253,10,'2015-05-22 15:00:08','0000-00-00 00:00:00'),(647,'2015-05-22','Actualización de datos de la persona encargada del sitio','Se realizó una reunión con la persona encargada del sitio para actualizar los datos del contacto ya que hubo un cambio en la coordinación, adicionalmente se le informó que la instalación del Punto de Navegación y la zona Wifi se estarán realizando en la segunda mitad del año por lo que sería bueno ir pensando en la estrategia de apropiación con los usuarios y usuarias. ','La funcionaria quedó con los datos de la persona del área de conectividad con la que puede comunicarse en caso tal de tener dudas. ','UPSS_Santo_Domingo_Reunion_empalme.JPG',NULL,NULL,'uploads/meeting/meeting_adjunct',2,498,21,'2015-05-23 11:23:00','0000-00-00 00:00:00'),(648,'2015-05-20','Gestión Aliados','Se llevó a cabo reunión con el administrador del punto Vive digital de San Cristóbal con el propósito de conocer la dinámica del lugar para realizar alianzas y gestionar, tanto préstamo de espacios como la posibilidad de vincularnos desde el programa para realizar en conjunto  determinados procesos de formación. El funcionario mencionó como gran ventaja el acompañamiento del programa para la fase 2 de Alfabetización Digital en tanto el punto tiene procesos de alfabetización más pausados y sólidos. Además se Habló del acompañamiento de las dos Gestoras Tic que tenemos en San Cristóbal. ','Iniciar Convocatorias con la Comunidad para Alfabetización Digital. Evaluar la posibilidad de préstamo de video beam para disponer los recursos de forma adecuada, compartir los contenidos con el administrador del punto. Acompañamiento constante ','Punto_Vive_Digital_Gestion_con_aliados.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',3,169,23,'2015-05-25 08:09:28','0000-00-00 00:00:00'),(649,'2015-05-20','Planeación de actividades.','Se realizó reunión con el coordinador del Cedezo, con el fin de  detectar las principales necesidades e intereses de la población que se atiende allí, el funcionario manifestó que sería viable realizar un taller de página Web con los emprendedores que tienen su negocio consolidado, con el fin de que estos puedan proyectar su negocio en la WEB. Luego del taller de página WEB, se piensa realizar con el mismo grupo, un taller de mercadeo digital. ','Quedó como compromiso por parte del Cedezo gestionar el espacio y convocar los emprendedores. El taller iniciaría el 2 de Junio.','Punto_de_atencion_Cedezo_Guayabal_Reunion_de_empalme_y_planeacion.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',5,175,43,'2015-05-25 08:19:41','0000-00-00 00:00:00'),(650,'2015-05-20','Empalme  y planeación','Se llevó a cabo una pequeña reunión con al rectora para conocer la I.E Y recordar los procesos llevados a cabo en el 2014 y se mencionaron someramente las propuestas para el 2015; sin embargo por motivo de las pruebas saber no se pudo realizar la planeación completa','Nueva reunión el martes 26 de mayo con docente encargado de procesos de aula abierta en 2014 y personero de la I.E para mirar estrategia de NSN . Se realizarán propuestas de intervención para el 2015','I_E_Santa_Margarita_Reunion_de_Empalme.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',2,285,23,'2015-05-25 08:21:04','0000-00-00 00:00:00'),(651,'2015-05-20','Planeación de procesos','Se realizó reunión con dinamizador del telecentro para evaluar las posibilidades de intervención según el tipo de población dado que son en su mayoría adultos mayores. Se concretó Realizar Taller de GEL con grupo de informática intermedio y dispositivos móviles con los otros  grupos de adultos.','martes- jueves 3 a 5 el taller de Gel . Se convocara otro tipo de población para otros procesos','Telecentro_altamira_Planeacion_de_procesos.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',5,490,23,'2015-05-25 08:35:01','0000-00-00 00:00:00'),(652,'2015-05-25','Gestión de procesos','Reunión para gestionar procesos de formación con los grados 5 y 11 de la I.E.','- Charlas de Navegar sin Naufragar con los niños de grado 5, son 3 grupos y las charlas se realizarán el día 3 de junio de 2015','INEM_Jose_Felix_de_Restrepo_Reunion_para_Gestion_de_procesos.JPG',NULL,NULL,'uploads/meeting/meeting_adjunct',5,343,38,'2015-05-25 14:32:06','0000-00-00 00:00:00'),(653,'2015-05-25','Gestión de procesos','Gestión para procesos de formación con los estudiantes de la IE','Se espera agendar charlas de Navegar sin naufragar con los estudiantes de 4o grado','INEM_Guillermo_Echavarria_Reunion_para_gestion_de_procesos.JPG',NULL,NULL,'uploads/meeting/meeting_adjunct',5,342,38,'2015-05-25 14:39:46','0000-00-00 00:00:00'),(654,'2015-05-21','Seguimiento al kit de inclusión','Se visitó el Colegio Mayor para realzar seguimiento del Kit de inclusión y se encontró que tienen dos de ellos en le lugar. El líder de tecnología es nuevo este año y no conocía el kit y los auxiliares si bien lo han visto no sabían realmente de su uso e importancia; por tanto se mostraron cada una de sus partes, se sugirieron actividades a realizar en los espacios donde se encuentran ','Sacar el kit del maletin de una manera más visible para la comunidad, disponer dos funcionarios para asistir al compartir de experiencias en la Biblioteca Fernando Gómez Martínez con el propósito de ampliar sus conocimientos respecto a las ventajas del kit. Enviar reporte a la gestora de cultura Digital de cuantas personas usan el Kit y  qué tipo de discapacidades tienen.','Colegio_Mayor_Segjuimiento_al_kit_de_inclusion.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',4,406,23,'2015-05-25 15:09:12','0000-00-00 00:00:00'),(655,'2015-05-26','Seguimiento al KIT de inclusión digital','Se realizó seguimiento al Kit de inclusión digital y se evidenció que este lo están usando 9 estudiantes con discapacidades cognitivas y motrices. Se planteó la posibilidad de programar una actividad con personas en situación de discapacidad de la comunidad para promover el uso del mismo. ','Quedó como compromiso por parte de la Institución Educativa convocar las personas en situación de discapacidad de la comunidad para la realización de la actividad. ','Institucion_Educativa_Pedro_Octavio_Amado_Seguimiento_al_Kit_de_Inclusion.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',4,126,43,'2015-05-28 09:41:02','0000-00-00 00:00:00'),(656,'2015-05-14','Articulación entre los diferentes actores','En la fecha, hora y lugar antes indicados, se reunieron los asistentes mencionados, y se trataron los siguientes temas:\r\n? Socialización concurso fortalecimiento upas con recursos de presupuesto participativo\r\n? Articulación fundación taxis de la felicidad\r\n? Curso de inglés con la Universidad Sto. Tomas\r\n? Cursos para panaderos en ofimática con Mde ciudad inteligente\r\n? Articulación con diferentes entidades para el evento\r\n? Sede para el evento cambia, ya no es plaza mayor\r\nLa reunión inicia explicando sobre el concurso de fortalecimiento de unidades productivas asociativas con recursos de presupuesto participativo y la oportunidad de participar como delegado en p.p. como organizaciones sociales, Rodrigo Zuluaga de la fundación Taxis de la felicidad comenta sobre el proceso de ser delegado, él se inscribió.\r\nVer opción de articulación con la fundación y los taxistas asociados para participar en la promoción del evento y uso de los vehículos para transporte de asistentes.\r\nVer promoción de los negocios de los panaderos de la ciudad con los taxistas.\r\n\r\nAsiste a la reunión Mónica Castañeda Dinamizadora de Medellín ciudad inteligente para ver posibilidad de capacitación en ofimática con los panaderos Asociados en AGRUPAN y la posibilidad de que participen en el evento, queda pendiente nueva reunión para organizar la programación y logística, posibilidad de realizar las capacitaciones en las salas de sistemas de los parque biblioteca, telecentros o Instituciones de educación públicas que se articulen a la iniciativa. Abelardo García de AGRUPAN pregunta sobre la posibilidad de ayudar a crear un sistema para pedidos a domicilio, caso página web, aplicación en celular.\r\n\r\nLa nueva fecha será el día viernes 16 de julio, desde las 8am hasta las 6pm en el club censa, sede avenida Colombia entre el palo y Girardot.\r\nSe habla sobre las diferentes Instituciones que hacen parte del ecosistema del emprendimiento para analizar quienes pueden acompañar el evento.\r\nSe hace la revisión de las Instituciones que pueden participar en el evento :\r\nCREAME\r\nRUTA N\r\nCAMARA DE CCIO\r\nMEDELLIN CIUDAD INTELIGENTE\r\nSECRETARIA DE DESARROLLO ECONOMICO: cedezo, pil, banco de las oportunidades, Subsecretaria de turismo\r\nFUNDACION TAXIS DE LA FELCIDAD\r\nFENALCO\r\nACOPI\r\nSENA','Pendiente programar reunión para la primera o segunda semana de junio con las Instituciones que desean participar en el evento.\r\nHablar con el Coordinador del programa cedezo y subsecretario para invitación formal a entidades aliadas.\r\nHablar con Mauricio Herrera Coordinador del pil para integración en el evento, programar primero reunión con AGRUPAN.','Cedezo_La_Quintana_Gestion_con_Aliados_1.jpg','Cedezo_La_Quintana_Gestion_con_Aliados_2.jpg',NULL,'uploads/meeting/meeting_adjunct',3,168,24,'2015-05-28 19:13:28','0000-00-00 00:00:00'),(657,'2015-05-21','Empalme y planeación','La reunión se centra en planear las nuevas intervenciones que se tendrán este año, además de evaluar la pertinencia de reactivar el aula abierta, planear los talleres que se realizarán en la IE. Se trabajarán tres componentes: \r\nAula Abierta, de está se hará cargo la docente Natalia Botero la cual integra el equipo gestor de la IE\r\nCharlas de Gobierno en Línea para los estudiantes de 10 y 11\r\nCharlas de Navegar sin Naufragar para los de quinto\r\nTaller Narrativas con los chicos de preescolar y sus padres de familia. ','Realizar la convocatoria del Aula Abierta la segunda semana de Julio, la docente Natalia Botero será la Gestora TIC encargada de dictar el curso.\r\nLa segunda semana se realizará una capacitación para el equipo Gestor en google Calendar','IE_Ciudadela_de_las_Americas_Empalme_y_planeacion.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',2,404,24,'2015-05-28 20:22:32','0000-00-00 00:00:00'),(658,'2015-05-14','Reunión con funcionarios del CAE','La reunión se centra en la planeación de la sensibilización a realizar con chicos residentes en el Centro de Atención Especializado Ciudad Don Bosco ubicado en Robledo La Pilarica, se busca diagnosticar los saberes de los estudiantes y formar varios grupos de trabajo con el fin de realizar un proceso de alfabetización Digital con ellos. ','No se generaron compromisos','Parque_Biblioteca_La_Quintana_Gestion_con_Aliados_1.jpg','Parque_Biblioteca_La_Quintana_Gestion_con_Aliados_2.jpg',NULL,'uploads/meeting/meeting_adjunct',3,184,24,'2015-05-28 21:24:10','0000-00-00 00:00:00'),(659,'2015-05-19','Seguimiento y planeación de actividades','Se retoma el contacto y las actividades planteadas en la reunión anterior, para esto se ponen fechas de inicio para poder generar conocimiento y reconocimiento de las personas que llegan al espacio del internet wifi y del punto de navegación que se instalará en este. ','microactivaciones en los eventos que se realizan los días viernes en las tardes noches en el TAL, esto se realizará cada quince días. ','Parque_y_TAL_de_Pedregal_Seguimiento_al_sitio_1.jpg','Parque_y_TAL_de_Pedregal_Seguimiento_al_sitio_2.jpg',NULL,'uploads/meeting/meeting_adjunct',4,486,24,'2015-05-28 21:44:45','0000-00-00 00:00:00'),(660,'2015-05-21','Planeación Actividades ','Después de realizada la activación pedagogica, procedemos a formar los grupos con los que se trabajarán las formaciones en Alfabetización Digital y Gobierno en línea, Herramientas web 2.0 y algunas asesorías en temas puntuales con los jóvenes del Centro de Atención Especializado Ciudad Don Bosco. ','Mandar la lista de los estudiantes que harán parte del grupo con los datos solicitados para ingresarlos al  Formato Procesos de Formación 2015','PB_Tomas_Carrasquilla_Planeacion_1.jpg','PB_Tomas_Carrasquilla_Planeacion_2.jpg',NULL,'uploads/meeting/meeting_adjunct',5,184,24,'2015-05-28 21:53:18','0000-00-00 00:00:00'),(661,'2015-05-19','Empalme y planeación','Se realiza la presentación del programa y explica la importancia del punto de navegación y la red wifi en el espacio. La funcionaria realiza preguntas referentes al funcionamiento de este espacio, se nos muestra el espacio en el que el contratista de la instalación colocó las conexiones de la energía, ella manifiesta que según los planos levantados a partir de la caracterización en campo, el contratista hizo caso omiso a esto y los destinó en el lugar equivocado. Se busca generar espacios de apropiación y para esto tendremos charlas en el punto de navegación y gran divulgación por parte de las personas que se encuentran en este. ','La gestora de cultura digital encargada del espacio, asistirá a la reunión mensual de los funcionarios del espacio a sensibilizarlos sobre la red wifi y el punto de navegación.','UPSS_Doce_de_Octubre_Empalme_y_Gestion.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',2,489,24,'2015-05-28 22:25:02','0000-00-00 00:00:00'),(662,'2015-05-26','Reunión de empalme y planeación de procesos','Reunión de empalme con la Supervisora del Proyecto, la Coordinadora General y el Coordinador de Educación, para gestionar procesos de formación con la comunidad. ','Se programa charla de sensibilización y Curso de alfabetización Digital y Gobierno en Línea, inicia el Martes 2 de Junio.','Reunion_Empalme_Por_Mis_Derechos_2.jpg','Reunion_Empalme_Por_Mis_Derechos_1.jpg',NULL,'uploads/meeting/meeting_adjunct',2,321,40,'2015-05-28 22:53:32','0000-00-00 00:00:00'),(663,'2015-05-28','Empalme y planeación ','Se realizó la presentación de la nueva Gestora de cultura digital que acompañará la Institución Educativa, se detectaron las principales necesidades de la Institución, entre las cuales está acompañar aula abierta, realizar charlas de Gobierno en Línea para jóvenes, incluyendo el tema de mapeo y conocimiento del territorio por medio de las herramientas virtuales. Lo anterior es una necesidad manifiesta en los estudiantes, por lo cual también se quiere hacer un ejercicio de cartografía social con el fin de fomentar la identidad social. ','Programar una próxima reunión para realizar una planeación estructurada de las actividades.','Institucion_Educativa_Debora_Arango_Empalme_y_planeacion.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',2,128,43,'2015-05-29 08:07:10','0000-00-00 00:00:00'),(664,'2015-05-27','Planeación Evento Panamericano de natación','Reunión para la planeación del evento panamericano de natación máster a realizarse desde el 15 al 25 de junio\r\n','Revisar servicios de conexión y como podemos articularnos.','20150527_152026.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',5,504,10,'2015-05-29 10:25:56','0000-00-00 00:00:00'),(665,'2015-05-26','Planeación de procesos','Se llevó a cabo reunión de planeación de procesos donde se convocó a la coordinadora académica, rectora y docente encargado del aula abierta en años anteriores y se habló de varios procesos:\r\n1. Con el propósito de reactivar el aula abierta se trató de mirar estrategias de acompañamiento y convocatoria dado que en lusitania se encontraron varios club de vida; sin embargo y pese a que la I.E demostró toda la disposición posible, el sistema en la nube causó gran deserción de los padres de familia y por ende se están direccionando al aula de sistemas de la estación de metro-cable Vallejuelos, por tal motivo se visitará el lugar para mirar posibles formas de acompañamiento y gestión.\r\n2. Se acordó que según las necesidades de la I.E se realizarán procesos de formación con los chicos de sexto inicialmente en relación a la estrategia NSN, también charlas de GEL con los grados once.\r\n\r\nEn relación a los padres de familia se programará según calendario de la I.E charlas de NSN.','Fechas charlas\r\n\r\nJulio 7: GEL once\r\nAgosto 6 : GEL once\r\nSept 9: NSN con sextos 90 niños\r\nSept 23: NSN con sextos 90 niños','I_E_Santa_margarita_Planeacion_de_procesos.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',5,285,23,'2015-05-29 11:13:09','0000-00-00 00:00:00'),(666,'2015-05-27','Reunión Palacio de la Cultura Rafael Uribe Uribe','Reunión con personal del Palacio de la Cultura y el Coordinador del CEDEZO, para gestionar el préstamo de espacios para realizar procesos de formación con la comunidad que asiste al Pasaje la Bastilla y a Por Mis Derechos. ','Se inicia curso de Alfabetización y Gobierno en Línea, para la comunidad de Por Mis Derechos el miércoles 10 de mayo en el aula de informática del Palacio.\r\nSe agenda proceso de formación con la comunidad del CEDEZO Pasaje la Bastilla.','Gestion_con_Aliados_CEDEZO_Pasaje_la_Bastilla_Palacio_de_la_Cultura_3.jpg','Gestion_con_Aliados_CEDEZO_Pasaje_la_Bastilla_Palacio_de_la_Cultura_2.jpg',NULL,'uploads/meeting/meeting_adjunct',3,171,40,'2015-05-29 11:26:34','0000-00-00 00:00:00'),(667,'2015-05-20','Empalme con Profesora','Se hizo reunión de empalme con la profesora, como es el manejo del Kit de Inclusión en la Institución','Reunirse nuevamente para ver el manejo del kit en algunos alumnos','Institucion_Educativa_Jose_Asuncion_Silva_Reunion_de_empalme.JPG',NULL,NULL,'uploads/meeting/meeting_adjunct',2,224,42,'2015-05-29 12:03:13','0000-00-00 00:00:00'),(668,'2015-05-29','Empalme con Profesora','´Se reunió con la profesora Claudia López para iniciar nuevamente el aula abierta en la institución','Se programó unas charlas y además se quedó de conseguir gestor o gestora para el aula abierta','Institucion_Educativa_Fe_y_Alegria_Villa_de_la_Candelaria.JPG',NULL,NULL,'uploads/meeting/meeting_adjunct',2,409,42,'2015-05-29 12:07:04','0000-00-00 00:00:00'),(669,'2015-05-08','Articulación Ciudad Comuna','Reunión con integrantes de colectivo Ciudad Comuna para gestionar acompañamiento en festival de la memoria.','Acompañar el festival el 7 de mayo y prestar las cámaras del programa para los talleres.','Parque_Santo_Gestion_con_Aliados_6.jpg','Parque_Santo_Gestion_con_Aliados_1.jpg',NULL,'uploads/meeting/meeting_adjunct',3,530,17,'2015-05-29 12:22:11','0000-00-00 00:00:00'),(670,'2015-05-26','Reunión de planeación ','Reunión con la directora para planear la actividad de stopomotion con línea de tiempo y la articulación con el Cedezo.','Realizar la convocatoria de los niños para el taller de stopmotion','Biblioteca_Santa_Elena_Reunion_planeacion_4.JPG','Biblioteca_Santa_Elena_Reunion_planeacion_8.JPG',NULL,'uploads/meeting/meeting_adjunct',5,190,17,'2015-05-29 15:24:53','0000-00-00 00:00:00'),(671,'2015-05-22','Seguimiento a la instalación del punto de navegación y wifi','Se visitó la UPSS Hermenegildo de Fex con la intención de hacerle seguimiento a la instalación del punto de navegación y conocer el contacto enlace encargado del sitio. Se tomaron los datos de contacto, y se dieron las recomendaciones y sugerencias del caso para acompañarlo desde el programa. ','Se asignarán dos gestores Tic de la comuna 3 para que estén acompañando el punto de navegación una vez esté instalado; sin embargo de iniciará el acompañamiento con la activación wifi del sitio y asesorías en dispositivos móviles. ','IMG_7619.JPG','IMG_7623.JPG',NULL,'uploads/meeting/meeting_adjunct',4,522,41,'2015-05-29 16:02:41','0000-00-00 00:00:00'),(672,'2015-05-14','Seguimiento a los compromisos curso de Mercadeo y Gestor Tic ','Se visitó el Cedezo Santo Domingo con el fin de presentar al coordinador la nueva gestora tic que acompañará el sitio con el curso de Mercadeo para emprendedores y asesorías personalizadas para algunos empresarios. \r\nSe establecieron posibles horarios y fechas de inicio para dar inicio a la convocatoria. ','El curso de Mercadeo Digital se iniciará en el mes de junio y el Cedezo se encargará de movilizar la convocatoria respectiva','IMG_7435.JPG','IMG_7437.JPG',NULL,'uploads/meeting/meeting_adjunct',4,165,41,'2015-05-29 16:07:56','0000-00-00 00:00:00'),(673,'2015-05-27','Articulación practicas - Gestrores TIC','Reunión con la coordinadora de práctica para articular la estrategia de Gestores TIC con el proceso de prácticas de las estudiantes de la modalidad de informática.','Encuentro con las 14 estudiantes para socializare el programa y la estrategia Gestores TIC\r\n','CEFA_Reunon_articulacion_2.JPG',NULL,NULL,'uploads/meeting/meeting_adjunct',5,299,17,'2015-05-29 16:20:43','0000-00-00 00:00:00'),(674,'2015-05-28','Reunión de empalme y planeación ','Reunión con el líder de proyectos y el coordinador del sitio para realizar la articulación y planeación de la intervención por parte del programa.','Realizar la gestión para la dotación de la sala de cómputo.','Casa_Afrodescendiente_Reunion_empalme_y_planeacion_4.JPG','Casa_Afrodescendiente_Reunion_empalme_y_planeacion_3.JPG',NULL,'uploads/meeting/meeting_adjunct',2,297,17,'2015-05-29 16:35:22','0000-00-00 00:00:00'),(675,'2015-05-28','Planeación de objetivo del taller de narrativas digitales','Reunión con Camilo funcionario de la Biblioteca para planear la estrategia que se implementará en el taller de fotografía con los jóvenes.','Realizar la segunda sesión del taller de narrativas digitales llevando una propuesta concreta de parte del programa.','Biblioteca_Publica_El_Limonar_Reunion_Planeacion_de_procesos.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',5,196,15,'2015-05-29 17:37:50','0000-00-00 00:00:00'),(676,'2015-05-26','Planeación proceso de formación','Reunión con de planeación del curso de alfabetización digital para personas en situación de discapacidad. El grupo se divide en dos para que sea más personalizado el curso, dos formadoras se encargaran de cada grupo. Uno es los lunes y el otro el jueves de 9:00 a 11:00 am','Elaboración de planeación conjuntamente.','PB_Leon_de_Greiff_planeacion.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',5,189,20,'2015-05-30 17:27:32','0000-00-00 00:00:00'),(677,'2015-05-21','Empalme y agenda de acompañamiento','Se visitó la institución educativa con el fin de articular los procesos de acompañamiento para este año. \r\nEl aula abierta se abre una vez estén los cupos deseados de la convocatoria a los padres de familia, por el momento están identificados los estudiantes que los acompañarán en los tallres. \r\nSe programaron charlas de gobierno en línea para estudiantes del grado once dictados por dos gestores tic. ','Confirmar la fecha de las charlas de NSF','IMG_7575.JPG','IMG_7581.JPG',NULL,'uploads/meeting/meeting_adjunct',2,147,41,'2015-06-01 11:13:06','0000-00-00 00:00:00'),(678,'2015-06-03','Reunión de Planeación Kit de Inclusión','Reunión con la docente de apoyo para poner en uso el kit en la institución ya que desde el momento en que se entregó no se ha hecho uso de este.','La profesora Martha hablará con el rector para buscar los computadores en donde está instalado el software, cuando lo haga, se planeará una nueva cita para asesorías de los programas.','Institucion_Educativa_Mariscal_Robledo_Reunion_de_planeacion_Kit_de_Inclusion.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',5,281,42,'2015-06-03 18:27:17','0000-00-00 00:00:00'),(679,'2015-06-05','Planeación certificación','Reunión para ultimar detalles de la ceremonia de certificación de los asistentes al aula abierta de la institución.','Próxima reunión ','20150605_100807_HDR.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',5,162,10,'2015-06-05 15:02:47','0000-00-00 00:00:00'),(680,'2015-06-02','Planeación de procesos','Se llevó a cabo reunión de planeación con Técnico en cultura digital de la biblioteca para intervenir los grupos existentes de A.D con GEL , posiblemente web 2.0 además se conversó del proceso de certificación y de la posibilidad de realizar talleres esporádicos con niños y niñas algunos sábados. Se realizará una próxima reunión para concretar procesos y compartir contenidos.','Concretar las intervenciones que realizará el programa en los diferentes grupos que ya tiene la biblioteca con procesos de formación. Pensar en intervención con grupos de niños posiblemente desde la propuesta de stop- motion. Agendar reunión para compartir contenidos.','Biblio_Fdo_gomez_Martinez_Planeacion_de_Procesos.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',5,268,23,'2015-06-05 16:34:56','0000-00-00 00:00:00'),(681,'2015-06-02','Planeación de procesos','Se llevó a cabo reunión con rector y docente de informática de la I.E loma hermosa en donde se concretó la estrategia para aperturar el aula abierta los dias lunes jueves  en las tardes. Para esto se dispone de la formación de algunos alfabetizadores de la I.E que estará a cargo de la docente Andrea Chica y de MDE ','El programa Mde acopañará el programa de aula abierta con charlas de GEL , NSN además de la formación a los alfabetizadores. En conjunto con la I.E se creará el paquete de contenidos para las clases con la comunidad. LLevar a cabo reunión para organizar contenidos . La I.E realizará convocatoria abierta entre el 1 y 17 de julio','I_E_Loma_Hermosa_Planeacion_de_procesos.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',5,493,23,'2015-06-09 15:45:54','0000-00-00 00:00:00'),(682,'2015-06-04','Presentación a Gestoras TIC','Encuentro con la coordinadora de prácticas del CEFA y un grupo  de 14 estudiantes de la modalidad de informática para presentarles el programa y la estrategia de Gestores TIC, y así generar una alianza entre la I.E. CEFA y MDE Ciudad Inteligente que permita a las estudiantes realizar sus horas de práctica con el programa.','Por parte de la institución: Agilizar el trámite de afiliación de las estudiantes a la ARL con la Secretaría de Educación para poder comenzar las prácticas.\r\npor parte del Programa: Averiguar el tipo de convenio con el cual se articularía la estrategia de Gestores TIC con las prácticas del CEFA en la modalidad de informática.','CEFA_Reunion_Gestoras_TIC_1.JPG','CEFA_Reunion_Gestoras_TIC_2.JPG','CEFA_Reunion_Gestoras_TIC_4.JPG','uploads/meeting/meeting_adjunct',6,299,17,'2015-06-09 16:03:49','0000-00-00 00:00:00'),(683,'2015-06-09','Planeación de procesos y convoctorias para talleres','reunión para realizar convocatoria de niños para el taller con la corporación línea de tiempo, y hacerle seguimiento a los cursos que se estan realizando con nuestros contenidos los gestores TIC de la biblioteca','- Realizar Convocatoria (PB San Javier)\r\n- Enviar Formatos para generar los certificados de los asistentes a cursos','Parque_Biblioteca_Belen_Reunion_de_planeacion_para_convocatorias.JPG',NULL,NULL,'uploads/meeting/meeting_adjunct',5,191,38,'2015-06-10 10:50:28','0000-00-00 00:00:00'),(684,'2015-06-09','Reunión con Gestor y gestion','Reunión para planificación de la certificación de los estudiantes y la entrega entrega de certificados al elecentro','Definir fecha para ceremonia.','telecentro.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',3,198,10,'2015-06-10 14:58:26','0000-00-00 00:00:00'),(685,'2015-06-03','Gestión con aliados','Se llevó a cabo reunión entre Director de parque biblioetca Fernando Botero, Gestora de Servicios Bibliotecarios y técnico en cultura digital del mismo lugar, además de MDE inteligente y el administrador del punto Vive Digital San Cristóbal con el propósito de anudar esfuerzos entre entidades para generar procesos de formación conjuntos e intervenir las comunidades con procesos integrales entre las tres entidades. Dentro de las actividades realizadas estuvieron:\r\n- Focalización de públicos probables.\r\n- Propuestas de intervención de las tres entidades.\r\n- Procesos de certificación conjuntos.\r\n- Apoyo y participación en eventos del corregimiento.\r\n- Vinculación a espacios como la mesa de inclusión de la comuna a través de charlas de accesibilidad e inclusión.\r\nEl parque biblioteca expresó como gran interés el trabajo con micro-empresarios y emprendedores; para esto tanto MDE  como vive digital serán el puente y se propone la creación de una especie de laboratorio donde a a partir de una reunión con ellos y ellas se identifiquen intereses y necesidadades de formación','Asistir a próxima reunión el día viernes  12 de Junio con el grupo de Cultura digital para agendar un proceso de formación que se desarrolle entre MDE inteligente y el punto Vive digital','Parque_Biblioteca_Fernando_Botero_Gestion_con_Aliados.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',3,186,23,'2015-06-10 14:59:27','0000-00-00 00:00:00'),(686,'2015-06-04','Reunión JAL Comuna 80','Se realizó una reunión para conversar acerca de los procesos en los que los estudiantes de pp han venido adelantando con nosotros, además se converso acerca de posibles procesos de formación que se abrirán en la comuna.','Enviar datos actualizados de los estudiantes de pp por parte de la funcionaria de la JAL.','Casa_de_Gobierno_San_Antonion_de_Prado_Reunion_JAL.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',3,333,15,'2015-06-11 08:44:26','0000-00-00 00:00:00'),(687,'2015-06-04','Reunión JAL Comuna 16','se realizó una corta reunión para conversar acerca de la labor que realizan los estudiantes de pp que están haciendo la labor social con el programa.','Ninguno.','Mascerca_Belen_Gestion_con_aliados_JAL_Comuna_16.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',3,438,15,'2015-06-11 08:59:32','0000-00-00 00:00:00'),(688,'2015-06-04','Planeación Curso para Adultos Mayores','Reunión con Luz Elena, Líder Comunitaria, integrante de la JAC Comuna 8 - Los Mangos, para programar Charla de sensibilización de Curso alfabetización Digital para grupo de Adulto Mayor en Aula abierta de la Sede Niño Jesús de Praga.','Se programa charla de Sensibilización del Curso Alfabetización Digital y Gobierno en Línea para el día 10 de junio de 3:00 p.m. a 5:00 p.m.','I_E_Luis_Carlos_Galan_Sarmiento_Sede_Nino_Jesus_de_Praga_Reunion-0.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',3,313,40,'2015-06-11 13:52:41','0000-00-00 00:00:00'),(689,'2015-06-03','Planeación asesorías página web','Se realizó una corta reunión con el coordinador de la Institución educativa para plantear la fecha de inicio de las asesorías con los profesores del equipo gestor y empezar a montar la página web de la IE.','Reunión viernes 12 de junio.','IE_San_Roberto_Belarmino_Reunion_proceso_pagina_web.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',5,356,15,'2015-06-11 16:17:54','0000-00-00 00:00:00'),(690,'2015-06-04','Gestión Aliados','Se visitó la sala de informática de la estación vallejuelos del metro cable y se estableció contacto con los formadores del lugar con el propósito de gestionar el espacio en dos vías; una de ellas desarrollar nuestros procesos de formación o bien apoyar los procesos del lugar y contactarlos con la comunidad de las flores que está en espera de la apertura de Alfabetización Digital básica para ellos. Los formadores quedaron muy interesados con las propuestas y hubo total disposición frente a una posible alianza. Se dejaron claros aspectos como la certificación de participación para la comunidad la cual ellos realizan de igual forma y la importancia de hacer sinergías con propósitos comunes en beneficio de la ciudadanía.','Llamar a La señora Paula, jefe inmediata de los formadores del Metro para agendar reunión y concretar las formas de vinculación entre el programa y el metro con el propósito común de antender las necesidades formativas de la comunidad del sector','Estacion_Vallejuelos_Gestion_Con_aliados.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',3,494,23,'2015-06-12 08:04:02','0000-00-00 00:00:00'),(691,'2015-06-11','Seguimiento CAV','Seguimiento de sitio y reunión con la coordinadora Para compartir impresiones y estrategias para el uso del CAV','Nueva reunión después de terminado los trabajos.','CAV.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',4,247,10,'2015-06-12 08:47:41','0000-00-00 00:00:00'),(692,'2015-06-12','Inducción Gestor TIC y firma de pacto','Firma Pacto de acompañamiento e inducción de procesos de MDE','Iniciar procesos de formación para la próxima semana y nos acompañará en el proceso de migración de información al sistema de apropiación.','Mascerca_Poblado_Induccion_Gestor_TIC_Miguel_Angel_Pastas.JPG',NULL,NULL,'uploads/meeting/meeting_adjunct',6,349,38,'2015-06-12 15:03:40','0000-00-00 00:00:00'),(693,'2015-06-10','Reunión de planeación','Reunión con una de la funcionarias del Parque de la Vida para planificar actividades con la comunidad de asiste al sitio. Se les ofrece la posibilidad de trabajar alfabetización digital con adultos mayores, GEL para líderes comunitarios, NSN niños. ','La funcionaria del sitio coordinadora el grupo con el cual se empieza la intervención','Parque_de_la_Vida_reunion_de_planeacion.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',5,318,20,'2015-06-12 15:17:38','0000-00-00 00:00:00'),(694,'2015-06-17','Empalme y detección de necesidades','Se realizó la presentación de la gestora de cultura digital que acompañará el sitio y se conversó con los funcionarios sobre la Zona Wifi y el Punto de Navegación que tendrán allí, explicándoles en que consiste el punto de navegación y cual es el objetivo de este. La red Wifi ya está funcionando y varios usuarios la están usando. \r\nAdemás se detectaron las principales necesidades de la comunidad, entre ellas aprender sobre trámites de salud y páginas que promuevan los hábitos de vida saludables, otra de las necesidades es la comunicación de los pacientes hospitalizados con sus familiares y amigos. Por lo anterior se planeará un acompañamiento al sitio que supla las necesidades de la comunidad.','Planear el acompañamiento que se hará en el sitio, a partir de las necesidades ya detectadas.','UPSS_Hector_Abad_Gomez_Reunion_de_empalme.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',2,561,43,'2015-06-17 13:57:26','0000-00-00 00:00:00'),(695,'2015-06-16','Gestión con la JAL','Reunión de gestión y alianza con el presidente de la JAL de santa Elena para la articulación de algunos estudiantes de PP con los procesos de apropiación en el corregimiento. En la reunión estuvo presente la secretaria, quien facilitó los datos de los estudiantes. ','Llamar a los estudiantes y gestionar su participación en el programa.','Casa_Gobierno_Santa_Elena_Gestion_con_aliados_2.JPG','Casa_Gobierno_Santa_Elena_Gestion_con_aliados_3.JPG',NULL,'uploads/meeting/meeting_adjunct',3,296,17,'2015-06-17 14:01:26','0000-00-00 00:00:00'),(696,'2015-06-16','Planeación Taller Stopmotion','Reunión con la directora de la biblioteca para conocer el proceso de convocatoria para el taller de stopmotion. Hasta el momento hay 19 niños y niñas preinscritos. ','Fortalecer la convocatoria por medio de llamadas telefónicas, y acompañar el taller.','Biblioteca_Santa_Elena_Planeacion_taller_Stopmotion_3.JPG','Biblioteca_Santa_Elena_Planeacion_taller_Stopmotion_2.JPG',NULL,'uploads/meeting/meeting_adjunct',5,190,17,'2015-06-17 14:04:41','0000-00-00 00:00:00'),(697,'2015-06-09','Empalme  y planeación','Se realizó reunión con Daniela Maury, Técnico en cultura Digital con el propósito de indagar los procesos hasta ahora desarrollados en la biblioteca con la comunidad además de ingresarla como gestora Tic, compartir con ella algunos de nuestros contenidos, explicarle el diligenciamiento de los formatos y planear intervenciones paulatinas en cada uno de los grupos que ella forma.','- Realizar charla de NSN para adultos con los grupos de informática básica.\r\n- Hay una invitación para participar con el grupo de niños de cápsulas digitales que se reúnen los sábados de 1 a 2 y realizar alguna intervención, posiblemente en el tema de Stop Motion o Fotografía\r\n-Certificar los procesos desarrollados por la Gestora Tic donde utilizará los contenidos del programa.','Biblioteca_Fdo_G_Martinez_Empalme_y_planeacion_Gestora_Tic_1.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',2,268,23,'2015-06-17 14:09:12','0000-00-00 00:00:00'),(698,'2015-06-10','Planeación de procesos','Se llevó  a cabo un encuentro con Carolina Gallón para ajustar los detalles del taller que se llevará a cabo el dia 18 de Julio de 2015 en la biblioteca con al corporación línea del tiempo sobre el teman de Astronomía, utilizando Stop motion. Se concretaron aspectos como Cantidad de niños, responsabilidad de convocatoria, edades, horario, refrigerio.','Realizar Convocatoria para dejar algunos cupos para el PVD . \r\nDisponer el espacio ','PB_Fernando_botero_Planeacion_de_procesos.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',5,186,23,'2015-06-17 16:16:35','0000-00-00 00:00:00'),(699,'2015-06-17','Inducción Gestor Tic','Se realizó reunión con La señora Martha  y yurany Londoño quien será la nueva gestora Tic en la Bpp la loma. Además de contarle en qué consistía el programa y todas las actividades que realizamos se hizo empalme del proceso  hasta ahora llevado a cabo en la biblioteca y como ella tiene la experiencia con Tic perfectamente puede asumirlo. Se mostró muy interesada en realizar su articulación con el programa, dispuesta y responsable. Se tomaron los datos y se planearon otras posibles actividades a realizar en el sitio.','Pasar los contenidos de A. D a la gestora Tic para que asuma en adelante el curso en la Biblioteca ','Pacto_de_acompanamiento_yurani.PDF','BPP_La_loma_Induccion_Gestor_Tic.jpg',NULL,'uploads/meeting/meeting_adjunct',6,187,23,'2015-06-19 12:12:19','0000-00-00 00:00:00'),(700,'2015-06-18','Gestión con aliados','Se realizó reunión con la profesional en Gestión territorial de la Unidad de Víctimas que acompaña el sector de la Loma dado que ella manifiesta la necesidad emergente de que la mesa de líderes del sector obtenga formación en Alfabetización  digital ya que no hay manejo del computador y como líderes necesitan dichas competencias básicas además de algunas específicas. Frente a esto se conversó con la biblioteca y se plantearon posibilidades de horarios; sin embargo los líderes solo pueden en su mayoría los sábados en la tarde y no es viable ni por el espacio dado que la biblioteca cierra a las 2 pm y ya tiene procesos este día. Frente a esto se pensó en la posibilidad de dividir el grupo para que algunos obtengan la formación en semana y los de los sábados traten de acomodarse al horario de la biblioteca. Este proceso lo asumiría la biblioteca como tal.','Claudia Escobar tomó los datos de la Gestora de Cultura Digital para que una vez converse con las personas se establezca comunicación y se traten de concretar estrategias. El programa propuso además acompañamiento en el tema de GEL dada la importancia que representa este conocimiento para los líderes.','BPP_La_loma_Gestion_con_Aliados_1.jpg','BPP_La_loma_Gestion_con_Aliados_2.jpg',NULL,'uploads/meeting/meeting_adjunct',3,187,23,'2015-06-19 14:31:54','0000-00-00 00:00:00'),(701,'2015-06-10','Reunión Hogar Infantil La Estrellita','Reunión en el Hogar Infantil La Estrellita, para programar Taller de Narrativas Digitales con los niños y niñas de párbulos, se plantea como fecha de inicio el mes de Agosto-','Queda pendiente fijar la fecha para iniciar el taller.','Telecentro_Los_Mangos_Gestion_con_Aliados.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',3,204,40,'2015-06-22 14:38:45','0000-00-00 00:00:00'),(702,'2015-06-10','Planeación Curso para Adultos Mayores','Reunión con el profesor Hammer, encargado del aula abierta en la institución, se estudian los posibles horarios para realizar curso de alfabetización Digital y Gobierno en Línea para grupo de adulto mayor. \r\nSe plantea programación de charlas para los grados 5 de primaria, de Navegar Sin Naufragar y de Gobierno en Línea para 11 de bachillerato.','Se confirma horario para el curso de Alfabetización y Gobierno en Línea con adultos mayores de 3:00 a 5:00 p.m., iniciando el miércoles 8 de julio.\r\n','I_E_Luis_Carlos_Galan_Sarmiento_Sede_Nino_Jesus_de_Praga_Reunion_Planeacion.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',5,313,40,'2015-06-22 15:21:08','0000-00-00 00:00:00'),(703,'2015-06-18','Empalme ','Se realizó una reunión de empalme con la gestora administrativa, con quien se puso a disposición los servicios del programa y se tuvo en cuenta el tipo de público que asiste al sitio','Se realizará una visita al mes, como mínimo, al sitio.','Diamante_de_Beisbol_2.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',2,505,46,'2015-06-22 16:21:03','0000-00-00 00:00:00'),(704,'2015-06-19','Seguimiento de evento','Seguimiento al buen funcionamiento del evento Panamericano Máster de Natación que se realiza en el sitio.','Seguimiento telefónico del evento','20150619_135942_HDR.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',4,504,10,'2015-06-23 08:40:27','0000-00-00 00:00:00'),(705,'2015-06-02','Planeación actividades en el punto de navegación','Se realizó una corta reunión con la nueva secretaria, para contarle que se estaba haciendo en el sitio, además se identificó la posibilidad de realizar otras actividades.','Ninguno','Unidad_Integral_de_Belen_6_seguimiento_y_planeacion_de_procesos-0.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',5,362,15,'2015-06-23 09:11:09','0000-00-00 00:00:00'),(706,'2015-06-12','Reunión página web','Se realizó una reunión con el equipo gestor de la IE para verificar el estado de la página web de la institución, se identifico que tenía un buen funcionamiento y se definió que los docentes la actualizarían frecuentemente.','Actualización de la página web por parte de los docentes de la IE.','IE_San_Roberto_Belarmino_Reunion_equipo_gestor.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',5,356,15,'2015-06-23 10:48:18','0000-00-00 00:00:00'),(707,'2015-06-11','Planeación procesos de formación','Se realizó una reunión con la encargada del telecentro para programar las actividades que se realizaran con las personas que frecuentan en lugar, se decidió iniciar un taller de narrativas digitales con adultos y adultos mayores.','Inicio de taller','Telecentro_Pradito_Planeacion_de_procesos_de_formacion.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',5,211,15,'2015-06-23 12:01:18','0000-00-00 00:00:00'),(708,'2015-06-17','Seguimiento al Punto de Navegación','Se realizó visita al punto de Navegación ubicado en el Centro de Innovación del Maestro MOVA, no se encontraban en el lugar los equipos destinados para este punto, por esta razón se realiza reunión con Luis Fernando Ribero, Coordinador Área de Sistemas, para conocer información de la situación.\r\nSe me informa que se desconectó el Punto de Navegación para realizar la contratación de los nuevos docentes que obtuvieron plaza a través del concurso Nacional Docente; aún no se conoce fecha para instalarlos nuevamente.','Informar fecha de instalación de los equipos.','Centro_Innovacion_del_Maestro_Seguimiento_al_Sitio.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',4,302,40,'2015-06-23 13:17:23','0000-00-00 00:00:00'),(709,'2015-06-17','Gestión de procesos de formación','Reunión de seguimiento al Punto de Navegación y gestión de inicio de procesos de formación. ','Queda pendiente realizar convocatoria para iniciar con asesoría para los funcionarios.','Archivo_Historico_de_Medellin_Reunion_de_Planeacion_1.jpg','Archivo_Historico_de_Medellin_Reunion_de_Planeacion_2.jpg','Archivo_Historico_de_Medellin_Reunion_de_Planeacion_3.jpg','uploads/meeting/meeting_adjunct',5,292,40,'2015-06-23 13:23:30','0000-00-00 00:00:00'),(710,'2015-06-16','Seguimiento al sitio','Reunión con el coordindor del CEDEZO para gestionar convocatoria para proceso de formación a funcionarios.','se realiza la convocatoria 15 días, tiempo que se tiene para la inscripción de los usuarios.','CEDEZO_Pasaje_La_Bastilla_Reunion_de_seguimiento.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',4,171,40,'2015-06-23 13:30:19','0000-00-00 00:00:00'),(711,'2015-06-19','Planeación Procesos de formación','Reunión con la Profesional de Formación de la Biblioteca EPM, para gestionar procesos de formación en Alfabetización Digital, para el adulto mayor y Narrativas Digitales, para los niños y niñas . Se habla de un evento que realizarán en agosto, contemplando la posibilidad de tener presencia de Medellín Ciudad Inteligente.','Analizar la posibilidad de asistir al evento y realizar convocatoria para los procesos de formación.','Biblioteca_EPM_Reunion_de_Planeacion.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',5,163,40,'2015-06-23 14:38:32','0000-00-00 00:00:00'),(712,'2015-06-16','Primera reunión con Gestora TIC','Reunión con Nueva Gestora TIC, se le habla del programa, los procesos de formación y los sitios que va a acompañar, se establece un horario y sitio para ella.','Acompañar el proceso de Alfabetización Digital y Gobierno en Línea que se tiene con la Comunidad de Por Mis Derechos.',NULL,NULL,NULL,'',6,571,40,'2015-06-23 15:33:54','0000-00-00 00:00:00'),(713,'2015-06-23','Planeación de procesos de formación','Reunión para programar Charla de Navegar Sin Naufragar para niños y Narrativas Digitales para Adulto Mayor.','Se programa charla para el martes 7 de julio a las 2:oo p.m.','Telecentro_El_Salvador_Reunion_Planeacion_1.jpg','Telecentro_El_Salvador_Reunion_Planeacion_2.jpg',NULL,'uploads/meeting/meeting_adjunct',5,569,40,'2015-06-23 15:44:14','0000-00-00 00:00:00'),(714,'2015-06-17','Invitación taller de animación','Se realizó una corta reunión con la auxiliar de la biblioteca para hacer la invitación a algunos chicos que visitan la biblioteca al taller de animación.','Una próxima reunión para planear procesos de formación.','Filial_biblioteca_San_Antonio_de_Prado_Gestion_de_participantes_taller_de_animacion.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',4,195,15,'2015-06-23 15:49:24','0000-00-00 00:00:00'),(715,'2015-06-23','Reunión seguimiento y gestión de procesos de formación','Reunión para gestionar charla de Navegar Sin Naufragar para Jóvenes y seguimiento al punto de Navegación.','Realizar convocatoria para la charla Navegar Sin Naufragar.','Centro_de_la_Diversidad_Sexual_Reunion_de_Seguimiento_1.jpg','Centro_de_la_Diversidad_Sexual_Reunion_de_Seguimiento_2.jpg','Centro_de_la_Diversidad_Sexual_Reunion_de_Seguimiento_3.jpg','uploads/meeting/meeting_adjunct',4,300,40,'2015-06-23 15:57:21','0000-00-00 00:00:00'),(716,'2015-06-23','Reunión de empalme','Reunión con el coordinador del centro de salud para planificar alguna intervención por parte del programa en el sitio. Verificación del buen funcionamiento de la red wifi. El funcionario pregunta por la entrega del punto de navegación. ','Se averigua con conectividad y se averigua que se encuentra parada por la ley de garantías, además se entrega en comodatos.   ','Centro_de_salud_San_Lorenzo_Reunion.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',2,573,20,'2015-06-23 17:02:02','0000-00-00 00:00:00'),(717,'2015-06-11','Planeación segundo semestre','La reunión se plantea con antelación con el fin de generar la planeación para el segundo semestre, se plantea cambiar la estrategia que se viene implementando con los emprendedores y empresarios adscritos al cedezo, se busca realizar otro tipo de cursos más llamativos para estás personas. Se propone entonces realizar dos talleres, el primero de excel y el segundo de Mercadeo Digital. \r\nSe plantean además fechas de inicio y cierre de cada uno de los procesos. ','El Cedezo realizará la convocatoria de las personas y la reserva del espacio. ','Cedezo_La_Tinaja_Empalme_y_planeacion.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',5,167,24,'2015-06-24 09:10:25','0000-00-00 00:00:00'),(718,'2015-06-24','Reunión de empalme y planeación','Reunión de empalme y planeación de actividades para el segundo semestre del año. El coordinador recuerda que había establecido con un anterior gestor un curso de alfabetización digital y un taller de mercado digital','Se conviene participar de unas reuniones con emprendedores para contarles sobre las ofertas del programa MCI','CEDEZO_La_Ladera_reunion_empalmeyplaneacion.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',2,170,20,'2015-06-24 15:17:12','0000-00-00 00:00:00'),(719,'2015-06-19','Gestión Funcionarios del buen Comienzo','La reunión se centra en contarle a las personas del programa Buen Comienzo que la Unidad Deportiva ya cuenta con internet wifi y que ellos pueden conectarse al servicio, se busca además que durante las horas que ellos están con las madres gestantes se puedan realizar sensibilizaciones buscando que ellas ingresen a páginas de interés frente a la gestación y lactancia materna. Para esto se pide a la coordinadora un espacio para realizarlo. ','Los Agentes Educativos divulgaran a los usuarios del sitio el internet wifi que se encuentra en la zona. \r\nRicardo Alvarez, buscará que la coordinadora nos ceda el espacio para realizar la actividad. ','Centralidad_Deportiva_El_Progreso_2_Gestion_con_aliados.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',3,485,24,'2015-06-25 09:23:37','0000-00-00 00:00:00'),(720,'2015-06-16','Disponibilidad de equipos en el Telecentro Pedregal','Se inicia con el reconocimiento de los nuevos computadores entregados por dotación de la Oficina de Telecentros, con esto se busca que las personas que se encuentren cerca al sitio puedan iniciar cursos de herramientas web 2.0 en el espacio. ','Se buscarán las personas idóneas para iniciar el proceso de formación en herramientas web 2.0','Casa_de_la_Cultura_Pedregal_Empalme_y_Planeacion_1.jpg','Casa_de_la_Cultura_Pedregal_Empalme_y_Planeacion.jpg',NULL,'uploads/meeting/meeting_adjunct',3,487,24,'2015-06-25 17:00:49','0000-00-00 00:00:00'),(721,'2015-06-19','Empalme con la coordinadora de la Corporación Picacho con Futuro','Se inicia una nueva reunión de empalme en la que se busca que el Telecentro por su gran oferta de formación con los cursos virtuales de la Universidad Católica del Norte no nos cierre las puertas, para esto se propone realizar formaciones a la comunidad con los nuevos equipos dotados por la oficina de Telecentros y para el equipo de líderes de la corporación. ','En la junta directiva la coordinadora propondrá a los integrantes realizar el taller en las horas de la noche con el fin de utilizar las herramientas de dotación y el espacio del Telecentro. ','Telecentro_Picacho_Empalme_y_planeacion.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',2,202,24,'2015-06-25 17:14:19','0000-00-00 00:00:00'),(722,'2015-06-16','Inducción al Gestor TIC ','Al realizar la visita al Telecentro de Pedregal observamos a este nuevo Gestor TIC dictando un curso de Alfabetización Digital con los contenidos del programa, a partir de lo anterior lo invitamos a hacer parte de la estrategia de los Gestores TIC y este acepta, argumentando que le encanta el trabajo comunitario, ya que este es un líder del barrio. ','Se abrirán otros grupos de formación en los cuales él será el Gestor TIC. ','Casa_de_la_Cultura_Pedregal_Pedro_Nel_Munoz.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',6,487,24,'2015-06-25 17:21:31','0000-00-00 00:00:00'),(723,'2015-06-25','nuevo gestor TIC','Reunión con nuevo gestor para socializar los contenidos de AD y GEL ','Dictará cursos de alfabetización Digital en la biblioteca Mario Gaviria Suárez ','Pactos_de_acompanamieto_Sebastian_Salazar.PDF','Biblioteca_Mario_Gaviria_Suarez_Gestor_TIC_Sebastian_Suarez.JPG',NULL,'uploads/meeting/meeting_adjunct',6,471,42,'2015-06-26 09:09:11','0000-00-00 00:00:00'),(724,'2015-06-25','nuevo gestor TIC','Reunión con nuevo gestor TIC para socializar los contenidos de los cursos','Se abrirán cursos para la comunidad en la biblioteca ','Biblioteca_Mario_Gaviria_Suarez_Gestor_TIC_Sebastian_Ospina.JPG','Pactos_de_acompanamieto_Sebastian_Ospina.PDF',NULL,'uploads/meeting/meeting_adjunct',6,471,42,'2015-06-26 09:14:42','0000-00-00 00:00:00'),(725,'2015-06-12','Seguimiento a la planeación de los procesos.','Se realizó visita al sitio con el fin de conocer como va el proceso de convocatoria para el taller de dispositivos móviles dirigido a padres de familia y enfocado en aprender a utilizar las aplicaciones y páginas web que promueven el aprendizaje y la comunicación en los niños diagnosticados con trastornos del espectro autista, además de indagar por la fecha de inicio del un taller de narrativas digitales con los niños. La respuesta que se obtuvo frente a los procesos mencionados, es que ya están aprobados, pero que ellos salen un mes a vacaciones. Por lo anterior las actividades se iniciarán a finales del mes de Julio.	 ','Por parte de la fundación quedó como compromiso programar las actividades ya planeadas. ','Fundacion_integrar_Seguimiento_al_sitio.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',4,215,43,'2015-06-26 10:21:55','0000-00-00 00:00:00'),(726,'2015-06-25','Gestión con aliados','Se visitó uno de los telecentros de Palmitas con el propósito de apoyar la labor del dinamizador con la comunidad en vista de que conversando con las personas se evidenció que el lugar está siendo visitado y reconocido por las personas. Se establecieron canales de comunicación, se le contó a cerca del programa y de nuestra labor en campo además de las formas en que podíamos intervenir en conjunto. El dinamizador quedó muy interesado y planteamos la opción de hacer una actividad mensual','Enviar por correo electrónico los contenidos de A.D y comunicarnos constantemente  para planear actividades mensuales.','telecentro_Palmitas_Gestion_con_Aliados_1.jpg','telecentro_Palmitas_Gestion_con_Aliados_2.jpg',NULL,'uploads/meeting/meeting_adjunct',3,276,23,'2015-06-26 10:24:59','0000-00-00 00:00:00'),(727,'2015-06-18','Inducción Gestor TIC','Se firmo el pacto de acompañamiento con la nueva gestora TIC, además se le explicó las funciones y las actividades que tendría a cargo.','Ninguno','Telecentro_Pradito_Induccion_Gestora_TIC.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',6,211,15,'2015-06-26 15:27:00','0000-00-00 00:00:00'),(728,'2015-06-26','Planeación actividades mes de julio','Se planea el nuevo curso de formación en Web 2.0 que se dictará a los líderes multiplicadores de la comuna, para fortalecer sus habilidades. ','Se organizará el grupo y pactarán las horas de trabajo. ','Telecentro_Doce_de_Octubre_Planeacion.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',5,480,24,'2015-06-30 15:51:44','0000-00-00 00:00:00'),(729,'2015-06-26','Revisión de la convocatoria para el Taller','Se revisa la convocatoria realizada por la encargada de dinamizar el Taller que realizará la corporación Línea de Tiempo en el espacio, además se miran los temas logísticos de la actividad. ','La técnico de cultura realizará las llamadas para confirmar a las personas que asistirán, además se busca postear de nuevo la E-card para realizar una convocatoria más grande. ','PB_Doce_de_Octubre_Planeacion.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',5,183,24,'2015-06-30 16:27:26','0000-00-00 00:00:00'),(730,'2015-06-26','Empalme ','Se hizo una presentación formal del programa y las posibilidades de nuevos procesos allí según las necesidades.','Listado de programas y/o talleres ','Cedezo_Moravia.JPG',NULL,NULL,'uploads/meeting/meeting_adjunct',2,166,46,'2015-07-01 09:39:41','0000-00-00 00:00:00'),(731,'2015-06-25','Empalme ','Se realizó reunión de empalme con la coordinadora y la gestora tic del sitio','Enviar información con programación de fechas para próximos talleres.','floresta.png','floresta.jpg',NULL,'uploads/meeting/meeting_adjunct',2,180,46,'2015-07-01 09:59:13','0000-00-00 00:00:00'),(732,'2015-07-03','Planeación de procesos','Se llevó a cabo reunión con el coordinador del cedezo para hablar del estado actual de las personas que frecuentan el cedezo en relación a los procesos de formación recibidos y la posible oferta que el programa MDE inteligente puede realizar. Además de esto se resaltó la importancia de que todos los actores institucionales del corregimiento hagan sinergia para desarrollar procesos en conjunto que beneficien la población y es por esto que nos vinculamos con Biblioteca Fernando Botero y Punto Vive Digital para llevar a cabo una reunión donde se indaguen los intereses y expectativas de los microempresarios y de este modo lograr vincularlos con nuestros procesos de formación.','Realizar llamado a personas del listado facilitado por el cedezo que se encuentran activas tanto emprendedores como microempresarios para convocarlos a reunión con Punto Vive digital y MDE para iniciar procesos de formación según sus necesidades y expectativas','Cedezo_San_Cristobal_Planeacion_de_procesos_2.jpg','Cedezo_San_Cristobal_Planeacion_de_procesos.jpg',NULL,'uploads/meeting/meeting_adjunct',5,169,23,'2015-07-07 15:07:17','0000-00-00 00:00:00'),(733,'2015-07-02','Reunión de planeación','Se realizó una reunión para planear la creación de laboratorio audiovisual que tendrá como objetivo reactivar el canal de TV de la Institución y la creación de contenidos para la página Web de la misma. Se iniciará con un Taller de Narrativas Digitales (Fotografía) el Lunes 6 de Julio, dirigido a los estudiantes de la Mediatecnica en Multimedia. ','Por parte de la Institución Educativa quedó como compromiso gestionar los recursos requeridos para el taller.','Institucion_Educativa_Jose_Acevedo_y_Gomez_Reunion_de_planeacion.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',5,344,43,'2015-07-08 07:49:48','2015-07-08 12:55:08'),(735,'2015-07-08','Reunión con nueva Líder de Servicio','Reunión con la nueva Líder de Servicio del sitio, empalme de procesos realizados y planeación de procesos nuevos con las personas que atiende el CAV','- Articularse a las capacitaciones que tienen los funcionarios en nuevos trámites en linea, requeridos para gestionar procesos de ayuda a victima. (resolución de la situación militar, chat de victimas, etc)\r\n\r\n- Buscar un espacio donde se pueda dar formación a jóvenes víctimas del conflicto en el trámite de la libreta Militar, ya que para este tipo de población existe un procedimiento especializado.','CAV_Belencito_Reunion_de_Empalme_con_nueva_Lider_de_Servicio.jpg',NULL,NULL,'uploads/meeting/meeting_adjunct',2,335,38,'2015-07-08 16:26:09','0000-00-00 00:00:00');
