INSERT INTO `training` VALUES (5,'FOAD2015-2','Es un proceso del Centro de Atención Especializado de Ciudad Don Bosco, en el cual se trabajará con menores de edad desvinculados las guerrillas del ELN y las FARC, los cuales fueron acogidos por el Estado con el fin de restituir sus derechos. ',1,'2015-06-04',NULL,24,1,'2015-06-02 10:19:39','0000-00-00 00:00:00'),(6,'FOMD2015-3','Mercadeo digital con emprendedores del Cedezo de Guayabal en la mediateca del parque biblioteca Guayabal, se realizarán 8 sesiones y como producto quedará una página web',1,'2015-06-02','2015-07-28',38,1,'2015-06-03 11:56:06','0000-00-00 00:00:00'),(7,'FOAD Y GEL2015-4','Curso en el aula digital de la Biblioteca con Amas de casa cercanas a la Biblioteca',1,'2015-05-16','2015-08-01',38,1,'2015-06-03 14:10:54','0000-00-00 00:00:00'),(8,'FOND2015-5','Taller de Narrativas Digitales dirigido a la comunidad de Villa Flora.',2,'2015-04-06','2015-06-03',42,2,'2015-06-04 14:17:41','0000-00-00 00:00:00'),(9,'FOAD Y GEL2015-6','Curso de alfabetización digital y gobierno en línea con adultos mayores del club de vida.',1,'2015-06-03','2015-08-05',15,1,'2015-06-05 10:23:53','0000-00-00 00:00:00'),(10,'FOAD Y GEL2015-6','Taller de alfabetización Digital para adultos',1,'2015-02-17','2015-06-04',42,2,'2015-06-09 14:54:47','2015-06-26 14:16:25'),(11,'FODM2015-7','Se realizó una asesoría de dispositivos móviles con las personas que participaron en el aula abierta de la IE.',4,'2015-06-02','2015-06-02',15,2,'2015-06-09 15:57:09','2015-06-09 20:59:58'),(12,'FOND2015-8','Taller de narrativas digitales (fotografía)',2,'2015-04-27','2015-07-01',17,1,'2015-06-10 11:05:26','0000-00-00 00:00:00'),(13,'FOND2015-9','Taller de fotografía con personas en situación de discapacidad de la fundación Alma Y vida',2,'2015-04-28','2015-06-09',38,2,'2015-06-10 11:17:52','0000-00-00 00:00:00'),(14,'FOAD Y GEL2015-10','Proceso piloto utilizando la nueva metodología de apropiación para sus procesos de formación. Se trabajarán temas de alfabetización digital, GEL y Narrativas digitales.\r\nPoblación: Víctimas de desplazamiento forzado\r\nObjetivo o \"Pretexto\": Rutas de la memoria\r\nProducto: Serie fotográfica en Power Point\r\n',1,'2015-04-24',NULL,17,1,'2015-06-10 14:52:48','0000-00-00 00:00:00'),(15,'FOND2015-11','Taller de Narrativas Digitales orientado a la fotografía, para los Líderes Comunitarios de la JAC Comuna 8 - Los Mangos, como herramienta de registro de las actividades que se realizan con la comunidad.',2,'2015-06-04',NULL,40,1,'2015-06-11 14:04:18','0000-00-00 00:00:00'),(16,'FOND2015-12','Narrativas digitales componente sonoro, se aborda el concepto básico del sonido, sus cualidades, utilización de la grabadora de sonido, ejercicios de grabación de contenidos, utilización de programas para generación de combinación de sonidos.',2,'2015-04-23','2015-06-18',20,2,'2015-06-12 16:03:45','2015-07-01 04:19:28'),(28,'FOAD Y GEL2015-24','Curso de Alfabetización Digital y Gobierno en Línea dirigido a adultos mayores de la comuna 15, que pretende desarrollar competencias digitales básicas en estos.',1,'2015-04-25','2015-06-06',43,2,'2015-06-16 08:01:43','0000-00-00 00:00:00'),(29,'FOHW2.02015-14','Taller de herramientas Web 2.0 dirigido a adultos mayores de la comuna 15, que pretende desarrollar en ellos competencias para el trabajo colaborativo en la Web.',2,'2015-05-09','2015-06-06',43,2,'2015-06-16 08:10:10','0000-00-00 00:00:00'),(30,'FODM2015-15','El día del cierre del curso de Web 2.0 con uno de los grupos del aula abierta, se destinó la primera parte del espacio para realizar asesorías en dispositivos móviles de forma individual a los integrantes del curso. En total fueron 10 personas que recibieron el acompañamiento.',4,'2015-06-04','2015-06-04',23,2,'2015-06-16 08:22:32','0000-00-00 00:00:00'),(31,'FOAD Y GEL2015-16','Alfabetización digital y GEL con adulto mayor',1,'2015-05-05','2015-07-14',38,1,'2015-06-16 13:18:21','0000-00-00 00:00:00'),(32,'FOAD Y GEL2015-17','Alfabetización Digital y GEL con adulto mayor',1,'2015-05-07','2015-07-16',38,1,'2015-06-16 13:26:32','0000-00-00 00:00:00'),(33,'FOND2015-18','El taller de Narrativas Digitales se desarrolla actualmente con 15 chicos y chicas en situación de discapacidad cognitiva que provienen de las diferentes comunas de Medellín y se agrupan en el centro  integrado para recibir diferentes tipos de acompañamientos y formaciones. Son 162 chicos en este lugar y la idea es desarrollar procesos continuos y que siempre haya un docente acompañando el espacio para que se empodere del conocimiento y pueda replicarlo',2,'2015-05-21',NULL,23,2,'2015-06-16 13:44:06','2015-07-06 18:47:33'),(34,'FOAD Y GEL2015-19','El curso de Alfabetización digital y Gobierno en línea inició en la biblioteca San javier la Loma como respuesta tanto a la demanda de la comunidad como a el diagnóstico del coordinador del lugar quien quiso que fortaleciéramos las competencias digitales básicas de aquellos habitantes del sector que desde hace un par de meses estaban a la espera de la oferta de cursos por parte de la biblioteca.',1,'2015-06-02',NULL,23,1,'2015-06-16 13:49:44','0000-00-00 00:00:00'),(35,'FOGEL2015-20','El taller de Gobierno en línea con líderes comunitarios surge como propuesta de la dinamizadora del telecentro la amistad villa Sofía en tanto es importante que estas cabezas reconocibles de la comunidad tengan herramientas para direccionar a los habitantes  según algunas necesidades específicas en relación a los diferentes trámites y servicios en línea del estado.',2,'2015-06-09',NULL,23,1,'2015-06-16 13:58:39','0000-00-00 00:00:00'),(36,'FOND2015-21','Formación en laboratorios Comunitarios a través del proceso EDULABS, desarrollado en las Instalaciones del Medialab de la Universidad EAFIT, formación en comunicación, programación e impresión 3D',6,'2015-03-20','2015-06-05',38,2,'2015-06-17 08:35:18','2015-06-18 13:38:45'),(37,'FOND2015-22','Formación en laboratorios Comunitarios a través del proceso EDULABS, desarrollado en las Instalaciones del Medialab de la Universidad EAFIT, formación en comunicación, programación e impresión 3D.',6,'2015-03-20','2015-06-05',38,2,'2015-06-17 09:12:54','2015-06-18 13:39:47'),(38,'FOND2015-23','Taller de Narrativas Digitales dirigido a los chicos usuarios del Telecentro Altavista y del Punto de Navegación de la Casa de Gobierno Altavista.',2,'2015-06-11',NULL,43,1,'2015-06-17 10:25:35','0000-00-00 00:00:00'),(39,'FOND2015-24','Taller De Narrativas Digitales aplicando la técnica de Stop Motion para acompañar las vacaciones creativas del Parque Biblioteca.',2,'2015-06-10','2015-06-11',38,2,'2015-06-17 10:35:51','0000-00-00 00:00:00'),(40,'FOAD Y GEL2015-25','Proceso piloto usandoi la nueva metodología, que articula contenidos de alfabetización digital, GEL, narrativas digitales y herramientas Web 2.0, con un grupo de mujeres.\r\nObjetivo o \"pretexto\": El territorio que habitamos\r\nPúblico: Adultos (mujeres principalmente)\r\nProducto: Galería web de foto reportajes ',1,'2015-04-24',NULL,17,1,'2015-06-17 11:07:35','0000-00-00 00:00:00'),(41,'FOND2015-26','Creación del Laboratorio Audiovisual de la institución con jóvenes estudiantes de 8° grado.',6,'2015-04-29',NULL,17,1,'2015-06-17 15:06:30','0000-00-00 00:00:00'),(42,'FOND2015-27','Taller de narrativas digitales (fotografía) con niños en situación de vulnerabilidad atendidos de la Fundación Munay.',2,'2015-04-14',NULL,17,1,'2015-06-18 10:34:09','0000-00-00 00:00:00'),(43,'FOND2015-28','Taller de narrativas digitales (fotografía) con jóvenes en situación de vulnerabilidad atendidos de la Fundación Munay.',2,'2015-04-14',NULL,17,1,'2015-06-18 10:35:50','0000-00-00 00:00:00'),(44,'FOND2015-29','Taller de narrativas digitales con adultos y adultos mayores.',2,'2015-05-13','2015-06-10',15,2,'2015-06-19 11:02:52','0000-00-00 00:00:00'),(45,'FOAD Y GEL2015-30','Curso de alfabetización digital y gobierno en línea con emprendedores.',1,'2015-03-25','2015-06-03',15,2,'2015-06-19 20:23:17','0000-00-00 00:00:00'),(46,'FOAD Y GEL2015-31','Curso de alfabetización digital y gobierno en línea con emprendedores y emprendedoras de la comuna 16.',1,'2015-04-24','2015-07-10',15,1,'2015-06-22 14:26:00','0000-00-00 00:00:00'),(47,'FOGEL2015-32','Taller de Gobierno en línea Comunidad y Jóvenes, para los empleados de la biblioteca.',2,'2015-06-12',NULL,40,1,'2015-06-22 16:19:51','0000-00-00 00:00:00'),(48,'FOAD Y GEL2015-33','Curso de Alfabetización Digital y Gobierno en Línea, para la comunidad que asiste al programa Por Mis Derechos, este curso se realiza en el aula de informática del Palacio de la Cultura Rafael Uribe Uribe.',1,'2015-06-17',NULL,40,1,'2015-06-22 17:04:15','0000-00-00 00:00:00'),(49,'FOND2015-34','Proyecto EDULABS que se realiza en articulación con la Universidad EAFIT, con el fin de capacitar a estudiantes de 8 colegios de Medellín en las áreas de Comunicación, Programación e Impresión 3D.',6,'2015-03-20','2015-06-05',40,2,'2015-06-23 13:42:18','0000-00-00 00:00:00'),(50,'FOND2015-35','Se convocó un grupo de niños y niñas en el Punto Vive Digital de San Cristóbal con el propósito de realizar un taller donde se vinculara la creación manual, en este caso la tarjeta del día del padre en origami, a la realización de un Stop Motión a al vez que los niños y niñas debían buscar el tutorial en you tube para elaborar los pasos de la tarteja.',2,'2015-06-13','2015-06-13',23,2,'2015-06-23 14:04:21','0000-00-00 00:00:00'),(51,'FOGEL2015-36','Se realiza asesoría en Gobierno en Línea a usuaria en el Punto de Navegación',4,'2015-06-16','2015-06-16',40,2,'2015-06-23 14:58:13','0000-00-00 00:00:00'),(52,'FOND2015-37','Taller de narrativas digitales-fotografía con personas en situación de discapacidad.',2,'2015-05-27','2015-06-24',15,2,'2015-06-24 11:26:30','0000-00-00 00:00:00'),(53,'FOGEL2015-38','Se inicia formación en Gobierno en línea con la secretaría de Gobierno a través del programa jóvenes por la vida en el sector La loma. Serán un grupo de aproximadamente 60 jóvenes para formar. En este caso, iniciamos el taller con los primeros 14 en la Biblioteca PP la loma, posteriormente se realizará con otros subgrupos tanto en  la loma como en el sector de San Cristóbal en asocio con el PVD.',2,'2015-06-18','2015-06-18',23,1,'2015-06-24 11:57:19','0000-00-00 00:00:00'),(54,'FOND2015-39','Se realizó taller de narrativas digitales Fotografía en el Telecentro Moscú con adultos. ',2,'2015-04-23','2015-06-28',41,2,'2015-06-24 15:42:11','0000-00-00 00:00:00'),(55,'FOND2015-40','Narrativas digitales componente sonoro, se aborda el concepto básico del sonido, sus cualidades, utilización de la grabadora de sonido, ejercicios de grabación de contenidos, utilización de programas para generación de combinación de sonidos.',2,'2015-06-16','2015-06-26',20,2,'2015-06-24 16:18:37','2015-07-01 04:20:09'),(56,'FOHW2.02015-41','Curso web 2.0 ',1,'2015-04-29','2015-06-10',41,2,'2015-06-24 16:33:10','0000-00-00 00:00:00'),(57,'FOAD2015-42','Curso de alfabetización digital para personas en situación de discapacidad; es una formación realizada conjuntamente por funcionarios de la biblioteca y la gestora de cultura digital del programa MCI. ',1,'2015-06-18',NULL,20,1,'2015-06-24 16:43:02','2015-06-26 16:45:58'),(58,'FOHW2.02015-43','Se realizó curso de herramientas web 2.0 para adultos mayores de la biblioteca Campo Valdés con la facilitación de una gestora tic perteneciente a la comuna 4 del programa presupuesto participativo y estudiante del Pascual Bravo. ',1,'2015-05-05','2015-06-26',41,2,'2015-06-25 16:15:53','0000-00-00 00:00:00'),(59,'FOND2015-44','En este sitio actualmente se está implementando un taller de narrativas sonoras con el objetivo de fortalecer las habilidades de los niños y niñas de la fundación en el manejo de herramientas digitales que les permitan acercarse a la producción de contenidos en este caso radiales.',2,'2015-03-24',NULL,41,1,'2015-06-25 17:10:11','0000-00-00 00:00:00'),(60,'FODM2015-45','Se acompañó el grupo de Alfabetización Digital, en este caso 6 personas mediante la asesoría personalizada del manejo de algunas funciones de sus propios dispositivos móviles. Ellos solicitaron encuentros periódicos siquiera una vez al mes para continuar con la exploración y aprendizaje del uso de dichos dispositivos. Trabajamos tanto con celulares flecha como con smart phone. ',4,'2015-06-24','2015-06-24',23,2,'2015-06-26 08:04:11','0000-00-00 00:00:00'),(61,'FOND2015-46','Se realizó un taller de Stop motion con los niños y niñas de la Biblioteca San sebastian de palmitas a través de la construcción de una granja con plastilina en donde cada uno de ellos y ellas asumía diferentes roles: Todos realizaron figuras, algunos hicieron el stop motion, otros aportaron la voz para el video, otros crearon el escenario para la granja y entre todos lograron el producto final',2,'2015-06-25','2015-06-25',23,2,'2015-06-26 08:53:46','0000-00-00 00:00:00'),(62,'FOHW2.02015-47','Taller de Herramientas Web 2.0 dictado a adultos mayores en el Aula Abierta de la institución Educativa',5,'2015-03-05','2015-06-04',24,2,'2015-06-26 09:35:24','0000-00-00 00:00:00'),(63,'FOND2015-48','Taller de Narrativas Digitales, se realizaron investigaciones de los sitios más reconocidos en el sector, cada estudiante eligió un sitio al cual le realizaron una investigación utilizando la salida de campo y recolección de datos. ',2,'2015-02-24','2015-06-10',24,2,'2015-06-26 11:47:43','0000-00-00 00:00:00'),(64,'FOAD2015-49','Taller de Excel básico para emprendedores',2,'2015-06-25',NULL,42,1,'2015-06-26 15:01:34','0000-00-00 00:00:00'),(65,'FOND2015-50','Se realizó un taller de stop motion con niños y niñas entre los 9 y 12 años, fue una jornada en la que los chicos pudieron sacar su creatividad inventando historias y luego generando una corta animación.',2,'2015-06-20','2015-06-20',15,2,'2015-06-30 16:09:43','0000-00-00 00:00:00'),(66,'FOND2015-51','Taller de experimentación sonora a través de la electrónica. ',2,'2015-06-22','2015-06-26'