alizó el taller de narrativas digitales con adultos mayores, orientado por una voluntaria, estudiante de comunicación gráfica y publicitaria.',2,'2015-05-01','2015-07-19',46,2,'2015-07-01 08:00:50','0000-00-00 00:00:00'),(75,'FOAD Y GEL2015-60','Curso de Alfabetizaciòn Digital y Gobierno en Línea dirigido a emprendedores.',1,'2015-03-19','2015-06-26',10,2,'2015-07-01 08:12:36','2015-07-01 14:19:31'),(76,'FOAD Y GEL2015-61','Curso de Alfabetización Digital y Gobierno en línea, dirigido a Adultos.\r\n',1,'2015-02-10','2015-06-12',10,2,'2015-07-01 09:19:04','2015-07-01 14:24:09'),(77,'FOAD Y GEL2015-62','Curso de Alfabetización Digital y Gobierno en línea dirigido a adultos.\r\n',1,'2015-04-13','2015-06-11',10,2,'2015-07-01 09:23:22','0000-00-00 00:00:00'),(78,'FOND2015-63','El Taller de Stop Motion tuvo la participación de veintiséis niños y niñas de la comuna 6 de la ciudad, fue dictado por la corporación Línea de Tiempo en el Parque Biblioteca Doce de Octubre.   ',2,'2015-07-04','2015-07-04',24,2,'2015-07-06 14:25:47','0000-00-00 00:00:00'),(79,'FOMD2015-64','Este taller tiene como objetivo que los emprendedores comprendan los conceptos asociados con la web y el mercadeo digital, llevándolos a la práctica con el fin de potencializar su negocio.',2,'2015-05-22',NULL,43,1,'2015-07-08 08:48:45','0000-00-00 00:00:00'),(80,'FOGEL2015-65','Activación o toma del sitio, con asesorías individuales de Gobierno y trámites en línea en el punto de navegación, inscripción de personas para procesos de formación y divulgación de la red Wifi existente en el sitio.',4,'2015-07-08','2015-07-08',38,2,'2015-07-08 15:03:06','0000-00-00 00:00:00'),(81,'FOAD Y GEL2015-66','Curso de alfabetización Digital y gobierno en línea con adultos mayores, es dictado por un Gestor TIC de la comuna.',1,'2015-05-23','2015-07-25',15,1,'2015-07-08 16:45:38','0000-00-00 00:00:00'),(82,'FOND2015-67','Taller de animacion stop motion con la corporacion linea de tiempo, para niños entre los 9 y los 15 años',2,